    briefText: "рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃЌрЃљ рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљ 9 рЃљрЃърЃарЃўрЃџрЃўрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА I-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљрЃАрЃљрЃњрЃљрЃю рЃЉрЃћрЃЋрЃарЃў рЃарЃљрЃЏ рЃњрЃљрЃўрЃњрЃћрЃА 9 рЃљрЃърЃарЃўрЃџрЃўрЃА, рЃарЃЮрЃњрЃЮрЃарЃф рЃўрЃАрЃбрЃЮрЃарЃўрЃБрЃџрЃў рЃЌрЃљрЃарЃўрЃдрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ!\nрЃърЃљрЃбрЃљрЃарЃћрЃЉрЃў рЃБрЃЎрЃЋрЃћ рЃърЃџрЃљрЃЎрЃљрЃбрЃўрЃА, рЃърЃЮрЃАрЃбрЃћрЃарЃўрЃАрЃљ рЃЊрЃљ рЃАрЃ«рЃЋрЃљ рЃЋрЃўрЃќрЃБрЃљрЃџрЃБрЃарЃў рЃЌрЃЋрЃљрЃџрЃАрЃљрЃЕрЃўрЃюрЃЮрЃћрЃЉрЃўрЃА рЃерЃћрЃЦрЃЏрЃюрЃљрЃАрЃљрЃф рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉрЃћрЃю!\nрЃЌрЃљрЃЋрЃўрЃљрЃюрЃЌрЃў рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃўрЃА рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃўрЃЌ рЃерЃћрЃЦрЃЏрЃюрЃћрЃА, рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљрЃф рЃЏрЃЮрЃљрЃгрЃДрЃЋрЃћрЃА рЃЊрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃўрЃф рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА 9 рЃљрЃърЃарЃўрЃџрЃўрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ.",
