    briefText: "рЃЏрЃћрЃАрЃљрЃЏрЃћ рЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃў рЃљрЃГрЃљрЃарЃўрЃА рЃ«рЃљрЃарЃўрЃбрЃЮрЃю рЃљрЃ«рЃЋрЃџрЃћрЃЊрЃўрЃљрЃюрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃерЃў\n2021 рЃгрЃџрЃўрЃА 12 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III-1 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃАрЃЮрЃцрЃЮ рЃАрЃљрЃюрЃўрЃЎрЃўрЃФрЃћрЃЏ рЃљрЃГрЃљрЃарЃўрЃА рЃ«рЃљрЃарЃўрЃбрЃЮрЃю рЃљрЃ«рЃЋрЃџрЃћрЃЊрЃўрЃљрЃюрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃерЃў рЃЕрЃљрЃБрЃбрЃљрЃарЃљ.\nрЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃЊрЃўрЃЊрЃў рЃўрЃюрЃбрЃћрЃарЃћрЃАрЃўрЃЌ рЃЊрЃљрЃЌрЃЋрЃљрЃџрЃўрЃћрЃарЃћрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃћрЃЦрЃАрЃърЃЮрЃюрЃљрЃбрЃћрЃЉрЃў, рЃЏрЃЮрЃўрЃАрЃЏрЃўрЃюрЃћрЃА рЃЏрЃфрЃўрЃарЃћ рЃћрЃЦрЃАрЃЎрЃБрЃарЃАрЃў рЃЊрЃљ рЃФрЃљрЃџрЃўрЃљрЃю рЃўрЃ«рЃљрЃџрЃўрЃАрЃћрЃА.",
