    title: "\"рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА\"!",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃарЃФрЃћрЃџрЃЊрЃћрЃЉрЃљ рЃърЃарЃЮрЃћрЃЦрЃбрЃў \"рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА\".\nрЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ, рЃарЃЮрЃЏ рЃЌрЃљрЃЋрЃўрЃАрЃў рЃфрЃЮрЃЊрЃюрЃљ рЃЊрЃљ рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃћрЃЉрЃљ рЃБрЃцрЃарЃЮрЃАрЃў рЃљрЃАрЃљрЃЎрЃўрЃА рЃДрЃЮрЃцрЃўрЃџрЃЏрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃњрЃљрЃБрЃќрЃўрЃљрЃарЃЮрЃю рЃБрЃЏрЃфрЃарЃЮрЃАрЃћрЃЉрЃА!\n2021 рЃгрЃџрЃўрЃА 13 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃљрЃЌрЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЮрЃюрЃџрЃљрЃўрЃю рЃцрЃЮрЃарЃЏрЃљрЃбрЃерЃў рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю рЃДрЃЮрЃцрЃўрЃџ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџ рЃњрЃўрЃЮрЃарЃњрЃў рЃљрЃ«рЃљрЃџрЃљрЃўрЃљрЃА.\nрЃњрЃўрЃЮрЃарЃњрЃў рЃЊрЃљрЃАрЃљрЃЦрЃЏрЃћрЃЉрЃБрЃџрЃўрЃљ Invited Lecturer рЃЎрЃљрЃЋрЃЎрЃљрЃАрЃўрЃўрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃерЃў рЃЊрЃљ Acting Head of Geodesy and Gravimetry Department рЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃўрЃА рЃерЃћрЃЏрЃАрЃгрЃљрЃЋрЃџрЃћрЃџ рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃљрЃЌрЃљ рЃўрЃюрЃАрЃбрЃўрЃбрЃБрЃбрЃўрЃА рЃАрЃћрЃўрЃАрЃЏрЃБрЃарЃў рЃЏрЃЮрЃюрЃўрЃб. рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃфрЃћрЃюрЃбрЃарЃў-рЃерЃў. рЃўрЃюрЃбрЃћрЃарЃљрЃЦрЃбрЃўрЃБрЃџрЃў рЃџрЃћрЃЦрЃфрЃўрЃўрЃА рЃЌрЃћрЃЏрЃљ рЃўрЃДрЃЮ \"рЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃўрЃА рЃерЃћрЃЏрЃАрЃгрЃљрЃЋрЃџрЃћрЃџрЃў рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃћрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљ рЃЊрЃљ рЃарЃЮрЃџрЃў рЃЦрЃЋрЃћрЃДрЃюрЃўрЃА рЃЏрЃЊрЃњрЃарЃљрЃЊ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃерЃў\".\nрЃџрЃћрЃЦрЃфрЃўрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃњрЃўрЃЮрЃарЃњрЃў рЃљрЃ«рЃљрЃџрЃљрЃўрЃљрЃА рЃДрЃЮрЃцрЃўрЃџрЃў рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃўрЃф рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю, рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮрЃЊ рЃгрЃљрЃарЃўрЃЏрЃљрЃарЃЌрЃљ.\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃљрЃЊрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃљрЃфрЃўрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃўрЃЊ рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃЋрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃњрЃўрЃЮрЃарЃњрЃўрЃА рЃљрЃЏ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃўрЃАрЃЌрЃЋрЃўрЃА!\n#рЃњрЃћрЃЮрЃћрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃАрЃЎрЃџрЃБрЃЉрЃў #рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА #рЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃўрЃАрЃерЃћрЃЏрЃАрЃгрЃљрЃЋрЃџрЃћрЃџрЃўрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃћрЃЉрЃўрЃАрЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљ #рЃЏрЃЊрЃњрЃарЃљрЃЊрЃўрЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃАрЃЏрЃўрЃќрЃюрЃћрЃЉрЃў",
