    briefText: "14 рЃљрЃърЃарЃўрЃџрЃў- рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃЊрЃдрЃћ!\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА I-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃЏрЃљрЃўрЃљ рЃўрЃЏрЃюрЃљрЃФрЃўрЃА рЃАрЃљрЃерЃБрЃљрЃџрЃћрЃЉрЃўрЃЌ рЃњрЃљрЃўрЃњрЃћрЃА, рЃарЃЮрЃЏ 14 рЃљрЃърЃарЃўрЃџрЃў рЃЊрЃћрЃЊрЃљрЃћрЃюрЃўрЃА рЃЊрЃдрЃћрЃљ, рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃЏрЃћрЃцрЃћ рЃцрЃљрЃарЃюрЃљрЃЋрЃљрЃќрЃўрЃА рЃЊрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃћрЃЉрЃљрЃќрЃћ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃерЃћрЃЦрЃЏрЃюрЃўрЃА рЃАрЃљрЃЦрЃЏрЃћрЃерЃў, рЃўрЃАрЃўрЃф рЃЌрЃБ рЃарЃљрЃбрЃЮрЃЏ рЃЊрЃљрЃБрЃЊрЃњрЃћрЃА рЃЦрЃљрЃарЃЌрЃЋрЃћрЃЉрЃЏрЃљ рЃФрЃћрЃњрЃџрЃў рЃЊрЃћрЃЊрЃљрЃћрЃюрЃўрЃА.\nрЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЊрЃљрЃбрЃЋрЃўрЃарЃЌрЃБрЃџрЃў рЃўрЃДрЃЮ рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃЊрЃљ рЃАрЃљрЃ«рЃљрЃџрЃўрЃАрЃЮ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃћрЃЉрЃўрЃЌ!",
