    briefText: "2021 рЃгрЃџрЃўрЃА 13 рЃљрЃърЃарЃўрЃџрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃарЃћрЃЦрЃбрЃЮрЃарЃў, рЃЉрЃљрЃбрЃЮрЃюрЃў рЃЊрЃљрЃЋрЃўрЃЌ рЃљрЃцрЃарЃљрЃАрЃўрЃФрЃћ рЃЊрЃљ рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃърЃћрЃарЃАрЃЮрЃюрЃљрЃџрЃў рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА.\nрЃЉрЃарЃўрЃбрЃљрЃюрЃБрЃџрЃў рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў - University of Buckingham - рЃћрЃарЃЌ-рЃћрЃарЃЌрЃў рЃњрЃљрЃЏрЃЮрЃарЃЕрЃћрЃБрЃџрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃўрЃљ.\nрЃЏрЃўрЃАрЃў рЃерЃћрЃЦрЃЏрЃюрЃљ рЃБрЃЎрЃљрЃЋрЃерЃўрЃарЃЊрЃћрЃЉрЃљ рЃфрЃюрЃЮрЃЉрЃўрЃџ рЃърЃЮрЃџрЃўрЃбрЃўрЃЎрЃБрЃа рЃЏрЃЮрЃдрЃЋрЃљрЃгрЃћрЃА, рЃЏрЃљрЃарЃњрЃљрЃарЃћрЃб рЃбрЃћрЃбрЃЕрЃћрЃарЃА. 1973 рЃгрЃћрЃџрЃА, рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃЉрЃўрЃА рЃЊрЃарЃЮрЃА, рЃАрЃгрЃЮрЃарЃћрЃЊ рЃбрЃћрЃбрЃЕрЃћрЃарЃў рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃЊрЃљ рЃЉрЃБрЃЎрЃўрЃюрЃњрЃћрЃЏрЃўрЃА рЃАрЃљрЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃЮ рЃЎрЃЮрЃџрЃћрЃ»рЃўрЃА рЃерЃћрЃЦрЃЏрЃюрЃљрЃА, рЃ«рЃЮрЃџрЃЮ 1983 рЃгрЃћрЃџрЃА, рЃБрЃЎрЃЋрЃћ рЃарЃЮрЃњрЃЮрЃарЃф рЃърЃарЃћрЃЏрЃўрЃћрЃа-рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЏрЃљ, рЃЊрЃўрЃЊрЃў рЃгрЃЋрЃџрЃўрЃџрЃў рЃерЃћрЃўрЃбрЃљрЃюрЃљ, рЃарЃЮрЃЏ рЃЉрЃБрЃЎрЃўрЃюрЃњрЃћрЃЏрЃА рЃАрЃљрЃЏрЃћрЃцрЃЮ рЃЦрЃљрЃарЃбрЃўрЃўрЃЌ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃбрЃљрЃбрЃБрЃАрЃў рЃЏрЃўрЃћрЃюрЃўрЃГрЃљ. 2020 рЃгрЃћрЃџрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃў рЃќрЃћрЃЊрЃўрЃќрЃћрЃЊ рЃЏрЃћрЃАрЃљрЃЏрЃћрЃЊ рЃЊрЃљрЃАрЃљрЃ«рЃћрЃџрЃЊрЃљ рЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮрЃЊ 129 рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃА рЃерЃЮрЃарЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃћрЃЉрЃўрЃА рЃЎрЃЏрЃљрЃДрЃЮрЃцрЃўрЃџрЃћрЃЉрЃўрЃА рЃЌрЃЋрЃљрЃџрЃАрЃљрЃќрЃарЃўрЃАрЃўрЃЌ. 2020 рЃгрЃћрЃџрЃА рЃЉрЃБрЃЎрЃўрЃюрЃњрЃћрЃЏрЃўрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃерЃў рЃЏрЃАрЃЮрЃцрЃџрЃўрЃЮрЃА 70-рЃќрЃћ рЃЏрЃћрЃбрЃў рЃЦрЃЋрЃћрЃДрЃюрЃўрЃЊрЃљрЃю 3,300 рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉрЃЊрЃљ. 2020 рЃгрЃћрЃџрЃА рЃЉрЃБрЃЎрЃўрЃюрЃњрЃћрЃЏрЃўрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃЏрЃљ рЃЊрЃљ рЃЉрЃарЃўрЃбрЃљрЃюрЃБрЃџрЃЏрЃљ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃЏрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃ«рЃћрЃџрЃў рЃЏрЃЮрЃљрЃгрЃћрЃарЃћрЃА рЃљрЃцрЃўрЃџрЃўрЃарЃћрЃЉрЃўрЃА рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃа рЃерЃћрЃЌрЃљрЃюрЃ«рЃЏрЃћрЃЉрЃљрЃА.",
