    briefText: "14 рЃљрЃърЃарЃўрЃџрЃў рЃЊрЃћрЃЊрЃљрЃћрЃюрЃўрЃА рЃЊрЃдрЃћрЃљ!\n2021 рЃгрЃџрЃўрЃА 13 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА I-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃЏрЃљрЃўрЃљ рЃўрЃЏрЃюрЃљрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃюрЃљрЃ«рЃћрЃА рЃљрЃюрЃўрЃЏрЃљрЃфрЃўрЃБрЃарЃў рЃцрЃўрЃџрЃЏрЃў РђюрЃцрЃљрЃарЃюрЃљрЃЋрЃљрЃќ рЃЏрЃћрЃцрЃћРђЮ, рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃерЃћрЃЦрЃЏрЃюрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃљрЃљрЃгрЃДрЃЋрЃћрЃА рЃ«рЃЏрЃЮрЃЋрЃљрЃюрЃў рЃЎрЃарЃЮрЃАрЃЋрЃЮрЃарЃЊрЃў, рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃЏрЃљрЃарЃфрЃЋрЃџрЃћрЃЉрЃўрЃЌ рЃерЃћрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃў.",
