    briefText: "14 рЃљрЃърЃарЃўрЃџрЃў- рЃЊрЃћрЃЊрЃљрЃћрЃюрЃўрЃА рЃЊрЃдрЃћ рЃърЃўрЃарЃЋрЃћрЃџрЃљрЃЊ рЃљрЃдрЃюрЃўрЃерЃюрЃћрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ!\nрЃЊрЃћрЃЊрЃљрЃћрЃюрЃўрЃА рЃЊрЃдрЃћ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮрЃЊ рЃљрЃдрЃюрЃўрЃерЃюрЃћрЃА I-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ. рЃљрЃЏрЃ»рЃћрЃарЃљрЃЊ рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃБрЃЏрЃљрЃАрЃърЃўрЃюрЃФрЃџрЃћрЃА V рЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃА. рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃџрЃћрЃЦрЃАрЃћрЃЉрЃў рЃЊрЃљ рЃБрЃцрЃарЃЮрЃА рЃЏрЃћрЃњрЃЮрЃЉрЃарЃћрЃЉрЃА рЃљрЃЕрЃЋрЃћрЃюрЃћрЃА рЃЌрЃљрЃЋрЃўрЃљрЃюрЃЌрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў - \"рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў\" рЃљрЃАрЃЮ-рЃЉрЃњрЃћрЃарЃћрЃЉрЃў.\nрЃърЃўрЃарЃЋрЃћрЃџрЃў рЃЎрЃџрЃљрЃАрЃўрЃА рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџрЃў рЃљрЃюрЃљ рЃЎрЃЋрЃўрЃГрЃўрЃФрЃћ, рЃ«рЃЮрЃџрЃЮ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљ",
