    briefText: "рЃЏрЃћрЃАрЃљрЃЏрЃћрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃљрЃдрЃюрЃўрЃерЃюрЃћрЃА рЃЊрЃћрЃЊрЃљ рЃћрЃюрЃўрЃА рЃЊрЃдрЃћ !\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЊрЃћрЃЊрЃљ рЃћрЃюрЃўрЃА рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЊрЃљ рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃћрЃЉрЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ .\nIII-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ (рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЏрЃљрЃўрЃљ рЃўрЃЏрЃюрЃљрЃФрЃћ) рЃЦрЃљрЃарЃЌрЃБрЃџрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃАрЃљрЃЏрЃў рЃАрЃљрЃ«рЃћрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃюрЃљрЃ«рЃћрЃА рЃљрЃюрЃўрЃЏрЃљрЃфрЃўрЃБрЃарЃў рЃцрЃўрЃџрЃЏрЃў, рЃћрЃАрЃбрЃБрЃЏрЃарЃюрЃћрЃю рЃАрЃЎрЃЮрЃџрЃўрЃА рЃБрЃџрЃљрЃЏрЃљрЃќрЃћрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃА, рЃюрЃљрЃ«рЃћрЃА рЃўрЃљрЃЎрЃЮрЃЉ рЃњрЃЮрЃњрЃћрЃЉрЃљрЃерЃЋрЃўрЃџрЃўрЃА рЃБрЃФрЃЋрЃћрЃџрЃћрЃАрЃў рЃАрЃљрЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃћрЃЉрЃў \" рЃЊрЃћрЃЊрЃљ рЃћрЃюрЃљ\" рЃЊрЃљ \"рЃЉрЃБрЃюрЃћрЃЉрЃўрЃА рЃЎрЃљрЃарЃў \", рЃгрЃљрЃЋрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃЊрЃљ рЃњрЃљрЃюрЃўрЃ«рЃўрЃџрЃћрЃА рЃўрЃџрЃўрЃљ рЃГрЃљрЃЋрЃГрЃљрЃЋрЃљрЃФрЃўрЃА РђюрЃЊрЃћрЃЊрЃљ-рЃЕрЃўрЃбрЃў.Рђю",
