    title: "рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃўрЃА РђъSCIENCE ON STAGEРђю рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ",
    briefText: " 2021 рЃгрЃџрЃўрЃА 16 рЃљрЃърЃарЃўрЃџрЃА рЃерЃћрЃЊрЃњрЃљ РђъSCIENSE ON STAGEРђЮ рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃћрЃЉрЃўрЃА рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃЌрЃљрЃю. рЃўрЃџрЃўрЃљрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃљрЃЉрЃБрЃюрЃћрЃЉрЃўрЃАрЃЏрЃћрЃбрЃДрЃЋрЃћрЃџрЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЎрЃЋрЃџрЃћрЃЋрЃўрЃЌрЃў рЃфрЃћрЃюрЃбрЃарЃўрЃА SALIS-рЃўрЃА рЃЮрЃцрЃўрЃфрЃўрЃљрЃџрЃБрЃарЃЏрЃљ рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃћрЃџрЃЏрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў, рЃърЃарЃЮрЃцрЃћрЃАрЃЮрЃарЃЏрЃљ рЃЏрЃљрЃарЃўрЃЎрЃљ рЃЎрЃљрЃърЃљрЃюрЃљрЃФрЃћрЃЏ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃА рЃњрЃљрЃљрЃфрЃюрЃЮ рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃўрЃА рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃўрЃА рЃърЃўрЃарЃЮрЃЉрЃћрЃЉрЃў рЃЊрЃљ рЃўрЃАрЃљрЃБрЃЉрЃарЃљ рЃърЃарЃЮрЃћрЃЦрЃбрЃћрЃЉрЃќрЃћ, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф рЃерЃћрЃАрЃљрЃФрЃџрЃћрЃЉрЃћрЃџрЃўрЃљ рЃгрЃљрЃарЃљрЃЊрЃњрЃўрЃюрЃЮрЃю рЃЪрЃўрЃБрЃарЃўрЃА рЃгрЃўрЃюрЃљрЃерЃћ. рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃў 4 рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃњрЃљрЃћрЃЏрЃњрЃќрЃљрЃЋрЃарЃћрЃЉрЃљ рЃърЃарЃљрЃдрЃљрЃерЃў рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃќрЃћ!\nрЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃў рЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃ«рЃљрЃарЃљрЃЉрЃљрЃФрЃћ рЃЊрЃљ рЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃњрЃЮрЃфрЃўрЃарЃўрЃФрЃћ.\nрЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃћрЃЉрЃА рЃЊрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃА!",
