    briefText: "2021 рЃгрЃџрЃў 19 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА IX-1рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљ рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃюрЃљрЃбрЃљрЃџрЃўрЃљ рЃАрЃўрЃарЃљрЃЉрЃўрЃФрЃћ рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃарЃЦрЃћрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃА.\nрЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃЏрЃљ рЃЊрЃљрЃљрЃЌрЃЋрЃљрЃџрЃўрЃћрЃарЃћрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЎрЃЮрЃџрЃћрЃЦрЃфрЃўрЃћрЃЉрЃў, рЃЏрЃЮрЃўрЃАрЃЏрЃўрЃюрЃћрЃА рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃћрЃЦрЃАрЃЎрЃБрЃарЃАрЃў, рЃ«рЃЮрЃџрЃЮ рЃерЃћрЃЏрЃЊрЃћрЃњ рЃюрЃљрЃбрЃљрЃџрЃўрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃАрЃљрЃЏрЃБрЃќрЃћрЃБрЃЏрЃЮ рЃАрЃўрЃЋрЃарЃфрЃћрЃерЃў рЃЕрЃљрЃљрЃбрЃљрЃарЃљ рЃћрЃарЃЌрЃњрЃЋрЃљрЃарЃў рЃерЃћрЃЏрЃљрЃ»рЃљрЃЏрЃћрЃЉрЃћрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЌрЃћрЃЏрЃћрЃЉрЃќрЃћ:\n1.рЃЦрЃЋрЃўрЃА рЃ«рЃљрЃюрЃљ; рЃћрЃюрЃћрЃЮрЃџрЃўрЃЌрЃў.;\n2.рЃЉрЃарЃўрЃюрЃ»рЃљрЃЮрЃА рЃ«рЃљрЃюрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў;\n3.рЃЎрЃЮрЃџрЃ«рЃљ рЃЏрЃўрЃЌрЃАрЃљ рЃЊрЃљ рЃАрЃўрЃюрЃљрЃЏрЃЊрЃЋрЃўрЃџрЃћрЃерЃў;\n4.рЃЎрЃЮрЃџрЃ«рЃћрЃЌрЃўрЃА рЃАрЃљрЃЏрЃћрЃцрЃЮ рЃФрЃЋ.рЃг.VI-I рЃАрЃљрЃБрЃЎрЃБрЃюрЃћрЃћрЃЉрЃерЃў.",
