    briefText: "2021 рЃгрЃџрЃўрЃА 21 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА X рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃАрЃљрЃЏрЃБрЃерЃљрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ РђърЃ»рЃБрЃюрЃўрЃЮрЃа рЃћрЃЕрЃўрЃЋрЃЏрЃћрЃюрЃбрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮРђю-рЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃћрЃџ рЃўрЃюрЃњрЃљ рЃњрЃћрЃњрЃћрЃерЃўрЃФрЃћрЃЏ.\nрЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃўрЃА рЃЌрЃћрЃЏрЃљ рЃўрЃДрЃЮ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃА Entrepreneurship Skill Pass (ESP)-рЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃАрЃљрЃЏрЃћрЃгрЃљрЃарЃЏрЃћрЃЮ\nрЃАрЃћрЃарЃбрЃўрЃцрЃўрЃфрЃўрЃарЃћрЃЉрЃўрЃА рЃърЃарЃЮрЃфрЃћрЃАрЃерЃў рЃЕрЃљрЃарЃЌрЃЋрЃљ рЃћрЃЋрЃарЃЮрЃърЃљрЃерЃў рЃЊрЃљрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЉрЃБрЃџрЃў рЃАрЃбрЃљрЃюрЃЊрЃљрЃарЃбрЃћрЃЉрЃўрЃЌ 15-рЃЊрЃљрЃю 25 рЃгрЃџрЃљрЃЏрЃЊрЃћ рЃљрЃАрЃљрЃЎрЃўрЃА рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА.\nрЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃљрЃЏ рЃАрЃћрЃарЃбрЃўрЃцрЃўрЃфрЃўрЃарЃћрЃЉрЃўрЃА рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃљрЃерЃў рЃЕрЃљрЃарЃЌрЃЋрЃўрЃА рЃБрЃцрЃџрЃћрЃЉрЃљ рЃљрЃЦрЃЋрЃА рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃўрЃЏ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф РђърЃ»рЃБрЃюрЃўрЃЮрЃа рЃћрЃЕрЃЋрЃЏрЃћрЃюрЃбрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃАРђю РђърЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃЎрЃЮрЃЏрЃърЃљрЃюрЃўрЃўрЃАРђю рЃЏрЃћрЃЌрЃЮрЃЊрЃЮрЃџрЃЮрЃњрЃўрЃўрЃЌ рЃАрЃгрЃљрЃЋрЃџрЃЮрЃЉрЃћрЃю РђърЃЏрЃћрЃгрЃљрЃарЃЏрЃћрЃЮрЃЉрЃљрЃАРђю.",
