    title: "рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ- рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃў рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃў рЃћрЃюрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ",
    briefText: "рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮрЃЊ рЃЊрЃљ рЃАрЃљрЃ«рЃљрЃџрЃўрЃАрЃЮрЃЊ рЃгрЃљрЃарЃўрЃЏрЃљрЃарЃЌрЃљ рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ- рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃў \"рЃЎрЃЮрЃЋрЃўрЃЊ рЃърЃљрЃюрЃЊрЃћрЃЏрЃўрЃљ\" рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃў рЃћрЃюрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ VII-2 рЃЊрЃљ VII-6 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃерЃў (рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃюрЃљрЃЌрЃўрЃљ рЃљрЃарЃЮрЃЉрЃћрЃџрЃўрЃФрЃћ) .",
