    briefText: "23 рЃљрЃърЃарЃўрЃџрЃў рЃгрЃўрЃњрЃюрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃљ!\nрЃгрЃўрЃњрЃюрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃўрЃА рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃљрЃЊ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃгрЃўрЃњрЃюрЃўрЃА рЃАрЃљрЃюрЃўрЃерЃюрЃћрЃћрЃЉрЃў рЃњрЃљрЃљрЃЎрЃћрЃЌрЃћрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА II, III рЃЊрЃљ IV рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ ( рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃўрЃарЃЏрЃљ рЃЎрЃћрЃарЃФрЃћрЃЋрЃљрЃФрЃћ)",
