    title: "рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ",
    briefText: "рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃЊрЃљрЃфрЃЋрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћ рЃљрЃдрЃЋрЃюрЃўрЃерЃюрЃћрЃЌ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў.III-IV рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ \"рЃЏрЃћ рЃЊрЃљ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА\" рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ (рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃАрЃљрЃџрЃЮрЃЏрЃћ рЃЊрЃљрЃюрЃћрЃџрЃўрЃљ) рЃЏрЃЮрЃўрЃАрЃЏрЃўрЃюрЃћрЃА рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљ, рЃўрЃЏрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ рЃЌрЃБ рЃарЃљ рЃЏрЃўрЃќрЃљрЃюрЃА рЃћрЃЏрЃАрЃљрЃ«рЃБрЃарЃћрЃЉрЃљ рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃЊрЃдрЃўрЃА рЃљрЃдрЃюрЃўрЃерЃЋрЃюрЃљ. рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃАрЃљрЃюрЃљрЃ«рЃљрЃЋрЃў рЃўрЃДрЃЮ рЃЉрЃљрЃЋрЃерЃЋрЃўрЃА рЃБрЃцрЃџрЃћрЃЉрЃљрЃЌрЃљ рЃЎрЃЮрЃюрЃЋрЃћрЃюрЃфрЃўрЃљ рЃљрЃюрЃўрЃЏрЃљрЃфрЃўрЃљрЃерЃў.рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃўрЃЏрЃАрЃ»рЃћрЃџрЃћрЃА , рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃарЃЮрЃЊрЃўрЃА рЃўрЃарЃдрЃћрЃЋрЃљ рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃў, рЃЏрЃЮрЃўрЃДрЃЋрЃљрЃюрЃћрЃА рЃЏрЃљрЃњрЃљрЃџрЃўрЃЌрЃћрЃЉрЃў, рЃЊрЃљрЃгрЃћрЃарЃћрЃА рЃарЃљрЃќрЃћ рЃЮрЃфрЃюрЃћрЃЉрЃЮрЃЉрЃћрЃю рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃў, рЃерЃћрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃюрЃљрЃ«рЃљрЃбрЃћрЃЉрЃў.\n",
