    id: 30,
    title: "\"рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА\"- рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃБрЃцрЃџрЃћрЃЉрЃљрЃЊрЃљрЃЏрЃфрЃЋрЃћрЃџрЃћрЃЉрЃЌрЃљрЃю",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃарЃФрЃћрЃџрЃЊрЃћрЃЉрЃљ рЃърЃарЃЮрЃћрЃЦрЃбрЃў \"рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА\".\nрЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў 31 рЃЏрЃљрЃўрЃАрЃА VII-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃЊрЃљрЃфрЃЋрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃўрЃА, 1 рЃўрЃЋрЃюрЃўрЃАрЃўрЃАрЃљрЃЊрЃЏрЃў рЃЏрЃўрЃФрЃдрЃЋрЃюрЃўрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЕрЃљрЃБрЃбрЃљрЃарЃЊрЃљрЃЌ рЃЌрЃћрЃЏрЃљрЃќрЃћ: \"рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃў; рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃЊрЃљрЃфрЃЋрЃўрЃА рЃЊрЃдрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљ рЃЊрЃљ рЃљрЃБрЃфрЃўрЃџрЃЮрЃЉрЃџрЃЮрЃЉрЃљ\" (рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў- рЃюрЃљрЃбрЃљрЃџрЃўрЃљ рЃАрЃўрЃарЃљрЃЉрЃўрЃФрЃћ).\nрЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃА рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю рЃДрЃЮрЃцрЃўрЃџрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў:\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃЎрЃЋрЃљрЃГрЃљрЃФрЃћ - рЃўрЃЋрЃљрЃюрЃћ рЃ»рЃљрЃЋрЃљрЃ«рЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃљрЃЏрЃљрЃарЃЌрЃљрЃџрЃЏрЃфрЃЮрЃЊрЃюрЃћрЃЮрЃЉрЃўрЃА рЃАрЃљрЃЏрЃљрЃњрЃўрЃАрЃбрЃарЃЮ рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў рЃЊрЃљ\nрЃюрЃўрЃЎрЃљ рЃ«рЃљрЃќрЃљрЃарЃљрЃФрЃћ - РђюрЃюрЃўрЃБ рЃЋрЃўрЃЪрЃћрЃю рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃАРђЮ рЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃЏрЃЮрЃфрЃЊрЃюрЃћрЃЮрЃЉрЃўрЃА рЃцрЃљрЃЎрЃБрЃџрЃбрЃћрЃбрЃўрЃА рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃў.\nрЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃўрЃюрЃбрЃћрЃарЃљрЃЦрЃбрЃўрЃБрЃџрЃў рЃџрЃћрЃЦрЃфрЃўрЃљ рЃњрЃљрЃњрЃарЃФрЃћрЃџрЃЊрЃљ рЃЎрЃўрЃЌрЃ«рЃЋрЃљ-рЃърЃљрЃАрЃБрЃ«рЃўрЃА рЃарЃћрЃЪрЃўрЃЏрЃерЃў, рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃЊрЃљрЃАрЃарЃБрЃџрЃЊрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЋрЃўрЃЦрЃбрЃЮрЃарЃўрЃюрЃўрЃЌ.  рЃБрЃдрЃарЃЏрЃћрЃА рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃЋрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃЏрЃљрЃарЃўрЃљрЃЏрЃАрЃљ рЃЊрЃљ рЃюрЃўрЃЎрЃљрЃА рЃЊрЃдрЃћрЃЋрЃљрЃюрЃЊрЃћрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЊрЃљ рЃЋрЃўрЃбрЃЮрЃЋрЃћрЃЉрЃЌ рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃўрЃА рЃўрЃЏрЃћрЃЊрЃА!\n",
