    title: "рЃАрЃЎрЃЮрЃџрЃўрЃА рЃњрЃћрЃЮрЃћрЃЎрЃЮрЃЎрЃџрЃБрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃў рЃљрЃЦрЃфрЃўрЃљ",
    briefText: "2021 рЃгрЃџрЃўрЃА 10-11 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ, рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃњрЃћрЃЮрЃћрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА   рЃгрЃћрЃЋрЃарЃћрЃЉрЃЏрЃљ, рЃЎрЃџрЃБрЃЉрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЏрЃљ рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ  рЃАрЃЮрЃцрЃЮ рЃ«рЃБрЃ«рЃБрЃюрЃљрЃўрЃерЃЋрЃўрЃџрЃЏрЃљ рЃЊрЃљ рЃЦрЃўрЃЏрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ  рЃюрЃЮрЃюрЃљ рЃљрЃЉрЃљрЃерЃўрЃФрЃћрЃЏ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃћрЃА  рЃћрЃЋрЃарЃЮрЃЎрЃљрЃЋрЃерЃўрЃарЃўрЃА  рЃЊрЃљрЃцрЃўрЃюрЃљрЃюрЃАрЃћрЃЉрЃўрЃЌ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃерЃљрЃЋрЃў рЃќрЃдрЃЋрЃўрЃА рЃћрЃЎрЃЮрЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃўрЃА рЃърЃарЃЮрЃћрЃбрЃўрЃА\nРђърЃАрЃљрЃќрЃдрЃЋрЃљрЃЮ рЃюрЃљрЃарЃЕрЃћрЃюрЃћрЃЉрЃўрЃАРђю рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃЊрЃљрЃњрЃћрЃњрЃЏрЃўрЃџрЃў рЃАрЃљрЃќрЃдрЃЋрЃљрЃЮ рЃюрЃљрЃарЃЕрЃћрЃюрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃюрЃўрЃбрЃЮрЃарЃўрЃюрЃњрЃўрЃА, рЃљрЃдрЃгрЃћрЃарЃўрЃАрЃљ рЃЊрЃљ рЃЊрЃљрЃАрЃБрЃцрЃЌрЃљрЃЋрЃћрЃЉрЃўрЃА рЃљрЃЦрЃфрЃўрЃљрЃерЃў.\n#рЃњрЃћрЃЮрЃћрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃАрЃЎрЃџрЃБрЃЉрЃў\n#рЃЕрЃЋрЃћрЃюрЃЋрЃБрЃцрЃарЃЌрЃ«рЃўрЃџрЃЊрЃћрЃЉрЃўрЃЌрЃЉрЃБрЃюрЃћрЃЉрЃљрЃА\n#рЃўрЃќрЃарЃБрЃюрЃћрЃњрЃљрЃарЃћрЃЏрЃЮрЃќрЃћ #рЃњрЃљрЃарЃћрЃЏрЃЮрЃАрЃЊрЃљрЃфрЃЋрЃљ #рЃюрЃљрЃарЃЕрЃћрЃюрЃћрЃЉрЃўрЃАрЃЏрЃљрЃарЃЌрЃЋрЃљ\n",
