    title: "рЃ»рЃћрЃЏрЃљрЃџ рЃЦрЃљрЃарЃЕрЃ«рЃљрЃФрЃўрЃА рЃАрЃљрЃдрЃљрЃЏрЃЮ",
    briefText: "2021 рЃгрЃџрЃўрЃА 14 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃџрЃЌрЃљ рЃЎрЃџрЃБрЃЉрЃЏрЃљ (рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЏрЃљрЃарЃўрЃюрЃљ рЃбрЃљрЃџрЃљрЃ«рЃљрЃФрЃћ) рЃЊрЃўрЃЊрЃў рЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃў рЃЏрЃгрЃћрЃарЃџрЃўрЃА рЃ»рЃћрЃЏрЃљрЃџ рЃЦрЃљрЃарЃЕрЃ«рЃљрЃФрЃўрЃА рЃЊрЃљрЃЉрЃљрЃЊрЃћрЃЉрЃўрЃЊрЃљрЃю 85 рЃгрЃџрЃўрЃА рЃўрЃБрЃЉрЃўрЃџрЃћ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃЎрЃљрЃЎрЃў рЃгрЃћрЃарЃћрЃЌрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃ»рЃљрЃарЃЮ рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃерЃў рЃљрЃдрЃюрЃўрЃерЃюрЃљ.\nрЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃЊрЃљ рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃЏрЃљ , IX-XII рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃ»рЃћрЃЏрЃљрЃџ рЃЦрЃљрЃарЃЕрЃ«рЃљрЃФрЃўрЃА рЃърЃарЃЮрЃќрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃЊрЃљрЃЏрЃАрЃгрЃарЃћ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃљрЃА рЃњрЃљрЃБрЃќрЃўрЃљрЃарЃћрЃА рЃўрЃА рЃћрЃЏрЃЮрЃфрЃўрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЏрЃгрЃћрЃарЃџрЃўрЃА рЃњрЃљрЃюрЃБрЃЏрЃћрЃЮрЃарЃћрЃЉрЃћрЃџрЃЏрЃљ рЃАрЃўрЃбрЃДрЃЋрЃљрЃЏ рЃњрЃљрЃЏрЃЮрЃўрЃгрЃЋрЃўрЃљ рЃЏрЃљрЃЌрЃерЃў.\n",
