    title: "­ЪЊБрЃЕрЃЋрЃћрЃюрЃЮ рЃФрЃЋрЃўрЃарЃцрЃљрЃАрЃЮ РЮц№ИЈрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃЮ!",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЮ, рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃЮ, рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃЮ, рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃЮ!\nрЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃњрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃДрЃЋрЃћрЃџрЃљрЃА, рЃЋрЃўрЃюрЃф рЃЌрЃљрЃЋрЃА рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃљрЃЊ рЃЏрЃўрЃўрЃЕрЃюрЃћрЃЋрЃЌ, рЃЋрЃўрЃюрЃф рЃДрЃЮрЃЋрЃћрЃџрЃў рЃерЃћрЃ«рЃЏрЃўрЃљрЃюрЃћрЃЉрЃўрЃАрЃљрЃА рЃњрЃЋрЃўрЃЊрЃњрЃћрЃЉрЃўрЃЌ рЃњрЃЋрЃћрЃарЃЊрЃўрЃЌ рЃЊрЃљ рЃњрЃЋрЃљрЃФрЃџрЃўрЃћрЃарЃћрЃЉрЃЌ!\nрЃљрЃЏрЃ»рЃћрЃарЃљрЃЊрЃљрЃф рЃљрЃАрЃћ рЃЏрЃЮрЃ«рЃЊрЃљ! рЃАрЃБрЃџ рЃарЃљрЃдрЃљрЃф рЃћрЃарЃЌрЃў рЃЎрЃЋрЃўрЃарЃўрЃА рЃЏрЃљрЃюрЃФрЃўрЃџрЃќрЃћ рЃЌрЃЦрЃЋрЃћрЃюрЃў рЃЌрЃљрЃюрЃљрЃЊрЃњрЃЮрЃЏрЃўрЃЌ рЃЮрЃарЃў рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃў рЃАрЃљрЃЦрЃЋрЃћрЃџрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃЮ рЃљрЃЦрЃфрЃўрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃљ рЃЊрЃљ рЃЕрЃљрЃбрЃљрЃарЃћрЃЉрЃљ рЃерЃћрЃЋрЃФрЃћрЃџрЃўрЃЌ!\nрЃћрЃА рЃцрЃЮрЃбрЃЮ, рЃљрЃџрЃЉрЃљрЃЌ, рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃЎрЃљрЃарЃњрЃљрЃЊ, рЃЌрЃљрЃю рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃБрЃарЃљрЃЊ рЃњрЃљрЃЏрЃЮрЃ«рЃљрЃбрЃљрЃЋрЃА рЃЕрЃЋрЃћрЃюрЃА рЃАрЃљрЃЌрЃЦрЃЏрЃћрЃџрЃА; рЃЌрЃљрЃюрЃљрЃЉрЃљрЃарЃў рЃърЃљрЃАрЃБрЃ«рЃўрЃАрЃЏрЃњрЃћрЃЉрЃџрЃЮрЃЉрЃўрЃЌ рЃћрЃарЃЌрЃў рЃўрЃЊрЃћрЃўрЃЌ рЃњрЃљрЃћрЃарЃЌрЃўрЃљрЃюрЃћрЃЉрЃБрЃџрЃюрЃў рЃњрЃЋрЃћрЃарЃЊрЃўрЃњрЃЋрЃћрЃарЃЊ рЃўрЃЊрЃњрЃюрЃћрЃю рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃў рЃЌрЃћрЃЎрЃџрЃљ рЃЉрЃљрЃќрЃўрЃљрЃерЃЋрЃўрЃџрЃў рЃЊрЃљ рЃЏрЃўрЃАрЃў рЃЉрЃћрЃЉрЃўрЃљ рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃљрЃЋрЃ«рЃћрЃџрЃўрЃФрЃћ. рЃњрЃљрЃюрЃљ рЃЏрЃљрЃарЃбрЃЮ рЃЌрЃћрЃЎрЃџрЃљ рЃЊрЃљ рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў?\nрЃљрЃАрЃћ, рЃЮрЃ»рЃљрЃ«рЃћрЃЉрЃўрЃЌ, рЃљрЃ«рЃџрЃЮрЃЉрЃџрЃћрЃЉрЃўрЃЌ, рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃЌ рЃерЃћрЃњрЃЋрЃўрЃФрЃџрЃўрЃљ рЃЕрЃЋрЃћрЃю рЃЌрЃљрЃюрЃљрЃЊрЃњрЃЮрЃЏрЃљ, рЃЌрЃљрЃюрЃљрЃњрЃљрЃюрЃфрЃЊрЃљ рЃЊрЃљ рЃљрЃЏрЃўрЃЌ рЃЋрЃљрЃарЃЌ рЃФрЃџрЃўрЃћрЃарЃћрЃЉрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў!\nрЃБрЃдрЃарЃЏрЃћрЃА рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃњрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃДрЃЋрЃћрЃџрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃА, рЃЋрЃўрЃюрЃф рЃЕрЃљрЃарЃЌрЃБрЃџрЃў рЃўрЃДрЃЮ рЃљрЃЏ рЃљрЃЦрЃфрЃўрЃћрЃЉрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃА рЃърЃарЃЮрЃфрЃћрЃАрЃерЃў!\nрЃБрЃдрЃарЃЏрЃћрЃА рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃњрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃДрЃЋрЃћрЃџрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃА рЃЊрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃА, рЃЋрЃўрЃюрЃф рЃЌрЃљрЃЋрЃўрЃАрЃў рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљ рЃгрЃљрЃарЃЏрЃЮрЃњрЃЋрЃўрЃЊрЃњрЃўрЃюрЃљ!\nрЃБрЃдрЃарЃЏрЃћрЃА рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃњрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃДрЃЋрЃћрЃџрЃљ рЃЏрЃерЃЮрЃЉрЃћрЃџрЃА, рЃЋрЃўрЃюрЃф рЃАрЃўрЃЎрЃћрЃЌрЃўрЃЌ рЃќрЃарЃЊрЃўрЃЌ рЃерЃЋрЃўрЃџрЃћрЃЉрЃА!\nрЃљрЃЏ рЃћрЃарЃЌрЃў рЃЎрЃЋрЃўрЃарЃўрЃА рЃЏрЃљрЃюрЃФрЃўрЃџрЃќрЃћ рЃЕрЃЋрЃћрЃю рЃўрЃЏрЃљрЃќрЃћ рЃЉрЃћрЃЋрЃарЃљрЃЊ рЃЏрЃћрЃбрЃў рЃЌрЃљрЃюрЃ«рЃљ рЃњрЃљрЃЋрЃўрЃдрЃћрЃЌ рЃАрЃљрЃЦрЃЋрЃћрЃџрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃЮ рЃЏрЃўрЃќрЃюрЃўрЃЌ, рЃЋрЃўрЃЊрЃарЃћ рЃгрЃљрЃарЃЏрЃЮрЃњрЃЋрЃћрЃЊрЃњрЃўрЃюрЃљ, рЃарЃЮрЃЏ рЃерЃћрЃЋрЃФрЃџрЃћрЃЉрЃЊрЃўрЃЌ!\nрЃерЃћрЃњрЃюрЃћрЃЉрЃБрЃџрЃљрЃЊ рЃљрЃа рЃЋрЃљрЃАрЃљрЃ«рЃћрЃџрЃћрЃЉрЃЌ рЃфрЃўрЃцрЃарЃА, рЃарЃљрЃЊрЃњрЃљрЃю рЃЋрЃЌрЃЋрЃџрЃўрЃЌ, рЃарЃЮрЃЏ рЃАрЃўрЃЎрЃћрЃЌрЃћ, рЃ»рЃљрЃюрЃЏрЃарЃЌрЃћрЃџрЃЮрЃЉрЃљ рЃЊрЃљ рЃАрЃўрЃфрЃЮрЃфрЃ«рЃџрЃћ рЃфрЃўрЃцрЃарЃћрЃЉрЃўрЃЌ рЃљрЃа рЃўрЃќрЃЮрЃЏрЃћрЃЉрЃљ!\nрЃЕрЃЋрЃћрЃю рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃЋрЃљрЃарЃЌ!\nрЃЕрЃЋрЃћрЃю рЃћрЃарЃЌрЃљрЃЊ рЃюрЃћрЃЉрЃўрЃАрЃЏрЃўрЃћрЃа рЃАрЃўрЃарЃЌрЃБрЃџрЃћрЃА рЃњрЃљрЃЊрЃљрЃЋрЃџрЃљрЃ«рЃљрЃЋрЃЌ!\nрЃЕрЃЋрЃћрЃю рЃњрЃЋрЃ»рЃћрЃарЃљ, рЃарЃЮрЃЏ рЃњрЃљрЃЏрЃЮрЃ»рЃљрЃюрЃЏрЃарЃЌрЃћрЃџрЃћрЃЉрЃБрЃџрЃў рЃЊрЃљрЃЏрЃўрЃљрЃюрЃћ рЃюрЃљрЃфрЃЋрЃџрЃўрЃерЃЋрЃўрЃџрЃўрЃф рЃАрЃБрЃџ рЃЏрЃљрЃџрЃћ рЃњрЃљрЃ«рЃЊрЃћрЃЉрЃљ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃў!\nрЃњ рЃЏ рЃљ рЃЊ рЃџ рЃЮ рЃЉ рЃЌ !\n---------------------------------------------------\nрЃърЃљрЃбрЃўрЃЋрЃўрЃАрЃфрЃћрЃЏрЃўрЃЌ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃљрЃЊрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃљрЃфрЃўрЃљ.\n",
