    title: "рЃћрЃЋрЃарЃЮрЃърЃўрЃА рЃўрЃЏрЃБрЃюрЃўрЃќрЃљрЃфрЃўрЃўрЃА рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃў",
    briefText: "24-рЃЊрЃљрЃю 30 рЃљрЃърЃарЃўрЃџрЃљрЃЏрЃЊрЃћ рЃћрЃЋрЃарЃЮрЃърЃўрЃА рЃўрЃЏрЃБрЃюрЃўрЃќрЃљрЃфрЃўрЃўрЃА рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃў рЃљрЃдрЃўрЃюрЃўрЃерЃюрЃћрЃЉрЃљ.\nрЃљрЃЏ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃЌрЃљрЃарЃўрЃдрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА XI-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃўрЃА рЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃ«рЃљрЃарЃљрЃЉрЃљрЃФрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃўрЃЌ рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮ- рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃЏрЃћрЃфрЃ«рЃарЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА.\n",
