    briefText: "2021 рЃгрЃџрЃўрЃА 12 рЃўрЃЋрЃџрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃдрЃЋрЃЌрЃўрЃАрЃЏрЃерЃЮрЃЉрЃџрЃўрЃА рЃерЃЮрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃЎрЃљрЃЌрЃћрЃЊрЃарЃЮ рЃбрЃљрЃФрЃљрЃарЃерЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃљрЃќрЃћрЃЌрЃўрЃА рЃЏрЃўрЃбрЃарЃЮрЃърЃЮрЃџрЃўрЃбрЃЏрЃљ рЃЊрЃўрЃЏрЃўрЃбрЃарЃўрЃЏ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃгрЃљрЃарЃЕрЃўрЃюрЃћрЃЉрЃБрЃџрЃў рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃў рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃБрЃџрЃљрЃЊ рЃЊрЃљрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃљ рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃЊрЃџрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ рЃћрЃарЃЌрЃ»рЃћрЃарЃљрЃЊрЃў рЃАрЃбрЃўрЃърЃћрЃюрЃЊрЃўрЃћрЃЉрЃўрЃЌ!\nрЃгрЃџрЃћрЃЋрЃљрЃюрЃЊрЃћрЃџрЃў рЃЏрЃћрЃЊрЃљрЃџрЃЮрЃАрЃюрЃћрЃЉрЃў рЃљрЃарЃўрЃљрЃю:\nрЃљрЃюрЃљ рЃЕрЃљрЃюрЃЕрЃўрЃЉрЃљрЃФрЃћ\nрЃЌрЃљрЃЏрЃЌрЃљ рЃГрЃљрЃЋрЃГрЃљрЃюрЃўрЃФрЃћ\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃ»рЃљрЃДрЃћрЃџрЃў\nрЃљрЃюрЃљ рЃЏрЃљрЃарЃўрЃљ рЃџрЃћрЃЪрЃљрЃЋрЃљ\nрЃЌрЃўрЃюрЃљрЃЌрЃўрЃю рЃ»рЃЮрЃ»рЃБрЃљ\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃЊрЃЮрЃЉрЃЮрЃарЃ»рЃњрЃўрЃюрЃўрЃФрЃћ\nрЃћрЃџрЃћрЃюрЃћ рЃЦрЃљрЃарЃфрЃўрЃЋрЃљрЃФрЃћ\nрЃюрЃљрЃюрЃБрЃЎрЃљ рЃЏрЃўрЃЦрЃљрЃФрЃћ\nрЃћрЃџрЃћрЃюрЃћ рЃЊрЃўрЃљрЃАрЃљрЃЏрЃўрЃФрЃћ\nрЃћрЃџрЃћрЃюрЃћ рЃњрЃБрЃЊрЃљрЃФрЃћ\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃЊрЃљ рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!",
