    briefText: "2021 рЃгрЃћрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљ 75 рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЏ рЃЊрЃљрЃљрЃАрЃарЃБрЃџрЃљ, рЃЏрЃљрЃЌрЃњрЃљрЃю 71 рЃБрЃЎрЃЋрЃћ рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃўрЃљ. рЃЋрЃарЃфрЃћрЃџрЃўрЃљ рЃўрЃЏ рЃБрЃЏрЃљрЃдрЃџрЃћрЃАрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃўрЃА рЃАрЃўрЃљ, рЃАрЃљрЃЊрЃљрЃф рЃЕрЃЋрЃћрЃюрЃў рЃљрЃдрЃќрЃарЃЊрЃўрЃџрЃћрЃЉрЃў рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃАрЃўрЃбрЃДрЃЋрЃљрЃА рЃўрЃбрЃДрЃЋрЃўрЃљрЃю.\n18 рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃЏрЃљ 70% рЃЊрЃљ 50 % -рЃўрЃљрЃюрЃў рЃњрЃарЃљрЃюрЃбрЃў рЃЊрЃљрЃўрЃЏрЃАрЃљрЃ«рЃБрЃарЃљ!\n100%-рЃўрЃљрЃюрЃў рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃњрЃарЃљрЃюрЃбрЃўрЃА рЃЏрЃцрЃџрЃЮрЃЉрЃћрЃџрЃћрЃЉрЃў рЃњрЃљрЃ«рЃЊрЃюрЃћрЃю рЃЕрЃЋрЃћрЃюрЃў рЃЏрЃћрЃЊрЃљрЃџрЃЮрЃАрЃюрЃћрЃЉрЃў:\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃ»рЃљрЃДрЃћрЃџрЃў - рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџрЃў рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў!\nрЃљрЃюрЃљ рЃЕрЃљрЃюрЃЕрЃўрЃЉрЃљрЃФрЃћ -рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџрЃў рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў!\nрЃћрЃџрЃћрЃюрЃћ рЃњрЃБрЃЊрЃљрЃФрЃћ - рЃЎрЃљрЃЋрЃЎрЃљрЃАрЃўрЃўрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў!\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\nрЃЋрЃљрЃЏрЃљрЃДрЃЮрЃЉрЃЌ, рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃЮ, рЃЌрЃЦрЃЋрЃћрЃюрЃў рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃЌ!\nрЃЕрЃЋрЃћрЃю рЃњрЃЋрЃ»рЃћрЃарЃљ рЃЌрЃЦрЃЋрЃћрЃюрЃў рЃдрЃўрЃарЃАрЃћрЃБрЃџрЃў рЃЏрЃЮрЃЏрЃљрЃЋрЃџрЃўрЃА!\n",
