    briefText: "2021 рЃгрЃџрЃўрЃА 10 рЃАрЃћрЃЦрЃбрЃћрЃЏрЃЉрЃћрЃарЃА рЃљрЃГрЃљрЃарЃўрЃА рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА, рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃАрЃљ рЃЊрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЏрЃљ рЃЏрЃљрЃўрЃљ рЃ«рЃљрЃ»рЃўрЃерЃЋрЃўрЃџрЃЏрЃљ, рЃљрЃГрЃљрЃарЃўрЃА рЃБрЃЏрЃљрЃдрЃџрЃћрЃАрЃў рЃАрЃљрЃЉрЃГрЃЮрЃА рЃЌрЃљрЃЋрЃЏрЃ»рЃЊрЃЮрЃЏрЃљрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћрЃЏ рЃбрЃўрЃбрЃћ рЃљрЃарЃЮрЃерЃўрЃФрЃћрЃЏ рЃЊрЃљ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЎрЃЮрЃЏрЃўрЃбрЃћрЃбрЃўрЃА рЃЌрЃљрЃЋрЃЏрЃ»рЃЊрЃЮрЃЏрЃљрЃарЃћрЃЏ рЃЊрЃљрЃЋрЃўрЃЌ рЃЉрЃљрЃфрЃўрЃЎрЃљрЃФрЃћрЃЏ рЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃћрЃЉрЃерЃў рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃћрЃА.\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃюрЃљрЃЎрЃарЃћрЃЉрЃў рЃњрЃБрЃюрЃЊрЃў рЃЏрЃљрЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃўрЃА рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃўрЃА рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃ«рЃЊрЃљ!\nрЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЊрЃўрЃърЃџрЃЮрЃЏрЃћрЃЉрЃў рЃЊрЃљ рЃърЃџрЃљрЃюрЃерЃћрЃбрЃћрЃЉрЃў рЃњрЃљрЃЊрЃљрЃћрЃфрЃљрЃЌ!\nрЃЏрЃљрЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃўрЃА рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃљрЃерЃў рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃў рЃњрЃБрЃюрЃЊрЃўрЃА рЃерЃћрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃЮрЃЉрЃљрЃерЃў рЃўрЃДрЃЋрЃюрЃћрЃю:\nрЃюрЃўрЃЎрЃљ рЃЕрЃ«рЃљрЃўрЃФрЃћ\nрЃџрЃБрЃЎрЃљ рЃБрЃЕрЃљрЃюрЃћрЃўрЃерЃЋрЃўрЃџрЃў\nрЃЌрЃћрЃЎрЃџрЃљ рЃерЃћрЃарЃЋрЃљрЃерЃўрЃФрЃћ\nрЃюрЃљрЃЌрЃўрЃљ рЃЊрЃљрЃЋрЃўрЃЌрЃљрЃФрЃћ\nрЃўрЃЮрЃљрЃюрЃћ рЃфрЃћрЃфрЃ«рЃџрЃљрЃФрЃћрЃЋрЃБрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃА рЃљрЃЏ рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃљрЃА рЃЊрЃљ рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃерЃў рЃЊрЃўрЃЊ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ!",
