    briefText: "2021 рЃгрЃџрЃўрЃА 14 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃГрЃљрЃЊрЃарЃљрЃЎрЃЮ рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃў.\nрЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃљрЃАрЃљрЃЎрЃЮрЃЉрЃарЃЮрЃЋ рЃЎрЃљрЃбрЃћрЃњрЃЮрЃарЃўрЃљрЃерЃў рЃЮрЃфрЃЊрЃљрЃљрЃЌрЃљрЃЏрЃЊрЃћ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃерЃћрЃ«рЃЋрЃЊрЃљ рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА.\nрЃбрЃБрЃарЃюрЃўрЃарЃўрЃА рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃћрЃЉрЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА рЃЏрЃўрЃўрЃдрЃћрЃЉрЃћрЃю рЃарЃћрЃАрЃърЃБрЃЉрЃџрЃўрЃЎрЃБрЃа рЃАрЃљрЃГрЃљрЃЊрЃарЃљрЃЎрЃЮ рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃерЃў.",
