    title: "­ЪїЈ­ЪќЇ­Ъќ╝ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃърЃарЃЮрЃћрЃЦрЃбрЃерЃў \"рЃЊрЃљрЃ«рЃљрЃбрЃћ, рЃарЃљрЃЌрЃљ рЃерЃћрЃфрЃЋрЃљрЃџрЃЮ рЃарЃћрЃљрЃџрЃЮрЃЉрЃљ\"",
    briefText: "рЃЊрЃдрЃћ рЃЏрЃћрЃЮрЃарЃћ , рЃЏрЃбрЃўрЃарЃљрЃџрЃљрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃърЃљрЃарЃЎрЃў,\n16 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃў\n2021 рЃгрЃџрЃўрЃА 13 рЃАрЃћрЃЦрЃбрЃћрЃЏрЃЉрЃарЃўрЃЊрЃљрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА 12 рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ рЃЕрЃљрЃћрЃарЃЌрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃерЃў \"YE Draw To Change Reality - Chapter II TEEN VERSION\"- рЃЊрЃљрЃ«рЃљрЃбрЃћ рЃарЃљрЃЌрЃљ рЃерЃћрЃфрЃЋрЃљрЃџрЃЮ рЃарЃћрЃљрЃџрЃЮрЃЉрЃљ - рЃюрЃљрЃгрЃўрЃџрЃў II, рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃБрЃџрЃў рЃЋрЃћрЃарЃАрЃўрЃљ;\nрЃърЃарЃЮрЃћрЃЦрЃбрЃА рЃљрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃљ Association of Small Business and Civil Development ASBCD- \"рЃЏрЃфрЃўрЃарЃћ рЃЉрЃўрЃќрЃюрЃћрЃАрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃљрЃАрЃЮрЃфрЃўрЃљрЃфрЃўрЃљ\".\nрЃърЃарЃЮрЃћрЃЦрЃбрЃерЃў рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃћрЃю рЃћрЃЋрЃарЃЮрЃърЃўрЃА рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃЦрЃЋрЃћрЃДрЃюрЃўрЃА рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃў.\nрЃЏрЃћрЃЮрЃарЃћ рЃЊрЃдрЃћрЃА рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЊрЃљ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃћрЃЉрЃЏрЃљ рЃЊрЃљрЃџрЃљрЃерЃЦрЃарЃћрЃА рЃЏрЃбрЃўрЃарЃљрЃџрЃљрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃърЃљрЃарЃЎрЃў.",
