    imageGallery:[],
    image: name44,
    id: 44,
    title: "­ЪЈє­ЪЈЁРЎЪрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃГрЃљрЃЊрЃарЃљрЃЎрЃћрЃћрЃЉрЃўрЃА рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃљ - III рЃАрЃљрЃърЃарЃўрЃќрЃЮ рЃљрЃЊрЃњрЃўрЃџрЃў рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃГрЃљрЃЊрЃарЃљрЃЎрЃЮ рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃАрЃљ рЃЊрЃљ рЃњрЃБрЃюрЃЊрЃБрЃа рЃърЃўрЃарЃЋрЃћрЃџрЃЮрЃЉрЃљрЃќрЃћ ­ЪЉЈ",
    briefText: "2021 рЃгрЃџрЃўрЃА 24 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃАрЃљрЃАрЃърЃЮрЃарЃбрЃЮ рЃАрЃЎрЃЮрЃџрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃГрЃљрЃЊрЃарЃљрЃЎрЃЮ рЃЎрЃџрЃБрЃЉ \"рЃюрЃЮрЃюрЃљрЃА\" рЃЉрЃљрЃќрЃљрЃќрЃћ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃГрЃљрЃЊрЃарЃљрЃЎрЃЮ рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃўрЃА рЃЏрЃћрЃАрЃљрЃЏрЃћ рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃўрЃЌрЃў рЃћрЃбрЃљрЃърЃў рЃцрЃўрЃюрЃљрЃџрЃў-рЃњрЃБрЃюрЃЊрЃБрЃарЃў рЃърЃўрЃарЃЋрЃћрЃџрЃЮрЃЉрЃљ. рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА 13 рЃАрЃЎрЃЮрЃџрЃљ ( рЃАрЃБрЃџ 62 рЃЏрЃЮрЃЌрЃљрЃЏрЃљрЃерЃћ). рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃАрЃЎрЃЮрЃџрЃљ рЃгрЃљрЃарЃЏрЃЮрЃЊрЃњрЃћрЃюрЃўрЃџрЃў рЃўрЃДрЃЮ 5 рЃЏрЃЮрЃГрЃљрЃЊрЃарЃљрЃЎрЃўрЃЌ.\nрЃърЃўрЃарЃЋрЃћрЃџрЃЮрЃЉрЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃцрЃўрЃЊрЃћрЃА рЃгрЃћрЃАрЃћрЃЉрЃўрЃЌ, рЃњрЃБрЃюрЃЊрЃБрЃарЃў рЃерЃЋрЃћрЃўрЃфрЃљрЃарЃБрЃџрЃў рЃАрЃўрЃАрЃбрЃћрЃЏрЃўрЃЌ 7 рЃбрЃБрЃарЃљрЃЊ.\nрЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃюрЃћрЃю рЃЊрЃћрЃЏрЃћрЃбрЃарЃћ рЃњрЃЮрЃњрЃўрЃљрЃерЃЋрЃўрЃџрЃў, рЃњрЃўрЃЮрЃарЃњрЃў рЃњрЃЮрЃњрЃўрЃљрЃерЃЋрЃўрЃџрЃў, рЃњрЃўрЃЮрЃарЃњрЃў рЃЊрЃљрЃЋрЃџрЃљрЃерЃћрЃарЃўрЃФрЃћ, рЃюрЃБрЃфрЃљ рЃюрЃўрЃЎрЃЮрЃџрЃљрЃўрЃерЃЋрЃўрЃџрЃў, рЃАрЃљрЃюрЃЊрЃарЃЮ рЃњрЃЮрЃарЃЊрЃћрЃџрЃљрЃФрЃћ, рЃЊрЃљрЃЌрЃБрЃюрЃљ рЃбрЃБрЃАрЃЎрЃўрЃљ.\nрЃњрЃБрЃюрЃЊрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃЊрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў.\n25 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃГрЃљрЃЊрЃарЃљрЃЎрЃЮ рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃўрЃА рЃАрЃљрЃќрЃћрЃўрЃЏрЃЮ рЃЊрЃљрЃ«рЃБрЃарЃЋрЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ.\nрЃЊрЃљрЃ«рЃБрЃарЃЋрЃљрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю: рЃљрЃГрЃљрЃарЃўрЃА рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃАрЃљ рЃЊрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћ рЃЉрЃљрЃЊрЃарЃў рЃюрЃљрЃЎрЃљрЃерЃўрЃФрЃћ, рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћ рЃАрЃЎрЃЮрЃџрЃћрЃЉрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃ«рЃЋрЃљ рЃЮрЃцрЃўрЃфрЃўрЃљрЃџрЃБрЃарЃў рЃърЃўрЃарЃћрЃЉрЃў.\nрЃЋрЃБрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃЕрЃЋрЃћрЃюрЃА рЃЏрЃЮрЃГрЃљрЃЊрЃарЃљрЃЎрЃћрЃћрЃЉрЃА рЃљрЃЏ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃљрЃА!",
