    briefText: ",,рЃњрЃќрЃљрЃЊ рЃўрЃљ рЃЊрЃљ рЃЋрЃљрЃарЃЊрЃў рЃЊрЃљрЃљрЃ░рЃцрЃўрЃюрЃћрЃЌ, рЃљрЃюрЃЉрЃљрЃюрЃў рЃЏрЃЮрЃЉрЃарЃФрЃљрЃюрЃЊрЃћрЃЉрЃљрЃЮ''\nрЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃћрЃЉрЃў 1/3 , 1/4 рЃЎрЃџрЃљрЃАрЃў . рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЌрЃћрЃљ рЃЦрЃЮрЃарЃЕрЃўрЃџрЃљрЃЋрЃљ",
