    title: "­Ъї║­ЪјЊ­ЪњљрЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃАрЃљрЃќрЃћрЃўрЃЏрЃЮ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў 1/ 1 рЃЎрЃџрЃљрЃАрЃерЃў \"рЃљрЃў рЃўрЃљ, рЃЊрЃћрЃЊрЃљрЃћрЃюрЃўрЃА рЃњрЃљрЃАрЃљрЃдрЃћрЃЉрЃў\" - рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃЮрЃўрЃФрЃћ.",
    briefText: "рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃЦрЃљрЃарЃЌрЃБрЃџ рЃљрЃюрЃЉрЃљрЃюрЃќрЃћ, рЃўрЃљрЃЎрЃЮрЃЉ рЃњрЃЮрЃњрЃћрЃЉрЃљрЃерЃЋрЃўрЃџрЃќрЃћ.\nРџўрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃњрЃљрЃћрЃфрЃюрЃћрЃю \"рЃљ\" рЃЊрЃљ \"рЃў\" рЃљрЃАрЃЮ-рЃЉрЃњрЃћрЃарЃћрЃЉрЃА , рЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃА рЃЏрЃЮрЃФрЃарЃљрЃЋрЃў рЃљрЃюрЃЉрЃљрЃюрЃўрЃЌ рЃцрЃарЃљрЃќрЃўрЃА \"рЃљрЃў рЃўрЃљ\" -рЃА рЃерЃћрЃЊрЃњрЃћрЃюрЃљрЃќрЃћ. рЃърЃџрЃљрЃАрЃбрЃћрЃџрЃўрЃюрЃўрЃА рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃўрЃЌ рЃњрЃљрЃЏрЃЮрЃФрЃћрЃарЃгрЃћрЃА рЃљрЃАрЃЮ-рЃЉрЃњрЃћрЃарЃћрЃЉрЃў.\nрЃЏрЃћрЃАрЃљрЃЏрЃћ рЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃА рЃЏрЃўрЃБрЃџрЃЮрЃфрЃћрЃА рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃљ рЃЊрЃљ рЃњрЃљрЃЊрЃљрЃАрЃфрЃћрЃА рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃљрЃЏрЃќрЃљрЃЊрЃћрЃЉрЃБрЃџрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў.",
