    title: "­ЪЊџ­ЪјЊ­Ъї╣­ЪїИрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА 1/2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃљрЃЊ рЃЊрЃљрЃўрЃгрЃДрЃћрЃА рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃљ.",
    briefText: "рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃЏрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃЊрЃљрЃ«рЃљрЃбрЃћрЃА рЃЌрЃћрЃЏрЃљрЃбрЃБрЃарЃў рЃАрЃБрЃарЃљрЃЌрЃћрЃЉрЃў, рЃњрЃљрЃЏрЃЮрЃФрЃћрЃарЃгрЃћрЃА рЃЊрЃљ рЃњрЃљрЃЏрЃЮрЃГрЃарЃћрЃА рЃцрЃћрЃарЃљрЃЊ- рЃцрЃћрЃарЃљрЃЊрЃў рЃљрЃАрЃЮ-рЃЉрЃњрЃћрЃарЃћрЃЉрЃў.",
