    title: "­ЪЊџ­ЪЊќ рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃљ рЃгрЃўрЃњрЃюрЃўрЃА рЃАрЃљрЃЏрЃЎрЃљрЃБрЃџрЃўрЃљ",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃЮрЃЌрЃ«рЃћ рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃљрЃЦрЃбрЃўрЃБрЃарЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃћрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃерЃў\n\"рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃљ рЃгрЃўрЃњрЃюрЃўрЃА рЃАрЃљрЃЏрЃЎрЃљрЃБрЃџрЃўрЃљ\".\nрЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЏрЃЮрЃљрЃЏрЃќрЃљрЃЊрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃЏрЃљ рЃўрЃарЃўрЃюрЃљ рЃАрЃћрЃЋрЃЮрЃАрЃбрЃўрЃљрЃюрЃЮрЃЋрЃљрЃЏ.\nрЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃАрЃљрЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃЮ рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃўрЃА рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљ.\nрЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮ рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃбрЃЮрЃарЃћрЃЉрЃА\nрЃњрЃљрЃЊрЃљрЃћрЃфрЃљ рЃАрЃљрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃЮ рЃАрЃўрЃњрЃћрЃџрЃћрЃЉрЃў. рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃАрЃљрЃЕрЃБрЃЦрЃарЃљрЃЊ рЃЏрЃўрЃўрЃдрЃћрЃА рЃгрЃўрЃњрЃюрЃћрЃЉрЃўрЃф.",
