    title: "­ЪїЈ   рЃърЃЮрЃџрЃЮрЃюрЃћрЃџрЃў рЃАрЃбрЃБрЃЏрЃљрЃарЃў рЃАрЃЎрЃЮрЃџрЃљрЃерЃў",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«. рЃАрЃЎрЃЮрЃџрЃљрЃАрЃљ рЃЊрЃљ рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃБрЃџ рЃЎрЃЮрЃџрЃћрЃ» РђърЃњрЃЮрЃџрЃЊрЃћрЃю рЃАрЃўРђю-рЃА рЃерЃЮрЃарЃўрЃА рЃЉрЃЮрЃџрЃЮ рЃгрЃџрЃћрЃЉрЃерЃў рЃюрЃљрЃДрЃЮрЃцрЃўрЃћрЃарЃў рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃљ рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃАрЃцрЃћрЃарЃЮрЃА рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃљрЃАрЃърЃћрЃЦрЃбрЃА рЃЏрЃЮрЃўрЃфрЃљрЃЋрЃА.\nрЃЊрЃдрЃћрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃАрЃбрЃБрЃЏрЃарЃљрЃЊ рЃЏрЃЮрЃЉрЃарЃФрЃљрЃюрЃЊрЃюрЃћрЃю рЃърЃЮрЃџрЃЮрЃюрЃћрЃЌрЃўрЃА  рЃарЃћрЃАрЃърЃБрЃЉрЃџрЃўрЃЎрЃўрЃА рЃЎрЃљрЃЋрЃЎрЃљрЃАрЃўрЃўрЃА рЃцрЃЮрЃюрЃЊрЃўрЃА рЃърЃарЃћрЃќрЃўрЃЊрЃћрЃюрЃбрЃў, рЃЦрЃљрЃџрЃљрЃЦ рЃЋрЃарЃЮрЃфрЃџрЃљрЃЋрЃўрЃА рЃљрЃњрЃџрЃЮрЃЏрЃћрЃарЃљрЃфрЃўрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃАрЃљрЃљрЃњрЃћрЃюрЃбрЃЮрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃЎрЃљрЃарЃЮрЃџ рЃцрЃерЃўрЃЋрЃљрЃарЃљ рЃЊрЃљ рЃљрЃГрЃљрЃарЃўрЃА рЃљ.рЃа. рЃБрЃЏрЃљрЃдрЃџрЃћрЃАрЃў рЃАрЃљрЃЉрЃГрЃЮрЃА рЃЌрЃљрЃЋрЃЏрЃ»рЃЊрЃЮрЃЏрЃљрЃарЃўрЃА рЃЎрЃљрЃЉрЃўрЃюрЃћрЃбрЃўрЃА рЃБрЃцрЃарЃЮрЃАрЃў рЃљрЃАрЃџрЃљрЃю рЃџрЃЮрЃарЃЌрЃЦрЃўрЃцрЃљрЃюрЃўрЃФрЃћ.\nрЃърЃЮрЃџрЃЮрЃюрЃћрЃџ рЃАрЃбрЃБрЃЏрЃљрЃарЃА, рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«. рЃАрЃЎрЃЮрЃџрЃўрЃАрЃљ рЃЊрЃљ рЃЎрЃЮрЃџрЃћрЃ» РђърЃњрЃЮрЃџрЃЊрЃћрЃю рЃАрЃўРђю-рЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃљрЃА рЃерЃЮрЃарЃўрЃА рЃерЃћрЃЊрЃњрЃљ рЃАрЃљрЃЏрЃЏрЃ«рЃарЃўрЃЋрЃў рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ, рЃАрЃљрЃЊрЃљрЃф рЃАрЃљрЃБрЃЉрЃљрЃарЃў рЃћрЃ«рЃћрЃЉрЃЮрЃЊрЃљ рЃАрЃљрЃЏрЃЮрЃЏрЃљрЃЋрЃџрЃЮрЃЊ рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃАрЃљрЃ«рЃўрЃА рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ-рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃљрЃА .\nрЃљрЃЏ рЃћрЃбрЃљрЃърЃќрЃћ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃљрЃЊ рЃњрЃљрЃфрЃюрЃЮрЃЉрЃўрЃЌ рЃ«рЃљрЃАрЃўрЃљрЃЌрЃА рЃљрЃбрЃљрЃарЃћрЃЉрЃЊрЃљ.",
