    title: "РюЈрЃЊрЃћрЃЉрЃљрЃб-рЃЎрЃџрЃБрЃЉрЃў Рџќ",
    briefText: "2021 рЃгрЃџрЃўрЃА 11 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«. рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљ рЃЊрЃљрЃўрЃгрЃДрЃЮ рЃЊрЃћрЃЉрЃљрЃб рЃЎрЃџрЃБрЃЉрЃЏрЃљ (рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃќрЃЋрЃўрЃљрЃЊ рЃЕрЃ«рЃћрЃюрЃЎрЃћрЃџрЃў ).\nрЃЎрЃџрЃБрЃЉрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃќрЃћ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃњрЃљрЃћрЃфрЃюрЃћрЃю рЃЎрЃљрЃарЃџ рЃърЃЮрЃърЃћрЃарЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЊрЃћрЃЉрЃљрЃбрЃћрЃЉрЃўрЃА рЃгрЃћрЃАрЃћрЃЉрЃА.\nрЃњрЃљрЃюрЃўрЃАрЃљрЃќрЃдрЃЋрЃарЃљ рЃЊрЃћрЃЉрЃљрЃбрЃћрЃЉрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃбрЃБрЃарЃюрЃўрЃарЃўрЃА рЃЌрЃћрЃЏрЃљ \"рЃљрЃарЃљрЃАрЃарЃБрЃџрЃгрЃџрЃЮрЃЋрЃљрЃюрЃЌрЃљ рЃЏрЃўрЃћрЃа рЃЕрЃљрЃЊрЃћрЃюрЃўрЃџрЃў рЃЊрЃљрЃюрЃљрЃерЃљрЃБрЃџрЃў рЃБрЃюрЃЊрЃљ рЃўрЃАрЃ»рЃћрЃЉрЃЮрЃЊрЃћрЃА\".",
