    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VI-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃћрЃњрЃБрЃбрЃўрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃАрЃљрЃЮрЃфрЃљрЃарЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃцрЃўрЃюрЃћрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ: \"рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃБрЃарЃљ рЃЊрЃљ рЃЊрЃўрЃќрЃљрЃўрЃюрЃў\".\nрЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃўрЃА рЃЏрЃЮрЃгрЃДрЃЮрЃЉрЃљрЃЏрЃЊрЃћ рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃЏрЃљ рЃерЃћрЃўрЃАрЃгрЃљрЃЋрЃџрЃћрЃА рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃБрЃарЃўрЃА рЃЏрЃўрЃЏрЃљрЃарЃЌрЃБрЃџрЃћрЃЉрЃћрЃЉрЃў, рЃюрЃљрЃњрЃћрЃЉрЃЮрЃЉрЃљрЃЌрЃљ рЃАрЃљрЃ«рЃћрЃЮрЃЉрЃћрЃЉрЃў,\nрЃЊрЃўрЃќрЃљрЃўрЃюрЃў, рЃњрЃљрЃўрЃњрЃћрЃА, рЃарЃЮрЃњрЃЮрЃа рЃўрЃЦрЃЏрЃюрЃћрЃЉрЃљ рЃЏрЃљрЃЎрЃћрЃбрЃў, рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃфрЃюрЃЮрЃЉрЃўрЃџрЃў рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃЮрЃарЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЊрЃўрЃќрЃљрЃўрЃюрЃћрЃарЃћрЃЉрЃўрЃА рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљрЃќрЃћ. рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃўрЃџ рЃЏрЃљрЃАрЃљрЃџрЃћрЃЉрЃќрЃћ рЃЊрЃљрЃДрЃарЃЊрЃюрЃЮрЃЉрЃўрЃЌ рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃЏрЃљ рЃерЃћрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃЎрЃЮрЃЏрЃърЃџрЃћрЃЦрЃАрЃБрЃарЃў рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ\n,, рЃЏрЃћ - рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃЮрЃарЃў рЃЊрЃљ рЃЕрЃћрЃЏрЃў рЃЊрЃљрЃърЃарЃЮрЃћрЃЦрЃбрЃћрЃЉрЃБрЃџрЃў рЃБрЃЉрЃљрЃюрЃў\".",
