    id: 64,
    title: "­Ъќ╝­ЪјерЃюрЃЮрЃарЃЕрЃў рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃЮрЃарЃћрЃЉрЃўрЃА рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљ",
    briefText: "\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VI-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃћрЃњрЃБрЃбрЃўрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃАрЃљрЃЮрЃфрЃљрЃарЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃцрЃўрЃюрЃћрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ: \"рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃБрЃарЃљ рЃЊрЃљ рЃЊрЃўрЃќрЃљрЃўрЃюрЃў\".\nрЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃўрЃА рЃЏрЃЮрЃгрЃДрЃЮрЃЉрЃљрЃЏрЃЊрЃћ рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃўрЃџ рЃЏрЃљрЃАрЃљрЃџрЃћрЃЉрЃќрЃћ рЃЊрЃљрЃДрЃарЃЊрЃюрЃЮрЃЉрЃўрЃЌ рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃЏрЃљ рЃерЃћрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃЎрЃЮрЃЏрЃърЃџрЃћрЃЦрЃАрЃБрЃарЃў рЃЊрЃљрЃЋрЃљрЃџрЃћрЃЉрЃљ\n,, рЃЏрЃћ - рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃЮрЃарЃў рЃЊрЃљ рЃЕрЃћрЃЏрЃў рЃЊрЃљрЃърЃарЃЮрЃћрЃЦрЃбрЃћрЃЉрЃБрЃџрЃў рЃБрЃЉрЃљрЃюрЃў\".",
