    title: "­ЪЊќ­ЪЊџ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃАрЃбрЃБрЃЏрЃарЃљрЃЊ рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃерЃў",
    briefText: "2021 рЃгрЃџрЃўрЃА 17 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VI-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃљрЃЋрЃ«рЃћрЃџрЃўрЃФрЃћрЃЏ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЊрЃљ рЃЊрЃљрЃАрЃљрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃћрЃЉрЃћрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЕрЃљрЃБрЃбрЃљрЃарЃљ рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃерЃў.\nрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃерЃћрЃўрЃАрЃгрЃљрЃЋрЃџрЃћрЃА   рЃюрЃБрЃњрЃќрЃљрЃа рЃерЃљрЃбрЃљрЃўрЃФрЃўрЃА рЃЏрЃЮрЃЌрЃ«рЃарЃЮрЃЉрЃљ \"рЃЕрЃћрЃЏрЃў рЃАрЃЮрЃцрЃџрЃўрЃА рЃАрЃљрЃЏрЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃџрЃЮ\". рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃњрЃљрЃюрЃўрЃ«рЃўрЃџрЃћрЃА рЃЏрЃЮрЃЌрЃ«рЃарЃЮрЃЉрЃљрЃерЃў рЃЊрЃљрЃАрЃЏрЃБрЃџрЃў рЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃћрЃЉрЃў, рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃњрЃБрЃџрЃљрЃ«рЃЊрЃўрЃџрЃљрЃЊ, рЃерЃћрЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃЉрЃў рЃЊрЃљрЃБрЃАрЃЋрЃћрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃарЃћрЃЉрЃА, рЃћрЃарЃЌрЃљрЃЊ рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃџрЃћрЃЦрЃАрЃћрЃЉрЃў, рЃцрЃарЃљрЃњрЃЏрЃћрЃюрЃбрЃћрЃЉрЃў рЃЏрЃЮрЃЌрЃ«рЃарЃЮрЃЉрЃћрЃЉрЃўрЃЊрЃљрЃю, рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃфрЃљрЃџрЃЎрЃћрЃБрЃџрЃў рЃЏрЃЮрЃюрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃА рЃўрЃюрЃАрЃфрЃћрЃюрЃўрЃарЃћрЃЉрЃљ, рЃўрЃЏрЃдрЃћрЃарЃћрЃА.рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃў рЃ«рЃћрЃџрЃфрЃљрЃарЃўрЃћрЃџрЃў рЃљрЃа рЃгрЃљрЃАрЃБрЃџрЃљрЃю рЃАрЃбрЃБрЃЏрЃарЃљрЃЊ; рЃЏрЃљрЃЌ рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃА рЃАрЃљрЃЕрЃБрЃЦрЃарЃљрЃЊ рЃЕрЃўрЃЕрЃўрЃџрЃљрЃЎрЃў, рЃгрЃўрЃњрЃюрЃћрЃЉрЃў, рЃАрЃљрЃюрЃЌрЃџрЃћрЃЉрЃў, рЃ«рЃЮрЃџрЃЮ рЃБрЃЎрЃћрЃЌрЃўрЃџрЃерЃЮрЃЉрЃўрЃџ рЃЏрЃљрЃАрЃърЃўрЃюрЃФрЃџрЃћрЃЉрЃА рЃбрЃЎрЃЉрЃўрЃџрЃћрЃБрЃџрЃў рЃЏрЃўрЃљрЃарЃЌрЃЋрЃћрЃА.   рЃерЃћрЃЏрЃЊрЃћрЃњ рЃЕрЃўрЃЕрЃўрЃџрЃљрЃЎрЃў рЃЌрЃљрЃЋрЃљрЃЊ рЃЏрЃЮрЃарЃЌрЃћрЃА рЃЏрЃљрЃЌрЃўрЃЋрЃћ рЃЊрЃљрЃЏрЃќрЃљрЃЊрЃћрЃЉрЃБрЃџрЃў рЃАрЃљрЃЌрЃљрЃЏрЃљрЃерЃЮрЃћрЃЉрЃўрЃЌ. рЃљрЃарЃф рЃўрЃЏрЃўрЃА рЃљрЃдрЃюрЃўрЃерЃЋрЃюрЃљ рЃЊрЃљрЃљрЃЋрЃўрЃгрЃДрЃЊрЃљрЃЌ рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃА,рЃарЃЮрЃЏ 17 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃў рЃЉрЃљрЃарЃЉрЃљрЃарЃЮрЃЉрЃљрЃљ.\nрЃБрЃдрЃарЃЏрЃћрЃА рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃЋрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃЦрЃљрЃџрЃЉрЃљрЃбрЃЮрЃю рЃюрЃљрЃюрЃљ рЃЎрЃЋрЃљрЃГрЃљрЃФрЃћрЃА -рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃўрЃА рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃњрЃБрЃџрЃўрЃАрЃ«рЃЏрЃўрЃћрЃа рЃЊрЃљ рЃДрЃБрЃарЃљрЃЊрЃдрЃћрЃЉрЃўрЃљрЃю рЃЏрЃљрЃАрЃърЃўрЃюрЃФрЃћрЃџрЃА!\n",
