    title: "­ЪЉГ­ЪЉг рЃЕрЃЋрЃћрЃю рЃЌрЃЦрЃЋрЃћрЃю рЃњрЃЋрЃћрЃарЃЊрЃўрЃЌ рЃЋрЃљрЃарЃЌ!",
    briefText: "рЃЮрЃЏрЃў рЃБрЃЉрЃћрЃЊрЃБрЃарЃћрЃЉрЃљрЃљ!\nрЃЮрЃЏрЃў рЃДрЃЋрЃћрЃџрЃљрЃцрЃћрЃарЃА рЃљрЃюрЃљрЃЊрЃњрЃБрЃарЃћрЃЉрЃА, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃЮрЃЏрЃўрЃЌ рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃЊрЃўрЃЊ рЃбрЃарЃљрЃЏрЃЋрЃљрЃА рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃў рЃњрЃљрЃюрЃўрЃфрЃЊрЃўрЃљрЃю!\n\nрЃЮрЃЏрЃўрЃА рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃў рЃЎрЃљрЃарЃњрЃљрЃЋрЃћрЃю рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃА, рЃљрЃ«рЃџрЃЮрЃЉрЃџрЃћрЃЉрЃА, рЃАрЃљрЃ«рЃџрЃА, рЃЏрЃћрЃњрЃЮрЃЉрЃарЃћрЃЉрЃА, рЃЏрЃерЃЋрЃўрЃЊ рЃФрЃўрЃџрЃА, рЃАрЃўрЃџрЃљрЃдрЃћрЃА.....\nрЃЮрЃЏрЃўрЃА рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃў рЃЎрЃљрЃарЃњрЃљрЃЋрЃћрЃю рЃАрЃљрЃДрЃЋрЃљрЃарЃћрЃџ рЃАрЃљрЃЌрЃљрЃЏрЃљрЃерЃЮрЃћрЃЉрЃА....\nрЃЕрЃЋрЃћрЃю рЃЌрЃЦрЃЋрЃћрЃю рЃњрЃЋрЃћрЃарЃЊрЃўрЃЌ рЃЋрЃљрЃарЃЌ!   рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ рЃЋрЃўрЃгрЃДрЃћрЃЉрЃЌ рЃАрЃљрЃЦрЃЋрЃћрЃџрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃЮ рЃљрЃЦрЃфрЃўрЃљрЃА!\nрЃЋрЃљрЃњрЃарЃЮрЃЋрЃћрЃЉрЃЌ рЃАрЃљрЃЌрЃљрЃЏрЃљрЃерЃЮрЃћрЃЉрЃА рЃЮрЃЏрЃўрЃА рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА!\nрЃЏрЃЮрЃњрЃўрЃгрЃЮрЃЊрЃћрЃЉрЃЌ рЃДрЃЋрЃћрЃџрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃА, рЃЏрЃерЃЮрЃЉрЃћрЃџрЃА, рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃА, рЃДрЃЋрЃћрЃџрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃћрЃџрЃА рЃЊрЃљ (рЃљрЃарЃљ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ), рЃарЃЮрЃЏ рЃЕрЃЋрЃћрЃюрЃљрЃЏрЃЊрЃћ рЃЏрЃЮрЃўрЃбрЃљрЃюрЃЮрЃЌ рЃАрЃљрЃЌрЃљрЃЏрЃљрЃерЃЮ рЃБрЃЎрЃарЃљрЃўрЃюрЃљрЃерЃў рЃЮрЃЏрЃўрЃА рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃњрЃљрЃАрЃљрЃњрЃќрЃљрЃЋрЃюрЃљрЃЊ!\nрЃАрЃЎрЃЮрЃџрЃљрЃерЃў (рЃЏрЃўрЃАрЃљрЃЏрЃљрЃарЃЌрЃў: рЃЉрЃљрЃЌрЃБрЃЏрЃў, рЃЊрЃћрЃЏрЃћрЃбрЃарЃћ рЃЌрЃљрЃЋрЃЊрЃљрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЦрЃБрЃЕрЃљ N 49) рЃћрЃарЃЌрЃў рЃЎрЃЋрЃўрЃарЃўрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў рЃерЃћрЃЋрЃљрЃњрЃарЃЮрЃЋрЃћрЃЉрЃЌ рЃАрЃљрЃЕрЃБрЃЦрЃарЃћрЃЉрЃА, рЃарЃЮрЃЏрЃџрЃўрЃА рЃњрЃљрЃњрЃќрЃљрЃЋрЃюрЃљрЃА рЃБрЃќрЃарЃБрЃюрЃЋрЃћрЃџрЃДрЃЮрЃцрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃљрЃЊрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃљрЃфрЃўрЃљ.",
