    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃАрЃЮрЃцрЃЮ рЃАрЃљрЃюрЃўрЃЎрЃўрЃФрЃћрЃЏ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЊрЃљ рЃЊрЃљрЃАрЃљрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃћрЃЉрЃћрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЕрЃљрЃБрЃбрЃљрЃарЃљ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃерЃў.\nрЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃЊрЃљрЃљрЃЌрЃЋрЃљрЃџрЃўрЃћрЃарЃћрЃА рЃгрЃљрЃарЃЏрЃЮрЃЊрЃњрЃћрЃюрЃўрЃџрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў, рЃњрЃљрЃЊрЃљрЃўрЃдрЃћрЃА рЃцрЃЮрЃбрЃЮрЃћрЃЉрЃў, рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃЏрЃ«рЃљрЃбрЃЋрЃарЃЮрЃЉрЃљрЃќрЃћ, рЃЏрЃ«рЃљрЃбрЃЋрЃарЃћрЃЉрЃќрЃћ, рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю рЃЊрЃљ рЃњрЃљрЃўрЃфрЃюрЃћрЃА рЃфрЃюрЃЮрЃЉрЃўрЃџрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃћрЃџрЃў рЃЏрЃ«рЃљрЃбрЃЋрЃљрЃарЃў рЃЉрЃљрЃбрЃЮрЃюрЃў рЃЋрЃљрЃ«рЃбрЃљрЃюрЃњ (рЃЉрЃћрЃАрЃЮ) рЃЉрЃћрЃАрЃћрЃџрЃўрЃљ.\nрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃЊрЃўрЃЊрЃў рЃерЃЌрЃљрЃЉрЃћрЃГрЃЊрЃўрЃџрЃћрЃЉрЃўрЃЌ рЃЊрЃљрЃбрЃЮрЃЋрЃћрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃў.",
