    briefText: "2022 рЃгрЃџрЃўрЃА 2 рЃЏрЃљрЃарЃбрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃерЃћрЃЊрЃњрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃерЃћрЃЏрЃАрЃгрЃљрЃЋрЃџрЃћрЃџрЃЌрЃљ рЃЎрЃџрЃБрЃЉрЃўрЃА рЃЏрЃЮрЃарЃўрЃњрЃў рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃњрЃљрЃцрЃљрЃарЃЌрЃЮрЃћрЃЉрЃБрЃџрЃў рЃцрЃЮрЃарЃЏрЃљрЃбрЃўрЃЌ.\nрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ, рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃЏрЃљ рЃЊрЃљ рЃАрЃбрЃБрЃЏрЃарЃћрЃЉрЃЏрЃљ рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА\nрЃЌрЃћрЃЏрЃљрЃќрЃћ \"рЃЮрЃЏрЃў рЃЊрЃљ рЃЎрЃБрЃџрЃбрЃБрЃарЃљ\".\nрЃЎрЃџрЃБрЃЉрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ",
