    briefText:
      "2022 рЃгрЃџрЃўрЃА 15 рЃљрЃърЃарЃўрЃџрЃА рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃБрЃљрЃџрЃБрЃарЃў рЃЎрЃџрЃБрЃЉрЃўрЃА рЃЋрЃўрЃЦрЃбрЃЮрЃарЃўрЃюрЃўрЃА рЃарЃўрЃњрЃўрЃЌ рЃЏрЃћ-8 рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ. рЃЎрЃџрЃБрЃЉрЃўрЃА рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃћрЃЉрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА рЃўрЃдрЃћрЃЉрЃћрЃю VIII-IX рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў.",
