    briefText:
      "рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃўрЃА рЃЊрЃљрЃгрЃДрЃћрЃЉрЃљрЃЏрЃЊрЃћ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЊрЃљрЃЏрЃАрЃгрЃарЃћ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃљрЃА рЃгрЃљрЃарЃБрЃЊрЃњрЃўрЃюрЃћрЃА рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃБрЃарЃў рЃцрЃўрЃџрЃЏрЃў рЃЦрЃљрЃџрЃЉрЃљрЃбрЃЮрЃю рЃЏрЃљрЃарЃўрЃЎрЃљ рЃџрЃЮрЃарЃЌрЃЦрЃўрЃцрЃљрЃюрЃўрЃФрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃерЃў рЃАрЃбрЃБрЃЏрЃарЃљрЃЊ рЃЉрЃарЃФрЃљрЃюрЃЊрЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЊрЃљ рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃЎрЃЮрЃАрЃў рЃЏрЃљрЃарЃўрЃљрЃЏ рЃџрЃЮрЃарЃЌрЃЦрЃўрЃцрЃљрЃюрЃўрЃФрЃћ рЃЏрЃЮрЃўрЃњрЃЮрЃюрЃћрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃЎрЃЮрЃАрЃћрЃЉрЃЏрЃљ, рЃърЃарЃЮрЃцрЃћрЃАрЃЮрЃарЃћрЃЉрЃЏрЃљ рЃюрЃљрЃюрЃљ рЃ«рЃљрЃ«рЃБрЃбрЃљрЃўрЃерЃЋрЃўрЃџрЃЏрЃљ рЃЊрЃљ рЃюрЃљрЃЊрЃўрЃЏ рЃЋрЃљрЃарЃерЃљрЃюрЃўрЃФрЃћрЃЏ.",
