      '­Ъїљ­ЪїЈ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃБрЃџрЃў рЃцрЃЮрЃарЃБрЃЏрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃАрЃљрЃАрЃбрЃБрЃЏрЃарЃЮ "рЃ░рЃўрЃџрЃбрЃЮрЃюрЃерЃў" рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЏрЃЮрЃарЃўрЃњрЃў рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљ рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА ,,рЃЌрЃћрЃЏрЃўрЃА рЃЏрЃЮрЃЉрЃўрЃџрЃўрЃќрЃљрЃфрЃўрЃљ рЃЊрЃљ рЃЌрЃљрЃюрЃљрЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ" рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў, рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф world vision рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮ рЃљрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃњрЃљрЃћрЃарЃЮрЃА рЃџрЃбрЃЮрЃџрЃЋрЃўрЃџрЃЌрЃљ рЃБрЃЏрЃљрЃдрЃџрЃћрЃАрЃў рЃЎрЃЮрЃЏрЃўрЃАрЃарЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃЮрЃЉрЃўрЃА UNHCR рЃцрЃўрЃюрЃљрЃюрЃАрЃБрЃарЃў рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃўрЃЌ.',
    briefText:
      "рЃљрЃЏ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃцрЃЮрЃарЃБрЃЏрЃерЃў рЃЊрЃћрЃџрЃћрЃњрЃљрЃбрЃўрЃА рЃАрЃбрЃљрЃбрЃБрЃАрЃўрЃЌ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЉрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў:\nрЃЏрЃўрЃљ рЃЏрЃўрЃюрЃљрЃерЃЋрЃўрЃџрЃў,\nрЃљрЃюрЃљ рЃФрЃюрЃћрЃџрЃљрЃФрЃћ,\nрЃЌрЃљрЃЏрЃљрЃа рЃЕрЃљрЃюрЃЕрЃўрЃЉрЃљрЃФрЃћ,\nрЃЮрЃЌрЃЮ рЃЎрЃљрЃ«рЃўрЃФрЃћ,\nрЃЌрЃЮрЃарЃюрЃўрЃЎрЃћ рЃерЃљрЃџрЃЋрЃљрЃерЃЋрЃўрЃџрЃў,\nрЃћрЃџрЃўрЃАрЃљрЃЉрЃћрЃЊ рЃарЃЮрЃЏрЃљрЃюрЃљрЃФрЃћ .\nрЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃЮ!",
