    title: "рЃЏрЃћрЃЊрЃўрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃцрЃЮрЃюрЃЊрЃў, MDF",
    briefText:
      'рЃЊрЃдрЃћрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃћрЃЊрЃўрЃљрЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃќрЃћ рЃњрЃљрЃћрЃарЃЮрЃА рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃцрЃЮрЃюрЃЊрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃћрЃџрЃў, рЃдрЃљрЃАрЃљрЃю рЃ«рЃљрЃџрЃўрЃџрЃў рЃњрЃЋрЃћрЃгрЃЋрЃўрЃљ рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЏрЃћрЃЊрЃўрЃљрЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃърЃљрЃюрЃЊрЃћрЃЏрЃўрЃўрЃА рЃЊрЃарЃЮрЃА рЃњрЃљрЃЋрЃарЃфрЃћрЃџрЃћрЃЉрЃБрЃџрЃў рЃДрЃљрЃџрЃЉрЃў рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃЏрЃљрЃЋрЃюрЃћ рЃњрЃљрЃЋрЃџрЃћрЃюрЃљрЃќрЃћ рЃћрЃАрЃљрЃБрЃЉрЃарЃљ.\nрЃбрЃарЃћрЃюрЃўрЃюрЃњрЃћрЃЉрЃўрЃА рЃАрЃћрЃарЃўрЃўрЃА "рЃюрЃБ рЃЊрЃљрЃўрЃюрЃцрЃўрЃфрЃўрЃарЃЊрЃћрЃЉрЃў рЃЊрЃћрЃќрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃЌ" рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃњрЃљрЃЊрЃљрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃўрЃА рЃўрЃюрЃАрЃбрЃарЃБрЃЏрЃћрЃюрЃбрЃћрЃЉрЃў рЃЊрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃДрЃљрЃарЃЮрЃА рЃЏрЃЮрЃФрЃўрЃћрЃЉрЃўрЃА рЃ«рЃћрЃарЃ«рЃћрЃЉрЃў рЃўрЃАрЃгрЃљрЃЋрЃџрЃћрЃА рЃЊрЃљ рЃЏрЃўрЃдрЃћрЃЉрЃБрЃџрЃў рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃЎрЃарЃўрЃбрЃўрЃЎрЃБрЃџрЃљрЃЊ рЃњрЃљрЃљрЃюрЃљрЃџрЃўрЃќрЃћрЃЉрЃљрЃќрЃћ рЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃА.\nрЃбрЃарЃћрЃюрЃўрЃюрЃњрЃћрЃЉрЃўрЃА рЃАрЃћрЃарЃўрЃљ рЃЊрЃљ рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮрЃљ рЃЎрЃљрЃЏрЃърЃљрЃюрЃўрЃљ UNICEF Georgia-рЃАрЃЌрЃљрЃю рЃърЃљрЃарЃбрЃюрЃўрЃЮрЃарЃЮрЃЉрЃўрЃЌрЃљ рЃЊрЃљ USAID/Georgia-рЃўрЃА рЃцрЃўрЃюрЃљрЃюрЃАрЃБрЃарЃў рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃўрЃЌ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА.',
