    id: 97,
    title:
      "­ЪЊџ 2022 рЃгрЃџрЃўрЃА 3 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЏрЃћрЃЊрЃўрЃљрЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў. рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃљ рЃњрЃљрЃћрЃарЃЮрЃА рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃцрЃЮрЃюрЃЊрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃћрЃџрЃў, рЃдрЃљрЃАрЃљрЃю рЃ«рЃљрЃџрЃўрЃџрЃў. рЃЏрЃљрЃю рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЏрЃћрЃЊрЃўрЃљрЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃърЃљрЃюрЃЊрЃћрЃЏрЃўрЃўрЃА рЃЊрЃарЃЮрЃА рЃњрЃљрЃЋрЃарЃфрЃћрЃџрЃћрЃЉрЃБрЃџрЃў рЃДрЃљрЃџрЃЉрЃў рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃЏрЃљрЃЋрЃюрЃћ рЃњрЃљрЃЋрЃџрЃћрЃюрЃљрЃќрЃћ рЃћрЃАрЃљрЃБрЃЉрЃарЃљ.",
    briefText:
      'рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃћрЃЉрЃўрЃА рЃАрЃћрЃарЃўрЃўрЃА "рЃюрЃБ рЃЊрЃљрЃўрЃюрЃцрЃўрЃфрЃўрЃарЃЊрЃћрЃЉрЃў рЃЊрЃћрЃќрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃЌ" рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃњрЃљрЃЊрЃљрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃўрЃА рЃўрЃюрЃАрЃбрЃарЃБрЃЏрЃћрЃюрЃбрЃћрЃЉрЃў рЃЊрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃДрЃљрЃарЃЮрЃА рЃЏрЃЮрЃФрЃўрЃћрЃЉрЃўрЃА рЃ«рЃћрЃарЃ«рЃћрЃЉрЃў рЃўрЃАрЃгрЃљрЃЋрЃџрЃћрЃА рЃЊрЃљ рЃЏрЃўрЃдрЃћрЃЉрЃБрЃџрЃў рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃЎрЃарЃўрЃбрЃўрЃЎрЃБрЃџрЃљрЃЊ рЃњрЃљрЃљрЃюрЃљрЃџрЃўрЃќрЃћрЃЉрЃљрЃќрЃћ рЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃА.\nрЃбрЃарЃћрЃюрЃўрЃюрЃњрЃћрЃЉрЃўрЃА рЃАрЃћрЃарЃўрЃљ рЃЊрЃљ рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮрЃљ рЃЎрЃљрЃЏрЃърЃљрЃюрЃўрЃљ UNICEF Georgia-рЃАрЃЌрЃљрЃю рЃърЃљрЃарЃбрЃюрЃўрЃЮрЃарЃЮрЃЉрЃўрЃЌрЃљ рЃЊрЃљ USAID/Georgia-рЃўрЃА рЃцрЃўрЃюрЃљрЃюрЃАрЃБрЃарЃў рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃўрЃЌ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА.',
