    id: 99,
    title:
      '­ЪЈЄ­ЪЈЄ­ЪДб 2022 рЃгрЃџрЃўрЃА 3 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА V-1 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљ рЃЏрЃљрЃЌрЃў рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџрЃў рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃЏрЃћрЃџрЃўрЃЦрЃљрЃФрЃћ рЃљ(рЃљ)рЃўрЃъ "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃАрЃљрЃфрЃ«рЃћрЃюрЃЮрЃАрЃюрЃЮ рЃЎрЃџрЃБрЃЉрЃА" рЃћрЃгрЃЋрЃўрЃЋрЃюрЃћрЃю. ­Ъљј­Ъљј­Ъљј­Ъљј',
    briefText:
      'рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЏрЃљрЃАрЃбрЃћрЃарЃЎрЃџрЃљрЃАрЃў рЃЕрЃљрЃБрЃбрЃљрЃарЃљ рЃбрЃарЃћрЃюрЃћрЃарЃЏрЃљ рЃњрЃўрЃЮрЃарЃњрЃў рЃФрЃўрЃюрЃФрЃўрЃЉрЃљрЃФрЃћрЃЏ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃарЃљрЃЋрЃљрЃџрЃњрЃќрЃўрЃА рЃЕрЃћрЃЏрЃърЃўрЃЮрЃюрЃў, рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃа-рЃљрЃЏрЃћрЃарЃўрЃЎрЃБрЃџрЃў рЃ»рЃўрЃерЃўрЃА рЃцрЃљрЃерЃљрЃбрЃўрЃЌ, рЃАрЃљрЃ«рЃћрЃџрЃљрЃЊ - "рЃљрЃЋрЃљрЃюрЃбрЃљрЃЪрЃў". рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃЏрЃљ рЃњрЃљрЃўрЃфрЃюрЃћрЃА , рЃљрЃАрЃћрЃЋрЃћ, "рЃЦрЃАрЃљрЃюрЃў" (рЃљрЃ«рЃљрЃџрЃЌрЃћрЃЦрЃБрЃарЃў, рЃўрЃерЃЋрЃўрЃљрЃЌрЃў рЃ»рЃўрЃерЃўрЃА рЃБрЃџрЃљрЃДрЃў) рЃЊрЃљ "рЃњрЃљрЃџрЃљрЃЌрЃћрЃљ" (рЃњрЃћрЃарЃЏрЃљрЃюрЃБрЃџрЃў рЃ»рЃўрЃерЃўрЃА рЃБрЃџрЃљрЃДрЃў);\nрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃЮрЃљрЃЏрЃќрЃљрЃЊрЃћрЃА рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃљ рЃЌрЃћрЃЏрЃљрЃќрЃћ: рЃўрЃАрЃбрЃЮрЃарЃўрЃљрЃерЃў рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃфрЃюрЃЮрЃЉрЃўрЃџрЃў рЃфрЃ«рЃћрЃюрЃћрЃЉрЃўрЃА рЃЊрЃљ рЃЏрЃ«рЃћрЃЊрЃарЃћрЃЉрЃўрЃАрЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃљрЃдрЃюрЃўрЃерЃюрЃБрЃџрЃўрЃА рЃгрЃљрЃарЃЊрЃњрЃћрЃюрЃљ рЃЏрЃћрЃбрЃљрЃЊ рЃБрЃЕрЃЋрЃћрЃБрЃџрЃЮ рЃњрЃљрЃарЃћрЃЏрЃЮрЃерЃў - рЃЌрЃљрЃЋрЃџрЃљрЃерЃў рЃЏрЃЮрЃ«рЃЊрЃљ, рЃарЃљрЃЏрЃљрЃф рЃФрЃљрЃџрЃўрЃљрЃю рЃЊрЃўрЃЊрЃў рЃ«рЃўрЃЉрЃџрЃў рЃерЃћрЃЏрЃљрЃбрЃљ рЃљрЃдрЃюрЃўрЃерЃюрЃБрЃџ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃљрЃА.\nрЃарЃљ рЃЌрЃЦрЃЏрЃљ рЃБрЃюрЃЊрЃљ, рЃцрЃЮрЃбрЃЮрЃћрЃЉрЃў рЃЋрЃћрЃа рЃљрЃдрЃгрЃћрЃарЃА рЃАрЃарЃБрЃџрЃљрЃЊ рЃћрЃЏрЃЮрЃфрЃўрЃћрЃЉрЃА рЃЊрЃљ рЃАрЃљрЃ»рЃўрЃюрЃўрЃЉрЃЮрЃерЃў рЃљрЃарЃАрЃћрЃЉрЃБрЃџ рЃАрЃўрЃфрЃЮрЃфрЃ«рЃџрЃўрЃЌ рЃАрЃљрЃЋрЃАрЃћ рЃњрЃљрЃарЃћрЃЏрЃЮрЃА.',
