    briefText:
      "2022 рЃгрЃџрЃўрЃА 12 рЃўрЃЋрЃџрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃдрЃЋрЃЌрЃўрЃАрЃЏрЃерЃЮрЃЉрЃџрЃўрЃА рЃерЃЮрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃЎрЃљрЃЌрЃћрЃЊрЃарЃЮ рЃбрЃљрЃФрЃљрЃарЃерЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃљрЃќрЃћрЃЌрЃўрЃА рЃЏрЃўрЃбрЃарЃЮрЃърЃЮрЃџрЃўрЃбрЃЏрЃљ рЃЊрЃўрЃЏрЃўрЃбрЃарЃўрЃЏ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА 2021-2022 рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃА рЃгрЃљрЃарЃЕрЃўрЃюрЃћрЃЉрЃБрЃџрЃў рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃў рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃБрЃџрЃљрЃЊ рЃЊрЃљрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃљ рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃЊрЃџрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ рЃћрЃарЃЌрЃ»рЃћрЃарЃљрЃЊрЃў рЃАрЃбрЃўрЃърЃћрЃюрЃЊрЃўрЃћрЃЉрЃўрЃЌ!\nрЃгрЃџрЃћрЃЋрЃљрЃюрЃЊрЃћрЃџрЃў рЃЏрЃћрЃЊрЃљрЃџрЃЮрЃАрЃюрЃћрЃЉрЃў рЃљрЃарЃўрЃљрЃю:\nрЃћрЃџрЃћрЃюрЃћ рЃЊрЃЮрЃџрЃўрЃФрЃћ\nрЃюрЃБрЃЎрЃљ рЃюрЃљрЃЎрЃљрЃерЃўрЃФрЃћ\nрЃџрЃўрЃџрЃћ рЃбрЃЮрЃарЃЮрЃюрЃ»рЃљрЃФрЃћ\nрЃЏрЃљрЃарЃў рЃўрЃљрЃерЃЋрЃўрЃџрЃў\nрЃАрЃљрЃџрЃЮрЃЏрЃћ рЃЕрЃЮрЃњрЃЮрЃЋрЃљрЃФрЃћ\nрЃЏрЃљрЃарЃў рЃЎрЃћрЃерЃћрЃџрЃљрЃЋрЃљ\nрЃюрЃўрЃюрЃў рЃЕрЃ«рЃћрЃўрЃФрЃћ\nрЃюрЃўрЃюрЃў рЃљрЃарЃФрЃћрЃюрЃљрЃФрЃћ\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\n\nрЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА! ",
