    briefText:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃА рЃџрЃћрЃЋрЃљрЃю рЃАрЃљрЃЏрЃАрЃЮрЃюрЃўрЃљрЃА рЃЋрЃБрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃўрЃА рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃ«рЃљрЃарЃўрЃАрЃ«рЃўрЃА рЃЏрЃўрЃюрЃўрЃГрЃћрЃЉрЃљрЃА! рЃАрЃљрЃЊрЃўрЃАрЃћрЃарЃбрЃљрЃфрЃўрЃЮ рЃЌрЃћрЃЏрЃљ: \"рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃарЃўрЃЋ-рЃърЃЮрЃџрЃўрЃбрЃўрЃЎрЃБрЃарЃў рЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ рЃљрЃГрЃљрЃарЃљрЃерЃў XX рЃАрЃљрЃБрЃЎрЃБрЃюрЃўрЃА 30-рЃўрЃљрЃю рЃгрЃџрЃћрЃЉрЃерЃў\".\n рЃЊрЃўрЃАрЃћрЃарЃбрЃљрЃфрЃўрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃЌрЃљрЃарЃўрЃдрЃў: 15 рЃўрЃЋрЃџрЃўрЃАрЃў 2022 рЃгрЃћрЃџрЃў   ",
