    title:  "­Ъїј рЃЏрЃћрЃЊрЃўрЃљрЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў",
    briefText:" 2022 рЃгрЃџрЃўрЃА 6 рЃљрЃњрЃЋрЃўрЃАрЃбрЃЮрЃА рЃЏрЃћрЃЊрЃўрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃцрЃЮрЃюрЃЊрЃЏрЃљ MDF рЃюрЃљрЃбрЃЮрЃА рЃАрЃљрЃ«рЃљрЃџрЃ«рЃЮ рЃЊрЃўрЃърЃџрЃЮрЃЏрЃљрЃбрЃўрЃўрЃА рЃЮрЃцрЃўрЃАрЃўрЃА рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃўрЃЌрЃљ рЃЊрЃљ The Critical Mass LLC-рЃЌрЃљрЃю рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃўрЃЌ рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЏрЃћрЃЊрЃўрЃљ рЃЊрЃљ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃБрЃџрЃў рЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў рЃЕрЃљрЃљрЃбрЃљрЃарЃљ. рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃюрЃљрЃбрЃЮрЃА рЃАрЃљрЃЏрЃћрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЮ рЃЮрЃцрЃўрЃАрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЏрЃљ, рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃЋрЃўрЃюрЃўрЃЎрЃЮрЃЋрЃЏрЃљ рЃњрЃљрЃ«рЃАрЃюрЃљ.\n  рЃўрЃюрЃбрЃћрЃюрЃАрЃўрЃБрЃарЃў рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃўрЃА рЃЏрЃЮрЃЊрЃБрЃџрЃў рЃАрЃЎрЃЮрЃџрЃћрЃЉрЃерЃў рЃЏрЃћрЃЊрЃўрЃљ рЃЊрЃљ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃБрЃџрЃў рЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃўрЃАрЃћрЃЌрЃў рЃЎрЃЮрЃЏрЃърЃћрЃбрЃћрЃюрЃфрЃўрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃА рЃўрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉрЃА, рЃарЃЮрЃњрЃЮрЃарЃўрЃфрЃљрЃљ рЃЏрЃћрЃЊрЃўрЃљрЃерЃўрЃюрЃљрЃљрЃарЃАрЃўрЃА рЃЎрЃарЃўрЃбрЃўрЃЎрЃБрЃџрЃў рЃљрЃюрЃљрЃџрЃўрЃќрЃў, рЃДрЃљрЃџрЃЉрЃў рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА, рЃЋрЃўрЃќрЃБрЃљрЃџрЃўрЃАрЃљ рЃЊрЃљ рЃљрЃюрЃњрЃљрЃарЃўрЃерЃћрЃЉрЃўрЃА рЃўрЃЊрЃћрЃюрЃбрЃўрЃцрЃўрЃфрЃўрЃарЃћрЃЉрЃљ, рЃдрЃўрЃљ рЃгрЃДрЃљрЃарЃЮрЃћрЃЉрЃўрЃА рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃўрЃЌ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃњрЃљрЃЊрЃљрЃЏрЃЮрЃгрЃЏрЃћрЃЉрЃљ. рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃљ рЃљрЃАрЃћрЃЋрЃћ рЃўрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉрЃА рЃЎрЃўрЃЉрЃћрЃарЃБрЃАрЃљрЃцрЃарЃЌрЃ«рЃЮрЃћрЃЉрЃўрЃА рЃЊрЃљ рЃЎрЃўрЃЉрЃћрЃарЃЉрЃБрЃџрЃўрЃюрЃњрЃўрЃА рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃўрЃА рЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃљрЃА.\n   рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ MDF-рЃўрЃА рЃљрЃ«рЃљрЃџрЃў рЃўрЃюрЃўрЃфрЃўрЃљрЃбрЃўрЃЋрЃўрЃА РђюрЃЏрЃћрЃЊрЃўрЃљрЃгрЃўрЃњрЃюрЃўрЃћрЃарЃў рЃАрЃЎрЃЮрЃџрЃћрЃЉрЃў рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃЏрЃћрЃЊрЃћрЃњрЃЮрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃўРђЮ рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ.\n    рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃўрЃА рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљрЃерЃў рЃљрЃЦрЃбрЃўрЃБрЃарЃљрЃЊ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЉрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў рЃљрЃюрЃљ рЃАрЃџрЃБрЃАрЃљрЃарЃћрЃЋрЃљ, рЃюрЃљрЃбрЃљрЃџрЃўрЃљ рЃцрЃарЃБрЃўрЃФрЃћ рЃЊрЃљ рЃќрЃЋрЃўрЃљрЃЊ рЃЕрЃ«рЃћрЃюрЃЎрЃћрЃџрЃў.",
