    title:  "рЃњрЃўрЃЮрЃарЃњрЃў рЃюрЃўрЃњрЃљрЃџрЃўрЃФрЃћ рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљрЃА Amazon-рЃерЃў рЃЊрЃљрЃўрЃгрЃДрЃћрЃЉрЃА.",
    briefText:"рЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџрЃў рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА MACS[E]-рЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЎрЃЮрЃЏрЃърЃўрЃБрЃбрЃћрЃарЃБрЃџрЃў рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃљрЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃўрЃА рЃАрЃљрЃЉрЃљрЃЎрЃљрЃџрЃљрЃЋрЃарЃЮ рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃўрЃА рЃЏрЃћрЃЮрЃЌрЃ«рЃћ рЃЎрЃБрЃарЃАрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў, рЃњрЃўрЃЮрЃарЃњрЃў рЃюрЃўрЃњрЃљрЃџрЃўрЃФрЃћ рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљрЃА Amazon-рЃерЃў рЃЊрЃљрЃўрЃгрЃДрЃћрЃЉрЃА.рЃњрЃўрЃЮрЃарЃњрЃў рЃАрЃћрЃЦрЃбрЃћрЃЏрЃЉрЃарЃўрЃЊрЃљрЃю Amazon-рЃўрЃА рЃњрЃЊрЃљрЃюрЃАрЃЎрЃўрЃА (рЃърЃЮрЃџрЃЮрЃюрЃћрЃЌрЃў) рЃЮрЃцрЃўрЃАрЃерЃў рЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃЉрЃА Software Development Engineer-рЃўрЃА рЃърЃЮрЃќрЃўрЃфрЃўрЃљрЃќрЃћ Alexa AI-Natural Understanding-рЃўрЃА рЃњрЃБрЃюрЃЊрЃерЃў.",
