    title: "рЃЊрЃљрЃЕрЃў рЃњрЃўрЃЮрЃарЃњрЃў рЃњрЃљрЃарЃБрЃЕрЃљрЃЋрЃљ рЃЉрЃћрЃарЃџрЃўрЃюрЃўрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА //University of the Arts in Berlin, Germany // рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў рЃњрЃљрЃ«рЃЊрЃљ!",
    briefText:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃў рЃЊрЃљрЃЕрЃў рЃњрЃўрЃЮрЃарЃњрЃў рЃњрЃљрЃарЃБрЃЕрЃљрЃЋрЃљ рЃЉрЃћрЃарЃџрЃўрЃюрЃўрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА //University of the Arts in Berlin, Germany // рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў рЃњрЃљрЃ«рЃЊрЃљ!\nрЃЊрЃљрЃЕрЃў, рЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃЊрЃўрЃЊрЃў рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃўрЃЌ рЃЊрЃљ рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃерЃўрЃф рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃЊрЃўрЃЊ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃљрЃА!\n              \n рЃЕрЃЋрЃћрЃю рЃЋрЃљрЃЏрЃљрЃДрЃЮрЃЉрЃЌ рЃерЃћрЃюрЃўрЃЌ! ",
