    briefText:" рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА 2022-2023 рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃА рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЎрЃљрЃџрЃћрЃюрЃЊрЃљрЃарЃў (рЃљрЃюрЃЮрЃбрЃљрЃфрЃўрЃўрЃЌ)",
