    title:  "­ЪЈФ­ЪЊџ­ЪјЊ­Ъї║ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃЌрЃљ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃљ!",
    briefText:"  рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљ 2021-2022 рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃћрЃџрЃА рЃЊрЃљрЃљрЃАрЃарЃБрЃџрЃљ 78 рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЏ.\n   рЃЏрЃљрЃЌрЃњрЃљрЃю рЃгрЃћрЃџрЃА 75 рЃњрЃљрЃ«рЃЊрЃљ рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў!\n   рЃњрЃарЃљрЃюрЃбрЃў рЃЏрЃЮрЃўрЃърЃЮрЃЋрЃљ :\n  100% - 5 рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ,\n  70 % - 6 рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ,\n  50% - 9 рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ!\n     рЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃЕрЃЋрЃћрЃюрЃЮ рЃАрЃљрЃљрЃЏрЃљрЃДрЃЮ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃЮ!    \n  рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!",
