    title: "­ЪЈФ­ЪЊџ­ЪЉЕРђЇ­ЪјЊ­Ъї║рЃЉрЃАрЃБ-рЃА рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃЏрЃљрЃдрЃљрЃџрЃЦрЃБрЃџрЃўрЃљрЃюрЃў рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃБрЃарЃАрЃћрЃџрЃў рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃўрЃљ! ­ЪЉЈ­ЪЉЈ­ЪЉЈ­ЪЉЈ­ЪЉЈ­ЪЉЈ­ЪЊќ­ЪЊќ­ЪЊќ­ЪЊќ­ЪјЊ­ЪјЊ­ЪјЊ­ЪјЊ",
    briefText:"   рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃЏрЃљ рЃџрЃћрЃџрЃљ рЃЏрЃљрЃ«рЃљрЃарЃљрЃФрЃћрЃЏ рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃЊрЃўрЃЊрЃў рЃюрЃљрЃЉрЃўрЃ»рЃў рЃњрЃљрЃЊрЃљрЃЊрЃњрЃљ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃАрЃЎрЃћрЃю!      \n  рЃЌрЃљрЃЏрЃљрЃќ рЃЉрЃћрЃЦрЃљрЃўрЃљрЃА рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃцрЃЮрЃюрЃЊрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЏрЃљ рЃџрЃћрЃЋрЃљрЃю рЃЉрЃћрЃЦрЃљрЃўрЃљрЃЏ рЃЉрЃАрЃБ-рЃерЃў (рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃў / B S U) рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃЏрЃљрЃдрЃљрЃџрЃЦрЃБрЃџрЃўрЃљрЃю рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃБрЃарЃАрЃћрЃџ рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃА рЃџрЃћрЃџрЃљ рЃЏрЃљрЃ«рЃљрЃарЃљрЃФрЃћрЃА рЃърЃарЃћрЃЏрЃўрЃљ рЃњрЃљрЃЊрЃљрЃАрЃфрЃљ 1 500 рЃџрЃљрЃарЃўрЃА рЃЮрЃЊрЃћрЃюрЃЮрЃЉрЃўрЃЌ.\n  рЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ, рЃџрЃћрЃџрЃљ!    \n   ",
