    briefText:"   рЃФрЃЋрЃўрЃарЃцрЃљрЃАрЃЮ рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃЮ!\n    рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃАрЃЌрЃљрЃю рЃљрЃарЃАрЃћрЃЉрЃЮрЃЉрЃА рЃљрЃюрЃќрЃЮрЃа рЃћрЃарЃЦрЃЮрЃЏрЃљрЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА\n рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃАрЃљрЃћрЃЎрЃџрЃћрЃАрЃўрЃЮ рЃњрЃљрЃџрЃЮрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃћрЃЌрЃюрЃЮрЃЏрЃБрЃАрЃўрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљ!\n   рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃљ рЃБрЃцрЃљрЃАрЃЮрЃљ!\n рЃЏрЃАрЃБрЃарЃЋрЃћрЃџрЃћрЃЉрЃА рЃерЃљрЃЉрЃљрЃЌрЃЮрЃЉрЃўрЃЌ\n I-VрЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА 14:00 рЃАрЃЌ-рЃќрЃћ, рЃ«рЃЮрЃџрЃЮ\n VI рЃЎрЃџрЃљрЃАрЃўрЃА рЃќрЃћрЃЏрЃЮрЃЌ 17:00 рЃАрЃљрЃљрЃЌрЃўрЃЊрЃљрЃю N 100 рЃљрЃБрЃЊрЃўрЃбрЃЮрЃарЃўрЃљрЃерЃў рЃњрЃћрЃџрЃЮрЃЊрЃћрЃЉрЃљрЃЌ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃћрЃЎрЃљ рЃЉрЃЪрЃўрЃюрЃљрЃЋрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃЊрЃћрЃбрЃљрЃџрЃћрЃЉрЃўрЃА рЃЊрЃљрЃќрЃБрЃАрЃбрЃћрЃЉрЃўрЃА рЃЏрЃўрЃќрЃюрЃўрЃЌ рЃерЃћрЃњрЃўрЃФрЃџрЃўрЃљрЃЌ рЃЊрЃљрЃБрЃЎрЃљрЃЋрЃерЃўрЃарЃЊрЃўрЃЌ рЃбрЃћрЃџ. 593284206!",
