    briefText:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћ-10 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў 2022 рЃгрЃџрЃўрЃА 4 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃА рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃЊрЃюрЃћрЃю.\n  рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ.\n   рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЕрЃљрЃБрЃбрЃљрЃарЃЊрЃљрЃЌ рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃљ ,,рЃарЃЮрЃЉрЃћрЃарЃб рЃЎрЃљрЃърЃљрЃА рЃЮрЃЉрЃўрЃћрЃЦрЃбрЃўрЃЋрЃерЃўРђЮ.\n   рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃљрЃА рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃљ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃњрЃўрЃЊрЃў рЃЌрЃћрЃЮрЃюрЃљ рЃЦрЃўрЃюрЃЦрЃџрЃљрЃФрЃћ.",
