    briefText:"   рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃў рЃћрЃюрЃўрЃА рЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА\n   рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљ рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃА рЃњрЃЌрЃљрЃЋрЃљрЃќрЃЮрЃЉрЃЌ рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃў рЃћрЃюрЃўрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃљрЃА.\n   рЃЏрЃћрЃфрЃљрЃЊрЃўрЃюрЃћрЃЮрЃЉрЃљрЃА рЃгрЃљрЃарЃЏрЃљрЃарЃЌрЃљрЃЋрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃќрЃћрЃўрЃюрЃљрЃЉ рЃЎрЃЮрЃюрЃфрЃћрЃџрЃўрЃФрЃћ.\n   рЃЏрЃћрЃфрЃљрЃЊрЃўрЃюрЃћрЃЮрЃЉрЃћрЃЉрЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃћрЃЉрЃљ рЃЮрЃЌрЃ«рЃерЃљрЃЉрЃљрЃЌрЃА рЃЊрЃљ рЃърЃљрЃарЃљрЃАрЃЎрЃћрЃЋрЃА 14:30 рЃАрЃЌ-рЃќрЃћ.\n  рЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃљрЃарЃўрЃА рЃБрЃцрЃљрЃАрЃЮ.\n    рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!",
