    briefText:"2022 рЃгрЃџрЃўрЃА 19 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА XII-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃюрЃЊрЃарЃЮ рЃЎрЃљрЃџрЃљрЃюрЃЊрЃљрЃФрЃћрЃЏ, рЃюрЃўрЃЎрЃљ рЃЏрЃЪрЃљрЃЋрЃљрЃюрЃљрЃФрЃћрЃЏ рЃЊрЃљ рЃЌрЃЮрЃарЃюрЃўрЃЎрЃћ рЃАрЃўрЃ«рЃљрЃарЃБрЃџрЃўрЃФрЃћрЃЏ рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃарЃћрЃцрЃћрЃарЃљрЃбрЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ:  \"рЃюрЃљрЃърЃЮрЃџрЃћрЃЮрЃюрЃў - рЃћрЃърЃЮрЃЦрЃўрЃА рЃерЃћрЃЏрЃЦрЃЏрЃюрЃћрЃџрЃў рЃЊрЃљ рЃћрЃърЃЮрЃЦрЃўрЃА рЃЏрЃАрЃ«рЃЋрЃћрЃарЃърЃџрЃў\" (рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ).\n   рЃгрЃљрЃарЃЊрЃњрЃћрЃюрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ рЃЏрЃАрЃЏрЃћрЃюрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃЊрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃЊрЃљрЃАрЃЋрЃћрЃА рЃерЃћрЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃЉрЃў, рЃњрЃљрЃЏрЃЮрЃЌрЃЦрЃЋрЃћрЃА рЃЏрЃЮрЃАрЃљрЃќрЃарЃћрЃЉрЃћрЃЉрЃў рЃЊрЃљ рЃерЃћрЃљрЃцрЃљрЃАрЃћрЃА рЃЌрЃљрЃюрЃљрЃЎрЃџрЃљрЃАрЃћрЃџрЃЌрЃљ рЃюрЃљрЃерЃарЃЮрЃЏрЃў.",
