    briefText:"  2022 рЃгрЃџрЃўрЃА 17 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџрЃў рЃЊрЃљ рЃљрЃњрЃарЃљрЃарЃБрЃџ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃћрЃџрЃЏрЃљ рЃљрЃЉрЃўрЃбрЃБрЃарЃўрЃћрЃюрЃбрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃћрЃЉрЃўрЃА рЃњрЃљрЃфрЃюрЃЮрЃЉрЃўрЃЌрЃў рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃЕрЃљрЃљрЃбрЃљрЃарЃљ.\n   рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ, рЃарЃЮрЃЏ рЃЕрЃЋрЃћрЃюрЃА рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃЌрЃљ рЃерЃЮрЃарЃўрЃА рЃЏрЃарЃљрЃЋрЃџрЃљрЃЊ рЃљрЃарЃўрЃљрЃю рЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџрЃў рЃЊрЃљ рЃљрЃњрЃарЃљрЃарЃБрЃџрЃў рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃћрЃЉрЃўрЃА рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃћрЃЉрЃў.",
