    briefText:"  22 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃў - рЃ«рЃўрЃА рЃЊрЃљрЃарЃњрЃЋрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћ!\n   22 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃ«рЃўрЃА рЃЊрЃљрЃарЃњрЃЋрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ рЃљрЃГрЃљрЃарЃўрЃА рЃњрЃљрЃарЃћрЃЏрЃЮрЃА рЃЊрЃљрЃфрЃЋрЃўрЃАрЃљ рЃЊрЃљ рЃЉрЃБрЃюрЃћрЃЉрЃарЃўрЃЋрЃў рЃарЃћрЃАрЃБрЃарЃАрЃћрЃЉрЃўрЃА рЃАрЃљрЃЏрЃЏрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЊрЃљ рЃАрЃАрЃўрЃъ рЃљрЃГрЃљрЃарЃўрЃА рЃАрЃљрЃбрЃДрЃћрЃЮ рЃАрЃљрЃљрЃњрЃћрЃюрЃбрЃЮрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃњрЃљрЃарЃћрЃЏрЃЮрЃАрЃЊрЃљрЃфрЃЋрЃўрЃЌрЃў рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃўрЃА рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ.\n     рЃАрЃљрЃбрЃДрЃћрЃЮ рЃАрЃљрЃљрЃњрЃћрЃюрЃбрЃЮрЃЏ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ-рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃАрЃљрЃАрЃљрЃ«рЃџрЃўрЃА рЃћрЃЎрЃЮ-рЃЎрЃџрЃБрЃЉ РђърЃфрЃўрЃАрЃюрЃљрЃЏрЃўРђЎРђЎ-рЃАрЃљ рЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃљрЃдрЃАрЃљрЃќрЃарЃЊрЃћрЃџрЃћрЃЉрЃА рЃЦрЃЮрЃЉрЃБрЃџрЃћрЃЌрЃерЃў, рЃЌрЃўрЃЎрЃћрЃарЃўрЃА рЃАрЃљрЃюрЃћрЃарЃњрЃћрЃерЃў рЃБрЃЏрЃљрЃАрЃърЃўрЃюрЃФрЃџрЃљ рЃЊрЃљ рЃљрЃАрЃљрЃЏрЃЊрЃћ рЃцрЃўрЃГрЃЋрЃўрЃА рЃюрЃћрЃарЃњрЃўрЃА рЃЊрЃљрЃарЃњрЃЋрЃўрЃА рЃерЃћрЃАрЃљрЃФрЃџрЃћрЃЉрЃџрЃЮрЃЉрЃљ рЃЏрЃўрЃАрЃфрЃљ.\n      ",
