    briefText:"   рЃбрЃЋрЃўрЃюрЃћрЃЉрЃўрЃА рЃЉрЃарЃФрЃЮрЃџрЃљ Рђб Battle of Brains\n    2022 рЃгрЃџрЃўрЃА 25 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃБрЃюрЃЊрЃБрЃарЃў рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃБрЃљрЃџрЃБрЃарЃў рЃЌрЃљрЃЏрЃљрЃерЃўрЃА \"рЃбрЃЋрЃўрЃюрЃћрЃЉрЃўрЃА рЃЉрЃарЃФрЃЮрЃџрЃљ\" рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃћрЃбрЃљрЃърЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ.\n   рЃЌрЃљрЃЏрЃљрЃерЃерЃў рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃљрЃАрЃљрЃЎрЃЮрЃЉрЃарЃЮрЃЋ рЃЎрЃљрЃбрЃћрЃњрЃЮрЃарЃўрЃљрЃерЃў рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃљрЃЌрЃћрЃБрЃџрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃљ.\n   рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃЕрЃЋрЃћрЃюрЃА рЃърЃљрЃбрЃљрЃарЃљ рЃЏрЃЮрЃљрЃќрЃарЃЮрЃЋрЃюрЃћрЃћрЃЉрЃА!",
