    briefText:"  рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃ»рЃћрЃџрЃўрЃљ - NASA Space Apps Challenge 2022-рЃўрЃА рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃБрЃџрЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћ!\n      рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃљрЃЌрЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃ»рЃћрЃџрЃўрЃљ рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃЊрЃљ Nasa Space Apps Challenge Apps 2022 рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃљрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА!\n   1-2 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃцрЃљрЃарЃЌрЃЮрЃЏрЃљрЃАрЃерЃбрЃљрЃЉрЃўрЃљрЃюрЃў рЃ░рЃљрЃЎрЃљрЃЌрЃЮрЃюрЃў NASA Space Apps Challenge 2022 .\n   NASA Space Apps Challenge 2022 рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃБрЃџрЃўрЃљ рЃўрЃџрЃўрЃљрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃЊрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃўрЃюрЃЮрЃЋрЃљрЃфрЃўрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃбрЃћрЃЦрЃюрЃЮрЃџрЃЮрЃњрЃўрЃћрЃЉрЃўрЃА рЃАрЃљрЃљрЃњрЃћрЃюрЃбрЃЮрЃА GITA Рђб Tech Park рЃЏрЃўрЃћрЃа. рЃ«рЃЮрЃџрЃЮ рЃЌрЃљрЃюрЃљрЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃўрЃљ рЃћрЃЋрЃарЃЮрЃЎрЃљрЃЋрЃерЃўрЃарЃўрЃА рЃЊрЃљрЃцрЃўрЃюрЃљрЃюрЃАрЃћрЃЉрЃўрЃЌ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃърЃарЃЮрЃћрЃЦрЃбрЃў РђърЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃБрЃџрЃў рЃбрЃћрЃЦрЃюрЃЮрЃџрЃЮрЃњрЃўрЃБрЃарЃў рЃЎрЃџрЃБрЃЉрЃћрЃЉрЃўрЃА рЃЦрЃАрЃћрЃџрЃўРђЮ.",
