    briefText:" рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЦрЃўрЃЏрЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃюрЃЮрЃюрЃљ рЃљрЃЉрЃљрЃерЃўрЃФрЃћ рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃЮ рЃцрЃЮрЃюрЃЊрЃўрЃА 2022 рЃгрЃџрЃўрЃА рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃљрЃюрЃбрЃБрЃарЃўрЃА рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃћрЃЉрЃўрЃА рЃАрЃљрЃњрЃарЃљрЃюрЃбрЃЮ рЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃўрЃА рЃњрЃарЃљрЃюрЃбрЃўрЃА рЃЏрЃцрЃџрЃЮрЃЉрЃћрЃџрЃў рЃњрЃљрЃ«рЃЊрЃљ рЃЌрЃћрЃЏрЃўрЃАрЃЌрЃЋрЃўрЃА \"рЃЊрЃљрЃАрЃљрЃЋрЃџрЃћрЃЌ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃЏрЃЮрЃгрЃћрЃБрЃџрЃў рЃЌрЃљрЃцрЃџрЃўрЃА рЃЉрЃЮрЃбрЃљрЃюрЃўрЃЎрЃБрЃарЃў рЃгрЃљрЃарЃЏрЃЮрЃерЃЮрЃЉрЃўрЃА рЃЊрЃљрЃАрЃљрЃЊрЃњрЃћрЃюрЃљрЃЊ рЃЌрЃљрЃцрЃџрЃўрЃА рЃЏрЃбрЃЋрЃарЃўрЃљрЃюрЃћрЃЉрЃўрЃА, рЃЉрЃўрЃЮрЃљрЃЦрЃбрЃўрЃБрЃарЃў рЃюрЃљрЃћрЃарЃЌрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃБрЃарЃў рЃљрЃЦрЃбрЃўрЃБрЃарЃЮрЃЉрЃўрЃА рЃЎрЃЋрЃџрЃћрЃЋрЃљ.\"\n    рЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ, рЃюрЃЮрЃюрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЮ рЃЊрЃљ рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!",
