    briefText:" 2022 рЃгрЃџрЃўрЃА 26 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃАрЃљрЃЎрЃарЃћрЃЉрЃБрЃџрЃЮрЃА рЃЌрЃљрЃЏрЃљрЃа рЃЏрЃћрЃцрЃўрЃА рЃЊрЃљрЃарЃЉрЃљрЃќрЃерЃў рЃерЃљрЃџрЃЋрЃљ рЃљрЃЏрЃЮрЃюрЃљрЃерЃЋрЃўрЃџрЃўрЃА рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА ,,рЃ░рЃБрЃЏрЃљрЃюрЃБрЃарЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮ\"\"-рЃА рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ.\n   рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃЎрЃЮрЃАрЃЏрЃљ рЃерЃљрЃџрЃЋрЃљ рЃљрЃЏрЃЮрЃюрЃљрЃерЃЋрЃўрЃџрЃЏрЃљ рЃЊрЃљрЃЏрЃАрЃгрЃарЃћ рЃљрЃБрЃЊрЃўрЃбрЃЮрЃарЃўрЃљрЃА рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃЏрЃўрЃќрЃюрЃћрЃЉрЃў рЃЊрЃљ рЃ«рЃћрЃЊрЃЋрЃћрЃЉрЃў рЃњрЃљрЃБрЃќрЃўрЃљрЃарЃљ.\n   рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљрЃќрЃћ рЃЏрЃўрЃгрЃЋрЃћрЃБрЃџрЃў рЃўрЃДрЃЮ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃф, рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃљрЃЏрЃ»рЃћрЃарЃљрЃЊ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃћрЃюрЃЊрЃљ рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃЊрЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃќрЃЋрЃўрЃљрЃЊ рЃЕрЃ«рЃћрЃюрЃЎрЃћрЃџрЃў\n  рЃАрЃљрЃЏрЃЮрЃЏрЃљрЃЋрЃџрЃЮрЃЊ ,,рЃ░рЃБрЃЏрЃљрЃюрЃБрЃа рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮ\"\"-рЃАрЃљ рЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃА рЃерЃЮрЃарЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃЊрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃљрЃА рЃћрЃДрЃарЃћрЃЉрЃљ рЃАрЃљрЃцрЃБрЃФрЃЋрЃћрЃџрЃў!",
