    title: "рЃќрЃдрЃЋрЃўрЃА рЃАрЃљрЃюрЃљрЃърЃўрЃарЃЮ рЃќрЃЮрЃџрЃўрЃА рЃЊрЃљрЃАрЃБрЃЌрЃљрЃЋрЃћрЃЉрЃўрЃА рЃљрЃЦрЃфрЃўрЃљ рЃерЃљрЃЋрЃў рЃќрЃдрЃЋрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ",
    briefText:" рЃќрЃдрЃЋрЃўрЃА рЃАрЃљрЃюрЃљрЃърЃўрЃарЃЮ рЃќрЃЮрЃџрЃўрЃА рЃЊрЃљрЃАрЃБрЃЌрЃљрЃЋрЃћрЃЉрЃўрЃА рЃљрЃЦрЃфрЃўрЃљ рЃерЃљрЃЋрЃў рЃќрЃдрЃЋрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ\n    31 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃерЃљрЃЋрЃў рЃќрЃдрЃЋрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃњрЃћрЃЮрЃћрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃЏрЃљ (рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃАрЃЮрЃцрЃЮ рЃ«рЃБрЃ«рЃБрЃюрЃљрЃўрЃерЃЋрЃўрЃџрЃў) рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ-рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃАрЃљрЃАрЃљрЃ«рЃџрЃўрЃА рЃљрЃдрЃАрЃљрЃќрЃарЃЊрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃЊрЃљрЃљрЃАрЃБрЃцрЃЌрЃљрЃЋрЃћрЃА рЃерЃљрЃЋрЃў рЃќрЃдрЃЋрЃўрЃА рЃАрЃљрЃюрЃљрЃърЃўрЃарЃЮ рЃќрЃЮрЃџрЃў, рЃљрЃАрЃћрЃЋрЃћ, рЃЏрЃЮрЃАрЃљрЃ«рЃџрЃћрЃЮрЃЉрЃўрЃА рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃўрЃА рЃЏрЃўрЃќрЃюрЃўрЃЌ рЃЊрЃљрЃљрЃарЃўрЃњрЃћрЃА рЃЏрЃљрЃЌ рЃЏрЃўрЃћрЃа рЃерЃћрЃЦрЃЏрЃюрЃўрЃџрЃў рЃЉрЃБрЃЎрЃџрЃћрЃбрЃћрЃЉрЃў.",
