    briefText:" рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃЏрЃгрЃћрЃарЃљрЃџрЃЌрЃљрЃю\n  2022 рЃгрЃџрЃўрЃА 3 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА IV-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃЏрЃљ рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃЮрЃўрЃФрЃћрЃЏ рЃАрЃбрЃБрЃЏрЃарЃљрЃЊ рЃЏрЃЮрЃўрЃгрЃЋрЃўрЃћрЃА рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃЏрЃгрЃћрЃарЃљрЃџрЃў рЃЊрЃљрЃџрЃў рЃЌрЃћрЃЊрЃЮрЃарЃљрЃФрЃћ.\n  рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃЏрЃўрЃАрЃў рЃљрЃЋрЃбрЃЮрЃарЃЮрЃЉрЃўрЃЌ рЃњрЃљрЃЏрЃЮрЃфрЃћрЃЏрЃБрЃџрЃў рЃќрЃдрЃљрЃърЃарЃћрЃЉрЃўрЃА рЃгрЃўрЃњрЃюрЃў -\"рЃарЃЮрЃњрЃЮрЃа рЃњрЃљрЃЕрЃюрЃЊрЃюрЃћрЃю рЃЊрЃћрЃЋрЃћрЃЉрЃў\".\n  рЃўрЃЏрЃАрЃ»рЃћрЃџрЃћрЃА рЃгрЃљрЃЎрЃўрЃЌрЃ«рЃБрЃџрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃерЃћрЃЦрЃЏрЃюрЃћрЃА рЃЊрЃљ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃЎрЃЮрЃЏрЃўрЃЦрЃАрЃћрЃЉрЃў.\n  рЃљрЃЋрЃбрЃЮрЃарЃАрЃљ рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃерЃЮрЃарЃўрЃА рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЊрЃљ рЃАрЃљрЃ«рЃљрЃџрЃўрЃАрЃЮ рЃАрЃљрЃБрЃЉрЃљрЃарЃў.\n  рЃЏрЃгрЃћрЃарЃљрЃџрЃЏрЃљ рЃњрЃБрЃџрЃгрЃарЃцрЃћрЃџрЃў рЃърЃљрЃАрЃБрЃ«рЃћрЃЉрЃў рЃњрЃљрЃАрЃфрЃљ рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃўрЃА рЃЏрЃўрЃћрЃа рЃЊрЃљрЃАрЃЏрЃБрЃџ рЃерЃћрЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃЉрЃА .\n    рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃўрЃА рЃАрЃБрЃарЃЋрЃўрЃџрЃўрЃА рЃњрЃљрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉрЃўрЃЌ рЃЊрЃљрЃўрЃњрЃћрЃњрЃЏрЃљ рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ.\n    IV-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџрЃў рЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃЮрЃўрЃФрЃћ рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃБрЃ«рЃЊрЃўрЃА рЃЦрЃљрЃџрЃЉрЃљрЃбрЃЮрЃю рЃЊрЃљрЃџрЃўрЃА рЃњрЃБрЃџрЃўрЃАрЃ«рЃЏрЃўрЃћрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА!",
