    title:  "рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃў-рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў",
    briefText:"   рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃў-рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў\n   10 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃў рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃљ!     \n рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃћрЃА рЃЊрЃдрЃћ рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃўрЃЌ рЃљрЃдрЃЋрЃюрЃўрЃерЃюрЃћрЃЌ.\n  рЃЏрЃљрЃАрЃерЃў рЃЕрЃљрЃарЃЌрЃБрЃџрЃў рЃўрЃДрЃЋрЃюрЃћрЃю рЃАрЃљрЃЉрЃљрЃќрЃЮ рЃЊрЃљ рЃАрЃљрЃерЃБрЃљрЃџрЃЮ рЃАрЃљрЃцрЃћрЃ«рЃБрЃарЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў.\n   рЃЕрЃЋрЃћрЃюрЃЊрЃљ рЃАрЃљрЃљрЃЏрЃљрЃДрЃЮрЃЊ рЃњрЃЋрЃАрЃБрЃарЃА рЃљрЃдрЃЋрЃюрЃўрЃерЃюрЃЮрЃЌ, рЃарЃЮрЃЏ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃљрЃерЃў рЃљрЃарЃљрЃћрЃарЃЌрЃў рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃљ рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃў рЃљрЃАрЃгрЃљрЃЋрЃџрЃўрЃА. рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃўрЃА рЃърЃљрЃарЃљрЃџрЃћрЃџрЃБрЃарЃљрЃЊ рЃўрЃАрЃўрЃюрЃў рЃюрЃљрЃДрЃЮрЃцрЃўрЃћрЃа рЃАрЃљрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃЮ рЃАрЃљрЃЦрЃЏрЃўрЃљрЃюрЃЮрЃЉрЃљрЃА рЃћрЃгрЃћрЃЋрЃўрЃљрЃю.\n    рЃюрЃљрЃфрЃюрЃЮрЃЉрЃў рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў рЃЊрЃдрЃћрЃА рЃљрЃ«рЃљрЃџ - рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃўрЃА рЃљрЃЏрЃърЃџрЃБрЃљрЃерЃў рЃўрЃ«рЃўрЃџрЃћрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ.",
