    briefText:"РђърЃЋрЃљрЃњрЃарЃЮрЃЋрЃћрЃЉрЃЌ рЃЏрЃљрЃЎрЃБрЃџрЃљрЃбрЃБрЃарЃљрЃА рЃбрЃДрЃўрЃА рЃњрЃљрЃЊрЃљрЃАрЃљрЃарЃЕрЃћрЃюрЃљрЃЊРђю \n   рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃњрЃћрЃЮ рЃћрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃЏрЃљ (рЃЎрЃџрЃБрЃЉрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃАрЃЮрЃцрЃўрЃЎрЃЮ рЃ«рЃБрЃ«рЃБрЃюрЃљрЃўрЃерЃЋрЃўрЃџрЃў) рЃЏрЃћрЃЮрЃЌрЃ«рЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃљрЃЦрЃфрЃўрЃљ рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ: РђърЃЋрЃљрЃњрЃарЃЮрЃЋрЃћрЃЉрЃЌ рЃЏрЃљрЃЎрЃБрЃџрЃљрЃбрЃБрЃарЃљрЃА рЃбрЃДрЃўрЃА рЃњрЃљрЃЊрЃљрЃАрЃљрЃарЃЕрЃћрЃюрЃљрЃЊРђю    ",
