    briefText:"  рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃ»рЃћрЃџрЃўрЃљ - рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃБрЃџрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃў!\n  31 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃбрЃћрЃЦрЃюрЃЮрЃърЃљрЃарЃЎрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ HARDWARE StartUP рЃўрЃюрЃЎрЃБрЃЉрЃљрЃбрЃЮрЃарЃўрЃА Demo рЃЊрЃдрЃћ, рЃАрЃљрЃЊрЃљрЃф рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃћрЃЉрЃў рЃгрЃўрЃюрЃљрЃАрЃгрЃљрЃа рЃЊрЃљрЃЎрЃЮрЃЏрЃърЃџрЃћрЃЦрЃбрЃћрЃЉрЃБрЃџрЃў рЃЪрЃўрЃБрЃарЃўрЃА рЃгрЃўрЃюрЃљрЃерЃћ рЃгрЃљрЃарЃАрЃЊрЃњрЃюрЃћрЃю рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃЉрЃўрЃќрЃюрЃћрЃА рЃўрЃЊрЃћрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ Hardware рЃърЃарЃЮрЃбрЃЮрЃбрЃўрЃърЃћрЃЉрЃўрЃЌ.\n  рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃљрЃАрЃерЃбрЃљрЃЉрЃўрЃЌ рЃърЃарЃЮрЃћрЃЦрЃбрЃў 5 рЃЌрЃЋрЃўрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃЊрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃбрЃћрЃЦрЃюрЃЮрЃърЃљрЃарЃЎрЃћрЃЉрЃерЃў, рЃАрЃљрЃЊрЃљрЃф рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃћрЃЉрЃА рЃБрЃбрЃљрЃарЃЊрЃћрЃЉрЃЮрЃЊрЃљрЃЌ рЃЏрЃўрЃЎрЃарЃЮрЃћрЃџрЃћрЃЦрЃбрЃарЃЮрЃюрЃўрЃЎрЃўрЃАрЃљ (Arduino, Raspeberry PI with IOT) рЃЊрЃљ рЃЉрЃўрЃќрЃюрЃћрЃА рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃћрЃЉрЃў/рЃЏрЃћрЃюрЃбрЃЮрЃарЃерЃўрЃцрЃћрЃЉрЃў\n   рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃўрЃЌ рЃћрЃбрЃљрЃърЃќрЃћ Demo рЃЊрЃдрЃћрЃќрЃћ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃБрЃџрЃљрЃЊ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃ»рЃћрЃџрЃўрЃљ. (рЃљрЃГрЃљрЃарЃўрЃА рЃарЃћрЃњрЃўрЃЮрЃюрЃўрЃЊрЃљрЃю рЃгрЃљрЃарЃЊрЃњрЃћрЃюрЃўрЃџрЃў рЃърЃарЃЮрЃћрЃЦрЃбрЃў - SmartWall ) \n   рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ, рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!   ",
