    briefText:" 2022 рЃгрЃџрЃўрЃА 13 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃГрЃљрЃЊрЃарЃљрЃЎрЃЮ рЃбрЃБрЃарЃюрЃўрЃарЃў V-XII рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃерЃЮрЃарЃўрЃА (рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃћрЃЉрЃў -рЃЏрЃљрЃўрЃљ рЃГрЃљрЃюрЃБрЃДрЃЋрЃљрЃФрЃћ, рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў, рЃЎрЃљрЃарЃџрЃЮ рЃбрЃарЃљрЃърЃљрЃўрЃФрЃћ).\n   рЃбрЃБрЃарЃюрЃўрЃарЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃљ 30-рЃќрЃћ рЃЏрЃћрЃбрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ.\n   рЃњрЃљрЃЏрЃЮрЃЋрЃџрЃўрЃюрЃЊрЃюрЃћрЃю рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃћрЃЉрЃў - рЃФрЃЏрЃћрЃЉрЃў рЃњрЃўрЃЮрЃарЃњрЃў рЃЊрЃљ рЃЊрЃћрЃЏрЃћрЃбрЃарЃћ рЃњрЃЮрЃњрЃўрЃљрЃерЃЋрЃўрЃџрЃћрЃЉрЃў рЃЊрЃљ рЃљрЃюрЃљ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў.   ",
