    title:  "рЃњрЃћрЃЮ рЃћрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃўрЃА рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљ рЃўрЃАрЃърЃљрЃљрЃюрЃўрЃА рЃГрЃљрЃЮрЃЉрЃерЃў.",
    briefText: "2022 рЃгрЃџрЃўрЃА 22 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃњрЃћрЃЮ рЃћрЃЎрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃў рЃЊрЃљ рЃЎрЃџрЃБрЃЉрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў, рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃАрЃЮрЃцрЃўрЃЎрЃЮ рЃ«рЃБрЃ«рЃБрЃюрЃљрЃўрЃерЃЋрЃўрЃџрЃў рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ-рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌрЃў рЃЏрЃўрЃќрЃюрЃўрЃЌ рЃЊрЃљрЃБрЃЎрЃљрЃЋрЃерЃўрЃарЃЊрЃюрЃћрЃю рЃЎрЃЮрЃџрЃ«рЃћрЃЌрЃўрЃА рЃЊрЃљрЃфрЃБрЃџрЃў рЃбрЃћрЃарЃўрЃбрЃЮрЃарЃўрЃћрЃЉрЃўрЃА рЃљрЃЊрЃЏрЃўрЃюрЃўрЃАрЃбрЃљрЃфрЃўрЃљрЃА рЃЊрЃљ рЃЏрЃЮрЃўрЃюрЃљрЃ«рЃБрЃџрЃћрЃА рЃўрЃАрЃърЃљрЃљрЃюрЃўрЃА рЃГрЃљрЃЮрЃЉрЃў.\n рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃфрЃћрЃюрЃбрЃарЃўрЃА рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃћрЃџрЃЏрЃљ рЃАрЃЮрЃцрЃЮ рЃЌрЃ«рЃўрЃџрЃљрЃўрЃерЃЋрЃўрЃџрЃЏрЃљ рЃњрЃљрЃљрЃфрЃюрЃЮ рЃГрЃљрЃЮрЃЉрЃћрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљ; рЃерЃћрЃЏрЃЊрЃћрЃњ рЃюрЃЮрЃарЃЕрЃў рЃћрЃЎрЃЮрЃџрЃЮрЃњрЃћрЃЉрЃў рЃњрЃљрЃЋрЃўрЃЊрЃюрЃћрЃю рЃљрЃдрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃўрЃАрЃљ рЃЊрЃљ рЃюрЃљрЃЎрЃарЃФрЃљрЃџрЃўрЃА рЃбрЃћрЃарЃўрЃбрЃЮрЃарЃўрЃљрЃќрЃћ, рЃАрЃљрЃЊрЃљрЃф рЃюрЃљрЃ«рЃћрЃА рЃЏрЃАрЃЮрЃцрЃџрЃўрЃЮ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃўрЃА рЃЌрЃћрЃЌрЃарЃў рЃ«рЃљрЃЋрЃАрЃў.\n рЃњрЃћрЃЮ рЃћрЃЎрЃЮрЃџрЃЮрЃњрЃћрЃЉрЃўрЃА рЃЋрЃўрЃќрЃўрЃбрЃўрЃА рЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃў рЃљрЃўрЃАрЃљрЃ«рЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃАрЃљрЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃЮ рЃюрЃљрЃерЃарЃЮрЃЏрЃерЃў.",
