    title:  "2022 рЃгрЃџрЃўрЃА 1 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА рЃцрЃўрЃџрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃљрЃЌрЃљ рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃў рЃњрЃўрЃљ рЃЏрЃБрЃарЃдрЃБрЃџрЃўрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃћрЃЉрЃА рЃерЃћрЃ«рЃЋрЃЊрЃљ рЃЊрЃљ рЃАрЃљрЃ»рЃљрЃарЃЮ рЃџрЃћрЃЦрЃфрЃўрЃљ рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃљ рЃЌрЃћрЃЏрЃљрЃќрЃћ: \"рЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃў - рЃћрЃЏрЃърЃљрЃЌрЃўрЃљ - рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃљРђю.",
    briefText: "рЃЉрЃљрЃбрЃЮрЃюрЃЏрЃљ рЃњрЃўрЃљрЃЏ рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃћрЃЉрЃА рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃгрЃўрЃњрЃюрЃћрЃЉрЃў - \"рЃАрЃљрЃБрЃЉрЃарЃћрЃЉрЃў рЃБрЃцрЃарЃЮрЃАрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЌрЃљрЃюРђЮ рЃЊрЃљ \"рЃфрЃ«рЃарЃўрЃАрЃюрЃљрЃ«рЃћрЃЋрЃљрЃарЃќрЃћРђЮ рЃгрЃљрЃарЃБрЃЊрЃњрЃўрЃюрЃљ .\n рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў.",
