    title:  "2022 рЃгрЃџрЃўрЃА 10 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃў! рЃўрЃюрЃЊрЃўрЃЋрЃўрЃЊрЃБрЃљрЃџрЃБрЃа рЃЊрЃљ рЃАрЃљрЃЮрЃ»рЃљрЃ«рЃЮ рЃерЃћрЃЏрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџрЃЌрЃљ рЃцрЃЮрЃџрЃЎрЃџрЃЮрЃарЃБрЃџ-рЃћрЃЌрЃюрЃЮрЃњрЃарЃљрЃцрЃўрЃБрЃџрЃў VI рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃў \"рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃћрЃЉрЃўрЃА рЃЎрЃЋрЃљрЃџрЃЊрЃљрЃЎрЃЋрЃљрЃџ\".",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃбрЃарЃўрЃЮрЃА ( рЃЊрЃћрЃЊрЃљ-рЃерЃЋрЃўрЃџрЃў рЃћрЃџрЃћрЃюрЃћ рЃБрЃарЃБрЃерЃљрЃФрЃћ , рЃЊрЃћрЃЊрЃљрЃЏрЃўрЃАрЃў, рЃЕрЃЋрЃћрЃюрЃў рЃЏрЃБрЃАрЃўрЃЎрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃЏрЃљрЃўрЃљ рЃГрЃљрЃюрЃБрЃДрЃЋрЃљрЃФрЃћ рЃЊрЃљ рЃџрЃЮрЃџрЃљ рЃ»рЃљрЃцрЃљрЃарЃўрЃФрЃћ) рЃЊрЃљ рЃњрЃЮрЃњрЃЮрЃюрЃљрЃЌрЃљ рЃљрЃюрЃАрЃљрЃЏрЃЉрЃџрЃўрЃА рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЏрЃЮрЃАрЃЋрЃџрЃљ (рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃџрЃЮрЃџрЃљ рЃ»рЃљрЃцрЃљрЃарЃўрЃФрЃћ).",
