    title:  "2022 рЃгрЃџрЃўрЃА 14 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћ-9 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџ рЃќрЃЋрЃўрЃљрЃЊ рЃЕрЃ«рЃћрЃюрЃЎрЃћрЃџрЃЌрЃљрЃю рЃЊрЃљ рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃАрЃЮрЃцрЃЮ рЃ«рЃБрЃ«рЃБрЃюрЃљрЃўрЃерЃЋрЃўрЃџрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃўрЃЏрЃДрЃЮрЃцрЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃерЃў рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљрЃќрЃћ рЃАрЃљрЃ«рЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃўрЃЌ- \"рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮ XVI-XVIII рЃАрЃљрЃБрЃЎрЃБрЃюрЃћрЃћрЃЉрЃўрЃА рЃюрЃўрЃЊрЃћрЃарЃџрЃљрЃюрЃЊрЃБрЃа рЃарЃБрЃЎрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃњрЃарЃљрЃЋрЃўрЃБрЃарЃћрЃЉрЃќрЃћ\".",
    briefText: "рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљ рЃюрЃўрЃЊрЃћрЃарЃџрЃљрЃюрЃЊрЃћрЃЉрЃўрЃА рЃАрЃљрЃЏрЃћрЃцрЃЮрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃерЃЮрЃарЃўрЃА рЃЮрЃарЃЏрЃ«рЃарЃўрЃЋрЃў рЃЊрЃўрЃърЃџрЃЮрЃЏрЃљрЃбрЃўрЃБрЃарЃў рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃЏрЃДрЃљрЃарЃћрЃЉрЃўрЃА 30 рЃгрЃџрЃўрЃАрЃЌрЃљрЃЋрЃА рЃћрЃФрЃдрЃЋрЃюрЃћрЃЉрЃљ рЃЊрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃюрЃўрЃЊрЃћрЃарЃџрЃљрЃюрЃЊрЃћрЃЉрЃўрЃА рЃАрЃљрЃЏрЃћрЃцрЃЮрЃА рЃАрЃљрЃћрЃџрЃЕрЃЮрЃА рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃўрЃЌ, рЃдрЃўрЃљ рЃАрЃўрЃЋрЃарЃфрЃћ рЃЎрЃљрЃЋрЃЎрЃљрЃАрЃўрЃўрЃА (COS) рЃЏрЃўрЃћрЃа рЃўрЃЏрЃљрЃарЃЌрЃћрЃЉрЃљ.",
