    title:  "рЃЦрЃљрЃарЃЌрЃБрЃџ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃдрЃўрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў",
    briefText: "2022 рЃгрЃџрЃўрЃА 22 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃЏрЃљрЃарЃўрЃюрЃљ рЃбрЃљрЃџрЃљрЃ«рЃљрЃФрЃћрЃЏ рЃЕрЃљрЃљрЃбрЃљрЃарЃљ XII рЃЎрЃџрЃљрЃАрЃерЃў рЃдрЃўрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ \"рЃћрЃЏрЃърЃўрЃарЃўрЃБрЃџрЃў рЃарЃћрЃљрЃџрЃЮрЃЉрЃљ рЃЊрЃљ рЃЏрЃ«рЃљрЃбрЃЋрЃарЃБрЃџрЃў рЃАрЃўрЃюрЃљрЃЏрЃЊрЃЋрЃўрЃџрЃћ\".\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА_рЃгрЃЏрЃўрЃюрЃЊрЃљ_рЃљрЃюрЃЊрЃарЃўрЃљ_рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА_рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА_рЃАрЃЎрЃЮрЃџрЃљ\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃљ",
