    title:  "рЃЏрЃўрЃюрЃў-рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃў рЃарЃБрЃАрЃБрЃџрЃў рЃћрЃюрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ.2022 рЃгрЃџрЃўрЃА 24 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VI - 4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ (рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃћрЃЋрЃњрЃћрЃюрЃўрЃљ рЃџрЃЮрЃЏрЃљрЃФрЃћ) рЃарЃБрЃАрЃБрЃџрЃў рЃћрЃюрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃЊрЃљрЃЊрЃњрЃћрЃА рЃЏрЃўрЃюрЃў-рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃў рЃарЃБрЃАрЃБрЃџрЃў рЃ«рЃљрЃџрЃ«рЃБрЃарЃў рЃќрЃдрЃљрЃърЃљрЃарЃў \"рЃбрЃћрЃарЃћрЃЏрЃЮрЃЎрЃў\".",
    briefText: "рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃљ рЃЏрЃўрЃќрЃюрЃљрЃЊ рЃўрЃАрЃљрЃ«рЃљрЃЋрЃЊрЃљ, рЃарЃЮрЃњрЃЮрЃарЃф рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў, рЃљрЃАрЃћрЃЋрЃћ, рЃарЃБрЃАрЃБрЃџ рЃћрЃюрЃљрЃерЃў рЃќрЃћрЃърЃўрЃарЃЏрЃћрЃбрЃДрЃЋрЃћрЃџрЃћрЃЉрЃўрЃА, рЃЊрЃўрЃљрЃџрЃЮрЃњрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃЮрЃюрЃЮрЃџрЃЮрЃњрЃўрЃА рЃБрЃюрЃљрЃарЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљрЃА, рЃЏрЃЮрЃбрЃўрЃЋрЃљрЃфрЃўрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃљрЃА.",
