    briefText: "2022 рЃгрЃџрЃўрЃА 28 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА рЃАрЃљрЃљрЃ«рЃљрЃџрЃгрЃџрЃЮ рЃњрЃљрЃюрЃгрЃДрЃЮрЃЉрЃўрЃЌ рЃњрЃљрЃ»рЃћрЃарЃћрЃЉрЃБрЃџрЃў рЃќрЃдрЃљрЃърЃарЃБрЃџрЃў рЃАрЃљрЃюрЃљрЃ«рЃљрЃЮрЃЉрЃљ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃЏрЃљрЃўрЃљ рЃўрЃЏрЃюрЃљрЃФрЃўрЃА рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃўрЃЌ.",
