    briefText: "рЃАрЃўрЃЏрЃдрЃћрЃарЃљ, рЃџрЃћрЃЦрЃАрЃў, рЃЏрЃЮрЃџрЃЮрЃфрЃЋрЃљ, рЃАрЃўрЃЎрЃћрЃЌрЃћ, рЃАрЃўрЃЌрЃЉрЃЮ рЃЊрЃљ рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃў рЃўрЃдрЃЋрЃарЃћрЃЉрЃЮрЃЊрЃљ 2022 рЃгрЃџрЃўрЃА 29 рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃАрЃфрЃћрЃюрЃўрЃЊрЃљрЃю рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃЌрЃљ рЃАрЃљрЃљрЃ«рЃљрЃџрЃгрЃџрЃЮ рЃќрЃћрЃўрЃЏрЃќрЃћ (рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃў рЃљрЃюрЃљ рЃЎрЃЋрЃўрЃГрЃўрЃФрЃћ рЃЊрЃљ рЃћрЃЎрЃљ рЃЉрЃЪрЃўрЃюрЃљрЃЋрЃљ).",
