    title:  "рЃљрЃЎрЃљрЃЎрЃў рЃгрЃћрЃарЃћрЃЌрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЦрЃљрЃџрЃљрЃЦ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃАрЃљрЃ»рЃљрЃарЃЮ рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃўрЃА рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ-рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃњрЃљрЃюрЃДрЃЮрЃцрЃўрЃџрЃћрЃЉрЃљрЃерЃў 8 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА, 14:00 рЃАрЃљрЃљрЃЌрЃќрЃћ рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА XII РђЊ 4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃдрЃўрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃљрЃерЃў : \"рЃљрЃЌрЃљрЃАрЃў рЃгрЃћрЃџрЃў рЃЏрЃћрЃцрЃћ рЃЊрЃљрЃЋрЃўрЃЌрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ.\" рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў: рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ.",
    briefText: "рЃљрЃЎрЃљрЃЎрЃў рЃгрЃћрЃарЃћрЃЌрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЦрЃљрЃџрЃљрЃЦ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃАрЃљрЃ»рЃљрЃарЃЮ рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃўрЃА рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ-рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃЮрЃЉрЃўрЃА рЃњрЃљрЃюрЃДрЃЮрЃцрЃўрЃџрЃћрЃЉрЃљрЃерЃў 8 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА, 14:00 рЃАрЃљрЃљрЃЌрЃќрЃћ рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА XII РђЊ 4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃдрЃўрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃљрЃерЃў : \"рЃљрЃЌрЃљрЃАрЃў рЃгрЃћрЃџрЃў рЃЏрЃћрЃцрЃћ рЃЊрЃљрЃЋрЃўрЃЌрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ.\" рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў: рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ.",
