    title:  "2023 рЃгрЃџрЃўрЃА 10 рЃЏрЃљрЃарЃбрЃА - рЃарЃљрЃЊрЃўрЃЮ \"рЃљрЃГрЃљрЃарЃўрЃА\" рЃАрЃљрЃљрЃЋрЃбрЃЮрЃарЃЮ рЃњрЃљрЃЊрЃљрЃфрЃћрЃЏрЃљрЃерЃў \" рЃдрЃўрЃљ рЃћрЃЌрЃћрЃарЃў'' - 13 рЃАрЃљрЃљрЃЌрЃАрЃљ рЃЊрЃљ 10 рЃгрЃБрЃЌрЃќрЃћ!",
    briefText: "2023 рЃгрЃџрЃўрЃА 10 рЃЏрЃљрЃарЃбрЃА - рЃарЃљрЃЊрЃўрЃЮ \"рЃљрЃГрЃљрЃарЃўрЃА\" рЃАрЃљрЃљрЃЋрЃбрЃЮрЃарЃЮ рЃњрЃљрЃЊрЃљрЃфрЃћрЃЏрЃљрЃерЃў \" рЃдрЃўрЃљ рЃћрЃЌрЃћрЃарЃў'' - 13 рЃАрЃљрЃљрЃЌрЃАрЃљ рЃЊрЃљ 10 рЃгрЃБрЃЌрЃќрЃћ!\n рЃњрЃљрЃЊрЃљрЃфрЃћрЃЏрЃљрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃюрЃћрЃю:\n --рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћ , рЃгрЃЏ. рЃўрЃЮрЃљрЃюрЃћ рЃдрЃЌрЃўрЃАрЃЏрЃћрЃбрЃДрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃАрЃБрЃџрЃўрЃћрЃарЃЮ рЃАрЃћрЃЏрЃўрЃюрЃљрЃарЃўрЃўрЃА рЃљрЃАрЃЮрЃфрЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃърЃарЃЮрЃцрЃћрЃАрЃЮрЃарЃў , рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃў , рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ ...\n - рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў -\n рЃљрЃюрЃљ рЃФрЃюрЃћрЃџрЃљрЃФрЃћ,\n рЃюрЃўрЃЎрЃљ рЃЏрЃЪрЃљрЃЋрЃљрЃюрЃљрЃФрЃћ,\n рЃЌрЃћрЃЏрЃЮ рЃерЃљрЃарЃљрЃЉрЃўрЃФрЃћ...\n #рЃЌрЃћрЃЏрЃљ: рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃћрЃЋрЃарЃЮрЃърЃБрЃџрЃў рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў - рЃЕрЃЋрЃћрЃю рЃЋрЃўрЃарЃЕрЃћрЃЋрЃЌ рЃћрЃЋрЃарЃЮрЃърЃљрЃА! рЃљрЃарЃљ рЃарЃБрЃАрЃћрЃЌрЃА ! рЃарЃБрЃАрЃћрЃЌрЃў рЃЮрЃЎрЃБрЃърЃљрЃюрЃбрЃўрЃљ..\n -рЃарЃЮрЃњрЃЮрЃа рЃћрЃАрЃЏрЃўрЃЌ рЃЏрЃЮрЃќрЃљрЃарЃЊрЃћрЃЉрЃА рЃћрЃЋрЃарЃЮрЃърЃБрЃџрЃў рЃдрЃўрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃћрЃЉрЃў?\n -рЃарЃљрЃбрЃЮрЃЏ рЃЏрЃўрЃЋрЃўрЃџрЃбрЃЋрЃўрЃЌ рЃћрЃЋрЃарЃЮрЃърЃўрЃАрЃЎрЃћрЃю ?\n -рЃарЃљрЃбрЃЮрЃЏ рЃљрЃарЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃў рЃћрЃЋрЃарЃЮрЃўрЃюрЃбрЃћрЃњрЃарЃљрЃфрЃўрЃўрЃА рЃърЃарЃЮрЃфрЃћрЃАрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃАрЃЌрЃЋрЃўрЃА?\n -рЃарЃЮрЃњрЃЮрЃа рЃўрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃБрЃљрЃ«рЃџрЃћрЃАрЃў рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃЦрЃарЃЮрЃюрЃўрЃЎрЃћрЃЉрЃў рЃАрЃЎрЃЮрЃџрЃћрЃЉрЃерЃў ?\n - рЃарЃЮрЃњрЃЮрЃа рЃЊрЃљрЃњрЃЋрЃљрЃерЃЮрЃарЃљ 70- рЃгрЃџрЃўрЃљрЃюрЃЏрЃљ рЃАрЃљрЃЉрЃГрЃЮрЃЌрЃљ рЃЮрЃЎрЃБрЃърЃљрЃфрЃўрЃљрЃЏ рЃћрЃЋрЃарЃЮрЃърЃБрЃџ рЃЮрЃ»рЃљрЃ«рЃА ?\n рЃЕрЃљрЃюрЃљрЃгрЃћрЃарЃў рЃўрЃ«. https://ajaratv.ge/video/13062...\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃЏрЃўрЃюрЃЊрЃљрЃљрЃюрЃЊрЃарЃўрЃљрЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃАрЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃАрЃЎрЃЮрЃџрЃљ\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃљ\n #рЃћрЃарЃЌрЃљрЃЊрЃЋрЃўрЃЏрЃАрЃ»рЃћрЃџрЃЮрЃЌрЃЊрЃљрЃЋрЃўрЃќрЃарЃБрЃюрЃЮрЃЌрЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃќрЃћ\n #рЃдрЃўрЃљрЃћрЃЌрЃћрЃарЃў\n #рЃарЃБрЃАрЃћрЃЌрЃўрЃЮрЃЎрЃБрЃърЃљрЃюрЃбрЃўрЃљ\n #рЃЕрЃЋрЃћрЃюрЃЋрЃўрЃарЃЕрЃћрЃЋрЃЌрЃћрЃЋрЃарЃЮрЃърЃљрЃА!\n #рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃАрЃћрЃЋрЃарЃЮрЃърЃБрЃџрЃўрЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў",
