    title:  "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃфрЃ«рЃарЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃџрЃБрЃЎрЃљ рЃБрЃЕрЃљрЃюрЃћрЃўрЃерЃЋрЃўрЃџрЃў рЃЊрЃљ рЃњрЃўрЃЮрЃарЃњрЃў рЃфрЃўрЃюрЃфрЃљрЃФрЃћ 2023 рЃгрЃџрЃўрЃА рЃљрЃњрЃЋрЃўрЃАрЃбрЃЮрЃерЃў рЃњрЃљрЃћрЃЏрЃњрЃќрЃљрЃЋрЃарЃћрЃЉрЃўрЃљрЃю рЃЌрЃБрЃарЃЦрЃћрЃЌрЃўрЃА рЃАрЃљрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃЮ рЃЉрЃљрЃюрЃљрЃЎрЃерЃў. рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљрЃА рЃгрЃљрЃарЃЏрЃљрЃарЃЌрЃљрЃЋрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃљ \"рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЏрЃћрЃњрЃЮрЃЉрЃарЃЮрЃЉрЃљ рЃАрЃљрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃњрЃќрЃўрЃЌ\".",
    briefText: "рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ, рЃарЃЮрЃЏ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃЮ рЃЉрЃљрЃюрЃљрЃЎрЃерЃў рЃњрЃљрЃЏрЃњрЃќрЃљрЃЋрЃарЃћрЃЉрЃљ рЃЊрЃўрЃЊрЃў рЃерЃарЃЮрЃЏрЃўрЃА, рЃАрЃгрЃљрЃЋрЃџрЃўрЃА, рЃЏрЃЮрЃюрЃЊрЃЮрЃЏрЃћрЃЉрЃўрЃА, рЃарЃЌрЃБрЃџрЃљрЃЊ рЃњрЃљрЃЊрЃљрЃАрЃљрЃџрЃљрЃ«рЃў рЃњрЃќрЃўрЃА рЃЊрЃљрЃФрЃџрЃћрЃЋрЃўрЃА рЃерЃћрЃЊрЃћрЃњрЃљрЃЊ рЃЊрЃљрЃўрЃЏрЃАрЃљрЃ«рЃБрЃарЃћрЃА!\n рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃџрЃБрЃЎрЃљрЃА рЃЊрЃљ рЃњрЃўрЃЮрЃарЃњрЃўрЃА!\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃЏрЃўрЃюрЃЊрЃљрЃљрЃюрЃЊрЃарЃўрЃљрЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃАрЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃАрЃЎрЃЮрЃџрЃљ",
