    title:  "21 рЃЏрЃљрЃарЃбрЃў - рЃЊрЃљрЃБрЃюрЃўрЃА рЃАрЃўрЃюрЃЊрЃарЃЮрЃЏрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћ! \"рЃЏрЃћрЃњрЃЮрЃЉрЃарЃћрЃЉрЃў рЃЦрЃарЃЮрЃЏрЃЮрЃАрЃЮрЃЏрЃћрЃЉрЃА рЃљрЃа рЃўрЃЌрЃЋрЃџрЃўрЃљрЃю!\"",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА X-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃюрЃљрЃюрЃљ рЃГрЃћрЃџрЃўрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃФрЃљрЃџрЃўрЃљрЃю рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌрЃў рЃАрЃљрЃ«рЃљрЃџрЃўрЃАрЃЮ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃљ рЃЊрЃљрЃњрЃћрЃњрЃЏрЃћрЃА рЃЊрЃљ рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃЏрЃћрЃ«рЃБрЃЌрЃћ рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА.\n #рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃА\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃЏрЃўрЃюрЃЊрЃљрЃљрЃюрЃЊрЃарЃўрЃљрЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃАрЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃАрЃЎрЃЮрЃџрЃљ\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃљ\n #рЃЏрЃћрЃњрЃЮрЃЉрЃарЃћрЃЉрЃўрЃЦрЃарЃЮрЃЏрЃЮрЃАрЃЮрЃЏрЃћрЃЉрЃАрЃљрЃарЃўрЃЌрЃЋрЃЎрЃўрЃљрЃю",
