    briefText: "2023 рЃгрЃџрЃўрЃА 21 рЃЏрЃљрЃарЃбрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃгрЃљрЃЏрЃДрЃЋрЃљрЃюрЃЏрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃерЃЮрЃарЃћрЃюрЃљ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃћрЃЏ рЃАрЃљрЃЏрЃБрЃерЃљрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃЕрЃљрЃљрЃбрЃљрЃарЃљ рЃЎрЃЮрЃџрЃћрЃњрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃБрЃцрЃарЃЮрЃАрЃЎрЃџрЃљрЃАрЃћрЃџрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ:\n \"рЃерЃбрЃарЃљрЃБрЃА-рЃ░рЃЮрЃЋрЃўрЃА\" рЃЌрЃљрЃЮрЃЉрЃљрЃЌрЃљ рЃЌрЃћрЃЮрЃарЃўрЃљ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃњрЃюрЃћрЃЉрЃўрЃА рЃърЃћрЃарЃАрЃърЃћрЃЦрЃбрЃўрЃЋрЃўрЃЊрЃљрЃю.\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃЏрЃўрЃюрЃЊрЃљрЃљрЃюрЃЊрЃарЃўрЃљрЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃАрЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃАрЃЎрЃЮрЃџрЃљ\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃљ",
