    title:  "рЃЦ. рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА, рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VII-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ \"рЃЕрЃЋрЃћрЃю рЃљрЃа рЃЋрЃўрЃЌрЃЋрЃџрЃўрЃЌ рЃЦрЃарЃЮрЃЏрЃЮрЃАрЃЮрЃЏрЃћрЃЉрЃА\" рЃ»рЃњрЃБрЃцрЃБрЃарЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃўрЃА рЃцрЃЮрЃарЃЏрЃљрЃбрЃерЃў, рЃЊрЃљрЃБрЃюрЃўрЃА рЃАрЃўрЃюрЃЊрЃарЃЮрЃЏрЃўрЃА рЃЌрЃљрЃЋрЃўрЃАрЃћрЃЉрЃБрЃарЃћрЃЉрЃћрЃЉрЃўрЃА рЃњрЃљрЃфрЃюрЃЮрЃЉрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ, рЃўрЃЏрЃАрЃ»рЃћрЃџрЃћрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ: рЃарЃЮрЃњрЃЮрЃа рЃерЃћрЃЋрЃЦрЃЏрЃюрЃљрЃЌ рЃўрЃюрЃЎрЃџрЃБрЃќрЃўрЃБрЃарЃў рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃАрЃћрЃарЃЋрЃўрЃАрЃћрЃЉрЃў?",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ, рЃЏрЃАрЃ»рЃћрЃџрЃЮрЃЉрЃўрЃА рЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃў рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃ»рЃњрЃБрЃцрЃБрЃарЃў рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃўрЃА рЃАрЃљрЃ«рЃўрЃЌ.\n рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў: рЃљрЃюрЃљ рЃљрЃюрЃБрЃерЃўрЃФрЃћ\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃЏрЃўрЃюрЃЊрЃљрЃљрЃюрЃЊрЃарЃўрЃљрЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃАрЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃАрЃЎрЃЮрЃџрЃљ\n #рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃљ"
