    title: "2023 рЃгрЃџрЃўрЃА 23 рЃЏрЃљрЃарЃбрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃфрЃ«рЃарЃћ рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃЌрЃљрЃю рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃЮрЃўрЃФрЃћрЃАрЃљ рЃЊрЃљ рЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃЦрЃљрЃ»рЃљрЃўрЃљрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃў / B S U -рЃА рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃЊрЃюрЃћрЃю, рЃАрЃљрЃЊрЃљрЃф рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю рЃфрЃюрЃЮрЃЉрЃўрЃџ рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃърЃарЃЮрЃцрЃћрЃАрЃЮрЃарЃА рЃЦрЃљрЃџрЃЉрЃљрЃбрЃЮрЃю рЃЌрЃўрЃюрЃљ рЃерЃўрЃЮрЃерЃЋрЃўрЃџрЃА.",
    briefText: "рЃЦрЃљрЃџрЃЉрЃљрЃбрЃЮрЃюрЃЏрЃљ рЃЌрЃўрЃюрЃљрЃЏ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃЌрЃљрЃю рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮрЃЊ рЃЊрЃљ рЃЊрЃљрЃАрЃљрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃћрЃЉрЃџрЃљрЃЊ рЃўрЃАрЃљрЃБрЃЉрЃарЃљ рЃЌрЃћрЃЏрЃљрЃќрЃћ \"рЃгрЃДрЃџрЃўрЃА рЃЎрЃБрЃџрЃбрЃў рЃЦрЃљрЃарЃЌрЃБрЃџ рЃЏрЃўрЃЌрЃЮрЃџрЃЮрЃњрЃўрЃљрЃАрЃљ рЃЊрЃљ рЃцрЃЮрЃџрЃЎрЃџрЃЮрЃарЃерЃў\"."
