    title: "рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃАрЃљ рЃЊрЃљ рЃЎрЃЮрЃЏрЃърЃљрЃюрЃўрЃљ English Book Education-рЃўрЃА рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў, рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃЊрЃљ рЃћрЃарЃЌ-рЃћрЃарЃЌрЃў рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃБрЃџрЃў рЃърЃарЃЮрЃћрЃЦрЃбрЃў: TOEFL рЃбрЃћрЃАрЃбрЃўрЃА рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃљ.\nTOEFL рЃЏрЃАрЃЮрЃцрЃџрЃўрЃЮрЃерЃў рЃДрЃЋрЃћрЃџрЃљрЃќрЃћ рЃљрЃдрЃўрЃљрЃарЃћрЃЉрЃБрЃџрЃў рЃЉрЃарЃћрЃюрЃЊрЃўрЃљ рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃў рЃћрЃюрЃўрЃА рЃерЃћрЃцрЃљрЃАрЃћрЃЉрЃўрЃА рЃЎрЃБрЃЌрЃ«рЃўрЃЌ.",
    briefText: "рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ, рЃарЃЮрЃЏ TOEFL рЃбрЃћрЃАрЃбрЃўрЃА рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃљ рЃљрЃГрЃљрЃарЃљрЃерЃў рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ.\nрЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃљ рЃАрЃљрЃЏ рЃбрЃБрЃарЃљрЃЊ рЃЊрЃљрЃўрЃњрЃћрЃњрЃЏрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃЊрЃљ рЃЊрЃљ рЃЎрЃЮрЃЏрЃърЃљрЃюрЃўрЃљ ,,English Book Education\" -рЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃћрЃџрЃЌрЃљ рЃЏрЃўрЃћрЃа. рЃбрЃћрЃАрЃбрЃў рЃЊрЃљ рЃерЃћрЃцрЃљрЃАрЃћрЃЉрЃљ рЃЌрЃљрЃюрЃљрЃЏрЃћрЃЊрЃарЃЮрЃЋрЃћ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃАрЃбрЃљрЃюрЃЊрЃљрЃарЃбрЃўрЃА рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃў рЃўрЃДрЃЮ.\n 2023 рЃгрЃџрЃўрЃА 24 рЃЏрЃљрЃарЃбрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃЊрЃюрЃћрЃю TOEFL рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃАрЃћрЃарЃбрЃўрЃцрЃўрЃЎрЃљрЃбрЃћрЃЉрЃўрЃЌ.\nрЃЮрЃЌрЃ«рЃў рЃБрЃЏрЃљрЃдрЃџрЃћрЃАрЃў рЃЦрЃБрЃџрЃўрЃА рЃЏрЃЦрЃЮрЃюрЃћ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА рЃЏрЃўрЃўрЃдрЃћрЃЉрЃА рЃЮрЃарЃЎрЃЋрЃўрЃарЃўрЃљрЃю рЃАрЃљрЃќрЃљрЃцрЃ«рЃБрЃџрЃЮ рЃАрЃЎрЃЮрЃџрЃљрЃерЃў, рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃЉрЃарЃўрЃбрЃљрЃюрЃБрЃџрЃў рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃЏрЃљрЃАрЃърЃўрЃюрЃФрЃџрЃЮрЃЉрЃА."
