    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃў рЃгрЃўрЃњрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃБрЃЏрЃљрЃдрЃџрЃћрЃАрЃў рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљрЃА - РђюBatumi Book & Higher Education 2023РђЮ рЃЏрЃљрЃАрЃърЃўрЃюрЃФрЃџрЃЮрЃЉрЃА.\nрЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ рЃгрЃўрЃњрЃюрЃўрЃА рЃЎрЃўрЃЌрЃ«рЃЋрЃўрЃА рЃърЃЮрЃърЃБрЃџрЃљрЃарЃўрЃќрЃљрЃфрЃўрЃљ, рЃАрЃљрЃњрЃљрЃЏрЃЮрЃЏрЃфрЃћрЃЏрЃџрЃЮ рЃАрЃћрЃЦрЃбрЃЮрЃарЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃ«рЃћрЃџрЃерЃћрЃгрЃДрЃЮрЃЉрЃљ рЃЊрЃљ рЃЌрЃљрЃюрЃљрЃЏрЃћрЃЊрЃарЃЮрЃЋрЃћ рЃбрЃћрЃЦрЃюрЃЮрЃџрЃЮрЃњрЃўрЃћрЃЉрЃўрЃА рЃњрЃљрЃфрЃюрЃЮрЃЉрЃљ. рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃљ рЃЊрЃљ рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌ-рЃњрЃљрЃАрЃљрЃарЃЌрЃЮрЃЉрЃў рЃърЃарЃЮрЃњрЃарЃљрЃЏрЃћрЃЉрЃў.",
    briefText: "рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљ рЃЎрЃЮрЃЏрЃърЃљрЃюрЃўрЃљ РђюExpo BatumiРђЮ-рЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃўрЃЏрЃљрЃарЃЌрЃћрЃЉрЃљ.\nрЃЕрЃЋрЃћрЃюрЃЌрЃЋрЃўрЃА рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃўрЃљ, рЃарЃЮрЃЏ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃБрЃџрЃў рЃбрЃћрЃЦрЃюрЃЮрЃџрЃЮрЃњрЃўрЃћрЃЉрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃЎрЃљрЃ«рЃў рЃЎрЃљрЃ«рЃўрЃФрЃћ рЃЊрЃљ рЃБрЃцрЃарЃЮрЃАрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃў рЃљрЃЦрЃбрЃўрЃБрЃарЃљрЃЊ рЃљрЃарЃўрЃљрЃю рЃЕрЃљрЃарЃЌрЃБрЃџрЃў рЃљрЃЏ рЃЏрЃюрЃўрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃЊрЃљ рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌ рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљрЃерЃў."
