    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃБрЃцрЃарЃЮрЃАрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃў рЃЊрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў рЃюрЃљрЃбрЃљрЃџрЃўрЃљ рЃцрЃарЃБрЃўрЃФрЃћ рЃЊрЃљ рЃЎрЃљрЃ«рЃў рЃЎрЃљрЃ«рЃўрЃФрЃћ рЃЮрЃарЃў рЃЊрЃдрЃћрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў рЃўрЃДрЃЋрЃюрЃћрЃю рЃЕрЃљрЃарЃЌрЃБрЃџрЃў рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃћрЃЉрЃерЃў."
