    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃгрЃџрЃўрЃЊрЃљрЃю рЃюрЃћрЃЉрЃўрЃАрЃЏрЃўрЃћрЃа рЃЏрЃАрЃБрЃарЃЋрЃћрЃџрЃА рЃерЃћрЃБрЃФрЃџрЃўрЃљ рЃЊрЃљрЃћрЃБрЃцрЃџрЃЮрЃА рЃЉрЃћрЃарЃФрЃюрЃБрЃџ рЃћрЃюрЃљрЃАрЃљ рЃЊрЃљ рЃЎрЃБрЃџрЃбрЃБрЃарЃљрЃА.рЃЎрЃБрЃарЃАрЃА рЃБрЃФрЃдрЃЋрЃћрЃЉрЃљ рЃЉрЃћрЃарЃФрЃюрЃБрЃџрЃў рЃћрЃюрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў, рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃў рЃюрЃўрЃюрЃЮ рЃФрЃюрЃћрЃџрЃљрЃФрЃћ.",
    briefText: "2023 рЃгрЃџрЃўрЃА 27 рЃЏрЃљрЃарЃбрЃА рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃА рЃАрЃљрЃЎрЃарЃћрЃЉрЃБрЃџрЃЮрЃерЃў рЃАрЃљрЃЉрЃћрЃарЃФрЃюрЃћрЃЌрЃўрЃА рЃАрЃљрЃћрЃџрЃЕрЃЮрЃЏ рЃњрЃљрЃЏрЃљрЃарЃЌрЃљ рЃАрЃљрЃЉрЃћрЃарЃФрЃюрЃћрЃЌрЃўрЃА рЃЊрЃљрЃЏрЃЮрЃБрЃЎрЃўрЃЊрЃћрЃЉрЃџрЃЮрЃЉрЃўрЃА 202-рЃћ рЃгрЃџрЃўрЃАрЃЌрЃљрЃЋрЃўрЃАрЃљрЃЊрЃЏрЃў рЃЏрЃўрЃФрЃдрЃЋрЃюрЃўрЃџрЃў рЃАрЃљрЃќрЃћрЃўрЃЏрЃЮ рЃЏрЃўрЃдрЃћрЃЉрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃАрЃЎрЃЮрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃўрЃЌ рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃюрЃўрЃюрЃЮ рЃФрЃюрЃћрЃџрЃљрЃФрЃћ рЃЊрЃљ рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ."
