    title: "2023 рЃгрЃџрЃўрЃА 29 рЃЏрЃљрЃарЃбрЃА рЃФрЃЏрЃћрЃЉрЃў рЃюрЃЮрЃЉрЃћрЃџрЃћрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃбрЃћрЃЦрЃюрЃЮрЃџрЃЮрЃњрЃўрЃБрЃа рЃЏрЃБрЃќрЃћрЃБрЃЏрЃерЃў, ,,рЃАрЃљрЃЏрЃБрЃќрЃћрЃБрЃЏрЃЮ рЃАрЃљрЃљрЃЌрЃўрЃАРђЎРђЎ рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў, рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃњрЃарЃљрЃцрЃўрЃЎрЃЮрЃА-рЃЊрЃўрЃќрЃљрЃўрЃюрЃћрЃарЃўрЃА, рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃўрЃА, рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА-рЃЏрЃБрЃюрЃўрЃфрЃўрЃърЃљрЃџрЃўрЃбрЃћрЃбрЃўрЃА рЃЏрЃћрЃарЃўрЃўрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃБрЃџрЃў рЃњрЃљрЃюрЃљрЃерЃћрЃюрЃўрЃљрЃюрЃћрЃЉрЃўрЃА рЃќрЃЮрЃюрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃДрЃЮрЃцрЃўрЃџрЃћрЃЉрЃўрЃА рЃБрЃцрЃарЃЮрЃАрЃўрЃА, рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃўрЃА рЃАрЃЮрЃцрЃЮ рЃАрЃљрЃюрЃўрЃЎрЃўрЃФрЃўрЃА рЃАрЃљрЃ»рЃљрЃарЃЮ рЃџрЃћрЃЦрЃфрЃўрЃљ рЃЌрЃћрЃЏрЃљрЃќрЃћ: ,,рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃБрЃарЃБрЃџрЃў рЃФрЃћрЃњрЃџрЃћрЃЉрЃў.\"\nрЃЏрЃАрЃЏрЃћрЃюрЃћрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃА рЃњрЃљрЃюрЃАрЃљрЃЎрЃБрЃЌрЃарЃћрЃЉрЃўрЃЌ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃљрЃдрЃЏрЃЮрЃЕрЃюрЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃарЃЦрЃўрЃбрЃћрЃЦрЃбрЃБрЃарЃБрЃџрЃў рЃФрЃћрЃњрЃџрЃћрЃЉрЃўрЃА рЃЏрЃ«рЃљрЃбрЃЋрЃарЃБрЃџ-рЃАрЃбрЃўрЃџрЃўрЃАрЃбрЃБрЃарЃў рЃЏрЃљрЃ«рЃљрЃАрЃўрЃљрЃЌрЃћрЃЉрЃџрЃћрЃЉрЃў, рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃћрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЮрЃЉрЃўрЃА рЃдрЃўрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃљ рЃЊрЃљ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљ.",
    briefText: "рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў.\nрЃАрЃљрЃ»рЃљрЃарЃЮ рЃџрЃћрЃЦрЃфрЃўрЃўрЃА рЃърЃљрЃарЃљрЃџрЃћрЃџрЃБрЃарЃљрЃЊ рЃЋрЃўрЃќрЃўрЃбрЃЮрЃарЃћрЃЉрЃА рЃАрЃљрЃерЃБрЃљрЃџрЃћрЃЉрЃљ рЃ░рЃЦрЃЮрЃюрЃЊрЃљрЃЌ рЃЊрЃљрЃћрЃЌрЃЋрЃљрЃџрЃўрЃћрЃарЃћрЃЉрЃўрЃюрЃљрЃЌ рЃАрЃљрЃћрЃЦрЃАрЃърЃЮрЃќрЃўрЃфрЃўрЃЮ рЃЊрЃљрЃарЃЉрЃљрЃќрЃерЃў рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃўрЃџрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃдрЃўрЃарЃерЃћрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃў рЃЎрЃБрЃџрЃбрЃБрЃарЃБрЃџрЃў рЃЏрЃћрЃЏрЃЎрЃЋрЃўрЃЊрЃарЃћрЃЮрЃЉрЃўрЃА рЃФрЃћрЃњрЃџрЃћрЃЉрЃўрЃА рЃцрЃЮрЃбрЃЮрЃћрЃЉрЃў."
