    title: "2023 рЃгрЃџрЃўрЃА 30 рЃЏрЃљрЃарЃбрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃерЃћрЃЊрЃњрЃљ рЃърЃЮрЃћрЃб рЃбрЃљрЃарЃўрЃћрЃџ рЃ«рЃљрЃарЃ«рЃћрЃџрЃљрЃБрЃарЃўрЃА рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃАрЃљрЃдрЃљрЃЏрЃЮ.\nрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃърЃЮрЃћрЃбрЃўрЃА рЃџрЃћрЃЦрЃАрЃћрЃЉрЃў, рЃерЃћрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃЏрЃўрЃА рЃџрЃћрЃЦрЃАрЃћрЃЉрЃќрЃћ рЃерЃћрЃЦрЃЏрЃюрЃўрЃџрЃў рЃАрЃўрЃЏрЃдрЃћрЃарЃћрЃЉрЃў; рЃЏрЃЮрЃгрЃЋрЃћрЃБрЃџрЃЏрЃљ рЃАрЃљрЃърЃљрЃбрЃўрЃЮ рЃАрЃбрЃБрЃЏрЃарЃћрЃЉрЃЏрЃљ, рЃЉрЃљрЃбрЃЮрЃю рЃбрЃљрЃарЃўрЃћрЃџрЃўрЃА рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃА рЃЌрЃљрЃДрЃЋрЃљрЃюрЃўрЃАрЃЏрЃфрЃћрЃЏрЃџрЃћрЃЉрЃЏрЃљ, рЃЊрЃўрЃЊрЃў рЃАрЃўрЃЌрЃЉрЃЮ рЃЊрЃљ рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃў рЃњрЃљрЃЏрЃЮрЃ«рЃљрЃбрЃћрЃА рЃърЃЮрЃћрЃбрЃўрЃА рЃЏрЃўрЃЏрЃљрЃарЃЌ!",
    briefText: "рЃЉрЃљрЃбрЃЮрЃю рЃбрЃљрЃарЃўрЃћрЃџрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃЕрЃљрЃЏрЃЮрЃЉрЃарЃФрЃљрЃюрЃЊрЃюрЃћрЃю рЃЏрЃўрЃАрЃў рЃЏрЃћрЃБрЃдрЃџрЃћ рЃЏрЃљрЃарЃўрЃюрЃљ рЃ«рЃљрЃарЃ«рЃћрЃџрЃљрЃБрЃарЃў, рЃцрЃўрЃџрЃЮрЃџрЃЮрЃњрЃў рЃџрЃўрЃљ рЃЌрЃБрЃерЃБрЃарЃў рЃЊрЃљ рЃЎрЃљрЃЋрЃЎрЃљрЃАрЃўрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃўрЃЮрЃарЃўрЃАрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃарЃћрЃЦрЃбрЃЮрЃарЃўрЃА рЃЏрЃарЃЕрЃћрЃЋрЃћрЃџрЃў рЃњрЃўрЃЮрЃарЃњрЃў рЃцрЃљрЃарЃћрЃерЃўрЃерЃЋрЃўрЃџрЃў.\nрЃЊрЃдрЃћ - рЃърЃЮрЃћрЃќрЃўрЃўрЃА рЃќрЃћрЃўрЃЏрЃўрЃАрЃљ рЃЊрЃўрЃЊрЃ«рЃљрЃюрЃА рЃћрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃћрЃЉрЃљ рЃЏрЃарЃљрЃЋрЃљрЃџрЃарЃўрЃфрЃ«рЃЮрЃЋрЃљрЃю рЃљрЃБрЃЊрЃўрЃбрЃЮрЃарЃўрЃљрЃА!"
