    title: "рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃћрЃЦрЃАрЃЎрЃБрЃарЃАрЃўрЃљ рЃерЃърЃА \"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃДрЃљрЃџрЃерЃў\".\n2023 рЃгрЃџрЃўрЃА 5 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ.рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА IX-6 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЏрЃЮрЃћрЃгрЃДрЃЮ рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃћрЃЦрЃАрЃЎрЃБрЃарЃАрЃўрЃљ-рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃерЃърЃА \"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃДрЃџрЃўрЃА\" рЃЦрЃўрЃЏрЃўрЃБрЃа -рЃЉрЃљрЃЦрЃбрЃћрЃарЃўрЃЮрЃџрЃЮрЃњрЃўрЃБрЃа рЃџрЃљрЃЉрЃЮрЃарЃљрЃбрЃЮрЃарЃўрЃљрЃерЃў (рЃЦрЃўрЃЏрЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃўрЃарЃўрЃюрЃљ рЃЋрЃўрЃЊрЃБрЃџрЃўрЃюрЃљ).",
    briefText: "рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ \"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃДрЃџрЃўрЃА\" рЃџрЃљрЃЉрЃЮрЃарЃљрЃбрЃЮрЃарЃўрЃўрЃА рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃћрЃЉрЃЏрЃљ рЃФрЃљрЃџрЃўрЃљрЃю рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЊрЃљ рЃЊрЃљрЃАрЃљрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃћрЃЉрЃћрЃџрЃў рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљ рЃЏрЃўрЃљрЃгрЃЮрЃЊрЃћрЃА рЃЉрЃљрЃЋрЃерЃЋрЃћрЃЉрЃА. рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃљрЃЊрЃњрЃўрЃџрЃќрЃћ рЃњрЃљрЃћрЃфрЃюрЃћрЃю рЃАрЃљрЃАрЃЏрЃћрЃџрЃў рЃгрЃДрЃџрЃўрЃА рЃЎрЃЋрЃџрЃћрЃЋрЃћрЃЉрЃА.\nрЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃЋрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃДрЃљрЃџрЃў Рђб Batumis Tskali рЃЊрЃљ рЃЋрЃўрЃбрЃЮрЃЋрЃћрЃЉрЃЌ рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃџрЃЮрЃЉрЃўрЃА рЃўрЃЏрЃћрЃЊрЃА!\n#рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃЏрЃўрЃюрЃЊрЃљрЃљрЃюрЃЊрЃарЃўрЃљрЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃАрЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃАрЃЎрЃЮрЃџрЃљ\n#рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮрЃћрЃЦрЃАрЃЎрЃБрЃарЃАрЃўрЃљ\n#рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃДрЃљрЃџрЃў"
