    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃљрЃА рЃњрЃљрЃЊрЃўрЃљрЃю рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЉрЃАрЃБ-рЃА рЃцрЃАрЃўрЃЦрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃцрЃљрЃЎрЃБрЃџрЃбрЃћрЃбрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃћрЃЉрЃў рЃћрЃџрЃўрЃАрЃљрЃЉрЃћрЃЊ рЃЏрЃљрЃЏрЃБрЃџрЃљрЃФрЃћ рЃЊрЃљ рЃЏрЃљрЃарЃўрЃљрЃЏ рЃЌрЃљрЃЋрЃЉрЃћрЃарЃўрЃФрЃћ.",
    briefText: "2023 рЃгрЃџрЃўрЃА 6 рЃљрЃърЃарЃўрЃџрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃћрЃЉрЃЏрЃљ рЃЏрЃћ-9 рЃЎрЃџрЃљрЃАрЃћрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃА рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ: \"рЃЏрЃћрЃюрЃбрЃљрЃџрЃБрЃарЃў рЃ»рЃљрЃюрЃЏрЃарЃЌрЃћрЃџрЃЮрЃЉрЃўрЃА рЃерЃћрЃюрЃљрЃарЃЕрЃБрЃюрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃљрЃГрЃўрЃарЃЮ рЃБрЃюрЃљрЃарЃћрЃЉрЃў\"."
