    title: "2023 рЃгрЃџрЃўрЃА 8 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЏрЃљрЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃўрЃА рЃерЃўрЃЊрЃљ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃљ рЃЊрЃљрЃгрЃДрЃћрЃЉрЃўрЃЌрЃў рЃАрЃљрЃцрЃћрЃ«рЃБрЃарЃўрЃА (II-VI рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА) рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА. рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃерЃў рЃџрЃЮрЃњрЃўрЃЎрЃБрЃарЃў рЃљрЃќрЃарЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА, рЃЊрЃљрЃЏрЃЮрЃБрЃЎрЃўрЃЊрЃћрЃЉрЃћрЃџрЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃўрЃА рЃБрЃюрЃљрЃа-рЃЕрЃЋрЃћрЃЋрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃљ, рЃАрЃљрЃњрЃюрЃўрЃАрЃљрЃЊрЃЏрЃў рЃЊрЃљрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃЊрЃљрЃЏрЃЮрЃЎрЃўрЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃўрЃА, рЃўрЃюрЃбрЃћрЃарЃћрЃАрЃўрЃА рЃњрЃљрЃдрЃЋрЃўрЃЋрЃћрЃЉрЃљ, рЃљрЃАрЃћрЃЋрЃћ, рЃДрЃЮрЃЋрЃћрЃџрЃЊрЃдрЃўрЃБрЃа рЃфрЃ«рЃЮрЃЋрЃарЃћрЃЉрЃљрЃерЃў рЃЏрЃљрЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃўрЃА рЃњрЃљрЃЏрЃЮрЃДрЃћрЃюрЃћрЃЉрЃўрЃА рЃњрЃљрЃљрЃќрЃарЃћрЃЉрЃљ.",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃерЃћрЃФрЃџрЃћрЃЉрЃћрЃю, рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃљрЃерЃў рЃЏрЃўрЃдрЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃћрЃЉрЃљ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃЮрЃю рЃАрЃЎрЃЮрЃџрЃўрЃАрЃњрЃљрЃарЃћрЃерЃћ рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃљрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃўрЃАрЃљрЃА."
