    briefText: "рЃЏрЃћрЃњрЃЮрЃЉрЃарЃћрЃЉрЃЮ!\nрЃЏрЃЮрЃњрЃЏрЃљрЃарЃЌрЃљрЃЋрЃЌ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА,\nрЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃА,\nрЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃА,\nрЃДрЃЮрЃцрЃўрЃџ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃА!\nрЃЎрЃЋрЃџрЃљрЃЋ рЃБрЃюрЃЊрЃљ рЃњрЃљрЃЋрЃћрЃарЃЌрЃўрЃљрЃюрЃЊрЃћрЃЌ рЃћрЃарЃЌрЃў рЃърЃљрЃбрЃљрЃарЃљ рЃЊрЃљ рЃЏрЃљрЃЏрЃљрЃфрЃў рЃњрЃЮрЃњрЃЮрЃюрЃљрЃА рЃЊрЃљрЃАрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃџрЃљрЃЊ!\nрЃЌрЃўрЃЉрЃўрЃАрЃў:\n#GE71TB7009945063600061\nрЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮ:\n#GE66BG0000000365875183\nрЃЌрЃљрЃЏрЃљрЃа рЃЦрЃљрЃЌрЃљрЃЏрЃљрЃФрЃћ\n(рЃъ/рЃю 61004052484) \n#рЃАрЃўрЃЎрЃћрЃЌрЃћ_рЃњрЃљрЃЊрЃљрЃЏрЃЊрЃћрЃЉрЃўрЃљ!\n#рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃўрЃЋрЃћрЃарЃЌрЃўрЃљрЃюрЃЊрЃћрЃЉрЃўрЃЌрЃўрЃЮрЃљрЃюрЃљрЃАрЃЌрЃЋрЃўрЃА!\nрЃњрЃљрЃарЃЊрЃљ рЃЏрЃўрЃЌрЃўрЃЌрЃћрЃЉрЃБрЃџрЃў рЃљрЃюрЃњрЃљрЃарЃўрЃерЃћрЃЉрЃўрЃАрЃљ, рЃерЃћрЃЏрЃЮрЃгрЃўрЃарЃБрЃџрЃЮрЃЉрЃўрЃА рЃњрЃљрЃдрЃћрЃЉрЃљрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃўрЃф рЃерЃћрЃФрЃџрЃћрЃЉрЃЌ рЃљрЃЏ рЃћрЃарЃЌрЃў рЃЎрЃЋрЃўрЃарЃўрЃА рЃЏрЃљрЃюрЃФрЃўрЃџрЃќрЃћ ( рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃљрЃЊрЃњрЃўрЃџрЃљрЃА рЃњрЃљрЃюрЃЋрЃљрЃЌрЃљрЃЋрЃАрЃћрЃЉрЃЌ рЃДрЃБрЃџрЃљрЃЉрЃћрЃЉрЃА), рЃљрЃАрЃћрЃЋрЃћ, рЃЎрЃЮрЃюрЃфрЃћрЃарЃбрЃўрЃА рЃЏрЃАрЃЋрЃџрЃћрЃџрЃЮрЃЉрЃўрЃАрЃљрЃА!"
