    title: "рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃљ РђърЃЌрЃўрЃ«рЃўрЃА рЃгрЃўрЃњрЃюрЃћрЃЉрЃўрЃЊрЃљрЃю рЃљрЃБрЃЊрЃўрЃЮ-рЃгрЃўрЃњрЃюрЃћрЃЉрЃљрЃЏрЃЊрЃћРђю.рЃгрЃўрЃњрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃљрЃЋрЃбрЃЮрЃарЃЮ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃЊрЃдрЃћрЃА, 23 рЃљрЃърЃарЃўрЃџрЃА, рЃАрЃАрЃўрЃъ рЃљрЃГрЃљрЃарЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃарЃЦрЃћрЃЮрЃџрЃЮрЃњрЃўрЃБрЃа рЃЏрЃБрЃќрЃћрЃБрЃЏрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ IV рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃљ РђърЃЌрЃўрЃ«рЃўрЃА рЃгрЃўрЃњрЃюрЃћрЃЉрЃўрЃЊрЃљрЃю рЃљрЃБрЃЊрЃўрЃЮ-рЃгрЃўрЃњрЃюрЃћрЃЉрЃљрЃЏрЃЊрЃћРђю.",
    briefText: "рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃљрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў-рЃЏрЃљрЃарЃўрЃљрЃЏ рЃюрЃўрЃюрЃўрЃФрЃћ,\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃћ,\nрЃЌрЃћрЃЎрЃџрЃљ рЃерЃљрЃерЃўрЃЎрЃљрЃФрЃћ,\nрЃљрЃюрЃљ рЃАрЃљрЃарЃ»рЃЋрЃћрЃџрЃљрЃФрЃћ,\nрЃюрЃўрЃЎрЃљ рЃЉрЃљрЃарЃљрЃЏрЃўрЃФрЃћ,\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃ»рЃљрЃюрЃДрЃљрЃарЃљрЃерЃЋрЃўрЃџрЃў,\nрЃџрЃўрЃџрЃћ рЃЎрЃўрЃЎрЃюрЃљрЃФрЃћ,\nрЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃарЃБрЃ«рЃљрЃФрЃћ\nрЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃЏрЃљ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃЏрЃЮрЃ«рЃАрЃћрЃюрЃћрЃЉрЃћрЃЉрЃў:\n\"рЃЋрЃћрЃцрЃ«рЃўрЃАрЃбрЃДрЃљрЃЮрЃАрЃюрЃўрЃА\" рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃћрЃЉрЃў;\nрЃгрЃўрЃњрЃюрЃў \"рЃЦрЃљрЃарЃЌрЃџрЃўрЃА рЃфрЃ«рЃЮрЃЋрЃарЃћрЃЉрЃљ\",\nрЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃўрЃўрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљ,\nрЃЉрЃўрЃЉрЃџрЃўрЃўрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃљ,\nрЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃБрЃџ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃљрЃЌрЃљ рЃфрЃЋрЃљрЃџрЃћрЃЉрЃљрЃЊрЃЮрЃЉрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃљрЃерЃў.\nрЃћрЃА рЃЊрЃдрЃћ, рЃљрЃАрЃћрЃЋрЃћ, рЃгрЃўрЃњрЃюрЃўрЃА рЃЕрЃБрЃЦрЃћрЃЉрЃўрЃА рЃЊрЃдрЃћрЃфрЃљрЃљ рЃЊрЃљ рЃљрЃГрЃљрЃарЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃЏрЃљ рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃўрЃА рЃДрЃЋрЃћрЃџрЃљ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћ рЃЊрЃљрЃљрЃАрЃљрЃЕрЃБрЃЦрЃарЃљ рЃгрЃўрЃњрЃюрЃћрЃЉрЃўрЃЌ.\nрЃгрЃўрЃњрЃюрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃћрЃарЃбрЃўрЃцрЃўрЃЎрЃљрЃбрЃћрЃЉрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃљрЃГрЃљрЃарЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃЏрЃљ рЃЌрЃћрЃЮрЃюрЃљ рЃќрЃЮрЃўрЃФрЃћрЃЏ, рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћрЃЏ рЃўрЃюрЃњрЃљ рЃњрЃЮрЃњрЃўрЃЉрЃћрЃарЃўрЃФрЃћрЃЏ, рЃљрЃарЃЦрЃћрЃЮрЃџрЃЮрЃњрЃўрЃБрЃарЃў рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЏрЃЏрЃљрЃарЃЌрЃЋрЃћрЃџрЃЏрЃљ рЃћрЃЏрЃќрЃљрЃа рЃЎрЃљрЃ«рЃўрЃФрЃћрЃЏ рЃњрЃљрЃЊрЃљрЃАрЃфрЃћрЃА.\nрЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃљ рЃЏрЃЮрЃљрЃЏрЃќрЃљрЃЊрЃљ рЃЊрЃљ рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃарЃЦрЃћрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃћрЃфрЃюрЃўрЃћрЃа-рЃЌрЃљрЃюрЃљрЃЏрЃерЃарЃЮрЃЏрЃћрЃџрЃў рЃюрЃўрЃюрЃЮ рЃФрЃюрЃћрЃџрЃљрЃФрЃћ."
