    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћ-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃћ рЃЊрЃљ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃЊрЃљрЃљрЃЏрЃќрЃљрЃЊрЃћрЃА рЃЊрЃљ рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃгрЃљрЃарЃБрЃЊрЃњрЃўрЃюрЃћрЃА рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃАрЃљрЃ«рЃўрЃА рЃЊрЃдрЃћрЃАрЃљрЃАрЃгрЃљрЃБрЃџрЃўрЃАрЃљрЃЊрЃЏрЃў рЃЏрЃўрЃФрЃдрЃЋрЃюрЃўрЃџрЃў рЃЏрЃўрЃАрЃљрЃџрЃЮрЃфрЃў рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў ( рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃ«рЃљрЃЌрЃБрЃюрЃљ рЃЏрЃљрЃюрЃ»рЃњрЃљрЃџрЃљрЃФрЃћ).",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћ-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃћ рЃЊрЃљ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃЊрЃљрЃљрЃЏрЃќрЃљрЃЊрЃћрЃА рЃЊрЃљ рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃгрЃљрЃарЃБрЃЊрЃњрЃўрЃюрЃћрЃА рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃАрЃљрЃ«рЃўрЃА рЃЊрЃдрЃћрЃАрЃљрЃАрЃгрЃљрЃБрЃџрЃўрЃАрЃљрЃЊрЃЏрЃў рЃЏрЃўрЃФрЃдрЃЋрЃюрЃўрЃџрЃў рЃЏрЃўрЃАрЃљрЃџрЃЮрЃфрЃў рЃЉрЃљрЃарЃљрЃЌрЃћрЃЉрЃў ( рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃ«рЃљрЃЌрЃБрЃюрЃљ рЃЏрЃљрЃюрЃ»рЃњрЃљрЃџрЃљрЃФрЃћ)."
