    title: "2 рЃљрЃърЃарЃўрЃџрЃў - рЃЏрЃАрЃЮрЃцрЃџрЃўрЃЮ рЃљрЃБрЃбрЃўрЃќрЃЏрЃўрЃА рЃфрЃюрЃЮрЃЉрЃљрЃЊрЃЮрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃљ. рЃљрЃърЃарЃўрЃџрЃўрЃА рЃЌрЃЋрЃћ рЃљрЃБрЃбрЃўрЃќрЃЏрЃўрЃА рЃЏрЃАрЃЮрЃцрЃџрЃўрЃЮ рЃЌрЃЋрЃћрЃЊ рЃљрЃарЃўрЃА рЃљрЃдрЃўрЃљрЃарЃћрЃЉрЃБрЃџрЃў рЃЊрЃљ рЃљрЃБрЃбрЃўрЃќрЃЏрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃљрЃА рЃћрЃФрЃдрЃЋрЃюрЃћрЃЉрЃљ.\nрЃўрЃюрЃЎрЃџрЃБрЃќрЃўрЃБрЃарЃў рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃБрЃ«рЃарЃћрЃџрЃў рЃЊрЃљрЃфрЃЋрЃљ рЃЊрЃљ рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃўрЃА рЃБрЃЎрЃћрЃЌ рЃњрЃљрЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VII-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃћрЃЉрЃќрЃћ рЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃА рЃърЃарЃЮрЃћрЃЦрЃбрЃќрЃћ: ,,рЃЎрЃў рЃњрЃљрЃЏрЃЮрЃарЃЕрЃћрЃБрЃџрЃў, рЃЎрЃў рЃЌрЃљрЃЋрЃўрЃАрЃћрЃЉрЃБрЃарЃў, рЃЏрЃљрЃњрЃарЃљрЃЏ рЃЌрЃЦрЃЋрЃћрЃюрЃюрЃљрЃўрЃарЃўРђю. рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў - рЃўрЃюрЃњрЃљ рЃЏрЃљрЃарЃЌрЃљрЃџрЃўрЃерЃЋрЃўрЃџрЃў.",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃЮрЃўрЃърЃЮрЃЋрЃћрЃЉрЃА рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљ рЃљрЃБрЃбрЃўрЃАрЃбрЃБрЃарЃў рЃАрЃърЃћрЃЦрЃбрЃарЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃљрЃАрЃћрЃЋрЃћ, рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃЎрЃЋрЃџрЃћрЃЋрЃљ рЃЌрЃћрЃЏрЃерЃў рЃљрЃарЃАрЃћрЃЉрЃБрЃџрЃў рЃАрЃбрЃћрЃарЃћрЃЮрЃбрЃўрЃърЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЊрЃљрЃЏрЃЮрЃЎрЃўрЃЊрЃћрЃЉрЃБрЃџрЃћрЃЉрЃўрЃА рЃњрЃљрЃЏрЃЮрЃАрЃљрЃЋрЃџрЃћрЃюрЃљрЃЊ.\nрЃфрЃюрЃЮрЃЉрЃљрЃЊрЃЮрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃерЃў рЃБрЃЎрЃћрЃЌ рЃњрЃљрЃарЃЎрЃЋрЃћрЃЋрЃўрЃА рЃЏрЃўрЃќрЃюрЃўрЃЌ, рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў рЃљрЃарЃАрЃћрЃЉрЃБрЃџ рЃарЃћрЃљрЃЉрЃўрЃџрЃўрЃбрЃљрЃфрЃўрЃўрЃА рЃфрЃћрЃюрЃбрЃарЃА ,,рЃцрЃљрЃюрЃерЃћрЃбрЃўРђЎРђЎ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃБрЃќрЃарЃБрЃюрЃЋрЃћрЃџрЃДрЃЮрЃцрЃўрЃџрЃўрЃљ рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃЊрЃљ рЃЏрЃЮрЃќрЃљрЃарЃЊрЃЌрЃљ рЃарЃћрЃљрЃЉрЃўрЃџрЃўрЃбрЃљрЃфрЃўрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃљрЃГрЃўрЃарЃЮ рЃАрЃћрЃарЃЋрЃўрЃАрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ рЃАрЃърЃћрЃфрЃўрЃљрЃџрЃўрЃАрЃбрЃћрЃЉрЃўрЃЌ.\nрЃфрЃћрЃюрЃбрЃарЃўрЃА рЃцрЃАрЃўрЃЦрЃЮрЃџрЃЮрЃњрЃў рЃЦрЃљрЃџрЃЉрЃљрЃбрЃЮрЃюрЃў рЃЊрЃљрЃарЃўрЃюрЃљ рЃЊрЃБрЃЏрЃЉрЃљрЃФрЃћ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃФрЃљрЃџрЃўрЃљрЃю рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮрЃЊ рЃЊрЃљ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃБрЃџрЃљрЃЊ рЃћрЃАрЃљрЃБрЃЉрЃарЃљ рЃљрЃБрЃбрЃўрЃќрЃўрЃА рЃАрЃърЃћрЃЦрЃбрЃарЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃњрЃљрЃюрЃўрЃ«рЃўрЃџрЃћрЃА, рЃарЃљ рЃАрЃљрЃ«рЃўрЃА рЃАрЃбрЃћрЃарЃћрЃЮрЃбрЃўрЃърЃћрЃЉрЃў рЃљрЃарЃАрЃћрЃЉрЃЮрЃЉрЃА рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃљрЃерЃў рЃЊрЃљ рЃарЃЮрЃњрЃЮрЃа рЃБрЃерЃџрЃўрЃА рЃ«рЃћрЃџрЃА рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃАрЃЮрЃфрЃўрЃљрЃџрЃўрЃќрЃљрЃфрЃўрЃљрЃА рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃљрЃерЃў рЃЊрЃљрЃЏрЃЎрЃЋрЃўрЃарЃЊрЃћрЃЉрЃБрЃџрЃў рЃАрЃбрЃўрЃњрЃЏрЃљ. рЃЏрЃљрЃю рЃљрЃдрЃюрЃўрЃерЃюрЃљ:\nРђърЃЏрЃљрЃЌ рЃерЃћрЃБрЃФрЃџрЃўрЃљрЃЌ рЃЎрЃЮрЃЏрЃБрЃюрЃўрЃЎрЃљрЃфрЃўрЃљ, рЃБрЃЉрЃарЃљрЃџрЃЮрЃЊ, рЃЕрЃЋрЃћрЃю рЃљрЃа рЃЋрЃўрЃфрЃўрЃЌ, рЃарЃЮрЃњрЃЮрЃа рЃЏрЃЮрЃЋрЃћрЃърЃДрЃарЃЮрЃЌ рЃЏрЃљрЃЌРђю.\nрЃљрЃБрЃбрЃўрЃќрЃЏрЃў - рЃърЃљрЃќрЃџрЃў, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃДрЃЋрЃћрЃџрЃљрЃЏ рЃћрЃарЃЌрЃљрЃЊ рЃБрЃюрЃЊрЃљ рЃљрЃЋрЃљрЃгрЃДрЃЮрЃЌ рЃЊрЃљ рЃљрЃЏрЃўрЃА рЃњрЃљрЃАрЃљрЃдрЃћрЃЉрЃў, рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃўрЃљ!"
