    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃАрЃљ рЃЊрЃљ рЃЎрЃўрЃЉрЃћрЃа рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃљрЃА ( Cyber Academy - рЃЎрЃўрЃЉрЃћрЃа рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃљ ) рЃерЃЮрЃарЃўрЃА рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃгрЃћрЃџрЃўрЃљ рЃњрЃарЃФрЃћрЃџрЃЊрЃћрЃЉрЃљ рЃЏрЃарЃљрЃЋрЃљрЃџрЃЏрЃ«рЃарЃўрЃЋрЃў рЃЊрЃљ рЃАрЃљрЃЦрЃЏрЃўрЃљрЃюрЃў рЃърЃљрЃарЃбрЃюрЃўрЃЮрЃарЃБрЃџрЃў рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃљ.",
    briefText: "2023 рЃгрЃџрЃўрЃА 3 рЃЏрЃљрЃўрЃАрЃА рЃБрЃцрЃарЃЮрЃАрЃЎрЃџрЃљрЃАрЃћрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃА рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃўрЃА рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ, рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃљ рЃЎрЃўрЃЉрЃћрЃа рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃћрЃџрЃў рЃАрЃљрЃЉрЃљ рЃЮрЃЎрЃБрЃ»рЃљрЃЋрЃљ."
