    title: "2023 рЃгрЃџрЃўрЃА 5 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў, рЃАрЃљрЃАрЃбрЃБрЃЏрЃарЃЮ \"рЃарЃћрЃЊрЃўрЃАрЃЮрЃюрЃерЃў\" рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃњрЃљрЃЏрЃГрЃЋрЃўрЃарЃЋрЃљрЃџрЃЮрЃЉрЃљ-рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃўрЃюрЃўрЃфрЃўрЃљрЃбрЃўрЃЋрЃўрЃЌ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃАрЃљрЃ»рЃљрЃарЃЮ рЃЊрЃљ рЃЎрЃћрЃарЃФрЃЮ рЃАрЃЎрЃЮрЃџрЃћрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃЌрЃљрЃю, рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃърЃарЃЮрЃцрЃћрЃАрЃЮрЃарЃћрЃЉрЃЌрЃљрЃю рЃЊрЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃћрЃЉрЃЌрЃљрЃю рЃћрЃЋрЃарЃЮрЃўрЃюрЃбрЃћрЃњрЃарЃљрЃфрЃўрЃўрЃА рЃЊрЃљ рЃЊрЃћрЃЏрЃЮрЃЎрЃарЃљрЃбрЃўрЃБрЃџрЃў рЃърЃарЃЮрЃфрЃћрЃАрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљрЃќрЃћ.\nрЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЊрЃўрЃАрЃЎрЃБрЃАрЃўрЃљрЃерЃў рЃЕрЃљрЃарЃЌрЃБрЃџрЃў рЃўрЃДрЃЋрЃюрЃћрЃю рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃўрЃА рЃљрЃдрЃЏрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџрЃў рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃў рЃћрЃЎрЃљ рЃњрЃўрЃњрЃљрЃБрЃарЃў, рЃўрЃАрЃбрЃЮрЃарЃўрЃЎрЃЮрЃАрЃў рЃџрЃљрЃерЃљ рЃЉрЃљрЃЦрЃарЃљрЃФрЃћ рЃЊрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃ»рЃўрЃџрЃЊрЃЮрЃА рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃћрЃЉрЃў рЃџрЃљрЃЊрЃЮ рЃљрЃцрЃ«рЃљрЃќрЃљрЃЋрЃљ, рЃАрЃЮрЃцрЃЮ рЃњрЃЮрЃњрЃЮрЃ«рЃўрЃљ рЃЊрЃљ рЃарЃЮрЃџрЃљрЃюрЃЊ рЃерЃљрЃЋрЃљрЃФрЃћ.",
    briefText: "рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ рЃЊрЃљ рЃќрЃЋрЃўрЃљрЃЊ рЃЕрЃ«рЃћрЃюрЃЎрЃћрЃџрЃў.\nрЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃЏрЃљ рЃќрЃЮрЃњрЃљрЃЊрЃў рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЎрЃБрЃЌрЃ«рЃўрЃЌ рЃљрЃарЃАрЃћрЃЉрЃБрЃџ рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃћрЃЉрЃќрЃћ рЃњрЃљрЃљрЃЏрЃљрЃ«рЃЋрЃўрЃџрЃћрЃА рЃДрЃБрЃарЃљрЃЊрЃдрЃћрЃЉрЃљ.\nрЃџрЃљрЃерЃљ рЃЉрЃљрЃЦрЃарЃљрЃФрЃћрЃЏ рЃљрЃБрЃЊрЃўрЃбрЃЮрЃарЃўрЃљрЃА рЃгрЃљрЃарЃБрЃЊрЃњрЃўрЃюрЃљ рЃЊрЃљ рЃЊрЃљрЃЏрЃгрЃарЃћ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃћрЃЉрЃА рЃАрЃљрЃЕрЃБрЃЦрЃарЃљрЃЊ рЃњрЃљрЃЊрЃљрЃАрЃфрЃљ рЃљрЃЎрЃљрЃЎрЃў рЃЉрЃљрЃЦрЃарЃљрЃФрЃўрЃА рЃгрЃўрЃњрЃюрЃўрЃА \"рЃЏрЃгрЃћрЃарЃџрЃЮрЃЉрЃўрЃА рЃЏрЃЮрЃЌрЃЋрЃўрЃюрЃўрЃћрЃарЃћрЃЉрЃљ\" рЃљрЃ«рЃљрЃџрЃў, рЃерЃћрЃЋрЃАрЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЏрЃЮрЃфрЃћрЃЏрЃљ."
