    title: "2023 рЃгрЃџрЃўрЃА 5 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА \"рЃЌрЃљрЃЋрЃўрЃАрЃБрЃцрЃљрЃџ рЃАрЃўрЃЋрЃарЃфрЃћрЃерЃў\" рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃњрЃљрЃЏрЃГрЃЋрЃўрЃарЃЋрЃљрЃџрЃЮрЃЉрЃљ-рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃБрЃцрЃарЃЮрЃАрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЌрЃљрЃю.\nрЃАрЃљрЃБрЃЉрЃљрЃарЃў рЃгрЃљрЃарЃўрЃЏрЃљрЃарЃЌрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃћрЃЋрЃарЃЮрЃўрЃюрЃбрЃћрЃњрЃарЃљрЃфрЃўрЃљрЃАрЃљ рЃЊрЃљ рЃћрЃЋрЃарЃЮрЃЎрЃљрЃЋрЃерЃўрЃарЃўрЃА рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃќрЃћ.",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃўрЃА рЃљрЃдрЃЏрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџрЃў рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃў рЃћрЃЎрЃљ рЃњрЃўрЃњрЃљрЃБрЃарЃў, рЃърЃБрЃЉрЃџрЃўрЃфрЃўрЃАрЃбрЃў рЃџрЃљрЃерЃљ рЃЉрЃљрЃЦрЃарЃљрЃФрЃћ, рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃ»рЃўрЃџрЃЊрЃЮрЃА рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃћрЃЉрЃў рЃџрЃљрЃЊрЃЮ рЃљрЃцрЃ«рЃљрЃќрЃљрЃЋрЃљ рЃЊрЃљ рЃАрЃЮрЃцрЃЮ рЃњрЃЮрЃњрЃЮрЃ«рЃўрЃљ рЃўрЃюрЃбрЃћрЃарЃљрЃЦрЃбрЃўрЃБрЃџ рЃарЃћрЃЪрЃўрЃЏрЃерЃў рЃћрЃАрЃљрЃБрЃЉрЃарЃюрЃћрЃю.\nрЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃБрЃцрЃарЃЮрЃАрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃў."
