    image: name235,
    id: 235 , 
    title: "рЃбрЃДрЃБрЃърЃћрЃЉрЃўрЃА рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃў.\n2023 рЃгрЃџрЃўрЃА 6 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ \"рЃбрЃДрЃБрЃърЃћрЃЉрЃўрЃА рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃў\". рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃў рЃўрЃДрЃЮ рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў, рЃАрЃљрЃЏрЃћрЃЊрЃўрЃфрЃўрЃюрЃЮ рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃ«рЃљрЃарЃљрЃЉрЃљрЃФрЃћ.",
    briefText: "рЃЏрЃЮрЃћрЃгрЃДрЃЮ рЃЉрЃћрЃЋрЃарЃў рЃдрЃўрЃЏрЃўрЃџрЃўрЃЌрЃљ рЃЊрЃљ рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃўрЃЌ рЃњрЃљрЃ»рЃћрЃарЃћрЃЉрЃБрЃџрЃў, рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў, рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌрЃў, рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃбрЃДрЃБрЃърЃћрЃЉрЃЌрЃљрЃю рЃЊрЃљ рЃЏрЃљрЃЌ рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃЌрЃљрЃю!\nрЃЏрЃћ-9 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃЏрЃљрЃарЃўрЃљрЃЏ рЃњрЃЮрЃарЃЮрЃќрЃўрЃљрЃЏ рЃЊрЃљрЃЏрЃАрЃгрЃарЃћ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЏрЃЮрЃљрЃЏрЃќрЃљрЃЊрЃљ рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃљ рЃЉрЃБрЃюрЃћрЃЉрЃўрЃА рЃљрЃЏ рЃцрЃћрЃюрЃЮрЃЏрЃћрЃюрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃАрЃљрЃЏрЃћрЃЊрЃўрЃфрЃўрЃюрЃЮ рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃЏрЃљ рЃюрЃўрЃџрЃљ рЃ»рЃўрЃюрЃГрЃљрЃарЃљрЃФрЃћрЃЏ, рЃЎрЃћрЃАрЃљрЃарЃўрЃљ рЃњрЃљрЃЌрЃћрЃюрЃљрЃФрЃћрЃЏ рЃЊрЃљ рЃљрЃюрЃљ рЃЊрЃљрЃарЃЕрЃўрЃФрЃћрЃЏ рЃгрЃљрЃарЃЏрЃљрЃарЃЌрЃћрЃА рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃЌрЃљрЃЏрЃљрЃерЃћрЃЉрЃў, рЃњрЃљрЃЏрЃЮрЃфрЃюрЃЮрЃЉрЃљрЃюрЃљ, рЃбрЃДрЃБрЃърЃћрЃЉрЃЏрЃљ рЃерЃћрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃАрЃўрЃЏрЃдрЃћрЃарЃћрЃЉрЃў, рЃњрЃљрЃўрЃ«рЃАрЃћрЃюрЃћрЃА рЃЎрЃБрЃарЃўрЃЮрЃќрЃћрЃЉрЃў."
