    title: "\"рЃЎрЃљрЃарЃњрЃў рЃарЃљрЃЏ\"- рЃ«рЃћрЃџрЃюрЃљрЃгрЃћрЃарЃў рЃЪрЃБрЃарЃюрЃљрЃџрЃў.\n2023 рЃгрЃџрЃўрЃА 23 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ VII рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃ«рЃћрЃџрЃюрЃљрЃгрЃћрЃарЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃБрЃџрЃў рЃЪрЃБрЃарЃюрЃљрЃџрЃўрЃА \"рЃЎрЃљрЃарЃњрЃў рЃарЃљрЃЏ\" рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃљ; рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃћрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЏрЃљрЃарЃўрЃюрЃљ рЃЏрЃљрЃЏрЃљрЃџрЃљрЃФрЃћ.",
    briefText: "рЃЪрЃБрЃарЃюрЃљрЃџрЃў рЃЏрЃўрЃћрЃФрЃдрЃЋрЃюрЃљ рЃўрЃџрЃўрЃљ рЃГрЃљрЃЋрЃГрЃљрЃЋрЃљрЃФрЃўрЃА рЃЏрЃЮрЃЌрЃ«рЃарЃЮрЃЉрЃљрЃА \"рЃЎрЃљрЃфрЃўрЃљ-рЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃў?!\"\nрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃЪрЃБрЃарЃюрЃљрЃџрЃерЃў рЃЏрЃЮрЃЌрЃљрЃЋрЃАрЃћрЃЉрЃБрЃџрЃў рЃАрЃбрЃљрЃбрЃўрЃћрЃЉрЃў, рЃњрЃљрЃюрЃўрЃ«рЃўрЃџрЃћрЃА рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃћрЃЉрЃў, рЃўрЃЏрЃАрЃ»рЃћрЃџрЃћрЃА рЃърЃћрЃарЃАрЃЮрЃюрЃљрЃЪрЃЌрЃљ рЃ«рЃљрЃАрЃўрЃљрЃЌрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃЏрЃљрЃЌ рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃћрЃЉрЃќрЃћ, рЃЏрЃгрЃћрЃарЃџрЃўрЃА рЃЏрЃўрЃћрЃа рЃгрЃљрЃЏрЃЮрЃГрЃарЃўрЃџрЃў рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃўрЃА рЃљрЃЦрЃбрЃБрЃљрЃџрЃБрЃарЃЮрЃЉрЃљрЃќрЃћ рЃЊрЃдрЃћрЃЋрЃљрЃюрЃЊрЃћрЃџ рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃљрЃерЃў.\nрЃЪрЃБрЃарЃюрЃљрЃџрЃќрЃћ рЃЏрЃБрЃерЃљрЃЮрЃЉрЃўрЃА рЃърЃарЃЮрЃфрЃћрЃАрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЊрЃљрЃћрЃ«рЃЏрЃљрЃарЃљ рЃюрЃљрЃгрЃљрЃарЃЏрЃЮрЃћрЃЉрЃўрЃА рЃАрЃљрЃЌрЃЦрЃЏрЃћрЃџрЃўрЃА рЃњрЃљрЃњрЃћрЃЉрЃљ-рЃњрЃљрЃљрЃќрЃарЃћрЃЉрЃљрЃерЃў.\nрЃњрЃљрЃгрЃћрЃБрЃџрЃў рЃАрЃљрЃЏрЃБрЃерЃљрЃЮ рЃерЃћрЃљрЃцрЃљрЃАрЃћрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃЏрЃљ, рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃЏрЃљ, рЃЏрЃћрЃарЃЋрЃћрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ.\nрЃЪрЃБрЃарЃюрЃљрЃџрЃў рЃњрЃљрЃЊрЃљрЃћрЃфрЃљ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃА."
