    title: "рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃў \"рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЏрЃЮрЃДрЃЋрЃљрЃарЃБрЃџрЃЌрЃљ рЃЎрЃџрЃБрЃЉрЃерЃў\".\nрЃАрЃАрЃўрЃъ \"рЃљрЃГрЃљрЃарЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃЏрЃљ\" , рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃА рЃЊрЃдрЃћ рЃАрЃљрЃќрЃћрЃўрЃЏрЃЮрЃЊ рЃљрЃдрЃюрЃўрЃерЃюрЃљ.",
    briefText: "рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЏрЃЮрЃДрЃЋрЃљрЃарЃБрЃџрЃЌрЃљ рЃЎрЃџрЃБрЃЉрЃўрЃА рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃљ , рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃљрЃГрЃљрЃарЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃЏрЃљ рЃЌрЃћрЃЮрЃюрЃљ рЃќрЃЮрЃўрЃФрЃћрЃЏ рЃЊрЃљ рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћ рЃўрЃюрЃњрЃљ рЃњрЃЮрЃњрЃўрЃЉрЃћрЃарЃўрЃФрЃћрЃЏ рЃгрЃљрЃарЃљрЃЊрЃњрЃўрЃюрЃћрЃА, рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљрЃА рЃљрЃГрЃљрЃарЃўрЃА рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА, рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃАрЃљ рЃЊрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћ рЃљрЃЎрЃљрЃЎрЃў рЃФрЃюрЃћрЃџрЃљрЃФрЃћ рЃЊрЃљрЃћрЃАрЃгрЃарЃЮ.\n\"рЃЏрЃБрЃќрЃћрЃБрЃЏрЃўрЃА рЃЏрЃЮрЃДрЃЋрЃљрЃарЃБрЃџрЃЌрЃљ рЃЎрЃџрЃБрЃЉрЃўрЃА\" рЃгрЃћрЃЋрЃарЃћрЃЉрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃф рЃљрЃарЃўрЃљрЃю.\nрЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃА!"
