    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III- 3 рЃЎрЃџрЃљрЃАрЃерЃў рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃЌрЃљрЃЏрЃљрЃа рЃЏрЃћрЃЦрЃЋрЃљрЃЉрЃўрЃерЃЋрЃўрЃџрЃЏрЃљ рЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљрЃЏ рЃњрЃљрЃюрЃљрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃА рЃърЃарЃЮрЃћрЃЦрЃбрЃў\"рЃЕрЃћрЃЏрЃў рЃЌрЃЋрЃљрЃџрЃўрЃЌ рЃЊрЃљрЃюрЃљрЃ«рЃБрЃџрЃў рЃюрЃЮрЃЊрЃљрЃа рЃЊрЃБрЃЏрЃЉрЃљрЃФрЃћ.\"",
    briefText: "рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў\nрЃњрЃљрЃћрЃфрЃюрЃћрЃю рЃюрЃЮрЃЊрЃљрЃа рЃЊрЃБрЃЏрЃЉрЃљрЃФрЃўрЃА рЃЉрЃўрЃЮрЃњрЃарЃљрЃцрЃўрЃљрЃА рЃЊрЃљ рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљрЃА,\nрЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃюрЃљрЃгрЃљрЃарЃЏрЃЮрЃћрЃЉрЃћрЃЉрЃў,\nрЃЊрЃљрЃћрЃАрЃгрЃарЃюрЃћрЃю рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃА\" рЃ░рЃћрЃџрЃљрЃЊрЃЮрЃА\",\nрЃЏрЃЮрЃћрЃгрЃДрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃўрЃА рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћ рЃърЃљрЃбрЃљрЃарЃљ рЃЏрЃАрЃљрЃ«рЃўрЃЮрЃЉрЃЌрЃљрЃю , рЃЕрЃЋрЃћрЃюрЃўрЃЋрЃћ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃЏрЃўрЃЦрЃљрЃћрЃџ рЃњрЃЮрЃњрЃБрЃљрЃФрЃћрЃАрЃЌрЃљрЃю,\nрЃБрЃДрЃБрЃарЃћрЃА рЃцрЃўрЃџрЃЏрЃћрЃЉрЃА,\nрЃЊрЃљрЃўрЃњрЃћрЃњрЃЏрЃљ рЃЊрЃљ рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃЊрЃљ рЃћрЃЦрЃАрЃЎрЃБрЃарЃАрЃўрЃљ рЃю. рЃЊрЃБрЃЏрЃЉрЃљрЃФрЃўрЃА рЃАрЃљрЃ«рЃџ- рЃЏрЃБрЃќрЃћрЃБрЃЏрЃерЃў.\nрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃўрЃЏрЃАрЃ»рЃћрЃџрЃћрЃА, рЃЊрЃљрЃцрЃўрЃЦрЃарЃЊрЃюрЃћрЃю, рЃерЃћрЃљрЃцрЃљрЃАрЃћрЃА, рЃњрЃљрЃЏрЃЮрЃЌрЃЦрЃЋрЃћрЃА рЃЏрЃЮрЃАрЃљрЃќрЃарЃћрЃЉрЃћрЃЉрЃў, рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃўрЃА , рЃАрЃўрЃЎрЃћрЃЌрЃўрЃА, рЃфрЃ«рЃЮрЃЋрЃарЃћрЃЉрЃўрЃАрЃћрЃБрЃџрЃў рЃАрЃўрЃарЃЌрЃБрЃџрЃћрЃћрЃЉрЃўрЃА рЃЪрЃљрЃЏрЃА рЃўрЃБрЃЏрЃЮрЃарЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљрЃќрЃћ."
