    briefText: "рЃАрЃгрЃЮрЃарЃћрЃЊ рЃљрЃЏ рЃЊрЃдрЃћрЃАрЃљрЃАрЃгрЃљрЃБрЃџрЃўрЃА рЃЏрЃўрЃћрЃФрЃдрЃЋрЃюрЃљ рЃЊрЃдрЃћрЃЋрЃљрЃюрЃЊрЃћрЃџрЃў рЃАрЃљрЃдрЃЋрЃЌрЃЮ рЃАрЃ»рЃБрЃџрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА V- 3 рЃЎрЃџрЃљрЃАрЃерЃў.\nрЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃерЃћрЃюрЃЮрЃЉрЃљрЃерЃў рЃљрЃарЃАрЃћрЃЉрЃБрЃџрЃў рЃбрЃљрЃФрЃљрЃарЃў рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃюрЃўрЃюрЃЮрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃљрЃљ.\n рЃАрЃљрЃдрЃЋрЃЌрЃЮ рЃАрЃ»рЃБрЃџрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЏрЃљрЃарЃўрЃљрЃЏ рЃЦрЃЮрЃарЃўрЃФрЃћ рЃћрЃАрЃљрЃБрЃЉрЃарЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃюрЃўрЃюрЃЮрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃерЃћрЃЏрЃЮрЃЉрЃарЃФрЃљрЃюрЃћрЃЉрЃљрЃќрЃћ, рЃЏрЃўрЃА рЃЏрЃЮрЃфрЃўрЃЦрЃБрЃџрЃћрЃЉрЃарЃўрЃЋ рЃдрЃЋрЃљрЃгрЃџрЃќрЃћ, рЃњрЃљрЃўрЃ«рЃАрЃћрЃюрЃћрЃА, рЃАрЃљрЃЊ рЃљрЃарЃўрЃА рЃЊрЃљрЃЎрЃарЃФрЃљрЃџрЃБрЃџрЃў рЃгрЃЏрЃўрЃюрЃЊрЃљрЃюрЃў, рЃАрЃљрЃЊ рЃўрЃюрЃљрЃ«рЃћрЃЉрЃљ рЃЏрЃўрЃАрЃў рЃ»рЃЋрЃљрЃарЃў. рЃЊрЃљрЃљрЃюрЃЌрЃћрЃА рЃАрЃљрЃюрЃЌрЃџрЃћрЃЉрЃў рЃЊрЃљ рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃюрЃўрЃюрЃЮрЃА рЃ«рЃљрЃбрЃЌрЃљрЃю рЃгрЃљрЃарЃЏрЃЮрЃЌрЃЦрЃЋрЃћрЃА рЃбрЃарЃЮрЃърЃљрЃарЃў ."
