    briefText: "рЃАрЃЎрЃЮрЃџрЃўрЃА рЃћрЃќрЃЮрЃерЃў рЃЏрЃЮрЃћрЃгрЃДрЃЮ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃюрЃљрЃ«рЃљрЃбрЃћрЃЉрЃўрЃА рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљ, рЃърЃџрЃћрЃюрЃћрЃарЃќрЃћ рЃ«рЃљрЃбрЃЋрЃљ, рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЉрЃџрЃўрЃф рЃбрЃБрЃарЃюрЃўрЃарЃў рЃГрЃљрЃЊрЃарЃљрЃЎрЃерЃў, рЃЏрЃЌрЃћрЃџрЃў рЃЊрЃдрЃўрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў рЃўрЃДрЃЮ рЃАрЃљрЃќрЃћрЃўрЃЏрЃЮ рЃњрЃљрЃюрЃгрЃДрЃЮрЃЉрЃљ, рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃўрЃдрЃћрЃЉрЃЊрЃюрЃћрЃю рЃцрЃЮрЃбрЃЮрЃћрЃЉрЃА, рЃфрЃћрЃЎрЃЋрЃљрЃЋрЃЊрЃюрЃћрЃю, рЃўрЃАрЃЏрЃЮрЃЊрЃљ рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃЏрЃћрЃџрЃЮрЃЊрЃўрЃћрЃЉрЃў."
