    title: "2023 рЃгрЃџрЃўрЃА 2 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VI-1 рЃЊрЃљ VI-2 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃЏрЃБрЃАрЃўрЃЎрЃљрЃџрЃБрЃарЃў рЃфрЃћрЃюрЃбрЃарЃў / Batumi State Music Centre-рЃўрЃА рЃАрЃўрЃЏрЃцрЃЮрЃюрЃўрЃБрЃа рЃЮрЃарЃЎрЃћрЃАрЃбрЃарЃА (рЃЏрЃБрЃАрЃўрЃЎрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃћрЃЎрЃљрЃбрЃћрЃарЃўрЃюрЃћ рЃЉрЃЪрЃўрЃюрЃљрЃЋрЃљ, рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџрЃў рЃЏрЃљрЃЏрЃљ рЃњрЃљрЃЉрЃарЃћрЃџ рЃЎрЃљрЃЎрЃљрЃфрЃўрЃФрЃћ).",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљрЃћрЃАрЃгрЃарЃюрЃћрЃю рЃЮрЃарЃЎрЃћрЃАрЃбрЃарЃўрЃА рЃарЃћрЃърЃћрЃбрЃўрЃфрЃўрЃљрЃА (рЃЊрЃўрЃарЃўрЃЪрЃЮрЃарЃў рЃЏрЃљрЃЏрЃБрЃЎрЃљ рЃљрЃџрЃљрЃцрЃўрЃерЃЋрЃўрЃџрЃў), рЃ«рЃЮрЃџрЃЮ рЃЮрЃарЃЎрЃћрЃАрЃбрЃарЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃЏрЃљ рЃЏрЃљрЃЌ рЃњрЃљрЃљрЃфрЃюрЃћрЃА рЃАрЃљрЃЎрЃарЃљрЃЋрЃћрЃЉрЃў, рЃЏрЃЮрЃљрЃАрЃЏрЃћрЃюрЃўрЃюрЃћрЃА рЃЏрЃфрЃўрЃарЃћ рЃЏрЃБрЃАрЃўрЃЎрЃљрЃџрЃБрЃарЃў рЃцрЃарЃљрЃњрЃЏрЃћрЃюрЃбрЃћрЃЉрЃў.\nрЃљрЃАрЃћрЃЌрЃў рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЏрЃБрЃАрЃўрЃЎрЃљрЃџрЃБрЃарЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЊрЃўрЃЊрЃ«рЃљрЃюрЃА рЃЊрЃљрЃљрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃЊрЃћрЃЉрЃљрЃЌ рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃА."
