    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃАрЃљрЃЏрЃћрЃЊрЃўрЃфрЃўрЃюрЃЮ рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃЏрЃљ (рЃЎрЃџрЃБрЃЉрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃ«рЃљрЃарЃљрЃЉрЃљрЃФрЃћ) рЃњрЃљрЃюрЃљрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃА рЃърЃарЃЮрЃћрЃЦрЃбрЃў РђърЃарЃћрЃЋрЃЮрЃџрЃБрЃфрЃўрЃљ рЃАрЃбрЃЮрЃЏрЃљрЃбрЃЮрЃџрЃЮрЃњрЃўрЃљрЃерЃўРђю.",
    briefText: "рЃљрЃЏ рЃЏрЃўрЃќрЃюрЃўрЃЌ рЃЎрЃџрЃБрЃЉрЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃў, X-1 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЎрЃћрЃАрЃљрЃарЃўрЃљ рЃњрЃљрЃЌрЃћрЃюрЃљрЃФрЃћ, рЃюрЃўрЃџрЃљ рЃ»рЃўрЃюрЃГрЃљрЃарЃљрЃФрЃћ, рЃџрЃўрЃЎрЃљ рЃЊрЃљрЃЋрЃўрЃЌрЃљрЃФрЃћ рЃЊрЃљ рЃљрЃюрЃљ рЃЊрЃљрЃарЃЕрЃўрЃФрЃћ рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃЊрЃюрЃћрЃю рЃЎрЃџрЃўрЃюрЃўрЃЎрЃљ РђърЃАрЃбрЃЮрЃЏрЃљ рЃЊрЃћрЃюрЃбрЃАРђю, рЃАрЃљрЃЊрЃљрЃф рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџ рЃАрЃбрЃЮрЃЏрЃљрЃбрЃЮрЃџрЃЮрЃњ рЃљрЃюрЃљ рЃЕрЃ«рЃћрЃюрЃЎрЃћрЃџрЃА, рЃЊрЃљрЃБрЃАрЃЋрЃћрЃА рЃЏрЃљрЃА рЃерЃћрЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃЉрЃў, рЃЊрЃљрЃљрЃЎрЃЋрЃўрЃарЃЊрЃюрЃћрЃю рЃАрЃбрЃЮрЃЏрЃљрЃбрЃЮрЃџрЃЮрЃњрЃўрЃА рЃЏрЃБрЃерЃљрЃЮрЃЉрЃўрЃА рЃАрЃърЃћрЃфрЃўрЃцрЃўрЃЎрЃљрЃА, рЃЏрЃўрЃўрЃдрЃћрЃА рЃЏрЃўрЃАрЃњрЃљрЃю рЃарЃЕрЃћрЃЋрЃћрЃЉрЃў рЃљрЃдрЃюрЃўрЃерЃюрЃБрЃџ рЃЌрЃћрЃЏрЃљрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ.\nрЃБрЃЎрЃЋрЃћ рЃЊрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃБрЃџрЃў рЃюрЃљрЃерЃарЃЮрЃЏрЃў рЃњрЃЮрЃњрЃЮрЃюрЃћрЃЉрЃЏрЃљ рЃгрЃљрЃарЃБрЃЊрЃњрЃўрЃюрЃћрЃА рЃЏрЃћрЃљрЃЌрЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА.\nрЃљрЃАрЃћ рЃерЃћрЃЊрЃњрЃљ рЃЎрЃўрЃЊрЃћрЃЋ рЃћрЃарЃЌрЃў рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃљ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА РђърЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃАРђю рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў."
