    title: "2023 рЃгрЃџрЃўрЃА 10 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЌрЃљрЃЏрЃљрЃерЃўрЃА РђърЃарЃљ? рЃАрЃљрЃЊ? рЃарЃЮрЃЊрЃўрЃА?Рђю рЃћрЃЋрЃарЃЮрЃърЃБрЃџ рЃбрЃБрЃарЃў, рЃарЃЮрЃЏрЃћрЃџрЃерЃўрЃф рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃћрЃ»рЃўрЃЉрЃарЃћрЃЉрЃЮрЃЊрЃљ рЃљрЃГрЃљрЃарЃўрЃА рЃарЃћрЃњрЃўрЃЮрЃюрЃўрЃА 100-рЃќрЃћ рЃЏрЃћрЃбрЃў рЃњрЃБрЃюрЃЊрЃў.",
    briefText: "рЃФрЃљрЃџрЃўрЃљрЃю рЃЏрЃ«рЃўрЃљрЃарЃБрЃџ рЃЊрЃљ рЃЎрЃЮрЃюрЃЎрЃБрЃарЃћрЃюрЃбрЃБрЃџ рЃњрЃљрЃарЃћрЃЏрЃЮрЃерЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃњрЃБрЃюрЃЊрЃЏрЃљ \"рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў\" рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃЌ рЃўрЃљрЃАрЃърЃљрЃарЃћрЃќрЃљ.\nрЃњрЃБрЃюрЃЊрЃўрЃА рЃерЃћрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃЮрЃЉрЃљрЃерЃў рЃўрЃДрЃЋрЃюрЃћрЃю:\nрЃЌрЃћрЃЎрЃџрЃљ рЃерЃљрЃерЃўрЃЎрЃљрЃФрЃћ,\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃћ,\nрЃЌрЃћрЃЏрЃЮ рЃерЃљрЃарЃљрЃЉрЃўрЃФрЃћ,\nрЃњрЃўрЃЮрЃарЃњрЃў рЃЕрЃ«рЃљрЃўрЃФрЃћ,\nрЃАрЃљрЃюрЃЊрЃарЃЮ рЃЎрЃљрЃџрЃљрЃюрЃЊрЃљрЃФрЃћ,\nрЃљрЃЎрЃљ рЃЉрЃљрЃЎрЃБрЃарЃўрЃФрЃћ.\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\nрЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!"
