    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃўрЃА рЃерЃћрЃЏрЃљрЃ»рЃљрЃЏрЃћрЃЉрЃћрЃџрЃў рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ. рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃљрЃюрЃљ рЃљрЃюрЃБрЃерЃўрЃФрЃћ.",
    briefText: "рЃерЃћрЃЏрЃљрЃ»рЃљрЃЏрЃћрЃЉрЃћрЃџрЃў рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў, рЃАрЃЎрЃЮрЃџрЃљрЃА рЃћрЃгрЃЋрЃўрЃљ рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃАрЃърЃћрЃфрЃўрЃљрЃџрЃўрЃќрЃљрЃфрЃўрЃўрЃА рЃЊрЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃўрЃА рЃљрЃЊрЃЋрЃЮрЃЎрЃљрЃбрЃў, рЃўрЃБрЃарЃўрЃАрЃбрЃў рЃЉрЃљрЃбрЃЮрЃюрЃў рЃЉрЃљрЃЕрЃў рЃњрЃљрЃЉрЃљрЃўрЃФрЃћ, рЃарЃЮрЃЏрЃћрЃџрЃЏрЃљрЃф рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃљ рЃўрЃюрЃбрЃћрЃарЃљрЃЦрЃфрЃўрЃБрЃџрЃў рЃџрЃћрЃЦрЃфрЃўрЃљ рЃЕрЃЋрЃћрЃюрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА, рЃљрЃЏрЃЮрЃЏрЃгрЃБрЃарЃљрЃЋрЃљрЃЊ рЃБрЃърЃљрЃАрЃБрЃ«рЃљ рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃўрЃА рЃерЃћрЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃА рЃЊрЃљ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃЮ рЃЊрЃљрЃњрЃћрЃњрЃЏрЃўрЃџ рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃћрЃЉрЃерЃў рЃЌрЃћрЃЏрЃћрЃЉрЃќрЃћ:\nрЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃўрЃА рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃў;\nрЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃћрЃЉрЃарЃўрЃЋрЃў рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃћрЃЉрЃў;\nрЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃўрЃА рЃдрЃўрЃарЃАрЃћрЃЉрЃљ;\nрЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃўрЃА рЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃўрЃџрЃћрЃЉрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃљрЃГрЃўрЃарЃЮрЃћрЃЉрЃћрЃЉрЃў;\nрЃЊрЃћрЃЏрЃЮрЃЎрЃарЃљрЃбрЃўрЃўрЃА рЃърЃарЃўрЃюрЃфрЃўрЃърЃћрЃЉрЃў;\nрЃЎрЃЮрЃџрЃћрЃЦрЃбрЃўрЃБрЃарЃў рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃў;\nрЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃўрЃА рЃЎрЃўрЃЉрЃћ;\nрЃарЃљ рЃљрЃарЃўрЃА рЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃћрЃЉрЃарЃўрЃЋрЃў рЃЎрЃБрЃџрЃбрЃБрЃарЃљ;\nрЃАрЃљрЃЏрЃљрЃарЃЌрЃџрЃўрЃА рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃЊрЃљрЃарЃњрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃљрЃЏрЃљрЃарЃЌрЃљрЃџрЃЊрЃљрЃЏрЃфрЃЋрЃћрЃџрЃћрЃЉрЃў;\nрЃљрЃарЃљрЃАрЃарЃБрЃџрЃгрЃџрЃЮрЃЋрЃљрЃюрЃў рЃЊрЃљ рЃЎрЃљрЃюрЃЮрЃюрЃў;\nрЃЏрЃарЃљрЃЋрЃљрЃџрЃцрЃћрЃарЃЮрЃЋрЃљрЃюрЃў рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃћрЃЉрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў, рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃљрЃЋрЃбрЃЮрЃарЃћрЃЉрЃЏрЃљ\nрЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћрЃА рЃЏрЃБрЃџрЃбрЃўрЃЏрЃћрЃЊрЃўрЃљ рЃарЃћрЃАрЃБрЃарЃАрЃћрЃЉрЃў,\nрЃЊрЃўрЃџрЃћрЃЏрЃБрЃарЃў рЃљрЃЏрЃЮрЃфрЃљрЃюрЃћрЃЉрЃў\nрЃњрЃљрЃљрЃљрЃюрЃљрЃџрЃўрЃќрЃћрЃА рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃБрЃџрЃў рЃЦрЃћрЃўрЃАрЃў."
