    title: "2023 рЃгрЃџрЃўрЃА 3 рЃЊрЃљ 4 рЃўрЃЋрЃюрЃўрЃАрЃА рЃљрЃГрЃљрЃарЃўрЃА рЃЏрЃБрЃќрЃћрЃБрЃЏрЃў Ajara Museum рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ.\nрЃљрЃГрЃљрЃарЃўрЃА рЃЏрЃљрЃерЃбрЃљрЃЉрЃўрЃЌ, рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ 150 -рЃќрЃћ рЃЏрЃћрЃбрЃў рЃюрЃљрЃерЃарЃЮрЃЏрЃў рЃгрЃљрЃарЃљрЃЊрЃњрЃўрЃюрЃћрЃА, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф рЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ, рЃАрЃћрЃЦрЃфрЃўрЃћрЃЉрЃљрЃЊ рЃњрЃљрЃюрЃљрЃгрЃўрЃџрЃЊрЃљ.",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ, рЃЏрЃЮрЃќрЃљрЃарЃЊрЃЌрЃљ рЃерЃћрЃАрЃљрЃФрЃџрЃћрЃЉрЃџрЃЮрЃЉрЃћрЃЉрЃўрЃА, рЃюрЃўрЃГрЃўрЃА, рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃБрЃџрЃў рЃЎрЃЋрЃџрЃћрЃЋрЃўрЃАрЃљ рЃЊрЃљ рЃљрЃюрЃљрЃџрЃўрЃбрЃўрЃЎрЃўрЃА рЃБрЃюрЃљрЃарЃўрЃА рЃњрЃљрЃЏрЃЮрЃЋрЃџрЃћрЃюрЃљ.\nрЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃўрЃА рЃЊрЃљрЃАрЃљрЃАрЃарЃБрЃџрЃА , рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃА рЃњрЃљрЃЊрЃљрЃћрЃфрЃљрЃЌ рЃАрЃћрЃарЃбрЃўрЃцрЃўрЃЎрЃљрЃбрЃћрЃЉрЃў.\nрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЉрЃЊрЃюрЃћрЃю рЃарЃљрЃЏрЃЊрЃћрЃюрЃўрЃЏрЃћ рЃАрЃћрЃЦрЃфрЃўрЃўрЃА рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљрЃерЃў. рЃЏрЃљрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃЌ рЃгрЃљрЃарЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃЌрЃљрЃЋрЃўрЃљрЃюрЃЌрЃў рЃюрЃљрЃерЃарЃЮрЃЏрЃћрЃЉрЃў:\nрЃюрЃБрЃфрЃљ рЃ«рЃБрЃфрЃўрЃерЃЋрЃўрЃџрЃў, рЃџрЃўрЃџрЃћ рЃдрЃЮрЃЏрЃўрЃФрЃћ - рЃЉрЃўрЃЉрЃџрЃўрЃљ рЃЊрЃљ рЃЏрЃљрЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃљ - X рЃЎрЃџрЃљрЃАрЃў ; \nрЃюрЃўрЃџрЃљ рЃ»рЃўрЃюрЃГрЃљрЃарЃљрЃФрЃћ, рЃЎрЃћрЃАрЃљрЃарЃўрЃљ рЃњрЃљрЃЌрЃћрЃюрЃљрЃФрЃћ - рЃўрЃАрЃърЃљрЃюрЃўрЃА рЃГрЃљрЃЮрЃЉрЃў - X рЃЎрЃџрЃљрЃАрЃў;\nрЃљрЃюрЃљрЃюрЃЮ рЃ«рЃўрЃюрЃЎрЃўрЃџрЃљрЃФрЃћ - рЃќрЃћрЃЊрЃљрЃърЃўрЃарЃБрЃџрЃў рЃЊрЃљ рЃЏрЃўрЃгрЃўрЃАрЃЦрЃЋрЃћрЃерЃљ рЃгрЃДрЃџрЃћрЃЉрЃў - X рЃЎрЃџрЃљрЃАрЃў;\nрЃџрЃБрЃЎрЃљ рЃБрЃЕрЃљрЃюрЃћрЃўрЃерЃЋрЃўрЃџрЃў - рЃбрЃЮрЃбрЃљрЃџрЃўрЃбрЃљрЃарЃўрЃќрЃЏрЃў рЃЊрЃљ рЃбрЃЮрЃбрЃљрЃџрЃўрЃбрЃљрЃарЃБрЃџрЃў рЃЏрЃЏрЃљрЃарЃЌрЃЋрЃћрЃџрЃў - IX рЃЎрЃџрЃљрЃАрЃў;\nрЃћрЃџрЃћрЃюрЃћ рЃ«рЃБрЃ»рЃљрЃФрЃћ, рЃЊрЃљрЃЌрЃљ рЃБрЃарЃБрЃерЃљрЃФрЃћ - рЃЏрЃћрЃЮрЃЌрЃ«рЃћ рЃцрЃўрЃњрЃБрЃарЃўрЃА рЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃљ рЃљрЃарЃўрЃАрЃбрЃЮрЃбрЃћрЃџрЃћрЃАрЃЌрЃљрЃю - X рЃЎрЃџрЃљрЃАрЃў;\nрЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃ»рЃћрЃџрЃўрЃљ - рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃўрЃА рЃћрЃџрЃћрЃЦрЃбрЃарЃБрЃџрЃў рЃАрЃўрЃАрЃбрЃћрЃЏрЃљ - X рЃЎрЃџрЃљрЃАрЃў;\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃњрЃЮрЃарЃЮрЃќрЃўрЃљ - рЃбрЃДрЃБрЃърЃћрЃЉрЃў IX рЃЎрЃџрЃљрЃАрЃў;\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃћ - РђърЃЏрЃЮрЃюрЃљРђю рЃўрЃарЃљрЃЎрЃџрЃў рЃЦрЃљрЃАрЃарЃљрЃерЃЋрЃўрЃџрЃў -XI рЃЎрЃџрЃљрЃАрЃў;\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃћ - рЃцрЃљрЃарЃЊрЃЮрЃЉрЃўрЃЌрЃЮрЃЉрЃўрЃА рЃЌрЃћрЃЮрЃарЃўрЃљ -XI рЃЎрЃџрЃљрЃАрЃў . \nрЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃљ рЃЏрЃЎрЃЋрЃџрЃћрЃЋрЃљрЃарЃћрЃЉрЃА!"
