    title: "2023 рЃгрЃџрЃўрЃА 21рЃўрЃЋрЃюрЃўрЃАрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃљрЃГрЃљрЃарЃўрЃА рЃарЃћрЃњрЃўрЃЮрЃюрЃБрЃџ рЃЮрЃцрЃўрЃАрЃерЃў рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў РђюрЃЏрЃћрЃЊрЃўрЃљ рЃЊрЃљ рЃЊрЃћрЃќрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљРђЮ.\nрЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃЉрЃљрЃбрЃЮрЃюрЃћрЃЉрЃЏрЃљ рЃЊрЃљрЃЋрЃўрЃЌ рЃЦрЃБрЃбрЃўрЃФрЃћрЃЏ рЃЊрЃљ рЃарЃљрЃбрЃў рЃљрЃ«рЃљрЃџрЃљрЃўрЃљрЃЏ.",
    briefText: "рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃўрЃА рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ.рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў\nрЃљрЃюрЃљрЃюрЃЮ рЃ«рЃўрЃюрЃЎрЃўрЃџрЃљрЃФрЃћ,\nрЃЏрЃљрЃарЃЌрЃљ рЃЊрЃБрЃЏрЃЉрЃљрЃФрЃћ,\nрЃћрЃџрЃћрЃюрЃћ рЃ«рЃБрЃ»рЃљрЃФрЃћ,\nрЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃ»рЃћрЃџрЃўрЃљ,\nрЃЎрЃћрЃАрЃљрЃарЃўрЃљ рЃњрЃљрЃЌрЃћрЃюрЃљрЃФрЃћ,\nрЃюрЃўрЃџрЃљ рЃ»рЃўрЃюрЃГрЃљрЃарЃљрЃФрЃћ,\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃњрЃЮрЃарЃЮрЃќрЃўрЃљ.\nрЃбрЃарЃћрЃюрЃўрЃюрЃњрЃўрЃА рЃЉрЃЮрЃџрЃЮрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃњрЃљрЃЊрЃљрЃћрЃфрЃљрЃЌ рЃАрЃћрЃарЃЌрЃўрЃцрЃўрЃЎрЃљрЃбрЃћрЃЉрЃў."
