    title: "рЃЊрЃўрЃЊрЃў рЃАрЃўрЃ«рЃљрЃарЃБрЃџрЃўрЃЌ рЃЊрЃљ рЃАрЃўрЃљрЃЏрЃљрЃДрЃўрЃЌ рЃњрЃЋрЃАрЃБрЃарЃА рЃњрЃљрЃБрЃгрЃДрЃЮрЃЌ, рЃарЃЮрЃЏ 2023 рЃгрЃџрЃўрЃА 26 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃюрЃљрЃюрЃљ рЃГрЃћрЃџрЃўрЃФрЃћрЃЏ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃў / B S U -рЃерЃў рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃЌ рЃЊрЃљрЃўрЃфрЃЋрЃљ рЃАрЃљрЃЊрЃЮрЃЦрЃбрЃЮрЃарЃЮ рЃЊрЃўрЃАрЃћрЃарЃбрЃљрЃфрЃўрЃљ рЃЌрЃћрЃЏрЃљрЃќрЃћ \"D рЃЋрЃўрЃбрЃљрЃЏрЃўрЃюрЃўрЃА рЃарЃћрЃфрЃћрЃърЃбрЃЮрЃарЃўрЃА (VDR) рЃњрЃћрЃюрЃўрЃА as 2228570 рЃърЃЮрЃџрЃўрЃЏрЃЮрЃарЃцрЃўрЃќрЃЏрЃўрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃљ рЃљрЃБрЃбрЃЮрЃўрЃЏрЃБрЃюрЃБрЃарЃў рЃЌрЃўрЃарЃћрЃЮрЃўрЃЊрЃўрЃбрЃўрЃА рЃЊрЃарЃЮрЃА рЃљрЃГрЃљрЃарЃўрЃА рЃърЃЮрЃърЃБрЃџрЃљрЃфрЃўрЃўрЃА рЃЏрЃљрЃњрЃљрЃџрЃўрЃЌрЃќрЃћ\" рЃЊрЃљ рЃЏрЃўрЃћрЃюрЃўрЃГрЃљ рЃЉрЃўрЃўрЃџрЃЮрЃњрЃўрЃўрЃА рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃўрЃА рЃ«рЃљрЃарЃўрЃАрЃ«рЃў!",
    briefText: "рЃЊрЃўрЃЊрЃў рЃАрЃўрЃ«рЃљрЃарЃБрЃџрЃўрЃЌ рЃЊрЃљ рЃАрЃўрЃљрЃЏрЃљрЃДрЃўрЃЌ рЃњрЃЋрЃАрЃБрЃарЃА рЃњрЃљрЃБрЃгрЃДрЃЮрЃЌ, рЃарЃЮрЃЏ 2023 рЃгрЃџрЃўрЃА 26 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃюрЃљрЃюрЃљ рЃГрЃћрЃџрЃўрЃФрЃћрЃЏ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃў / B S U -рЃерЃў рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃЌ рЃЊрЃљрЃўрЃфрЃЋрЃљ рЃАрЃљрЃЊрЃЮрЃЦрЃбрЃЮрЃарЃЮ рЃЊрЃўрЃАрЃћрЃарЃбрЃљрЃфрЃўрЃљ рЃЌрЃћрЃЏрЃљрЃќрЃћ \"D рЃЋрЃўрЃбрЃљрЃЏрЃўрЃюрЃўрЃА рЃарЃћрЃфрЃћрЃърЃбрЃЮрЃарЃўрЃА (VDR) рЃњрЃћрЃюрЃўрЃА as 2228570 рЃърЃЮрЃџрЃўрЃЏрЃЮрЃарЃцрЃўрЃќрЃЏрЃўрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃљ рЃљрЃБрЃбрЃЮрЃўрЃЏрЃБрЃюрЃБрЃарЃў рЃЌрЃўрЃарЃћрЃЮрЃўрЃЊрЃўрЃбрЃўрЃА рЃЊрЃарЃЮрЃА рЃљрЃГрЃљрЃарЃўрЃА рЃърЃЮрЃърЃБрЃџрЃљрЃфрЃўрЃўрЃА рЃЏрЃљрЃњрЃљрЃџрЃўрЃЌрЃќрЃћ\" рЃЊрЃљ рЃЏрЃўрЃћрЃюрЃўрЃГрЃљ рЃЉрЃўрЃўрЃџрЃЮрЃњрЃўрЃўрЃА рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЊрЃЮрЃЦрЃбрЃЮрЃарЃўрЃА рЃ«рЃљрЃарЃўрЃАрЃ«рЃў!\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ, рЃюрЃљрЃюрЃљ рЃЊрЃљ рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!"
