    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљ-рЃФрЃЏрЃљ рЃћрЃџрЃћрЃюрЃћ рЃЊрЃљ рЃАрЃљрЃЉрЃљ рЃ«рЃБрЃ»рЃљрЃФрЃћрЃћрЃЉрЃў рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃБрЃџрЃў рЃЏрЃБрЃАрЃўрЃЎрЃЮрЃАрЃћрЃЉрЃў рЃљрЃарЃўрЃљрЃю.",
    briefText: "2023 рЃгрЃџрЃўрЃА 5-12 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў рЃњрЃљрЃЏрЃљрЃарЃЌрЃБрЃџ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃљ рЃЏрЃБрЃАрЃўрЃЎрЃЮрЃА-рЃерЃћрЃЏрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџрЃЌрЃљ VII рЃарЃћрЃњрЃўрЃЮрЃюрЃљрЃџрЃБрЃа рЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃќрЃћ рЃАрЃљрЃЉрЃљрЃЏ рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃљрЃЊрЃњрЃўрЃџрЃў рЃљрЃўрЃдрЃЮ рЃцрЃџрЃћрЃўрЃбрЃўрЃА, рЃ«рЃЮрЃџрЃЮ рЃћрЃџрЃћрЃюрЃћрЃЏ рЃЊрЃўрЃърЃџрЃЮрЃЏрЃў рЃАрЃљрЃЮрЃърЃћрЃарЃЮ рЃЋрЃЮрЃЎрЃљрЃџрЃўрЃА рЃЊрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃљрЃЊрЃњрЃўрЃџрЃў рЃАрЃљрЃњрЃБрЃюрЃЊрЃЮ рЃЏрЃўрЃЏрЃљрЃарЃЌрЃБрЃџрЃћрЃЉрЃўрЃЌ.\nрЃАрЃБрЃџ рЃљрЃ«рЃџрЃљрЃ«рЃљрЃю рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃљ рЃЏрЃБрЃАрЃўрЃЎрЃЮрЃА-рЃерЃћрЃЏрЃАрЃарЃБрЃџрЃћрЃЉрЃћрЃџрЃЌрЃљ рЃЎрЃЮрЃюрЃЎрЃБрЃарЃА-рЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџрЃќрЃћ РђърЃарЃЮрЃюрЃЊрЃЮ -рЃЎрЃџрЃљрЃАрЃўрЃЎрЃљРђю рЃАрЃљрЃЉрЃљрЃЏ рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃърЃарЃћрЃЏрЃўрЃљ рЃЊрЃљрЃўрЃЏрЃАрЃљрЃ«рЃБрЃарЃљ.\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\nрЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!"
