    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћ-10 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ 2023 рЃгрЃџрЃўрЃА 24 рЃўрЃЋрЃюрЃўрЃАрЃА рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃћрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃЏрЃўрЃћрЃа рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃБрЃџ рЃЊрЃћрЃЉрЃљрЃбрЃћрЃЉрЃерЃў, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЎрЃљрЃарЃџ рЃърЃЮрЃърЃћрЃарЃўрЃА рЃгрЃћрЃАрЃћрЃЉрЃўрЃЌ рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ.\nрЃЊрЃћрЃЉрЃљрЃбрЃћрЃЉрЃў рЃЊрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃАрЃљ рЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА Рёќ16 рЃАрЃљрЃ»рЃљрЃарЃЮ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЮрЃа-рЃЮрЃа рЃњрЃБрЃюрЃЊрЃА рЃерЃЮрЃарЃўрЃА.",
    briefText: "рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ, рЃфрЃ«рЃљрЃЊрЃћ рЃЊрЃљ рЃЊрЃљрЃФрЃљрЃЉрЃБрЃџрЃў рЃЌрЃљрЃЏрЃљрЃерЃўрЃА рЃЊрЃарЃЮрЃА рЃњрЃљрЃюрЃўрЃ«рЃўрЃџрЃћрЃА рЃерЃћрЃЏрЃЊрЃћрЃњрЃў рЃарЃћрЃќрЃЮрЃџрЃБрЃфрЃўрЃћрЃЉрЃў:\n-рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў 12 рЃгрЃџрЃўрЃљрЃюрЃў рЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃљ рЃњрЃљрЃЏрЃљрЃарЃЌрЃџрЃћрЃЉрЃБрЃџрЃўрЃљ;\n- рЃЦрЃљрЃџрЃћрЃЉрЃА рЃюрЃљрЃЎрЃџрЃћрЃЉрЃљрЃЊ рЃљрЃЦрЃЋрЃЌ рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃБрЃџрЃў рЃбрЃћрЃЦрЃюрЃЮрЃџрЃЮрЃњрЃўрЃБрЃарЃў рЃБрЃюрЃљрЃарЃћрЃЉрЃў, рЃЋрЃўрЃЊрЃарЃћ рЃЎрЃљрЃфрЃћрЃЉрЃА;\n- рЃАрЃўрЃЎрЃЋрЃЊрЃўрЃџрЃўрЃЌ рЃЊрЃљрЃАрЃ»рЃљ рЃњрЃљрЃЏрЃљрЃарЃЌрЃџрЃћрЃЉрЃБрЃџрЃўрЃљ.\nрЃЊрЃћрЃЉрЃљрЃбрЃћрЃЉрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА рЃўрЃдрЃћрЃЉрЃЊрЃюрЃћрЃю:\nрЃюрЃўрЃџрЃљ рЃ»рЃўрЃюрЃГрЃљрЃарЃљрЃФрЃћ,\nрЃЏрЃљрЃарЃЌрЃљ рЃЊрЃБрЃЏрЃЉрЃљрЃФрЃћ,\nрЃљрЃюрЃљрЃюрЃЮ рЃ«рЃўрЃюрЃЎрЃўрЃџрЃљрЃФрЃћ,\nрЃЊрЃљрЃЌрЃљ рЃБрЃарЃБрЃерЃљрЃФрЃћ,\nрЃЦрЃарЃўрЃАрЃбрЃўрЃюрЃћ рЃљрЃюрЃЌрЃљрЃФрЃћ,\nрЃћрЃџрЃћрЃюрЃћ рЃ«рЃБрЃ»рЃљрЃФрЃћ.\nрЃњрЃљрЃўрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃљ рЃЏрЃЮрЃўрЃърЃЮрЃЋрЃљ рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃњрЃБрЃюрЃЊрЃЏрЃљ рЃћрЃџрЃћрЃюрЃћ рЃ»рЃБрЃ«рЃљрЃФрЃўрЃА, рЃЦрЃарЃўрЃАрЃбрЃўрЃюрЃћ рЃљрЃюрЃЌрЃљрЃФрЃўрЃА рЃЊрЃљ рЃЊрЃљрЃЌрЃљ рЃБрЃарЃБрЃерЃљрЃФрЃўрЃА рЃерЃћрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃЮрЃЉрЃўрЃЌ!\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\nрЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ!"
