    title: "рЃЏрЃћрЃЊрЃљрЃџрЃЮрЃАрЃљрЃюрЃЌрЃљ рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃћрЃЉрЃљ.\n 2023 рЃгрЃџрЃўрЃА 12 рЃўрЃЋрЃџрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃдрЃЋрЃЌрЃўрЃАрЃЏрЃерЃЮрЃЉрЃџрЃўрЃА рЃерЃЮрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃЎрЃљрЃЌрЃћрЃЊрЃарЃЮ рЃбрЃљрЃФрЃљрЃарЃерЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃљрЃќрЃћрЃЌрЃўрЃА рЃЏрЃўрЃбрЃарЃЮрЃърЃЮрЃџрЃўрЃбрЃЏрЃљ рЃЊрЃўрЃЏрЃўрЃбрЃарЃўрЃЏ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА 2022-2023 рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃА рЃгрЃљрЃарЃЕрЃўрЃюрЃћрЃЉрЃБрЃџрЃў рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃў рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃБрЃџрЃљрЃЊ рЃЊрЃљрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃљ рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћрЃЊрЃџрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ рЃћрЃарЃЌрЃ»рЃћрЃарЃљрЃЊрЃў рЃАрЃбрЃўрЃърЃћрЃюрЃЊрЃўрЃћрЃЉрЃўрЃЌ!",
    briefText: "рЃгрЃџрЃћрЃЋрЃљрЃюрЃЊрЃћрЃџрЃў рЃЏрЃћрЃЊрЃљрЃџрЃЮрЃАрЃюрЃћрЃЉрЃў рЃљрЃарЃўрЃљрЃю:\nрЃюрЃўрЃюрЃў рЃГрЃДрЃЮрЃюрЃўрЃљ\nрЃЌрЃћрЃЎрЃџрЃљ рЃерЃљрЃерЃўрЃЎрЃљрЃФрЃћ\nрЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃњрЃЮрЃарЃЊрЃћрЃџрЃљрЃФрЃћ\nрЃњрЃљрЃЉрЃарЃўрЃћрЃџ рЃЏрЃБрЃарЃЋрЃљрЃюрЃўрЃФрЃћ\nрЃњрЃўрЃЮрЃарЃњрЃў рЃЕрЃ«рЃљрЃўрЃФрЃћ\nрЃюрЃБрЃфрЃўрЃЎрЃЮ рЃЎрЃћрЃЎрЃћрЃџрЃўрЃФрЃћ\nрЃњрЃЮрЃњрЃљ рЃЦрЃљрЃЌрЃљрЃЏрЃљрЃФрЃћ\nрЃЮрЃЌрЃЮ рЃЎрЃљрЃ«рЃўрЃФрЃћ\nрЃљрЃюрЃљ рЃЎрЃЋрЃљрЃГрЃљрЃФрЃћ\nрЃЌрЃљрЃЏрЃљрЃа рЃЕрЃљрЃюрЃЕрЃўрЃЉрЃљрЃФрЃћ\nрЃЏрЃљрЃарЃўрЃљрЃЏ рЃГрЃљрЃдрЃљрЃџрЃўрЃФрЃћ\nрЃџрЃўрЃќрЃў рЃЮрЃњрЃљрЃюрЃћрЃќрЃЮрЃЋрЃљ\nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\nрЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!\n#рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃАрЃгрЃЏрЃўрЃюрЃЊрЃљрЃюрЃЊрЃарЃўрЃљрЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃАрЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃАрЃАрЃЎрЃЮрЃџрЃљ\n#рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃўрЃАрЃЏрЃћрЃЊрЃљрЃџрЃЮрЃАрЃюрЃћрЃЉрЃў"
