    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃЮрЃўрЃАрЃЏрЃўрЃюрЃћрЃА рЃџрЃћрЃЦрЃфрЃўрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃАрЃљрЃЏрЃерЃЋрЃўрЃЊрЃЮрЃЉрЃЮ рЃЏрЃўрЃАрЃўрЃћрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃерЃћрЃЦрЃЏрЃюрЃћрЃА SWOT рЃљрЃюрЃљрЃџрЃўрЃќрЃў рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃАрЃљрЃЏрЃерЃЋрЃўрЃЊрЃЮрЃЉрЃЮ рЃЏрЃўрЃАрЃўрЃљрЃерЃў рЃЕрЃЋрЃћрЃюрЃў рЃЦрЃЋрЃћрЃДрЃюрЃўрЃА рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃгрЃљрЃарЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃърЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃћрЃЉрЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ: \"рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃАрЃљрЃЏрЃерЃЋрЃўрЃЊрЃЮрЃЉрЃЮ рЃЏрЃўрЃАрЃўрЃћрЃЉрЃерЃў\""
