    title: "рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃАрЃбрЃљрЃарЃбрЃћрЃЉрЃў",
    briefText: "рЃцрЃћрЃ«рЃЉрЃБрЃарЃЌрЃў рЃЊрЃљ рЃЎрЃљрЃџрЃљрЃЌрЃЉрЃБрЃарЃЌрЃў: VIII-2 рЃЊрЃљ VIII-4 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃў \nрЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў\n рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃАрЃбрЃљрЃарЃбрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃ«рЃЋрЃљ рЃАрЃърЃЮрЃарЃбрЃБрЃџрЃў рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃћрЃЉрЃў: II-2 II-3 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃў рЃЊрЃљ IV-3 IV-4 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃў\nрЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃЎрЃљрЃарЃџрЃЮ рЃбрЃарЃљрЃърЃљрЃўрЃФрЃћ\n рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃцрЃарЃћрЃюрЃЉрЃБрЃарЃЌрЃў: III-1 vs III-3 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃў\nрЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃњрЃўрЃЋрЃў рЃЎрЃћрЃарЃћрЃАрЃћрЃџрЃўрЃФрЃћ\n рЃ«рЃћрЃџрЃЉрЃБрЃарЃЌрЃў: V-3 vs V-4 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃў\nрЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў\n рЃ«рЃћрЃџрЃЉрЃБрЃарЃЌрЃў: V-1 vs V-2 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃў \nрЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў\n рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃАрЃбрЃљрЃарЃбрЃћрЃЉрЃў: V-1 VS V-2 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃў \nрЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў"
