    title: "X-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃЊрЃарЃљрЃЏрЃљрЃбрЃБрЃџ рЃЌрЃћрЃљрЃбрЃарЃерЃў рЃЏрЃўрЃ«рЃћрЃўрЃџ рЃ»рЃљрЃЋрЃљрЃ«рЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃърЃўрЃћрЃАрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ рЃЊрЃљрЃЊрЃњрЃЏрЃБрЃџ рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃА \"рЃАрЃЮрЃцрЃћрЃџрЃАрЃљ рЃерЃўрЃюрЃљ\" рЃЊрЃљрЃћрЃАрЃгрЃарЃюрЃћрЃю.\nрЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃљрЃЋрЃ«рЃћрЃџрЃўрЃФрЃћ\nрЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџрЃў - рЃќрЃЋрЃўрЃљрЃЊ рЃЕрЃ«рЃћрЃюрЃЎрЃћрЃџрЃў",
    briefText: "X-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃЊрЃарЃљрЃЏрЃљрЃбрЃБрЃџ рЃЌрЃћрЃљрЃбрЃарЃерЃў рЃЏрЃўрЃ«рЃћрЃўрЃџ рЃ»рЃљрЃЋрЃљрЃ«рЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃърЃўрЃћрЃАрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ рЃЊрЃљрЃЊрЃњрЃЏрЃБрЃџ рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃА \"рЃАрЃЮрЃцрЃћрЃџрЃАрЃљ рЃерЃўрЃюрЃљ\" рЃЊрЃљрЃћрЃАрЃгрЃарЃюрЃћрЃю."
