    id: 266,
    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃарЃФрЃћрЃџрЃЊрЃћрЃЉрЃљ рЃърЃарЃЮрЃћрЃЦрЃбрЃў \"рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃў рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃА\".",
    briefText: "рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ, рЃарЃЮрЃЏ рЃБрЃцрЃарЃЮрЃАрЃў рЃљрЃАрЃљрЃЎрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЌрЃљрЃЋрЃўрЃАрЃў рЃфрЃЮрЃЊрЃюрЃљ рЃЊрЃљ рЃњрЃљрЃЏрЃЮрЃфрЃЊрЃўрЃџрЃћрЃЉрЃљ рЃњрЃљрЃБрЃќрЃўрЃљрЃарЃЮрЃю рЃБрЃЏрЃфрЃарЃЮрЃАрЃћрЃЉрЃА!\nрЃљрЃЏрЃ»рЃћрЃарЃљрЃЊ, 2023 рЃгрЃџрЃўрЃА 9 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃњрЃЋрЃћрЃАрЃбрЃБрЃЏрЃарЃљ рЃЕрЃЋрЃћрЃюрЃў рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃў рЃўрЃЋрЃљрЃюрЃћ рЃ»рЃљрЃЋрЃљрЃ«рЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЌрЃАрЃБ-рЃА рЃЏрЃљрЃњрЃўрЃАрЃбрЃарЃў, рЃЏрЃћрЃЊрЃўрЃљ-рЃърЃџрЃљрЃбрЃцрЃЮрЃарЃЏрЃљ \"рЃЏрЃљрЃБрЃгрЃДрЃћрЃЉрЃћрЃџрЃў\"-рЃА рЃЊрЃљрЃЏрЃцрЃБрЃФрЃюрЃћрЃЉрЃћрЃџрЃў рЃарЃљрЃбрЃў рЃарЃљрЃбрЃўрЃљрЃюрЃў.\nрЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃўрЃА рЃЌрЃћрЃЏрЃљ - рЃърЃЮрЃџрЃўрЃбрЃўрЃЎрЃўрЃА рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃљ.\nрЃўрЃюрЃбрЃћрЃарЃљрЃЦрЃбрЃўрЃБрЃџрЃў рЃџрЃћрЃЦрЃфрЃўрЃљ рЃЎрЃўрЃЌрЃ«рЃЋрЃљ-рЃърЃљрЃАрЃБрЃ«рЃўрЃА рЃарЃћрЃЪрЃўрЃЏрЃерЃў рЃњрЃљрЃњрЃарЃФрЃћрЃџрЃЊрЃљ. рЃарЃљрЃбрЃўрЃЏ рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃљрЃарЃљрЃћрЃарЃЌрЃў рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃў рЃърЃарЃЮрЃЉрЃџрЃћрЃЏрЃљ рЃњрЃљрЃюрЃўрЃ«рЃўрЃџрЃћрЃА рЃЊрЃљ рЃњрЃљрЃљрЃљрЃюрЃљрЃџрЃўрЃќрЃћрЃА.\nрЃБрЃдрЃарЃЏрЃћрЃА рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљрЃА рЃЏрЃЮрЃЋрЃљрЃ«рЃАрЃћрЃюрЃћрЃЉрЃЌ рЃарЃљрЃбрЃўрЃА рЃЊрЃўрЃЊ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃЏрЃљрЃА!"
