    title: "рЃљ(рЃљ)рЃўрЃъ рЃЦ. рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў VII рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃћрЃюрЃбрЃЮрЃарЃў рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃљрЃюрЃљ рЃљрЃюрЃБрЃерЃўрЃФрЃўрЃА рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃўрЃЌ рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃўрЃА рЃцрЃЮрЃарЃЏрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃўрЃЊрЃўрЃЊрЃўрЃА рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃБрЃџрЃў рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ. рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃњрЃљрЃЏрЃЮрЃўрЃДрЃћрЃюрЃћрЃА рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃљрЃЏрЃќрЃљрЃЊрЃћрЃЉрЃБрЃџрЃў рЃњрЃџрЃЮрЃЉрЃБрЃАрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃљрЃљрЃЏрЃќрЃљрЃЊрЃћрЃА \"рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃўрЃА рЃгрЃўрЃњрЃюрЃћрЃЉрЃў\".",
    briefText: "рЃљрЃЏ рЃњрЃќрЃўрЃЌ рЃерЃћрЃљрЃ»рЃљрЃЏрЃћрЃА рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃў:\nрЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃўрЃА рЃцрЃЮрЃарЃЏрЃљ рЃЊрЃљ рЃАрЃўрЃЊрЃўрЃЊрЃћ;\nрЃњрЃарЃљрЃЊрЃБрЃАрЃЌрЃљ рЃЉрЃљрЃЊрЃћ рЃЊрЃљ рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃБрЃџрЃў рЃЎрЃЮрЃЮрЃарЃЊрЃўрЃюрЃљрЃбрЃћрЃЉрЃў;\nрЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃўрЃА рЃцрЃЮрЃарЃЏрЃљ рЃЊрЃљ рЃАрЃўрЃЊрЃўрЃЊрЃћ;\nрЃњрЃарЃљрЃЊрЃБрЃАрЃЌрЃљ рЃЉрЃљрЃЊрЃћ рЃЊрЃљ рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃБрЃџрЃў рЃЎрЃЮрЃЮрЃарЃЊрЃўрЃюрЃљрЃбрЃћрЃЉрЃў;\nрЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃў рЃърЃљрЃбрЃљрЃарЃљ рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃћрЃЉрЃА!"
