    image: name270,
    id: 270,
    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА X-1 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ (рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЦрЃћрЃЌрЃћрЃЋрЃљрЃю рЃ«рЃљрЃарЃљрЃЉрЃљрЃФрЃћ) рЃўрЃЏрЃБрЃерЃљрЃЋрЃћрЃА рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ-рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃќрЃћ РђърЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃўрЃюрЃћрЃарЃљрЃџрЃБрЃарЃў рЃгрЃДрЃџрЃћрЃЉрЃўРђю.",
    briefText: "рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃЏрЃљ рЃЏрЃЮрЃљрЃЏрЃќрЃљрЃЊрЃћрЃА рЃЏрЃљрЃАрЃљрЃџрЃљ, рЃгрЃљрЃарЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃљрЃБрЃЊрЃўрЃбрЃЮрЃарЃўрЃўрЃА рЃгрЃўрЃюрЃљрЃерЃћ , рЃўрЃЏрЃАрЃ»рЃћрЃџрЃћрЃА рЃгрЃДрЃџрЃўрЃА рЃарЃћрЃАрЃБрЃарЃАрЃћрЃЉрЃўрЃА рЃерЃћрЃюрЃљрЃарЃЕрЃБрЃюрЃћрЃЉрЃљрЃќрЃћ, рЃЏрЃўрЃюрЃћрЃарЃљрЃџрЃБрЃарЃў рЃгрЃџрЃћрЃЉрЃўрЃА рЃЏрЃарЃљрЃЋрЃљрЃџрЃцрЃћрЃарЃЮрЃЋрЃюрЃћрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃерЃћрЃЊрЃњрЃћрЃюрЃўрЃџрЃЮрЃЉрЃљрЃќрЃћ, рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃљрЃќрЃћ рЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃўрЃА рЃ»рЃљрЃюрЃЏрЃарЃЌрЃћрЃџрЃЮрЃЉрЃўрЃАрЃљрЃЌрЃЋрЃўрЃА, рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃћрЃбрЃўрЃЎрЃћрЃбрЃћрЃЉрЃў, рЃАрЃљрЃЊрЃљрЃф рЃЏрЃўрЃюрЃўрЃерЃюрЃћрЃЉрЃБрЃџрЃўрЃљ рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃЏрЃўрЃюрЃћрЃарЃљрЃџрЃБрЃарЃў рЃгрЃДрЃџрЃўрЃА рЃЦрЃўрЃЏрЃўрЃБрЃарЃў рЃерЃћрЃЊрЃњрЃћрЃюрЃўрЃџрЃЮрЃЉрЃљ, рЃЉрЃЮрЃџрЃЮрЃА рЃЎрЃў рЃЌрЃљрЃЋрЃљрЃЊ рЃерЃћрЃЦрЃЏрЃюрЃћрЃА рЃЏрЃўрЃюрЃћрЃарЃљрЃџрЃБрЃарЃў рЃгрЃДрЃљрЃџрЃў."
