    title: "24 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЏрЃАрЃЮрЃцрЃџрЃўрЃЮ рЃЎрЃџрЃўрЃЏрЃљрЃбрЃўрЃА рЃфрЃЋрЃџрЃўрЃџрЃћрЃЉрЃўрЃА рЃЊрЃдрЃћрЃА рЃљрЃдрЃюрЃўрЃерЃюрЃљрЃЋрЃА. рЃљрЃЏ рЃЊрЃдрЃўрЃА рЃљрЃдрЃюрЃўрЃерЃЋрЃюрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ рЃЎрЃџрЃўрЃЏрЃљрЃбрЃўрЃА рЃфрЃЋрЃџрЃўрЃџрЃћрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃљ, рЃАрЃљрЃцрЃарЃЌрЃ«рЃћрЃћрЃЉрЃўрЃА рЃњрЃљрЃљрЃюрЃљрЃџрЃўрЃќрЃћрЃЉрЃљ рЃЊрЃљ рЃърЃарЃћрЃЋрЃћрЃюрЃфрЃўрЃБрЃџрЃў рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЊрЃљрЃњрЃћрЃњрЃЏрЃЋрЃљ рЃљрЃЏ рЃърЃарЃЮрЃфрЃћрЃАрЃўрЃА рЃерЃћрЃАрЃљрЃЕрЃћрЃарЃћрЃЉрЃџрЃљрЃЊ.",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃф рЃерЃћрЃБрЃћрЃарЃЌрЃЊрЃљ рЃљрЃЏ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљрЃА!\nXI рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЎрЃћрЃерЃћрЃџрЃљрЃЋрЃљрЃЏ рЃЊрЃљ рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃ»рЃћрЃџрЃўрЃљрЃЏ рЃЏрЃћрЃћрЃЦрЃЋрЃАрЃћ рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌрЃў рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃљ рЃЎрЃџрЃўрЃЏрЃљрЃбрЃўрЃА рЃфрЃЋрЃџрЃўрЃџрЃћрЃЉрЃўрЃА, рЃЏрЃўрЃАрЃў рЃЏрЃЮрЃАрЃљрЃџрЃЮрЃЊрЃюрЃћрЃџрЃў рЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃўрЃА рЃЊрЃљ рЃърЃарЃћрЃЋрЃћрЃюрЃфрЃўрЃБрЃџрЃў рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃљрЃЋрЃбрЃЮрЃарЃў - рЃЉрЃўрЃЮрЃџрЃЮрЃњрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЏрЃљрЃўрЃљ рЃЏрЃерЃЋрЃћрЃџрЃўрЃФрЃћ."
