    title: "2023 рЃгрЃџрЃўрЃА 26 рЃЮрЃЦрЃбрЃЮрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃдрЃЋрЃарЃЌрЃЮ рЃАрЃ»рЃБрЃџрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃЌрЃљрЃЏрЃљрЃа рЃюрЃўрЃюрЃўрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃерЃћрЃљрЃ»рЃљрЃЏрЃћрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃўрЃџрЃў рЃЏрЃљрЃАрЃљрЃџрЃљ.",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃ«рЃћрЃџрЃўрЃЌ рЃерЃћрЃЦрЃЏрЃюрЃўрЃџрЃў рЃћрЃАрЃЎрЃўрЃќрЃћрЃЉрЃў, рЃЕрЃљрЃюрЃљрЃ«рЃљрЃбрЃћрЃЉрЃў, рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃћрЃЉрЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ рЃБрЃцрЃџрЃўрЃА рЃЏрЃўрЃћрЃа рЃфрЃўрЃАрЃљ рЃЊрЃљ рЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃўрЃА рЃерЃћрЃЦрЃЏрЃюрЃљ, рЃЦрЃЏрЃюрЃўрЃџрЃћрЃЉрЃљрЃЌрЃљ рЃарЃўрЃњрЃў \"рЃерЃћрЃАрЃљрЃЦрЃЏрЃћ\" (рЃЊрЃљрЃЉ.1-2 рЃЌ.) . \nрЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮрЃЊ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЕрЃўрЃюрЃћрЃА рЃфрЃЮрЃЊрЃюрЃљ, рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃЊрЃљ рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃўрЃЌрЃў рЃБрЃюрЃљрЃарЃћрЃЉрЃў."
