    briefText: "рЃњрЃљрЃЏрЃЮрЃЋрЃџрЃўрЃюрЃЊрЃюрЃћрЃю рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃў - рЃЋрЃљрЃЪрЃЌрЃљ рЃерЃЮрЃарЃўрЃА рЃФрЃЏрЃћрЃЉрЃў рЃЊрЃћрЃЏрЃћрЃбрЃарЃћ рЃЊрЃљ рЃњрЃўрЃЮрЃарЃњрЃў рЃњрЃЮрЃњрЃўрЃљрЃерЃЋрЃўрЃџрЃћрЃЉрЃў, рЃ«рЃЮрЃџрЃЮ рЃњрЃЮрЃњрЃЮрЃюрЃљрЃЌрЃљ рЃерЃЮрЃарЃўрЃА - рЃАрЃљрЃџрЃЮрЃЏрЃћ рЃЉрЃћрЃЊрЃўрЃюрЃљрЃФрЃћ. рЃАрЃгрЃЮрЃарЃћрЃЊ рЃћрЃА рЃАрЃљрЃЏрЃћрЃБрЃџрЃў рЃгрЃљрЃарЃљрЃЊрЃњрЃћрЃюрЃА рЃАрЃЎрЃЮрЃџрЃљ 2023 рЃгрЃџрЃўрЃА 12 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃА рЃљрЃГрЃљрЃарЃўрЃА рЃАрЃЎрЃЮрЃџрЃћрЃЉрЃА рЃерЃЮрЃарЃўрЃА рЃЊрЃљрЃњрЃћрЃњрЃЏрЃўрЃџ рЃърЃўрЃарЃЋрЃћрЃџрЃЮрЃЉрЃљрЃќрЃћ.\nрЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃбрЃБрЃарЃюрЃўрЃарЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃў рЃўрЃДрЃЮ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў.\nрЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃЕрЃЋрЃћрЃюрЃА рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃљ рЃЏрЃЮрЃГрЃљрЃЊрЃарЃљрЃЎрЃћрЃћрЃЉрЃА!"
