    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА V рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџ рЃўрЃарЃўрЃюрЃљ рЃЋрЃўрЃЊрЃБрЃџрЃўрЃюрЃљрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю\"рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА РђЎРђЎ рЃЏрЃўрЃћрЃа рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃБрЃџ рЃАрЃљрЃЉрЃљрЃЋрЃерЃЋрЃЮ рЃАрЃљрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃЮ рЃерЃЮрЃБрЃА РђърЃЊрЃўрЃЊрЃў рЃЎрЃЮрЃАрЃЏрЃЮрЃАрЃБрЃарЃў рЃЏрЃЮрЃњрЃќрЃљрЃБрЃарЃЮрЃЉрЃљРђю.",
    briefText: "рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃўрЃЏрЃЮрЃњрЃќрЃљрЃБрЃарЃћрЃА рЃЎрЃЮрЃАрЃЏрЃўрЃБрЃарЃў рЃАрЃљрЃЏрЃДрЃљрЃарЃЮ рЃўрЃЊрЃБрЃЏрЃљрЃџрЃћрЃЉрЃўрЃЌрЃљрЃљ рЃЏрЃЮрЃфрЃБрЃџ рЃџрЃљрЃЉрЃўрЃарЃўрЃюрЃЌрЃћрЃЉрЃерЃў!\nрЃАрЃљрЃЏрЃћрЃфрЃюрЃўрЃћрЃарЃЮ рЃћрЃЦрЃърЃћрЃарЃўрЃЏрЃћрЃюрЃбрЃћрЃЉрЃўрЃА рЃЏрЃћрЃерЃЋрЃћрЃЮрЃЉрЃўрЃЌ рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃЊрЃљ рЃюрЃљрЃ«рЃћрЃА рЃарЃљ рЃљрЃарЃўрЃА рЃБрЃгрЃЮрЃюрЃљрЃЊрЃЮрЃЉрЃљ рЃЊрЃљ рЃЋрЃљрЃЎрЃБрЃБрЃЏрЃў?\nрЃарЃўрЃАрЃњрЃљрЃю рЃерЃћрЃЊрЃњрЃћрЃЉрЃљ рЃЏрЃќрЃћ рЃЊрЃљ рЃарЃЮрЃњрЃЮрЃарЃўрЃљ рЃњрЃћрЃўрЃќрЃћрЃарЃћрЃЉрЃў рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃърЃџрЃљрЃюрЃћрЃбрЃћрЃЉрЃќрЃћ. рЃЌрЃљрЃЋрЃўрЃАрЃў рЃ«рЃћрЃџрЃўрЃЌ рЃњрЃљрЃљрЃЎрЃћрЃЌрЃћрЃА рЃЏрЃћрЃбрЃћрЃЮрЃарЃўрЃбрЃћрЃЉрЃА, рЃЏрЃЮрЃљрЃгрЃДрЃЋрЃћрЃА рЃЋрЃБрЃџрЃЎрЃљрЃюрЃўрЃА рЃљрЃЏрЃЮрЃцрЃарЃЦрЃЋрЃћрЃЋрЃљ рЃЋрЃћрЃюрЃћрЃарЃљрЃќрЃћ рЃЊрЃљ рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю рЃЏрЃљрЃарЃАрЃўрЃљрЃюрЃћрЃџрЃћрЃЉрЃА!\nрЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЊрЃљ рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌрЃў рЃДрЃЋрЃћрЃџрЃљ рЃћрЃЦрЃАрЃърЃћрЃарЃўрЃЏрЃћрЃюрЃбрЃў рЃљрЃЉрЃАрЃЮрЃџрЃБрЃбрЃБрЃарЃљрЃЊ рЃБрЃАрЃљрЃцрЃарЃЌрЃ«рЃЮ рЃўрЃДрЃЮ!"
