    title: "2023 рЃгрЃџрЃўрЃА 28 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў V-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџ рЃўрЃарЃўрЃюрЃљ рЃАрЃћрЃЋрЃЮрЃАрЃбрЃўрЃљрЃюрЃЮрЃЋрЃљрЃА, рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃўрЃА рЃћрЃЎрЃљ рЃЉрЃЪрЃўрЃюрЃљрЃЋрЃљрЃА рЃЊрЃљ рЃЎрЃљрЃ«рЃў рЃЎрЃљрЃ«рЃўрЃФрЃўрЃА рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃўрЃЌ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ, рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЊрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЏрЃўрЃюрЃў рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃў \"рЃЕрЃћрЃЏрЃў рЃАрЃљрЃЏрЃерЃЮрЃЉрЃџрЃЮ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃљ\".",
    briefText: "2023 рЃгрЃџрЃўрЃА 28 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў V-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџ рЃўрЃарЃўрЃюрЃљ рЃАрЃћрЃЋрЃЮрЃАрЃбрЃўрЃљрЃюрЃЮрЃЋрЃљрЃА, рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃўрЃА рЃћрЃЎрЃљ рЃЉрЃЪрЃўрЃюрЃљрЃЋрЃљрЃА рЃЊрЃљ рЃЎрЃљрЃ«рЃў рЃЎрЃљрЃ«рЃўрЃФрЃўрЃА рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃўрЃЌ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ, рЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў рЃЊрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЏрЃўрЃюрЃў рЃАрЃърЃћрЃЦрЃбрЃљрЃЎрЃџрЃў \"рЃЕрЃћрЃЏрЃў рЃАрЃљрЃЏрЃерЃЮрЃЉрЃџрЃЮ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃљ\"."
