    title: "25 рЃюрЃЮрЃћрЃЏрЃЉрЃћрЃарЃў рЃњрЃљрЃћрЃарЃЮ-рЃА рЃњрЃћрЃюрЃћрЃарЃљрЃџрЃБрЃа рЃљрЃАрЃљрЃЏрЃЉрЃџрЃћрЃљрЃА рЃЦрЃљрЃџрЃЌрЃљ рЃЏрЃўрЃЏрЃљрЃарЃЌ рЃФрЃљрЃџрЃљрЃЊрЃЮрЃЉрЃўрЃА рЃгрЃўрЃюрЃљрЃљрЃдрЃЏрЃЊрЃћрЃњ рЃЉрЃарЃФрЃЮрЃџрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃЊ рЃљрЃЦрЃЋрЃА рЃњрЃљрЃЏрЃЮрЃфрЃ«рЃљрЃЊрЃћрЃЉрЃБрЃџрЃў.\nрЃљрЃЏ рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ, VIII-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃћрЃЮрЃЉрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃўрЃюрЃњрЃљ рЃЏрЃљрЃарЃЌрЃљрЃџрЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃўрЃЌ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃљ ,,рЃљрЃа рЃњрЃљрЃЕрЃБрЃЏрЃЊрЃћ!РђЎРђЎ.",
    briefText: "рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃЏрЃўрЃќрЃљрЃюрЃў рЃфрЃюрЃЮрЃЉрЃљрЃЊрЃЮрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃљрЃљ рЃўрЃЏ рЃцрЃљрЃЦрЃбрЃўрЃА рЃЏрЃўрЃЏрЃљрЃарЃЌ, рЃарЃЮрЃЏ рЃЦрЃљрЃџрЃћрЃЉрЃў рЃЏрЃЌрЃћрЃџ рЃЏрЃАрЃЮрЃцрЃџрЃўрЃЮрЃерЃў рЃ«рЃЊрЃћрЃЉрЃўрЃљрЃю рЃцрЃўрЃќрЃўрЃЎрЃБрЃарЃў, рЃцрЃАрЃўрЃЦрЃЮрЃџрЃЮрЃњрЃўрЃБрЃарЃў, рЃЮрЃ»рЃљрЃ«рЃерЃў рЃФрЃљрЃџрЃљрЃЊрЃЮрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃ«рЃЋрЃљ рЃАрЃљрЃ«рЃўрЃА рЃФрЃљрЃџрЃљрЃЊрЃЮрЃЉрЃўрЃА рЃЏрЃАрЃ«рЃЋрЃћрЃарЃърЃџрЃўрЃюрЃў.\nрЃЏрЃЮрЃАрЃгрЃљрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃњрЃљрЃюрЃўрЃ«рЃўрЃџрЃћрЃА рЃърЃарЃЮрЃЉрЃџрЃћрЃЉрЃЏрЃўрЃА рЃЏрЃљрЃАрЃерЃбрЃљрЃЉрЃБрЃарЃЮрЃЉрЃљ рЃЊрЃљ рЃўрЃА рЃАрЃўрЃюрЃљрЃЏрЃЊрЃЋрЃўрЃџрЃћ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃ«рЃерЃўрЃарЃљрЃЊ рЃЊрЃљрЃЏрЃљрЃџрЃБрЃџрЃў рЃарЃЕрЃћрЃЉрЃљ.\nрЃарЃћрЃњрЃўрЃЮрЃюрЃерЃў рЃљрЃарЃАрЃћрЃЉрЃБрЃџрЃў рЃЌрЃљрЃЋрЃўрЃАрЃћрЃЉрЃБрЃарЃћрЃЉрЃћрЃЉрЃўрЃА рЃБрЃЎрЃћрЃЌ рЃњрЃљрЃфрЃюрЃЮрЃЉрЃўрЃА рЃЏрЃўрЃќрЃюрЃўрЃЌ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃћрЃгрЃЋрЃўрЃЋрЃюрЃћрЃю рЃАрЃљрЃЦрЃЋрЃћрЃџрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃЮ рЃцрЃЮрЃюрЃЊ ,,рЃўрЃљрЃџрЃЦрЃљрЃюрЃА.РђЎРђЎ рЃцрЃЮрЃюрЃЊрЃў 2015 рЃгрЃџрЃўрЃЊрЃљрЃю рЃцрЃАрЃўрЃЦрЃЮрЃџрЃЮрЃњрЃўрЃБрЃа рЃЊрЃљ рЃўрЃБрЃарЃўрЃЊрЃўрЃБрЃџ рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃљрЃА рЃБрЃгрЃћрЃЋрЃА рЃЏрЃљрЃарЃбрЃЮрЃ«рЃћрЃџрЃљ рЃЊрЃћрЃЊрЃћрЃЉрЃАрЃљ, рЃФрЃљрЃџрЃљрЃЊрЃЮрЃЉрЃўрЃА рЃЏрЃАрЃ«рЃЋрЃћрЃарЃърЃџ рЃЦрЃљрЃџрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃЏрЃљрЃЌ рЃерЃЋрЃўрЃџрЃћрЃЉрЃА. рЃЎрЃўрЃЌрЃ«рЃЋрЃљрЃќрЃћ, рЃЌрЃБ рЃарЃљрЃЏрЃЊрЃћрЃюрЃљрЃЊ рЃ«рЃерЃўрЃарЃўрЃљ рЃЮрЃ»рЃљрЃ«рЃерЃў рЃФрЃљрЃџрЃљрЃЊрЃЮрЃЉрЃўрЃА рЃЎрЃБрЃЌрЃ«рЃўрЃЌ рЃЏрЃЮрЃЏрЃљрЃарЃЌрЃЋрЃўрЃљрЃюрЃЮрЃЉрЃўрЃА рЃцрЃљрЃЦрЃбрЃћрЃЉрЃў, рЃЦрЃљрЃџрЃЉрЃљрЃбрЃЮрЃюрЃЏрЃљ рЃЌрЃўрЃЎрЃљ рЃљрЃЉрЃљрЃерЃўрЃФрЃћрЃЏ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЊрЃдрЃўрЃА рЃфрЃћрЃюрЃбрЃарЃўрЃА рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃўрЃљ, рЃЉрЃарЃФрЃљрЃюрЃљ рЃарЃЮрЃЏ рЃЎрЃЋрЃўрЃарЃљрЃерЃў рЃАрЃљрЃерЃБрЃљрЃџрЃЮрЃЊ 22 рЃцрЃљрЃЦрЃбрЃў рЃцрЃўрЃЦрЃАрЃўрЃарЃЊрЃћрЃЉрЃљ рЃЏрЃљрЃЌрЃЌрЃљрЃю.\nрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃАрЃљрЃЋрЃљрЃџрЃА рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃљрЃерЃў, рЃфрЃюрЃЮрЃЉрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃљрЃЏрЃљрЃдрЃџрЃћрЃЉрЃљрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃА рЃЏрЃ«рЃарЃўрЃЊрЃљрЃю рЃЏрЃћрЃб рЃЏрЃ«рЃљрЃарЃЊрЃљрЃГрЃћрЃарЃљрЃерЃў рЃ«рЃћрЃЊрЃљрЃЋрЃћрЃю."
