    briefText: "рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃћрЃЉрЃљрЃЊ рЃгрЃљрЃарЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃЌрЃљрЃЋрЃў, рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃљрЃЏрЃљ рЃЌрЃБ рЃўрЃЏ рЃАрЃцрЃћрЃарЃЮрЃА рЃЊрЃўрЃЊ рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃЮрЃюрЃљрЃџрЃћрЃЉрЃќрЃћ, рЃљрЃАрЃћрЃЋрЃћ, рЃЊрЃдрЃћрЃА рЃњрЃљрЃЏрЃЦрЃарЃљрЃџ рЃърЃарЃЮрЃцрЃћрЃАрЃўрЃћрЃЉрЃќрЃћ рЃЊрЃљ рЃАрЃ«рЃЋрЃљ."
