    briefText: "рЃћрЃџрЃћрЃюрЃћ, рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃЊрЃўрЃЊ рЃАрЃърЃЮрЃарЃбрЃБрЃџ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!"
