    briefText: "рЃЏрЃљрЃарЃЌрЃџрЃљрЃф рЃќрЃљрЃЏрЃЌрЃарЃўрЃА рЃќрЃдрЃљрЃърЃљрЃарЃерЃў рЃњрЃЋрЃљрЃЏрЃЮрЃњрЃќрЃљрЃБрЃарЃћрЃА рЃЕрЃЋрЃћрЃюрЃЏрЃљ рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃЊрЃљ рЃАрЃљрЃЮрЃфрЃљрЃарЃў рЃњрЃљрЃюрЃгрЃДрЃЮрЃЉрЃљ рЃерЃћрЃЦрЃЏрЃюрЃћрЃА рЃАрЃљрЃљрЃ«рЃљрЃџрЃгрЃџрЃЮрЃЊ (рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў рЃўрЃарЃўрЃюрЃљ рЃАрЃћрЃЋрЃЮрЃАрЃбрЃўрЃљрЃюрЃЮрЃЋрЃљ рЃЊрЃљ рЃАрЃЮрЃцрЃЮ рЃАрЃљрЃюрЃўрЃЎрЃўрЃФрЃћ)"
