    briefText: "рЃЎрЃЮрЃюрЃцрЃћрЃарЃћрЃюрЃфрЃўрЃљрЃќрЃћ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃБрЃюрЃўрЃЋрЃћрЃарЃАрЃўрЃбрЃћрЃбрЃўрЃА рЃАрЃбрЃБрЃЊрЃћрЃюрЃбрЃћрЃЉрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃюрЃљрЃерЃарЃЮрЃЏрЃў рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ.рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА XI-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћ рЃљрЃюрЃљрЃюрЃЮ рЃ«рЃўрЃюрЃЎрЃўрЃџрЃљрЃФрЃћрЃЏ рЃЌрЃћрЃЏрЃљрЃќрЃћ \" рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃЌрЃљрЃцрЃџрЃў, рЃарЃЮрЃњрЃЮрЃарЃф рЃФрЃџрЃўрЃћрЃарЃў рЃљрЃюрЃбрЃўрЃЮрЃЦрЃАрЃўрЃЊрЃљрЃюрЃбрЃў\" ; рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃЦрЃўрЃЏрЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃюрЃЮрЃюрЃљ рЃљрЃЉрЃљрЃерЃўрЃФрЃћ."
