    title: "рЃАрЃљрЃљрЃ«рЃљрЃџрЃгрЃџрЃЮ рЃќрЃћрЃўрЃЏрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VI-1 рЃЎрЃџрЃљрЃАрЃерЃў.",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃарЃБрЃАрЃБрЃџрЃўрЃА рЃћрЃюрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃќрЃћ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃюрЃўрЃюрЃЮ рЃЦрЃљрЃЋрЃЪрЃљрЃарЃљрЃФрЃћрЃАрЃљ рЃЊрЃљ рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃћрЃџ рЃЏрЃљрЃўрЃљ рЃГрЃљрЃюрЃБрЃДрЃЋрЃљрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃўрЃЏрЃдрЃћрЃарЃћрЃА, рЃўрЃфрЃћрЃЎрЃЋрЃћрЃА, рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃџрЃћрЃЦрЃАрЃћрЃЉрЃў, рЃњрЃљрЃљрЃфрЃЮрЃфрЃ«рЃџрЃћрЃА рЃАрЃљрЃДрЃЋрЃљрЃарЃћрЃџрЃў рЃќрЃдрЃљрЃърЃарЃћрЃЉрЃўрЃА рЃњрЃЏрЃўрЃарЃћрЃЉрЃў. рЃарЃљрЃф рЃЏрЃЌрЃљрЃЋрЃљрЃарЃўрЃљ, рЃЊрЃљрЃЏрЃАрЃгрЃарЃћ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃљрЃА рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃгрЃўрЃюрЃљрЃАрЃљрЃљрЃ«рЃљрЃџрЃгрЃџрЃЮ рЃњрЃљрЃюрЃгрЃДрЃЮрЃЉрЃљ рЃерЃћрЃБрЃЦрЃЏрЃюрЃћрЃА!"
