    title: "рЃЉрЃЮрЃџрЃЮ рЃгрЃџрЃћрЃЉрЃерЃў рЃћрЃарЃЮрЃЋрЃюрЃБрЃџрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃњрЃћрЃњрЃЏрЃўрЃЌ X рЃЎрЃџрЃљрЃАрЃерЃў рЃљрЃ«рЃљрЃџрЃў рЃАрЃљрЃњрЃљрЃюрЃў РђЊ РђърЃърЃарЃЮрЃћрЃЦрЃбрЃў рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃљрЃерЃўРђю рЃЊрЃљрЃўрЃюрЃћрЃарЃњрЃљ.\nрЃърЃарЃЮрЃћрЃЦрЃбрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃљ рЃЏрЃўрЃќрЃюрЃљрЃЊ рЃўрЃАрЃљрЃ«рЃљрЃЋрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃЌрЃЋрЃљрЃџрЃАрЃљрЃгрЃўрЃћрЃарЃўрЃА рЃњрЃљрЃцрЃљрЃарЃЌрЃЮрЃћрЃЉрЃљрЃА рЃЏрЃљрЃЌрЃЌрЃЋрЃўрЃА рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃЏрЃўрЃЏрЃљрЃарЃЌрЃБрЃџрЃћрЃЉрЃўрЃЌ, рЃЎрЃЋрЃџрЃћрЃЋрЃўрЃЌрЃў рЃБрЃюрЃљрЃарЃћрЃЉрЃўрЃА рЃЕрЃљрЃЏрЃЮрЃЏрЃБрЃерЃљрЃЋрЃћрЃЉрЃљрЃА рЃЊрЃљ рЃАрЃ«рЃЋ.",
    briefText: "рЃЊрЃћрЃЎрЃћрЃЏрЃЉрЃћрЃарЃА, рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА X рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњ рЃАрЃљрЃџрЃЮрЃЏрЃћ рЃЏрЃўрЃЦрЃљрЃФрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃўрЃЌ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃЏрЃљрЃЌ рЃЏрЃўрЃћрЃа рЃћрЃарЃЌрЃў рЃАрЃћрЃЏрЃћрЃАрЃбрЃарЃўрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў рЃњрЃљрЃюрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃБрЃџрЃў рЃЏрЃБрЃерЃљрЃЮрЃЉрЃўрЃА рЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃў.\nрЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЎрЃџрЃљрЃАрЃўрЃА рЃърЃарЃЮрЃћрЃЦрЃбрЃў рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃўрЃАрЃљрЃњрЃљрЃю рЃњрЃљрЃюрЃАрЃ«рЃЋрЃљрЃЋрЃћрЃЉрЃБрЃџрЃў рЃўрЃДрЃЮ рЃЊрЃљ рЃњрЃљрЃЏрЃЮрЃўрЃарЃЕрЃћрЃЮрЃЊрЃљ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃўрЃА рЃЏрЃарЃљрЃЋрЃљрЃџрЃцрЃћрЃарЃЮрЃЋрЃюрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ рЃАрЃўрЃБрЃ«рЃЋрЃўрЃЌ. рЃгрЃљрЃарЃЏрЃЮрЃЊрЃњрЃћрЃюрЃўрЃџрЃў рЃЌрЃћрЃЏрЃћрЃЉрЃў рЃњрЃљрЃ«рЃџрЃЊрЃљрЃЌ:\nX1 - рЃЎрЃўрЃЉрЃћрЃарЃБрЃАрЃљрЃцрЃарЃЌрЃ«рЃЮрЃћрЃЉрЃљ рЃЊрЃљ рЃЏрЃћрЃЊрЃўрЃљрЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃљ\nX2- рЃЏрЃўрЃБрЃАрЃљрЃцрЃљрЃарЃў рЃфрЃ«рЃЮрЃЋрЃћрЃџрЃћрЃЉрЃў\nX3- рЃЦрЃљрЃџрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃў рЃЊрЃљ рЃцрЃћрЃЏрЃўрЃфрЃўрЃЊрЃў\nX4-рЃњрЃћрЃюрЃЊрЃћрЃарЃБрЃџрЃў рЃБрЃЌрЃљрЃюрЃљрЃАрЃгрЃЮрЃарЃЮрЃЉрЃљ\nX5 -рЃЉрЃБрЃџрЃўрЃюрЃњрЃў рЃЊрЃљ рЃЎрЃўрЃЉрЃћрЃарЃЉрЃБрЃџрЃўрЃюрЃњрЃў"
