    id: 325,
    title: "2024 рЃгрЃџрЃўрЃА 6 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VII-2 рЃЎрЃџрЃљрЃАрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃўрЃюрЃбрЃћрЃњрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў (рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃљ рЃЊрЃљ рЃЏрЃБрЃАрЃўрЃЎрЃљ) рЃЌрЃћрЃЏрЃљрЃќрЃћ \"рЃљрЃЏрЃдрЃћрЃарЃћрЃЉрЃБрЃџрЃў рЃџрЃћрЃЦрЃАрЃў\". рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃА рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃЏрЃљрЃарЃўрЃюрЃљ рЃЏрЃљрЃЏрЃљрЃџрЃљрЃФрЃћ рЃЊрЃљ рЃЏрЃБрЃАрЃўрЃЎрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃћрЃЎрЃљрЃбрЃћрЃарЃўрЃюрЃћ рЃЉрЃЪрЃўрЃюрЃљрЃЋрЃљ.",
    briefText: "2024 рЃгрЃџрЃўрЃА 6 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VII-2 рЃЎрЃџрЃљрЃАрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃўрЃюрЃбрЃћрЃњрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў (рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃљ рЃЊрЃљ рЃЏрЃБрЃАрЃўрЃЎрЃљ) рЃЌрЃћрЃЏрЃљрЃќрЃћ \"рЃљрЃЏрЃдрЃћрЃарЃћрЃЉрЃБрЃџрЃў рЃџрЃћрЃЦрЃАрЃў\". рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃА рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃЏрЃљрЃарЃўрЃюрЃљ рЃЏрЃљрЃЏрЃљрЃџрЃљрЃФрЃћ рЃЊрЃљ рЃЏрЃБрЃАрЃўрЃЎрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃћрЃЎрЃљрЃбрЃћрЃарЃўрЃюрЃћ рЃЉрЃЪрЃўрЃюрЃљрЃЋрЃљ."
