    briefText: "2024 рЃгрЃџрЃўрЃА 9 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III-3 рЃЎрЃџрЃљрЃАрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃўрЃюрЃбрЃћрЃњрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў (рЃЉрЃБрЃюрЃћрЃЉрЃљ рЃЊрЃљ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃљ) рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ РђърЃДрЃЋрЃљрЃЋрЃўрЃџрЃўрЃА рЃљрЃњрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљРђю.\n рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃА рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃћрЃЉрЃў рЃАрЃљрЃџрЃЮрЃЏрЃћ рЃЊрЃљрЃюрЃћрЃџрЃўрЃљ рЃЊрЃљ рЃўрЃарЃўрЃюрЃљ рЃАрЃћрЃЋрЃЮрЃАрЃбрЃўрЃљрЃюрЃЮрЃЋрЃљ."
