    briefText: "2024 рЃгрЃџрЃўрЃА 13 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VI-2 рЃЎрЃџрЃљрЃАрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃдрЃўрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ РђърЃБрЃфрЃ«рЃЮ рЃЏрЃЮрЃДрЃЏрЃўрЃА рЃюрЃљрЃ«рЃЋрЃљРђю (рЃерЃЮрЃЌрЃљ рЃарЃБрЃАрЃЌрЃљрЃЋрЃћрЃџрЃўрЃА РђърЃЋрЃћрЃцрЃ«рЃўрЃАрЃбрЃДрЃљрЃЮрЃАрЃюрЃўрЃАРђю рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ) - рЃбрЃћрЃЦрЃАрЃбрЃўрЃА рЃљрЃюрЃљрЃџрЃўрЃќрЃў.\nрЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃА рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃЏрЃќрЃўрЃљ рЃ»рЃљрЃюрЃћрЃџрЃўрЃФрЃћ."
