    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃќрЃћрЃўрЃЏрЃЮрЃЊ рЃЊрЃљрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃљ.\nрЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃљрЃљрЃЏрЃќрЃљрЃЊрЃћрЃА рЃўрЃџрЃБрЃАрЃбрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃљрЃюрЃЉрЃљрЃюрЃў рЃЊрЃљ рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў рЃЌрЃљрЃюрЃљрЃбрЃЮрЃџрЃћрЃЉрЃА рЃњрЃљрЃБрЃќрЃўрЃљрЃарЃћрЃА.\nI-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃљрЃдрЃЏрЃќрЃарЃЊрЃћрЃџрЃў - рЃЌрЃљрЃЏрЃљрЃа рЃЎрЃЋрЃћрЃарЃдрЃћрЃџрЃўрЃФрЃћ , рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљ.",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃќрЃћрЃўрЃЏрЃЮрЃЊ рЃЊрЃљрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃљрЃюрЃЉрЃљрЃюрЃўрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃљ.\nрЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃАрЃљрЃЎрЃБрЃЌрЃљрЃарЃў рЃ«рЃћрЃџрЃўрЃЌ рЃЊрЃљрЃљрЃЏрЃќрЃљрЃЊрЃћрЃА рЃўрЃџрЃБрЃАрЃбрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃљрЃюрЃЉрЃљрЃюрЃў рЃЊрЃљ рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў рЃЌрЃљрЃюрЃљрЃбрЃЮрЃџрЃћрЃЉрЃА рЃњрЃљрЃБрЃќрЃўрЃљрЃарЃћрЃА.\nI-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃљрЃдрЃЏрЃќрЃарЃЊрЃћрЃџрЃў - рЃЌрЃљрЃЏрЃљрЃа рЃЎрЃЋрЃћрЃарЃдрЃћрЃџрЃўрЃФрЃћ , рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў - рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљ."
