    title: "2024 рЃгрЃџрЃўрЃА 28 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў РђърЃАрЃЎрЃЮрЃџрЃўрЃА рЃћрЃџрЃЕрЃћрЃЉрЃўрЃАРђю рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃгрЃўрЃЌрЃћрЃџрЃў рЃ»рЃЋрЃарЃўрЃА рЃЏрЃЮрЃ«рЃљрЃџрЃўрЃАрЃћрЃЏ рЃЊрЃљ рЃћрЃџрЃЕрЃЏрЃљ, рЃЏрЃћ-11 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЏ рЃюрЃБрЃфрЃљ рЃюрЃўрЃЎрЃЮрЃџрЃљрЃўрЃерЃЋрЃўрЃџрЃЏрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЕрЃљрЃљрЃбрЃљрЃарЃљ рЃгрЃўрЃЌрЃћрЃџрЃў рЃ»рЃЋрЃарЃўрЃА рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮ рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў. ",
    briefText: "2024 рЃгрЃџрЃўрЃА 28 рЃЌрЃћрЃЉрЃћрЃарЃЋрЃљрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў РђърЃАрЃЎрЃЮрЃџрЃўрЃА рЃћрЃџрЃЕрЃћрЃЉрЃўрЃАРђю рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃгрЃўрЃЌрЃћрЃџрЃў рЃ»рЃЋрЃарЃўрЃА рЃЏрЃЮрЃ«рЃљрЃџрЃўрЃАрЃћрЃЏ рЃЊрЃљ рЃћрЃџрЃЕрЃЏрЃљ, рЃЏрЃћ-11 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЏ рЃюрЃБрЃфрЃљ рЃюрЃўрЃЎрЃЮрЃџрЃљрЃўрЃерЃЋрЃўрЃџрЃЏрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЕрЃљрЃљрЃбрЃљрЃарЃљ рЃгрЃўрЃЌрЃћрЃџрЃў рЃ»рЃЋрЃарЃўрЃА рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮ рЃбрЃарЃћрЃюрЃўрЃюрЃњрЃў."
