    id: 336,
    title: "2024 рЃгрЃџрЃўрЃА 1-7 рЃЏрЃљрЃарЃбрЃА рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃўрЃА II рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃў рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃћрЃФрЃдрЃЋрЃюрЃљ рЃЎрЃџрЃўрЃЏрЃљрЃбрЃБрЃарЃў рЃАрЃљрЃарЃбрЃДрЃџрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЉрЃБрЃюрЃћрЃЉрЃарЃўрЃЋрЃў рЃќрЃЮрЃюрЃћрЃЉрЃўрЃА рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃА.\nрЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃћрЃА рЃЏрЃћ - 7, рЃЏрЃћ - 10 рЃЊрЃљ рЃЏрЃћ - 11 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ;",
    briefText: "рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃљ рЃњрЃљрЃўрЃњрЃћрЃА:\nрЃарЃљ рЃљрЃарЃўрЃА рЃЎрЃџрЃўрЃЏрЃљрЃбрЃў рЃЊрЃљ рЃарЃЮрЃЏрЃћрЃџрЃўрЃљ рЃЎрЃџрЃўрЃЏрЃљрЃбрЃгрЃљрЃарЃЏрЃЮрЃЏрЃЦрЃЏрЃюрЃћрЃџрЃў рЃцрЃљрЃЦрЃбрЃЮрЃарЃћрЃЉрЃў?\nрЃарЃљ рЃљрЃарЃўрЃА рЃЎрЃўрЃЮрЃърЃћрЃюрЃўрЃА рЃЎрЃџрЃўрЃЏрЃљрЃбрЃўрЃА рЃЎрЃџрЃљрЃАрЃўрЃцрЃўрЃЎрЃљрЃфрЃўрЃљ?\nрЃарЃљ рЃњрЃљрЃюрЃАрЃ«рЃЋрЃљрЃЋрЃћрЃЉрЃљрЃљ рЃФрЃўрЃарЃўрЃЌрЃљрЃЊ рЃЊрЃљ рЃњрЃљрЃарЃЊрЃљрЃЏрЃљрЃЋрЃљрЃџ рЃЎрЃџрЃўрЃЏрЃљрЃбрЃБрЃа рЃАрЃљрЃарЃбрЃДрЃџрЃћрЃЉрЃА рЃерЃЮрЃарЃўрЃА?\nрЃарЃљ рЃљрЃарЃўрЃА рЃАрЃўрЃЏрЃљрЃдрЃџрЃћрЃЉрЃарЃўрЃЋрЃў/рЃЋрЃћрЃарЃбрЃўрЃЎрЃљрЃџрЃБрЃарЃў рЃќрЃЮрЃюрЃљрЃџрЃЮрЃЉрЃљ рЃЊрЃљ рЃарЃўрЃАрЃў рЃерЃћрЃЊрЃћрЃњрЃўрЃљ рЃўрЃА?\nрЃарЃЮрЃЏрЃћрЃџрЃў рЃЉрЃБрЃюрЃћрЃЉрЃарЃўрЃЋрЃў рЃќрЃЮрЃюрЃћрЃЉрЃўрЃљ рЃњрЃљрЃЋрЃарЃфрЃћрЃџрЃћрЃЉрЃБрЃџрЃў рЃЊрЃћрЃЊрЃљрЃЏрЃўрЃгрЃљрЃќрЃћ?\nрЃарЃљ рЃЌрЃљрЃЋрЃўрЃАрЃћрЃЉрЃБрЃарЃћрЃЉрЃћрЃЉрЃўрЃЌ рЃњрЃљрЃЏрЃЮрЃўрЃарЃЕрЃћрЃЋрЃљ рЃЌрЃўрЃЌрЃЮрЃћрЃБрЃџрЃў рЃЏрЃљрЃЌрЃњрЃљрЃюрЃў?\nрЃарЃљ рЃљрЃарЃўрЃА рЃљрЃЏ рЃЌрЃљрЃЋрЃўрЃАрЃћрЃЉрЃБрЃарЃћрЃЉрЃћрЃЉрЃўрЃА рЃњрЃљрЃЏрЃЮрЃЏрЃгрЃЋрЃћрЃЋрЃў рЃЏрЃўрЃќрЃћрЃќрЃћрЃЉрЃў?\nрЃарЃЮрЃњрЃЮрЃарЃўрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЎрЃџрЃўрЃЏрЃљрЃбрЃБрЃарЃў рЃЊрЃљрЃарЃљрЃўрЃЮрЃюрЃћрЃЉрЃљ рЃЎрЃўрЃЮрЃърЃћрЃюрЃўрЃА рЃЎрЃџрЃљрЃАрЃўрЃцрЃўрЃЎрЃљрЃфрЃўрЃўрЃўрЃА рЃЌрЃљрЃюрЃљрЃ«рЃЏрЃљрЃЊ?\nрЃарЃЮрЃњрЃЮрЃарЃўрЃљ рЃЎрЃџрЃўрЃЏрЃљрЃбрЃБрЃарЃў рЃарЃљрЃўрЃЮрЃюрЃћрЃЉрЃўрЃА рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃЎрЃџрЃўрЃЏрЃљрЃбрЃБрЃарЃў рЃЏрЃљрЃ«рЃљрЃАрЃўрЃљрЃЌрЃћрЃЉрЃџрЃћрЃЉрЃў рЃЊрЃљ рЃњрЃљрЃЋрЃарЃфрЃћрЃџрЃћрЃЉрЃўрЃА рЃљрЃарЃћрЃљрЃџрЃћрЃЉрЃў?\nрЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃерЃћрЃўрЃЦрЃЏрЃюрЃљ рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃарЃћрЃАрЃБрЃарЃАрЃў РђърЃЉрЃБрЃюрЃћрЃЉрЃарЃўрЃЋрЃў рЃќрЃЮрЃюрЃћрЃЉрЃўрЃА рЃФрЃўрЃарЃўрЃЌрЃљрЃЊрЃў рЃЏрЃљрЃ«рЃљрЃАрЃўрЃљрЃЌрЃћрЃЉрЃџрЃћрЃЉрЃўРђю рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃА рЃЏрЃўрЃћрЃа рЃЊрЃљрЃЏрЃЮрЃБрЃЎрЃўрЃЊрЃћрЃЉрЃџрЃљрЃЊ рЃерЃћрЃЦрЃЏрЃюрЃўрЃџрЃў РђърЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃБрЃџрЃў рЃљрЃЏрЃЮрЃфрЃљрЃюрЃћрЃЉрЃўрЃА рЃЎрЃарЃћрЃЉрЃБрЃџрЃўРђю.\nрЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў: рЃљрЃюрЃљ рЃљрЃюрЃБрЃерЃўрЃФрЃћ"
