    briefText: "28 рЃЏрЃљрЃарЃбрЃА IX -3 рЃЎрЃџрЃљрЃАрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў \" рЃћрЃЋрЃарЃЮрЃърЃБрЃџрЃў рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃљ рЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃЎрЃўрЃюрЃЮ\" (рЃџрЃБрЃўрЃ»рЃў рЃърЃўрЃарЃљрЃюрЃЊрЃћрЃџрЃЮ рЃЊрЃљ рЃцрЃўрЃџрЃЏрЃў \"рЃЦрЃЋрЃћрЃЋрЃарЃў\").\n рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃА рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЏрЃљрЃарЃўрЃюрЃљ рЃЏрЃљрЃЏрЃљрЃџрЃљрЃФрЃћ."
