    briefText: "29 рЃЏрЃљрЃарЃбрЃА рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃерЃЮрЃарЃћрЃюрЃљ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃћрЃЏ VII рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃњрЃљрЃљрЃфрЃюрЃЮ рЃљрЃџрЃцрЃЮрЃюрЃА рЃЊрЃЮрЃЊрЃћрЃА рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљ."
