    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃарЃФрЃћрЃџрЃЊрЃћрЃЉрЃљ рЃћрЃЋрЃарЃЮрЃърЃћрЃџрЃў рЃљрЃЋрЃбрЃЮрЃарЃћрЃЉрЃўрЃА рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃў.",
    briefText: "2024 рЃгрЃџрЃўрЃА 28 рЃЏрЃљрЃарЃбрЃА III-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃЌрЃћрЃљ рЃЦрЃЮрЃарЃЕрЃўрЃџрЃљрЃЋрЃљрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃарЃЮрЃљрЃџрЃЊ рЃЊрЃљрЃџрЃўрЃА \"рЃЕрЃљрЃарЃџрЃў рЃЊрЃљ рЃерЃЮрЃЎрЃЮрЃџрЃљрЃЊрЃўрЃА рЃЦрЃљрЃарЃ«рЃљрЃюрЃљ\";\n рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃњрЃљрЃЏрЃЮрЃЌрЃЦрЃЋрЃћрЃА рЃљрЃќрЃарЃў, рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃгрЃљрЃЎрЃўрЃЌрЃ«рЃБрЃџрЃў рЃюрЃљрЃгрЃљрЃарЃЏрЃЮрЃћрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ, рЃерЃћрЃЦрЃЏрЃюрЃћрЃА рЃўрЃџрЃБрЃАрЃбрЃарЃљрЃфрЃўрЃћрЃЉрЃў."
