    title: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃњрЃарЃФрЃћрЃџрЃЊрЃћрЃЉрЃљ рЃћрЃЋрЃарЃЮрЃърЃћрЃџрЃў рЃљрЃЋрЃбрЃЮрЃарЃћрЃЉрЃўрЃА рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃў.",
    briefText: "2024 рЃгрЃџрЃўрЃА 1 рЃљрЃърЃарЃўрЃџрЃА XI рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃЏрЃќрЃўрЃљ рЃ»рЃљрЃюрЃћрЃџрЃўрЃФрЃћрЃЏ рЃњрЃљрЃљрЃфрЃюрЃЮ рЃцрЃарЃљрЃюрЃф рЃЎрЃљрЃцрЃЎрЃљрЃА рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљ, рЃЎрЃћрЃарЃФрЃЮрЃЊ , \"рЃЏрЃћрЃбрЃљрЃЏрЃЮрЃарЃцрЃЮрЃќрЃљ\"."
