    title: "рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃљ \"рЃћрЃЋрЃћрЃарЃћрЃАрЃбрЃўрЃА \" рЃАрЃљрЃерЃћрЃЏрЃЮрЃЊрЃњрЃЮрЃЏрЃЮ рЃАрЃћрЃќрЃЮрЃюрЃерЃў рЃЏрЃўрЃдрЃгрЃћрЃБрЃџрЃў рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃўрЃњрЃћрЃџрЃћрЃЉрЃўрЃЌ рЃЊрЃљ рЃАрЃљрЃЕрЃБрЃЦрЃарЃћрЃЉрЃўрЃЌ рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў:",
    briefText: "- рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃњрЃљрЃцрЃарЃўрЃюрЃЊрЃљрЃерЃЋрЃўрЃџрЃў-II рЃЎрЃџрЃљрЃАрЃў,\n - рЃЊрЃћрЃЏрЃћрЃбрЃарЃћ рЃерЃћрЃарЃЋрЃљрЃерЃўрЃФрЃћ-IV рЃЎрЃџрЃљрЃАрЃў,\n -рЃћрЃЏрЃўрЃџрЃў рЃЎрЃљрЃўрЃбрЃљрЃЏрЃЉрЃљ-VI рЃЎрЃџрЃљрЃАрЃў.\n- рЃарЃћрЃЋрЃљрЃќ рЃњрЃљрЃцрЃарЃўрЃюрЃЊрЃљрЃерЃЋрЃўрЃџрЃў- VI рЃЎрЃџрЃљрЃАрЃў, рЃарЃћрЃќрЃўрЃЎрЃЮрЃА рЃњрЃљрЃюрЃАрЃљрЃЎрЃБрЃЌрЃарЃћрЃЉрЃБрЃџрЃў рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃЏрЃљ рЃЊрЃљ рЃАрЃЎрЃЮрЃџрЃљрЃЏ рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃўрЃА рЃгрЃћрЃарЃўрЃџрЃўрЃф рЃЏрЃўрЃўрЃдрЃЮ!\n рЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\n рЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!"
