    title: "2024 рЃгрЃџрЃўрЃА 2 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃА: рЃЌрЃћрЃЎрЃџрЃљ рЃ«рЃљрЃарЃљрЃЉрЃљрЃФрЃўрЃА, рЃЏрЃљрЃарЃўрЃљрЃЏ рЃЕрЃ«рЃљрЃбрЃљрЃарЃљрЃерЃЋрЃўрЃџрЃўрЃА, рЃњрЃЋрЃљрЃюрЃфрЃљ рЃљрЃџрЃћрЃџрЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃЊрЃљ рЃерЃЮрЃЌрЃўрЃЎрЃЮ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃўрЃА рЃўрЃюрЃўрЃфрЃўрЃљрЃбрЃўрЃЋрЃўрЃЌрЃљ рЃЊрЃљ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃБрЃљрЃџрЃБрЃарЃў рЃЋрЃўрЃЦрЃбрЃЮрЃарЃўрЃюрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃерЃўрЃф рЃАрЃљрЃЉрЃљрЃќрЃЮ рЃАрЃљрЃцрЃћрЃ«рЃБрЃарЃўрЃА рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃљрЃњрЃљрЃю рЃЊрЃљрЃЎрЃЮрЃЏрЃърЃџрЃћрЃЦрЃбрЃћрЃЉрЃБрЃџрЃў рЃњрЃБрЃюрЃЊрЃћрЃЉрЃў рЃўрЃдрЃћрЃЉрЃЊрЃюрЃћрЃю рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА.",
    briefText: "2024 рЃгрЃџрЃўрЃА 2 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃА: рЃЌрЃћрЃЎрЃџрЃљ рЃ«рЃљрЃарЃљрЃЉрЃљрЃФрЃўрЃА, рЃЏрЃљрЃарЃўрЃљрЃЏ рЃЕрЃ«рЃљрЃбрЃљрЃарЃљрЃерЃЋрЃўрЃџрЃўрЃА, рЃњрЃЋрЃљрЃюрЃфрЃљ рЃљрЃџрЃћрЃџрЃўрЃерЃЋрЃўрЃџрЃўрЃА рЃЊрЃљ рЃерЃЮрЃЌрЃўрЃЎрЃЮ рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃўрЃА рЃўрЃюрЃўрЃфрЃўрЃљрЃбрЃўрЃЋрЃўрЃЌрЃљ рЃЊрЃљ рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃБрЃљрЃџрЃБрЃарЃў рЃЋрЃўрЃЦрЃбрЃЮрЃарЃўрЃюрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃерЃўрЃф рЃАрЃљрЃЉрЃљрЃќрЃЮ рЃАрЃљрЃцрЃћрЃ«рЃБрЃарЃўрЃА рЃАрЃ«рЃЋрЃљрЃЊрЃљрЃАрЃ«рЃЋрЃљ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃАрЃљрЃњрЃљрЃю рЃЊрЃљрЃЎрЃЮрЃЏрЃърЃџрЃћрЃЦрЃбрЃћрЃЉрЃБрЃџрЃў рЃњрЃБрЃюрЃЊрЃћрЃЉрЃў рЃўрЃдрЃћрЃЉрЃЊрЃюрЃћрЃю рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА."
