    id: 357,
    title: "рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃЌрЃљ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃљ рЃЦрЃўрЃЏрЃўрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃбрЃБрЃарЃюрЃўрЃарЃќрЃћ\n2024 рЃгрЃџрЃўрЃА 28-31 рЃЏрЃљрЃарЃбрЃА рЃЌрЃЉрЃўрЃџрЃўрЃАрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ International Chemistry Competition \"Golden Fleece 2024\" рЃбрЃБрЃарЃюрЃўрЃарЃў \"рЃЮрЃЦрЃарЃЮрЃА рЃАрЃљрЃгрЃЏрЃўрЃАрЃў\" рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃњрЃБрЃюрЃЊрЃБрЃарЃў рЃерЃћрЃ»рЃўрЃЉрЃарЃў рЃЦрЃўрЃЏрЃўрЃљрЃерЃў.\nрЃбрЃБрЃарЃюрЃўрЃарЃўрЃА рЃЏрЃЌрЃљрЃЋрЃљрЃарЃў рЃЏрЃўрЃќрЃљрЃюрЃўрЃљ рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃћрЃЉрЃўрЃА рЃ«рЃћрЃџрЃерЃћрЃгрЃДрЃЮрЃЉрЃљ рЃЊрЃљ рЃЦрЃўрЃЏрЃўрЃўрЃЌ рЃЊрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃћрЃЉрЃБрЃџрЃў рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃА рЃгрЃљрЃ«рЃљрЃџрЃўрЃАрЃћрЃЉрЃљ.",
    briefText: "рЃбрЃБрЃарЃюрЃўрЃарЃерЃў рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА рЃўрЃдрЃћрЃЉрЃЊрЃюрЃћрЃю рЃљрЃарЃљ рЃЏрЃ«рЃЮрЃџрЃЮрЃЊ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА, рЃљрЃарЃљрЃЏрЃћрЃЊ рЃАрЃ«рЃЋрЃљ рЃЦрЃЋрЃћрЃДрЃюрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў.\nрЃЏрЃљрЃЌ, рЃерЃЮрЃарЃўрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃњрЃБрЃюрЃЊрЃў, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЊрЃљрЃЎрЃЮрЃЏрЃърЃџрЃћрЃЦрЃбрЃћрЃЉрЃБрЃџрЃў рЃўрЃДрЃЮ XI рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃўрЃЌ. рЃњрЃБрЃюрЃЊрЃЏрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЏрЃЮрЃљрЃЏрЃќрЃљрЃЊрЃљ рЃЦрЃўрЃЏрЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃЏрЃљ рЃюрЃЮрЃюрЃљ рЃљрЃЉрЃљрЃерЃўрЃФрЃћрЃЏ, рЃАрЃљрЃњрЃюрЃўрЃА рЃљрЃарЃљрЃЕрЃЋрЃћрЃБрЃџрЃћрЃЉрЃарЃўрЃЋрЃў рЃфрЃЮрЃЊрЃюрЃљ рЃњрЃљрЃЏрЃЮрЃљрЃЋрЃџрЃўрЃюрЃљ рЃЊрЃљ рЃЏрЃЮрЃўрЃърЃЮрЃЋрЃљ рЃЋрЃћрЃарЃфрЃ«рЃџрЃўрЃА рЃЏрЃћрЃЊрЃљрЃџрЃў. рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ, рЃарЃЮрЃЏ рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃљрЃЊрЃњрЃўрЃџрЃўрЃА рЃЏрЃцрЃџрЃЮрЃЉрЃћрЃџрЃћрЃЉрЃў рЃњрЃљрЃ«рЃЊрЃюрЃћрЃю рЃарЃБрЃЏрЃўрЃюрЃћрЃџрЃћрЃЉрЃў, рЃљрЃюрЃБ рЃЕрЃЋрЃћрЃюрЃЏрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃЏрЃљрЃАрЃерЃбрЃљрЃЉрЃўрЃЌ рЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮ рЃерЃћрЃЊрЃћрЃњрЃў рЃљрЃЕрЃЋрЃћрЃюрЃћрЃА!\nрЃњрЃБрЃюрЃЊрЃўрЃА рЃерЃћрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃЮрЃЉрЃљрЃерЃў рЃўрЃДрЃЋрЃюрЃћрЃю:\nрЃљрЃюрЃљрЃюрЃЮ рЃ«рЃўрЃюрЃЎрЃўрЃџрЃљрЃФрЃћ,\nрЃюрЃБрЃфрЃљ рЃюрЃўрЃЎрЃЮрЃџрЃљрЃўрЃерЃЋрЃўрЃџрЃў,\nрЃљрЃюрЃљ рЃњрЃЮрЃњрЃўрЃЕрЃљрЃўрЃерЃЋрЃўрЃџрЃў,\nрЃџрЃўрЃџрЃћ рЃдрЃЮрЃЏрЃўрЃФрЃћ,\nрЃЊрЃљрЃЌрЃљ рЃБрЃарЃБрЃерЃљрЃФрЃћ . \nрЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\nрЃњрЃўрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!"
