    title: "рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ рЃЏрЃФрЃџрЃћрЃЮрЃАрЃюрЃЮрЃЉрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃћрЃЉрЃБрЃџ рЃАрЃљрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃерЃћрЃ»рЃўрЃЉрЃарЃќрЃћ 60 рЃЏ рЃЊрЃўрЃАрЃбрЃљрЃюрЃфрЃўрЃљрЃќрЃћ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃБрЃџрЃљрЃЊ рЃњрЃљрЃЏрЃЮрЃЋрЃўрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў; рЃ«рЃЮрЃџрЃЮ VIII рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЏ рЃћрЃџрЃћрЃюрЃћ рЃБрЃарЃБрЃерЃљрЃФрЃћрЃЏ рЃЊрЃљрЃўрЃЎрЃљрЃЋрЃљ II рЃАрЃљрЃърЃарЃўрЃќрЃЮ рЃљрЃЊрЃњрЃўрЃџрЃў.",
    briefText: "рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЊрЃљрЃЋрЃўрЃЌ рЃЮрЃюрЃўрЃљрЃерЃЋрЃўрЃџрЃў. \n рЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!"
