    id: 363,
    title: "рЃњрЃљрЃќрЃљрЃцрЃ«рЃБрЃџрЃўрЃА рЃерЃћрЃЏрЃЮрЃЉрЃарЃФрЃљрЃюрЃћрЃЉрЃљ рЃњрЃЋрЃљрЃ«рЃљрЃарЃћрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ.",
    briefText: "рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃЊрЃўрЃЊрЃў рЃЏрЃЮрЃюрЃЊрЃЮрЃЏрЃћрЃЉрЃўрЃЌрЃљ рЃЊрЃљ рЃАрЃўрЃДрЃЋрЃљрЃарЃБрЃџрЃўрЃЌ рЃерЃћрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃЏрЃ«рЃљрЃбрЃЋрЃарЃБрЃџ- рЃЏрЃБрЃАрЃўрЃЎрЃљрЃџрЃБрЃарЃў рЃюрЃЮрЃЏрЃарЃћрЃЉрЃў, рЃўрЃфрЃћрЃЎрЃЋрЃћрЃА, рЃўрЃЏрЃдрЃћрЃарЃћрЃА рЃЊрЃљ рЃбрЃЎрЃЉрЃўрЃџрЃў рЃАрЃўрЃбрЃДрЃЋрЃћрЃЉрЃўрЃЌ рЃњрЃБрЃџрЃў рЃњрЃљрЃБрЃЌрЃЉрЃћрЃА рЃЊрЃћрЃЊрЃўрЃЎрЃЮрЃћрЃЉрЃА рЃЊрЃљ рЃЏрЃЮрЃгрЃЋрЃћрЃБрЃџ рЃАрЃбрЃБрЃЏрЃарЃћрЃЉрЃА.\n I-3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃљрЃдрЃЏрЃќрЃарЃЊрЃћрЃџрЃў рЃўрЃарЃўрЃюрЃљ рЃЕрЃ«рЃљрЃўрЃФрЃћ. рЃЏрЃБрЃАрЃўрЃЎрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃџрЃЮрЃџрЃљ рЃ»рЃљрЃцрЃљрЃарЃўрЃФрЃћ."
