    title: "2024 рЃгрЃџрЃўрЃА 10 рЃљрЃърЃарЃўрЃџрЃА I-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљрЃАрЃљ рЃЊрЃљ рЃЎрЃџрЃљрЃАрЃўрЃА рЃљрЃдрЃЏрЃќрЃарЃЊрЃћрЃџ рЃЌрЃљрЃЏрЃљрЃа рЃЎрЃЋрЃћрЃарЃдрЃћрЃџрЃўрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃюрЃћрЃю рЃАрЃбрЃБрЃЊрЃўрЃљ \"рЃљрЃюрЃЊрЃљрЃЏрЃљрЃбрЃА\" рЃЊрЃљ рЃюрЃљрЃЏрЃЊрЃЋрЃўрЃџ рЃерЃћрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљрЃЊ рЃўрЃЦрЃфрЃюрЃћрЃю.",
    briefText: "рЃЌрЃўрЃ«рЃўрЃАрЃљрЃњрЃљрЃю рЃњрЃљрЃЏрЃЮрЃФрЃћрЃарЃгрЃћрЃА рЃцрЃўрЃњрЃБрЃарЃћрЃЉрЃў, рЃЏрЃЮрЃўрЃАрЃЏрЃўрЃюрЃћрЃА рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљ рЃЌрЃўрЃ«рЃљрЃАрЃљ рЃЊрЃљ рЃЏрЃўрЃА рЃЌрЃЋрЃўрЃАрЃћрЃЉрЃћрЃЉрЃќрЃћ, рЃерЃћрЃўрЃФрЃўрЃюрЃћрЃА рЃфрЃЮрЃЊрЃюрЃљ рЃЊрЃљ рЃАрЃљрЃАрЃўрЃљрЃЏрЃЮрЃЋрЃюрЃЮрЃЊ рЃњрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃЊрЃдрЃћ."
