    title: "2024 рЃгрЃџрЃўрЃА 10 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃљрЃГрЃљрЃарЃўрЃА рЃљрЃЋрЃбрЃЮрЃюрЃЮрЃЏрЃўрЃБрЃарЃў рЃарЃћрЃАрЃърЃБрЃЉрЃџрЃўрЃЎрЃўрЃА рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА, рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃАрЃљ рЃЊрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃЦрЃЋрЃћрЃърЃарЃЮрЃњрЃарЃљрЃЏрЃўрЃА РђърЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃћрЃЉрЃў рЃЊрЃљ рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃћрЃЉрЃўРђю рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃњрЃљрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉрЃБрЃџрЃў рЃАрЃљрЃ«рЃЋрЃўрЃЌрЃў рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃбрЃБрЃарЃў , рЃарЃЮрЃЏрЃћрЃџрЃерЃўрЃф рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃћрЃА V-IX рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ .",
    briefText: "2024 рЃгрЃџрЃўрЃА 10 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃљрЃГрЃљрЃарЃўрЃА рЃљрЃЋрЃбрЃЮрЃюрЃЮрЃЏрЃўрЃБрЃарЃў рЃарЃћрЃАрЃърЃБрЃЉрЃџрЃўрЃЎрЃўрЃА рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА, рЃЎрЃБрЃџрЃбрЃБрЃарЃўрЃАрЃљ рЃЊрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃАрЃљрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃЮрЃА рЃЦрЃЋрЃћрЃърЃарЃЮрЃњрЃарЃљрЃЏрЃўрЃА РђърЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃћрЃЉрЃў рЃЊрЃљ рЃЮрЃџрЃўрЃЏрЃърЃўрЃљрЃЊрЃћрЃЉрЃўРђю рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў рЃњрЃљрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉрЃБрЃџрЃў рЃАрЃљрЃ«рЃЋрЃўрЃЌрЃў рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЎрЃЮрЃюрЃЎрЃБрЃарЃАрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃў рЃбрЃБрЃарЃў , рЃарЃЮрЃЏрЃћрЃџрЃерЃўрЃф рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃћрЃА V-IX рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ ."
