    briefText: "рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃћрЃЉрЃА рЃћрЃарЃЌрЃў рЃЎрЃЋрЃўрЃарЃўрЃА рЃњрЃљрЃюрЃЏрЃљрЃЋрЃџрЃЮрЃЉрЃљрЃерЃў рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃю рЃЊрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃћрЃЉрЃў рЃ░рЃЦрЃЮрЃюрЃЊрЃљрЃЌ рЃћрЃЋрЃарЃЮрЃЎрЃљрЃЋрЃерЃўрЃарЃўрЃА рЃўрЃюрЃАрЃбрЃўрЃбрЃБрЃфрЃўрЃћрЃЉрЃерЃў рЃЊрЃљ рЃюрЃљрЃбрЃЮрЃерЃў.\n рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ, рЃарЃЮрЃЏ рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃў рЃюрЃљрЃбрЃЮрЃА рЃерЃбрЃљрЃЉ-рЃЉрЃўрЃюрЃљрЃерЃў рЃљрЃџрЃўрЃљрЃюрЃАрЃўрЃА рЃгрЃљрЃарЃЏрЃЮрЃЏрЃљрЃЊрЃњрЃћрЃюрЃџрЃћрЃЉрЃА рЃерЃћрЃ«рЃЋрЃЊрЃюрЃћрЃю; рЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА рЃюрЃљрЃбрЃЮ-рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃЏрЃ«рЃарЃћрЃЌ рЃЎрЃљрЃЋрЃЎрЃљрЃАрЃўрЃўрЃА рЃЌрЃћрЃЏрЃљрЃќрЃћ.\n рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃА рЃЕрЃЋрЃћрЃюрЃА рЃАрЃљрЃљрЃЏрЃљрЃДрЃЮ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА!"
