    briefText: "рЃЏрЃљрЃЌ рЃ«рЃћрЃџрЃЮрЃЋрЃюрЃћрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃЌрЃљрЃЏрЃБрЃюрЃљ рЃгрЃБрЃџрЃљрЃФрЃўрЃА рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃўрЃЌ рЃЎрЃБрЃЉрЃўрЃАрЃбрЃБрЃа рЃАрЃбрЃўрЃџрЃерЃў, р▓ърЃљрЃЉрЃџрЃЮ рЃърЃўрЃЎрЃљрЃАрЃЮрЃА рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃўрЃА рЃЏрЃўрЃ«рЃћрЃЊрЃЋрЃўрЃЌ рЃерЃћрЃАрЃарЃБрЃџрЃћрЃЉрЃБрЃџрЃў рЃюрЃљрЃ«рЃљрЃбрЃћрЃЉрЃў рЃЊрЃљ рЃАрЃљрЃЏрЃњрЃљрЃюрЃќрЃЮрЃЏрЃўрЃџрЃћрЃЉрЃўрЃљрЃюрЃў рЃърЃЮрЃарЃбрЃарЃћрЃбрЃћрЃЉрЃў рЃњрЃљрЃЏрЃЮрЃцрЃўрЃюрЃћрЃА."
