    title: "2024 рЃгрЃџрЃўрЃА 23 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃарЃЦрЃћрЃЮрЃџрЃЮрЃњрЃўрЃБрЃа рЃЏрЃБрЃќрЃћрЃБрЃЏрЃерЃў рЃгрЃўрЃњрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃљрЃЋрЃбрЃЮрЃарЃЮ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЊрЃдрЃћрЃАрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃўрЃА рЃњрЃљрЃЏрЃЮрЃцрЃћрЃюрЃљ рЃЌрЃћрЃЏрЃљрЃќрЃћ \"рЃЌрЃўрЃ«рЃўрЃА рЃгрЃўрЃњрЃюрЃћрЃЉрЃўрЃЊрЃљрЃю рЃЌрЃљрЃюрЃљрЃЏрЃћрЃЊрЃарЃЮрЃЋрЃћ рЃгрЃўрЃњрЃюрЃћрЃЉрЃљрЃЏрЃЊрЃћ\".",
    briefText: "рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА XI-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЏ рЃњрЃЋрЃљрЃюрЃфрЃљ рЃЊрЃћрЃЋрЃљрЃФрЃћрЃЏ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃљ рЃљрЃЏрЃљрЃЋрЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃЌрЃљ рЃЏрЃўрЃћрЃа рЃЌрЃљрЃюрЃљрЃЏрЃћрЃЊрЃарЃЮрЃЋрЃћ рЃЎрЃЮрЃЏрЃўрЃЦрЃАрЃљрЃЊ рЃЦрЃфрЃћрЃБрЃџрЃў рЃ░рЃљрЃњрЃўрЃЮрЃњрЃарЃљрЃцрЃўрЃБрЃџрЃў рЃбрЃћрЃЦрЃАрЃбрЃў рЃњрЃўрЃЮрЃарЃњрЃў рЃЏрЃћрЃарЃЕрЃБрЃџрЃћрЃА \"рЃњрЃарЃўрЃњрЃЮрЃџ рЃ«рЃљрЃюрЃФрЃЌрЃћрЃџрЃўрЃА рЃфрЃ«рЃЮрЃЋрЃарЃћрЃЉрЃљ\" . рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЌрЃљрЃЏрЃљрЃа рЃџрЃЮрЃЏрЃЌрЃљрЃФрЃћ."
