    title: "\"рЃљрЃЕрЃБрЃЦрЃћ рЃгрЃўрЃњрЃюрЃў! \" рЃљрЃЏ рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃБрЃџрЃљрЃЊ рЃЦрЃфрЃћрЃБрЃџ рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃљрЃА рЃерЃћрЃБрЃћрЃарЃЌрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА II-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљ 23 рЃљрЃърЃарЃўрЃџрЃА , рЃгрЃўрЃњрЃюрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃА, рЃАрЃўрЃ«рЃљрЃарЃБрЃџрЃўрЃЌ рЃљрЃЕрЃБрЃЦрЃћрЃА рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃгрЃўрЃњрЃюрЃћрЃЉрЃў. рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃЮрЃўрЃФрЃћ.",
    briefText: "\"рЃљрЃЕрЃБрЃЦрЃћ рЃгрЃўрЃњрЃюрЃў! \" рЃљрЃЏ рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃБрЃџрЃљрЃЊ рЃЦрЃфрЃћрЃБрЃџ рЃњрЃљрЃЏрЃЮрЃгрЃЋрЃћрЃЋрЃљрЃА рЃерЃћрЃБрЃћрЃарЃЌрЃЊрЃюрЃћрЃю рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА II-4 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљ 23 рЃљрЃърЃарЃўрЃџрЃА , рЃгрЃўрЃњрЃюрЃўрЃА рЃАрЃљрЃћрЃарЃЌрЃљрЃерЃЮрЃарЃўрЃАрЃЮ рЃЊрЃдрЃћрЃА, рЃАрЃўрЃ«рЃљрЃарЃБрЃџрЃўрЃЌ рЃљрЃЕрЃБрЃЦрЃћрЃА рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃгрЃўрЃњрЃюрЃћрЃЉрЃў. рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃЌрЃЮрЃўрЃФрЃћ."
