    title: "2024 рЃгрЃџрЃўрЃА 27 рЃљрЃърЃарЃўрЃџрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃерЃћрЃЊрЃњрЃљ рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌ-рЃўрЃюрЃбрЃћрЃџрЃћрЃЦрЃбрЃБрЃљрЃџрЃБрЃарЃў рЃерЃћрЃ«рЃЋрЃћрЃЊрЃарЃљ \"рЃЕрЃЋрЃћрЃю рЃњрЃЋрЃўрЃДрЃЋрЃљрЃарЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃљ!\"",
    briefText: "рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃфрЃЮрЃЊрЃюрЃљрЃерЃў рЃћрЃ»рЃўрЃЉрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю VIII-3 рЃЊрЃљ VIII-4 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃўрЃА рЃњрЃБрЃюрЃЊрЃћрЃЉрЃў \"рЃњрЃЮрЃарЃњрЃљрЃАрЃџрЃўрЃљрЃюрЃў\" рЃЊрЃљ \"рЃЊрЃљрЃЋрЃўрЃЌрЃцрЃћрЃарЃБрЃџрЃў\".\n рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃбрЃЮрЃарЃўрЃљ рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃ«рЃљрЃЌрЃБрЃюрЃљ рЃЉрЃћрЃарЃљрЃФрЃћ."
