    briefText: "рЃЋрЃБрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџрЃћрЃЉрЃА рЃЊрЃљ рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!\n рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ рЃЏрЃћрЃфрЃ«рЃарЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЎрЃљрЃџрЃљрЃЌрЃЉрЃБрЃарЃЌрЃћрЃџрЃЌрЃљ рЃњрЃљрЃЏрЃЮрЃарЃЕрЃћрЃБрЃџрЃў рЃЌрЃљрЃЏрЃљрЃерЃўрЃф.\n рЃњрЃЋрЃАрЃБрЃарЃА, рЃЏрЃљрЃЊрЃџрЃЮрЃЉрЃљ рЃЏрЃЮрЃЋрЃљрЃ«рЃАрЃћрЃюрЃЮрЃЌ рЃўрЃЏ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃАрЃљ рЃЊрЃљ рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃА, рЃарЃЮрЃЏрЃџрЃћрЃЉрЃўрЃф рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЏрЃљрЃбрЃЕрЃА! рЃЌрЃЦрЃЋрЃћрЃюрЃў рЃњрЃБрЃџрЃерЃћрЃЏрЃљрЃбрЃЎрЃўрЃЋрЃарЃЮрЃЉрЃљ рЃФрЃљрЃџрЃўрЃљрЃю рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃўрЃљ!"
