    id: 392,
    title: "2024 рЃгрЃџрЃўрЃА 14 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃЎрЃљрЃЎрЃў рЃгрЃћрЃарЃћрЃЌрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА IX рЃЎрЃџрЃљрЃАрЃўрЃА рЃдрЃўрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃљрЃерЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ: ,,рЃАрЃљрЃўрЃАрЃбрЃЮрЃарЃўрЃЮ рЃгрЃДрЃљрЃарЃЮрЃћрЃЉрЃў рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃЏрЃЮрЃдрЃЋрЃљрЃгрЃћрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉРђю , рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃюрЃћрЃюрЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ рЃЊрЃљ рЃАрЃљрЃдрЃЋрЃарЃЌрЃЮ рЃАрЃ»рЃБрЃџрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃЏрЃћрЃџрЃўрЃЦрЃљрЃФрЃћ.рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃљрЃЦрЃбрЃўрЃБрЃарЃљрЃЊ рЃўрЃДрЃЋрЃюрЃћрЃю рЃЕрЃљрЃарЃЌрЃБрЃџрЃў рЃАрЃљрЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃЮ рЃърЃарЃЮрЃфрЃћрЃАрЃерЃў.",
    briefText: "2024 рЃгрЃџрЃўрЃА 14 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃљрЃЎрЃљрЃЎрЃў рЃгрЃћрЃарЃћрЃЌрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃўрЃА рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃћрЃЉрЃўрЃЌ рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА IX рЃЎрЃџрЃљрЃАрЃўрЃА рЃдрЃўрЃљ рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃљрЃерЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ: ,,рЃАрЃљрЃўрЃАрЃбрЃЮрЃарЃўрЃЮ рЃгрЃДрЃљрЃарЃЮрЃћрЃЉрЃў рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃерЃў рЃЏрЃЮрЃдрЃЋрЃљрЃгрЃћрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉРђю , рЃарЃЮрЃЏрЃћрЃџрЃАрЃљрЃф рЃБрЃФрЃдрЃЋрЃћрЃЉрЃЮрЃЊрЃюрЃћрЃюрЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ рЃЊрЃљ рЃАрЃљрЃдрЃЋрЃарЃЌрЃЮ рЃАрЃ»рЃБрЃџрЃўрЃА рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃў рЃљрЃџрЃћрЃЦрЃАрЃљрЃюрЃЊрЃарЃћ рЃЏрЃћрЃџрЃўрЃЦрЃљрЃФрЃћ.рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃљрЃЦрЃбрЃўрЃБрЃарЃљрЃЊ рЃўрЃДрЃЋрЃюрЃћрЃю рЃЕрЃљрЃарЃЌрЃБрЃџрЃў рЃАрЃљрЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃЮ рЃърЃарЃЮрЃфрЃћрЃАрЃерЃў."
