    title: "рЃърЃљрЃарЃљрЃЎрЃџрЃўрЃАрЃў рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃА\n рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃА рЃћрЃарЃЌрЃў рЃЏрЃерЃЋрЃћрЃюрЃўрЃћрЃарЃў рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃљ рЃљрЃЦрЃЋрЃА, рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃЌрЃљрЃЌрЃЋрЃўрЃА рЃЊрЃљ рЃЏрЃљрЃЌрЃў рЃЮрЃ»рЃљрЃ«рЃўрЃА рЃгрЃћрЃЋрЃарЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃАрЃљрЃ»рЃљрЃюрЃЏрЃарЃЌрЃћрЃџрЃЮ рЃърЃљрЃарЃљрЃЎрЃџрЃўрЃАрЃўрЃА рЃњрЃљрЃЊрЃљрЃ«рЃЊрЃљ, рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃћрЃЉрЃўрЃА рЃЊрЃљрЃџрЃЮрЃфрЃЋрЃљ рЃЊрЃљ рЃљрЃАрЃћ рЃњрЃљрЃфрЃўрЃџрЃћрЃЉрЃљ рЃАрЃЎрЃЮрЃџрЃўрЃЊрЃљрЃю.",
    briefText: "2024 рЃгрЃћрЃџрЃА рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃљрЃА 25-рЃћ рЃЌрЃљрЃЮрЃЉрЃљ рЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃА.\n рЃърЃљрЃарЃљрЃЎрЃџрЃўрЃАрЃў рЃЏрЃћрЃЌрЃЮрЃарЃЏрЃћрЃбрЃћ рЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃњрЃљрЃЊрЃљрЃўрЃ«рЃљрЃЊрЃљ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃФрЃдрЃЋрЃљрЃарЃЏрЃљ, рЃЊрЃћрЃЎрЃљрЃюрЃЮрЃќрЃЏрЃљ рЃЊрЃўрЃЏрЃўрЃбрЃарЃўрЃЏ (рЃАрЃљрЃарЃ»рЃЋрЃћрЃџрЃљрЃФрЃћ), рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЊрЃљрЃџрЃЮрЃфрЃљ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃарЃћрЃЦрЃбрЃЮрЃарЃЏрЃљ, рЃЊрЃћрЃЎрЃљрЃюрЃЮрЃќрЃЏрЃљ рЃўрЃљрЃЎрЃЮрЃЉрЃЏрЃљ (рЃЉрЃћрЃюрЃўрЃФрЃћ).\n рЃърЃљрЃарЃљрЃЎрЃџрЃўрЃАрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЊрЃљрЃЏрЃарЃўрЃњрЃћрЃЉрЃџрЃћрЃЉрЃў рЃџрЃљрЃџрЃў рЃЉрЃЮрЃџрЃЦрЃЋрЃљрЃФрЃћ, рЃЏрЃљрЃарЃўрЃюрЃљ рЃбрЃљрЃџрЃљрЃ«рЃљрЃФрЃћ рЃЊрЃљ рЃЌрЃљрЃЏрЃљрЃа рЃЋрЃљрЃерЃљрЃЎрЃўрЃФрЃћ рЃЊрЃљ рЃЏрЃерЃЮрЃЉрЃћрЃџрЃћрЃЉрЃў.\n рЃЎрЃБрЃарЃАрЃЊрЃљрЃЏрЃЌрЃљрЃЋрЃарЃћрЃЉрЃБрЃџрЃћрЃЉрЃЏрЃљ (рЃЎрЃџрЃљрЃАрЃћрЃЉрЃЏрЃљ) рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃўрЃАрЃљрЃЏрЃћрЃЉрЃа рЃ«рЃљрЃбрЃћрЃЉрЃў рЃерЃћрЃгрЃўрЃарЃћрЃА рЃгрЃЏ. рЃюрЃўрЃюрЃЮрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃбрЃљрЃФрЃљрЃарЃА.\n рЃЋрЃБрЃџрЃЮрЃфрЃљрЃЋрЃЌ рЃЕрЃЋрЃћрЃюрЃА рЃАрЃљрЃљрЃЏрЃљрЃДрЃЮ рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃћрЃЉрЃА!"
