    briefText: "X-XI рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљ рЃЏрЃўрЃўрЃдрЃћрЃА STEM рЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃАрЃўрЃАрЃбрЃћрЃЏрЃљрЃќрЃћ рЃЊрЃљрЃцрЃБрЃФрЃюрЃћрЃЉрЃБрЃџ рЃБрЃљрЃдрЃарЃћрЃАрЃљрЃЊ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃАрЃљрЃ«рЃљрЃџрЃўрЃАрЃЮ -рЃерЃћрЃЏрЃћрЃфрЃюрЃћрЃЉрЃўрЃЌ рЃЦрЃўрЃЏрЃўрЃБрЃа рЃћрЃЦрЃАрЃърЃћрЃарЃўрЃЏрЃћрЃюрЃбрЃћрЃЉрЃерЃў.\n рЃЦрЃўрЃЏрЃўрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃў рЃюрЃЮрЃюрЃљ рЃљрЃЉрЃљрЃерЃўрЃФрЃћ рЃЊрЃљ рЃўрЃарЃўрЃюрЃљ рЃЋрЃўрЃЊрЃБрЃџрЃўрЃюрЃљ."
