    title: "2024 рЃгрЃџрЃўрЃА 24 рЃЏрЃљрЃўрЃАрЃА, рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃўрЃџрЃўрЃљ рЃГрЃљрЃЋрЃГрЃљрЃЋрЃљрЃФрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃЊрЃарЃљрЃЏрЃљрЃбрЃБрЃџ рЃЌрЃћрЃљрЃбрЃарЃерЃў рЃњрЃљрЃўрЃЏрЃљрЃарЃЌрЃљ рЃЎрЃЮрЃюрЃЮрЃцрЃћрЃАрЃбрЃўрЃЋрЃљрЃџ \"рЃфрЃљ-рЃЏрЃћрЃбрЃўрЃА\" рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃћрЃЉрЃљ, рЃарЃЮрЃЏрЃћрЃџрЃерЃўрЃф рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃЮрЃЉрЃљрЃА рЃўрЃдрЃћрЃЉрЃЊрЃюрЃћрЃю рЃЕрЃЋрЃћрЃюрЃў рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃў рЃЏрЃљрЃЌ рЃЏрЃўрЃћрЃа рЃерЃћрЃЦрЃЏрЃюрЃўрЃџрЃў рЃцрЃўрЃџрЃЏрЃўрЃЌ \"рЃАрЃўрЃюрЃљрЃЌрЃџрЃўрЃА рЃќрЃћрЃЏрЃЮрЃЌ\"//РђюAbove The LightРђЮ.\n рЃњрЃўрЃЏрЃюрЃљрЃќрЃўрЃћрЃџрЃЌрЃљ рЃцрЃўрЃџрЃЏрЃЏрЃљ рЃњрЃљрЃўрЃЏрЃљрЃарЃ»рЃЋрЃљ рЃюрЃЮрЃЏрЃўрЃюрЃљрЃфрЃўрЃљрЃерЃў РђърЃЏрЃЮрЃќрЃљрЃарЃЊрЃўрЃА рЃ«рЃЏрЃљРђю.",
    briefText: "рЃљрЃЏрЃљрЃЋрЃћ рЃцрЃўрЃџрЃЏрЃерЃў рЃњрЃЮрЃњрЃЮрЃА рЃарЃЮрЃџрЃўрЃА рЃАрЃљрЃБрЃЎрЃћрЃЌрЃћрЃАрЃЮрЃЊ рЃерЃћрЃАрЃарЃБрЃџрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃЊрЃљрЃ»рЃўрЃџрЃЊрЃЮрЃЋрЃЊрЃљ рЃЦрЃарЃўрЃАрЃбрЃўрЃюрЃћ рЃљрЃюрЃЌрЃљрЃФрЃћ.\n рЃАрЃфрЃћрЃюрЃљрЃарЃўрЃА рЃљрЃЋрЃбрЃЮрЃарЃў, рЃарЃћрЃЪрЃўрЃАрЃЮрЃарЃў, рЃърЃарЃЮрЃЊрЃўрЃБрЃАрЃћрЃарЃў, рЃЏрЃЮрЃюрЃбрЃљрЃЪрЃў - рЃЦрЃарЃўрЃАрЃбрЃўрЃюрЃћ рЃљрЃюрЃЌрЃљрЃФрЃћ\n рЃарЃЮрЃџрЃћрЃЉрЃерЃў: рЃЦрЃарЃўрЃАрЃбрЃўрЃюрЃћ рЃљрЃюрЃЌрЃљрЃФрЃћ, рЃљрЃюрЃЊрЃарЃўрЃљ рЃЎрЃўрЃЎрЃюрЃљрЃФрЃћ, рЃюрЃўрЃбрЃљ рЃљрЃюрЃљрЃюрЃўрЃФрЃћ, рЃюрЃўрЃЎрЃЮрЃџрЃЮрЃќ рЃњрЃЮрЃњрЃЮрЃџрЃљрЃФрЃћ, рЃЌрЃљрЃЏрЃљрЃа рЃЕрЃљрЃюрЃбрЃџрЃљрЃФрЃћ\n рЃЊрЃљрЃЏрЃ«рЃЏрЃљрЃарЃћ рЃ»рЃњрЃБрЃцрЃў (background/voice): рЃћрЃџрЃћрЃюрЃћ рЃ«рЃБрЃ»рЃљрЃФрЃћ, рЃљрЃюрЃљрЃюрЃЮ рЃ«рЃўрЃюрЃЎрЃўрЃџрЃљрЃФрЃћ, рЃљрЃюрЃЊрЃарЃўрЃљ рЃљрЃюрЃЌрЃљрЃФрЃћ.\n рЃњрЃўрЃџрЃЮрЃфрЃљрЃЋрЃЌ!\n рЃЕрЃЋрЃћрЃю рЃњрЃЋрЃ»рЃћрЃарЃљ, рЃЌрЃЦрЃЋрЃћрЃюрЃў рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃўрЃЌ рЃЎрЃЋрЃџрЃљрЃЋ рЃЋрЃўрЃљрЃЏрЃљрЃДрЃћрЃЉрЃЌ!"
