    title:"2024 рЃгрЃџрЃўрЃА 28 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III- 3 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃў рЃћрЃюрЃўрЃА рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЕрЃљрЃБрЃбрЃљрЃарЃЊрЃљрЃЌ рЃњрЃљрЃюрЃАрЃ«рЃЋрЃљрЃЋрЃћрЃЉрЃБрЃџ рЃњрЃљрЃарЃћрЃЏрЃЮрЃерЃў- рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃерЃў.",
    briefText: "рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃўрЃюрЃњрЃџрЃўрЃАрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџ рЃќрЃћрЃЎрЃЮ рЃЎрЃЮрЃюрЃфрЃћрЃџрЃўрЃФрЃћрЃАрЃЌрЃљрЃю рЃћрЃарЃЌрЃљрЃЊ рЃгрЃљрЃўрЃЎрЃўрЃЌрЃ«рЃћрЃА рЃЏрЃЮрЃЌрЃ«рЃарЃЮрЃЉрЃљ \"The lazy grasshopper\" - рЃГрЃарЃўрЃГрЃўрЃюрЃљ рЃЊрЃљ рЃГрЃўрЃљрЃюрЃГрЃЋрЃћрЃџрЃљ.\nрЃўрЃАрЃљрЃБрЃЉрЃарЃћрЃА, рЃўрЃЏрЃАрЃ»рЃћрЃџрЃћрЃА рЃЏрЃЮрЃЌрЃ«рЃарЃЮрЃЉрЃўрЃА рЃърЃћрЃарЃАрЃЮрЃюрЃљрЃЪрЃћрЃЉрЃќрЃћ, рЃњрЃљрЃљрЃЎрЃћрЃЌрЃћрЃА рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃљ рЃўрЃЏрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ , рЃарЃљрЃА рЃњрЃЋрЃљрЃАрЃгрЃљрЃЋрЃџрЃўрЃА рЃћрЃА рЃЏрЃЮрЃЌрЃ«рЃарЃЮрЃЉрЃљ?"
