    briefText: "25.05.2024- рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃърЃўрЃарЃЋрЃћрЃџрЃЎрЃџрЃљрЃАрЃћрЃџрЃЌрЃљ рЃЏрЃ«рЃўрЃљрЃарЃБрЃџрЃў рЃАрЃбрЃљрЃарЃбрЃћрЃЉрЃў рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃБрЃџрЃљрЃЊ рЃЊрЃўрЃЊрЃў рЃЪрЃарЃўрЃљрЃЏрЃБрЃџрЃўрЃЌ рЃЊрЃљ рЃћрЃЏрЃЮрЃфрЃўрЃћрЃЉрЃўрЃЌ рЃгрЃљрЃарЃўрЃЏрЃљрЃарЃЌрЃљ рЃАрЃърЃЮрЃарЃбрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃњрЃўрЃЋрЃў рЃЎрЃћрЃарЃћрЃАрЃћрЃџрЃўрЃФрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃЮрЃЉрЃўрЃЌ."
