    title:"2024 рЃгрЃџрЃўрЃА 29 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ \"рЃћрЃЋрЃарЃЮрЃърЃБрЃџрЃў рЃЋрЃўрЃЦрЃбрЃЮрЃарЃўрЃюрЃљ\", рЃарЃЮрЃЏрЃћрЃџрЃўрЃф рЃЕрЃљрЃљрЃбрЃљрЃарЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃАрЃљрЃџрЃЮрЃЏрЃћ рЃЏрЃўрЃЦрЃљрЃФрЃћрЃЏ \"рЃљрЃ«рЃљрЃџрЃњрЃљрЃќрЃарЃЊрЃљ рЃћрЃЋрЃарЃЮрЃърЃћрЃџрЃў рЃћрЃџрЃЕрЃћрЃЉрЃўрЃА рЃўрЃюрЃўрЃфрЃўрЃљрЃбрЃўрЃЋрЃўрЃА\" рЃ«рЃћрЃџрЃерЃћрЃгрЃДрЃЮрЃЉрЃўрЃЌ.",
    briefText: "рЃЏрЃЮрЃюрЃљрЃгрЃўрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃБрЃърЃљрЃАрЃБрЃ«рЃћрЃА рЃЎрЃўрЃЌрЃ«рЃЋрЃћрЃЉрЃА рЃћрЃЋрЃарЃЮрЃЎрЃљрЃЋрЃерЃўрЃарЃўрЃА рЃўрЃАрЃбрЃЮрЃарЃўрЃўрЃА, рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћ рЃЏрЃЮрЃЋрЃџрЃћрЃюрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃў рЃцрЃљрЃЦрЃбрЃћрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃњрЃљрЃўрЃњрЃћрЃА рЃЉрЃћрЃЋрЃарЃў рЃљрЃ«рЃљрЃџрЃў рЃЊрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ рЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃљ рЃАрЃљрЃЦрЃљрЃарЃЌрЃЋрЃћрЃџрЃЮрЃАрЃљ рЃЊрЃљ рЃћрЃЋрЃарЃЮрЃЎрЃљрЃЋрЃљрЃерЃўрЃарЃўрЃА рЃБрЃарЃЌрЃўрЃћрЃарЃЌрЃЮрЃЉрЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ.\nрЃњрЃљрЃЏрЃљрЃарЃ»рЃЋрЃћрЃЉрЃБрЃџ рЃњрЃБрЃюрЃЊрЃА рЃАрЃўрЃЏрЃЉрЃЮрЃџрЃБрЃарЃў рЃАрЃљрЃЕрЃБрЃЦрЃарЃћрЃЉрЃўрЃА рЃАрЃљрЃ«рЃўрЃЌ рЃњрЃљрЃЊрЃљрЃћрЃфрЃљ рЃгрЃўрЃњрЃюрЃћрЃЉрЃў."
