    image: name405,
    id: 405,
    title:"2024 рЃгрЃџрЃўрЃА 30 рЃЏрЃљрЃўрЃАрЃА рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЏрЃћ-7 рЃЎрЃџрЃљрЃАрЃерЃў рЃњрЃћрЃЮрЃњрЃарЃљрЃцрЃўрЃўрЃА рЃЏрЃћрЃюрЃбрЃЮрЃарЃЏрЃљ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЏрЃљ рЃљрЃюрЃљ рЃљрЃюрЃБрЃерЃўрЃФрЃћрЃЏ рЃўрЃюрЃбрЃћрЃњрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА \"рЃцрЃўрЃюрЃљрЃюрЃљрЃАрЃБрЃарЃў рЃЊрЃљ рЃћрЃЎрЃЮрЃюрЃЮрЃЏрЃўрЃЎрЃБрЃарЃў рЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА\" рЃерЃћрЃЏрЃљрЃ»рЃљрЃЏрЃћрЃЉрЃћрЃџрЃў рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљ рЃЕрЃљрЃљрЃбрЃљрЃарЃљ рЃЉрЃљрЃЋрЃерЃЋрЃЌрЃљ рЃБрЃцрЃџрЃћрЃЉрЃћрЃЉрЃўрЃА рЃЊрЃљрЃфрЃЋрЃўрЃА рЃЎрЃЋрЃўрЃарЃћрЃБрЃџрЃўрЃА рЃцрЃљрЃарЃњрЃџрЃћрЃЉрЃерЃў .",
    briefText: "рЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃЏрЃАрЃЋрЃџрЃћрЃџрЃЮрЃЉрЃўрЃАрЃљрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃърЃарЃљрЃЦрЃбрЃўрЃЎрЃБрЃџрЃў рЃљрЃЦрЃбрЃўрЃЋрЃЮрЃЉрЃћрЃЉрЃўрЃА рЃњрЃќрЃўрЃЌ рЃњрЃљрЃўрЃфрЃюрЃћрЃА рЃцрЃўрЃюрЃљрЃюрЃАрЃБрЃарЃў рЃЊрЃљ рЃћрЃЎрЃЮрЃюрЃЮрЃЏрЃўрЃЎрЃБрЃарЃў рЃгрЃўрЃњрЃюрЃўрЃћрЃарЃћрЃЉрЃўрЃА рЃАрЃљрЃЎрЃЋрЃљрЃюрЃФрЃЮ рЃАрЃљрЃЎрЃўрЃЌрЃ«рЃћрЃЉрЃў:\nрЃцрЃБрЃџрЃў рЃЊрЃљ рЃЉрЃљрЃарЃбрЃћрЃарЃў\nрЃЉрЃљрЃќрЃљрЃарЃў (рЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃљ - рЃЏрЃўрЃгрЃЮрЃЊрЃћрЃЉрЃљ) рЃЊрЃљ рЃцрЃљрЃАрЃў\nрЃЎрЃћрЃарЃФрЃЮ рЃЊрЃљ рЃАрЃљрЃ»рЃљрЃарЃЮ рЃАрЃљрЃЎрЃБрЃЌрЃарЃћрЃЉрЃљ\nрЃЊрЃљрЃќрЃЮрЃњрЃЋрЃљ рЃЊрЃљ рЃЦрЃЋрЃћрЃџрЃЏрЃЮрЃЦрЃЏрЃћрЃЊрЃћрЃЉрЃљ\nрЃерЃћрЃЏрЃЮрЃАрЃљрЃЋрЃљрЃџрЃў, рЃ«рЃљрЃарЃ»рЃЋрЃљ рЃЊрЃљ рЃЉрЃўрЃБрЃ»рЃћрЃбрЃўрЃарЃћрЃЉрЃљ.\nрЃърЃарЃЮрЃћрЃЦрЃбрЃўрЃА рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљрЃерЃў рЃЕрЃљрЃћрЃарЃЌрЃЮ рЃЊрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃАрЃбрЃБрЃЏрЃарЃЮрЃЉрЃЊрЃљ рЃљрЃГрЃљрЃарЃўрЃА рЃљ/рЃа рЃБрЃЏрЃљрЃдрЃџрЃћрЃАрЃў рЃАрЃљрЃЉрЃГрЃЮрЃА рЃљрЃърЃљрЃарЃљрЃбрЃўрЃА рЃАрЃљрЃцрЃўрЃюрЃљрЃюрЃАрЃЮ рЃерЃћрЃАрЃДрЃўрЃЊрЃЋрЃћрЃЉрЃўрЃА рЃЊрЃљ рЃбрЃћрЃЦрЃюрЃўрЃЎрЃБрЃарЃў рЃБрЃќрЃарЃБрЃюрЃЋрЃћрЃџрЃДрЃЮрЃцрЃўрЃА рЃЊрЃћрЃърЃљрЃарЃбрЃљрЃЏрЃћрЃюрЃбрЃўрЃА рЃАрЃљрЃцрЃўрЃюрЃљрЃюрЃАрЃЮ рЃБрЃќрЃарЃБрЃюрЃЋрЃћрЃџрЃДрЃЮрЃцрЃўрЃА рЃЊрЃљ рЃерЃћрЃАрЃДрЃўрЃЊрЃЋрЃћрЃЉрЃўрЃА рЃњрЃљрЃюрЃДрЃЮрЃцрЃўрЃџрЃћрЃЉрЃўрЃА рЃБрЃцрЃарЃЮрЃАрЃў рЃЊрЃљрЃЋрЃўрЃЌ рЃЉрЃћрЃарЃўрЃФрЃћ."
