    title:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА VII-2 рЃЎрЃџрЃљрЃАрЃўрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃћрЃюрЃўрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃўрЃА рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃўрЃА рЃЏрЃљрЃарЃўрЃюрЃљ рЃЏрЃљрЃЏрЃљрЃџрЃљрЃФрЃўрЃА рЃЊрЃљрЃ«рЃЏрЃљрЃарЃћрЃЉрЃўрЃЌ рЃњрЃљрЃЏрЃЮрЃАрЃфрЃћрЃА рЃ«рЃћрЃџрЃюрЃљрЃгрЃћрЃарЃў рЃЪрЃБрЃарЃюрЃљрЃџрЃў \"рЃ░рЃћрЃџрЃљрЃЊрЃЮрЃА\".",
    briefText: "рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃЏрЃљ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃЌрЃљ рЃЊрЃљ рЃЏрЃерЃЮрЃЉрЃћрЃџрЃЌрЃљ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃљрЃА рЃгрЃљрЃарЃБрЃЊрЃњрЃўрЃюрЃћрЃА рЃЌрЃљрЃЋрЃўрЃљрЃюрЃЌрЃў рЃюрЃљрЃЏрЃБрЃерЃћрЃЋрЃарЃћрЃЉрЃў рЃЊрЃљ рЃАрЃбрЃљрЃбрЃўрЃћрЃЉрЃў , рЃюрЃљрЃ«рЃљрЃбрЃћрЃЉрЃў, рЃўрЃюрЃбрЃћрЃарЃЋрЃўрЃБрЃћрЃЉрЃў рЃърЃћрЃарЃАрЃЮрЃюрЃљрЃЪрЃћрЃЉрЃЌрЃљрЃю, рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃЌрЃљрЃю, рЃњрЃљрЃЏрЃЋрЃџрЃћрЃџрЃћрЃЉрЃЌрЃљрЃю, рЃЕрЃљрЃбрЃљрЃарЃћрЃЉрЃБрЃџрЃў рЃЎрЃЋрЃџрЃћрЃЋрЃўрЃА рЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃў, рЃЋрЃўрЃю рЃЊрЃљ рЃарЃЮрЃњрЃЮрЃа рЃЎрЃўрЃЌрЃ«рЃБрЃџрЃЮрЃЉрЃА рЃюрЃЮрЃЊрЃљрЃа рЃЊрЃБрЃЏрЃЉрЃљрЃФрЃўрЃА рЃюрЃљрЃгрЃљрЃарЃЏрЃЮрЃћрЃЉрЃћрЃЉрЃА.\nрЃ«рЃћрЃџрЃюрЃљрЃгрЃћрЃарЃў рЃЪрЃБрЃарЃюрЃљрЃџрЃў рЃўрЃЦрЃЋрЃћ рЃљрЃўрЃЎрЃўрЃюрЃФрЃљ рЃЊрЃљ рЃњрЃљрЃЊрЃљрЃћрЃфрЃљ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЉрЃўрЃЉрЃџрЃўрЃЮрЃЌрЃћрЃЎрЃљрЃА.\nрЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃљрЃА рЃћрЃАрЃгрЃарЃћрЃЉрЃЮрЃЊрЃюрЃћрЃю рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃў рЃЊрЃљ рЃЏрЃерЃЮрЃЉрЃџрЃћрЃЉрЃў."
