    title:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏ. рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў 2024 рЃгрЃџрЃўрЃА 3-рЃЊрЃљрЃю 7 рЃўрЃЋрЃюрЃўрЃАрЃљрЃЏрЃЊрЃћ рЃЕрЃљрЃбрЃљрЃарЃЊрЃљ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃњрЃћрЃњрЃЏрЃўрЃЌ рЃњрЃљрЃЌрЃЋрЃљрЃџрЃўрЃАрЃгрЃўрЃюрЃћрЃЉрЃБрЃџрЃў рЃЊрЃўрЃљрЃњрЃюрЃЮрЃАрЃбрЃўрЃЎрЃБрЃа//рЃарЃћрЃўрЃбрЃўрЃюрЃњрЃБрЃџрЃў рЃгрЃћрЃарЃћрЃЉрЃў IV, VI, VII, VIII, IX, X, XI рЃЎрЃџрЃљрЃАрЃћрЃЉрЃерЃў.",
    briefText: "рЃљрЃдрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ, рЃарЃЮрЃЏ рЃбрЃћрЃАрЃбрЃўрЃарЃћрЃЉрЃљ рЃљрЃдрЃюрЃўрЃерЃюрЃБрЃџ рЃЎрЃџрЃљрЃАрЃћрЃЉрЃерЃў рЃЕрЃљрЃбрЃЊрЃћрЃЉрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџ рЃћрЃюрЃљрЃАрЃљ рЃЊрЃљ рЃџрЃўрЃбрЃћрЃарЃљрЃбрЃБрЃарЃљрЃерЃў, рЃЏрЃљрЃЌрЃћрЃЏрЃљрЃбрЃўрЃЎрЃљрЃАрЃљ рЃЊрЃљ рЃфрЃљрЃџрЃЎрЃћрЃБрЃџ рЃАрЃљрЃњрЃюрЃЮрЃЉрЃарЃўрЃЋ рЃ»рЃњрЃБрЃцрЃерЃў рЃерЃћрЃЏрЃљрЃЋрЃљрЃџ рЃАрЃљрЃњрЃюрЃћрЃЉрЃерЃў.\nрЃЊрЃўрЃњрЃюрЃЮрЃАрЃбрЃўрЃЎрЃБрЃарЃў рЃбрЃћрЃАрЃбрЃўрЃарЃћрЃЉрЃљ рЃЏрЃўрЃќрЃюрЃљрЃЊ рЃўрЃАрЃљрЃ«рЃљрЃЋрЃА рЃњрЃљрЃюрЃЋрЃџрЃўрЃџрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃА рЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃўрЃА рЃерЃћрЃАрЃгрЃљрЃЋрЃџрЃљрЃА.\nрЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃўрЃА рЃљрЃюрЃљрЃџрЃўрЃќрЃў рЃФрЃљрЃџрЃўрЃљрЃю рЃЏрЃюрЃўрЃерЃЋрЃюрЃћрЃџрЃЮрЃЋрЃљрЃюрЃўрЃљ рЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў рЃгрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА рЃћрЃцрЃћрЃЦрЃбрЃБрЃарЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃърЃарЃЮрЃфрЃћрЃАрЃўрЃА рЃЊрЃљрЃАрЃљрЃњрЃћрЃњрЃЏрЃљрЃЊ.\nрЃљрЃЏ рЃћрЃбрЃљрЃърЃќрЃћ рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА рЃюрЃљрЃерЃарЃЮрЃЏрЃћрЃЉрЃўрЃА рЃњрЃљрЃАрЃгрЃЮрЃарЃћрЃЉрЃљ рЃЊрЃљ рЃерЃћрЃЊрЃћрЃњрЃћрЃЉрЃўрЃА рЃљрЃюрЃљрЃџрЃўрЃќрЃў рЃЊрЃљ рЃЎрЃЋрЃџрЃћрЃЋрЃљ.\nрЃДрЃЋрЃћрЃџрЃљ рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃА рЃЊрЃљ рЃЏрЃљрЃЌ рЃърЃћрЃЊрЃљрЃњрЃЮрЃњрЃА рЃЋрЃБрЃАрЃБрЃарЃЋрЃћрЃЉрЃЌ рЃгрЃљрЃарЃЏрЃљрЃбрЃћрЃЉрЃћрЃЉрЃА!"
