    title:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃўрЃА III-2 рЃЊрЃљ IV-3 рЃЎрЃџрЃљрЃАрЃћрЃЉрЃерЃў рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃџрЃћрЃЉрЃЏрЃљ рЃюрЃўрЃюрЃЮ рЃБрЃњрЃБрЃџрЃљрЃЋрЃљрЃЏ рЃЊрЃљ рЃарЃБрЃАрЃБрЃЊрЃљрЃю рЃБрЃарЃБрЃерЃљрЃФрЃћрЃЏ рЃЕрЃљрЃљрЃбрЃљрЃарЃћрЃА рЃўрЃюрЃбрЃћрЃњрЃарЃўрЃарЃћрЃЉрЃБрЃџрЃў рЃњрЃљрЃЎрЃЋрЃћрЃЌрЃўрЃџрЃў рЃЦрЃљрЃарЃЌрЃБрЃџ рЃћрЃюрЃљрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃдрЃЏрЃарЃЌрЃЮ рЃАрЃ»рЃБрЃџрЃерЃў рЃЌрЃћрЃЏрЃљрЃќрЃћ ,, рЃФрЃЋрЃћрЃџрЃў рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃ«рЃљрЃџрЃ«рЃБрЃарЃў рЃЊрЃљ рЃЦрЃарЃўрЃАрЃбрЃўрЃљрЃюрЃБрЃџрЃў рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃћрЃЉрЃў\".",
    briefText: "рЃЏрЃћрЃЮрЃЌрЃ«рЃћрЃЎрЃџрЃљрЃАрЃћрЃџрЃћрЃЉрЃЏрЃљ рЃгрЃљрЃарЃЏрЃЮрЃљрЃЊрЃњрЃўрЃюрЃћрЃА рЃърЃарЃћрЃќрЃћрЃюрЃбрЃљрЃфрЃўрЃћрЃЉрЃў рЃАрЃљрЃљрЃдрЃЊрЃњрЃЮрЃЏрЃЮ рЃбрЃарЃљрЃЊрЃўрЃфрЃўрЃћрЃЉрЃЌрЃљрЃю рЃЊрЃљрЃЎрЃљрЃЋрЃерЃўрЃарЃћрЃЉрЃўрЃЌ,\nрЃАрЃбрЃБрЃЏрЃарЃћрЃЉрЃА рЃЊрЃљ рЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃБрЃЏрЃљрЃАрЃърЃўрЃюрЃФрЃџрЃћрЃА рЃбрЃЎрЃЉрЃўрЃџрЃћрЃБрЃџрЃўрЃЌрЃљ,\nрЃерЃћрЃљрЃАрЃарЃБрЃџрЃћрЃА рЃАрЃљрЃЎрЃБрЃџрЃбрЃЮ рЃџрЃћрЃЦрЃА- рЃАрЃўрЃЏрЃдрЃћрЃарЃћрЃЉрЃўрЃЌ,\nрЃћрЃарЃЌрЃЏрЃљрЃюрЃћрЃЌрЃА рЃњрЃљрЃБрЃќрЃўрЃљрЃарЃћрЃА рЃфрЃЮрЃЊрЃюрЃљ рЃЊрЃљ рЃћрЃЏрЃЮрЃфрЃўрЃћрЃЉрЃў."
