    briefText: "рЃљрЃАрЃћ рЃџрЃљрЃЏрЃљрЃќрЃљрЃЊ рЃљрЃдрЃюрЃўрЃерЃюрЃћрЃА рЃЏрЃћрЃЮрЃЌрЃ«рЃќрЃћ рЃЎрЃџрЃљрЃАрЃўрЃА рЃЊрЃљрЃАрЃарЃБрЃџрЃћрЃЉрЃљ рЃЊрЃљ рЃЏрЃљрЃўрЃЎрЃЮ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃЌрЃљрЃю рЃЊрЃљрЃЏрЃерЃЋрЃўрЃЊрЃЮрЃЉрЃћрЃЉрЃљ.\nрЃљрЃЎрЃљрЃЊрЃћрЃЏрЃўрЃБрЃарЃў, рЃцрЃћрЃарЃљрЃЊрЃў, рЃЏрЃБрЃАрЃўрЃЎрЃљрЃџрЃБрЃарЃў рЃгрЃљрЃарЃЏрЃЮрЃЊрЃњрЃћрЃюрЃўрЃЌ рЃБрЃюрЃўрЃГрЃўрЃћрЃарЃћрЃАрЃЏрЃљ рЃърЃљрЃбрЃљрЃарЃћрЃЉрЃЏрЃљ рЃњрЃљрЃљрЃфрЃЮрЃфрЃ«рЃџрЃћрЃА рЃФрЃЋрЃћрЃџрЃў рЃЌрЃЉрЃўрЃџрЃўрЃАрЃўрЃАрЃљ рЃЊрЃљ рЃЦрЃљрЃарЃЌрЃБрЃџрЃў рЃцрЃўрЃџрЃЏрЃћрЃЉрЃўрЃАрЃљ рЃърЃћрЃарЃАрЃЮрЃюрЃљрЃЪрЃћрЃЉрЃў.\nрЃЏрЃљрЃўрЃЎрЃЮ рЃЏрЃљрЃАрЃгрЃљрЃЋрЃџрЃћрЃЉрЃћрЃџрЃў рЃЌрЃЉрЃўрЃџрЃў, рЃљрЃЏрЃљрЃдрЃћрЃџрЃЋрЃћрЃЉрЃћрЃџрЃў рЃАрЃўрЃбрЃДрЃЋрЃўрЃЌ рЃЊрЃљрЃћрЃЏрЃерЃЋрЃўрЃЊрЃЮрЃЉрЃљ рЃФрЃЋрЃўрЃарЃцрЃљрЃА рЃЏрЃЮрЃАрЃгрЃљрЃЋрЃџрЃћрЃћрЃЉрЃА рЃЊрЃљ рЃАрЃљрЃЏрЃљрЃ«рЃАрЃЮрЃЋрЃарЃЮ рЃљрЃџрЃЉрЃЮрЃЏрЃћрЃЉрЃў рЃњрЃљрЃЊрЃљрЃАрЃфрЃљ рЃЏрЃљрЃЌ.\nрЃЏрЃЮрЃЏрЃљрЃЋрЃљрЃџрЃў рЃгрЃџрЃўрЃЊрЃљрЃю рЃЊрЃўрЃЊрЃў рЃЊрЃљ рЃАрЃљрЃўрЃюрЃбрЃћрЃарЃћрЃАрЃЮ, рЃАрЃ«рЃЋрЃљрЃюрЃљрЃўрЃарЃў рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃфрЃ«рЃЮрЃЋрЃарЃћрЃЉрЃљ рЃўрЃгрЃДрЃћрЃЉрЃљ!"
