    title:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА рЃЏрЃќрЃљрЃЊрЃћрЃЉрЃљ рЃљрЃ«рЃљрЃџрЃў, 2024-2025 рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА. ",
    briefText: "­ЪЈФрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА рЃЏрЃќрЃљрЃЊрЃћрЃЉрЃљ рЃљрЃ«рЃљрЃџрЃў, 2024-2025 рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА. \n­ЪЈФ рЃљрЃ«рЃљрЃџрЃў рЃАрЃбрЃљрЃюрЃЊрЃљрЃарЃбрЃўрЃА рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃљрЃЊ  рЃБрЃЎрЃЋрЃћ рЃАрЃарЃБрЃџрЃљрЃЊ рЃњрЃљрЃюрЃљрЃ«рЃџрЃЊрЃљ, рЃњрЃљрЃарЃћрЃЏрЃЮрЃюрЃбрЃЊрЃљ,  рЃБрЃцрЃарЃЮ рЃЏрЃћрЃбрЃў рЃАрЃљрЃЏрЃћрЃЊрЃўрЃфрЃўрЃюрЃЮ рЃАрЃљрЃерЃБрЃљрЃџрЃћрЃЉрЃўрЃЌ  рЃЊрЃљ  рЃўрЃюрЃЋрЃћрЃюрЃбрЃљрЃарЃўрЃЌ рЃљрЃдрЃўрЃГрЃБрЃарЃЋрЃљ рЃАрЃљрЃЏрЃћрЃЊрЃўрЃфрЃўрЃюрЃЮ рЃЎрЃљрЃЉрЃўрЃюрЃћрЃбрЃў."
