    title:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў  рЃЊрЃўрЃЊ рЃДрЃБрЃарЃљрЃЊрЃдрЃћрЃЉрЃљрЃА рЃЋрЃљрЃЦрЃфрЃћрЃЋрЃЌ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃБрЃАрЃљрЃцрЃарЃЌрЃ«рЃЮ рЃЊрЃљ рЃЊрЃљрЃфрЃБрЃџрЃў рЃњрЃљрЃарЃћрЃЏрЃЮрЃА рЃерЃћрЃЦрЃЏрЃюрЃљрЃА. ",
    briefText: "­ЪЈФрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў  рЃЊрЃўрЃЊ рЃДрЃБрЃарЃљрЃЊрЃдрЃћрЃЉрЃљрЃА рЃЋрЃљрЃЦрЃфрЃћрЃЋрЃЌ рЃАрЃљрЃАрЃЎрЃЮрЃџрЃЮ рЃАрЃљрЃќрЃЮрЃњрЃљрЃЊрЃЮрЃћрЃЉрЃўрЃАрЃЌрЃЋрЃўрЃА рЃБрЃАрЃљрЃцрЃарЃЌрЃ«рЃЮ рЃЊрЃљ рЃЊрЃљрЃфрЃБрЃџрЃў рЃњрЃљрЃарЃћрЃЏрЃЮрЃА рЃерЃћрЃЦрЃЏрЃюрЃљрЃА. \nрЃљрЃЏ рЃЏрЃўрЃЏрЃљрЃарЃЌрЃБрЃџрЃћрЃЉрЃўрЃЌ рЃЏрЃБрЃЊрЃЏрЃўрЃЋрЃљрЃЊ рЃбрЃљрЃарЃЊрЃћрЃЉрЃљ рЃърЃарЃћрЃЋрЃћрЃюрЃфрЃўрЃБрЃџрЃў рЃдрЃЮрЃюрЃўрЃАрЃФрЃўрЃћрЃЉрЃћрЃЉрЃў. \nрЃљрЃ«рЃљрЃџрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃА рЃЊрЃљрЃгрЃДрЃћрЃЉрЃљрЃЏрЃЊрЃћ рЃЎрЃўрЃЊрЃћрЃЋ рЃћрЃарЃЌрЃ«рЃћрЃџ рЃЏрЃўрЃЋрЃЏрЃљрЃарЃЌрЃћрЃЌ рЃърЃљрЃарЃбрЃюрЃўрЃЮрЃа рЃЮрЃарЃњрЃљрЃюрЃўрЃќрЃљрЃфрЃўрЃљрЃА  рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃДрЃљрЃџрЃў Рђб Batumis Tskali , рЃарЃЮрЃЏрЃћрЃџрЃЏрЃљрЃф рЃАрЃљрЃАрЃЏрЃћрЃџрЃў  рЃгрЃДрЃџрЃўрЃА рЃАрЃўрЃюрЃ»рЃћрЃЉрЃўрЃА рЃЎрЃЋрЃџрЃћрЃЋрЃўрЃА рЃерЃћрЃЏрЃЊрЃћрЃњ рЃЏрЃЮрЃњрЃЋрЃљрЃгрЃЮрЃЊрЃљ рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃЮрЃЉрЃўрЃА рЃЊрЃљрЃАрЃЎрЃЋрЃюрЃљ."
