    title:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљ  рЃАрЃАрЃўрЃъ  рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃ«рЃљрЃарЃўрЃАрЃ«рЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџ рЃфрЃћрЃюрЃбрЃарЃерЃў 2024 рЃгрЃџрЃўрЃА 1 рЃАрЃћрЃЦрЃбрЃћрЃЏрЃЉрЃарЃљрЃЏрЃЊрЃћ  рЃгрЃљрЃарЃАрЃљрЃЊрЃњрЃћрЃю ",
    briefText: "­ЪЈФрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА рЃЏрЃБрЃерЃљрЃЮрЃЉрЃљ  рЃАрЃАрЃўрЃъ  рЃњрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃўрЃА рЃ«рЃљрЃарЃўрЃАрЃ«рЃўрЃА рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃћрЃарЃЮрЃЋрЃюрЃБрЃџ рЃфрЃћрЃюрЃбрЃарЃерЃў 2024 рЃгрЃџрЃўрЃА 1 рЃАрЃћрЃЦрЃбрЃћрЃЏрЃЉрЃарЃљрЃЏрЃЊрЃћ  рЃгрЃљрЃарЃАрЃљрЃЊрЃњрЃћрЃю\nрЃќрЃЮрЃњрЃљрЃЊрЃАрЃљрЃњрЃљрЃюрЃЏрЃљрЃюрЃљрЃЌрЃџрЃћрЃЉрЃџрЃЮ рЃЊрЃљрЃгрЃћрЃАрЃћрЃЉрЃБрЃџрЃћрЃЉрЃўрЃА рЃљрЃЋрЃбрЃЮрЃарЃўрЃќрЃљрЃфрЃўрЃўрЃА рЃАрЃбрЃљрЃюрЃЊрЃљрЃарЃбрЃћрЃЉрЃЌрЃљрЃю рЃерЃћрЃАрЃљрЃЉрЃљрЃЏрЃўрЃАрЃЮрЃЉрЃўрЃА рЃцрЃЮрЃарЃЏрЃљрЃќрЃћ. \n­ЪјЊрЃърЃљрЃАрЃБрЃ«рЃўрЃАрЃЏрЃњрЃћрЃЉрЃћрЃџ рЃърЃўрЃарЃљрЃЊ рЃњрЃљрЃюрЃўрЃАрЃљрЃќрЃдрЃЋрЃарЃљ рЃАрЃЎрЃЮрЃџрЃўрЃА рЃЊрЃўрЃарЃћрЃЦрЃбрЃЮрЃарЃўрЃА рЃЏрЃЮрЃљрЃЊрЃњрЃўрЃџрЃћ рЃърЃўрЃарЃўрЃЏрЃќрЃћ рЃарЃБрЃарЃБрЃљ.\n­ЪЊџрЃцрЃЮрЃбрЃЮрЃќрЃћ- рЃАрЃЎрЃЮрЃџрЃўрЃА рЃАрЃбрЃарЃљрЃбрЃћрЃњрЃўрЃБрЃџрЃў рЃњрЃљрЃюрЃЋрЃўрЃЌрЃљрЃарЃћрЃЉрЃўрЃА рЃ»рЃњрЃБрЃцрЃўрЃА рЃ«рЃћрЃџрЃЏрЃФрЃдрЃЋрЃљрЃюрЃћрЃџрЃў рЃљрЃюрЃљ рЃљрЃюрЃБрЃерЃўрЃФрЃћ рЃЊрЃљ рЃАрЃљрЃўрЃюрЃцрЃЮрЃарЃЏрЃљрЃфрЃўрЃЮ рЃЉрЃљрЃќрЃўрЃА рЃЏрЃћрЃюрЃћрЃ»рЃћрЃарЃў  рЃљрЃдрЃљрЃќрЃљ рЃњрЃћрЃџрЃљрЃерЃЋрЃўрЃџрЃў рЃАрЃљрЃЏрЃБрЃерЃљрЃЮ рЃърЃарЃЮрЃфрЃћрЃАрЃерЃў."
