    title:"рЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА рЃЏрЃќрЃљрЃЊрЃћрЃЉрЃљ рЃљрЃ«рЃљрЃџрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА. ",
    briefText: "­ЪЈФрЃЉрЃљрЃЌрЃБрЃЏрЃўрЃА рЃгрЃЏрЃўрЃюрЃЊрЃљ рЃљрЃюрЃЊрЃарЃўрЃљ рЃърЃўрЃарЃЋрЃћрЃџрЃгрЃЮрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃАрЃљрЃ«рЃћрЃџрЃЮрЃЉрЃўрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃўрЃЏрЃЊрЃўрЃюрЃљрЃарЃћрЃЮрЃЉрЃА рЃЏрЃќрЃљрЃЊрЃћрЃЉрЃљ рЃљрЃ«рЃљрЃџрЃў рЃАрЃљрЃАрЃгрЃљрЃЋрЃџрЃЮ рЃгрЃџрЃўрЃАрЃЌрЃЋрЃўрЃА. \n­ЪДЉРђЇ­ЪџњрЃљрЃЏ рЃћрЃбрЃљрЃърЃќрЃћ рЃЏрЃЌрЃћрЃџрЃА рЃАрЃЎрЃЮрЃџрЃљрЃерЃў рЃЏрЃЮрЃюрЃбрЃљрЃЪрЃЊрЃћрЃЉрЃљ рЃЏрЃљрЃдрЃљрЃџрЃў рЃЊрЃЮрЃюрЃўрЃА рЃ«рЃљрЃюрЃФрЃљрЃарЃАрЃљрЃгрЃўрЃюрЃљрЃљрЃдрЃЏрЃЊрЃћрЃњрЃЮ рЃЊрЃљрЃфрЃЋрЃўрЃА рЃАрЃўрЃАрЃбрЃћрЃЏрЃљ. рЃАрЃљрЃЏрЃБрЃерЃљрЃЮрЃћрЃЉрЃА рЃљрЃ«рЃЮрЃарЃфрЃўрЃћрЃџрЃћрЃЉрЃА рЃерЃърЃА РђърЃћрЃџ+''. \n­ЪЈФрЃАрЃЎрЃЮрЃџрЃўрЃА рЃљрЃЊрЃЏрЃўрЃюрЃўрЃАрЃбрЃарЃљрЃфрЃўрЃљрЃЏ рЃърЃарЃЮрЃћрЃЦрЃбрЃў рЃерЃћрЃАрЃљрЃцрЃљрЃАрЃћрЃЉрЃџрЃљрЃЊ рЃњрЃљрЃЊрЃљрЃБрЃњрЃќрЃљрЃЋрЃюрЃљ рЃерЃАрЃА-рЃА рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃАрЃљрЃЦрЃЋрЃћрЃБрЃгрЃДрЃћрЃЉрЃЮ рЃЊрЃљрЃгрЃћрЃАрЃћрЃЉрЃБрЃџрЃћрЃЉрЃљ-рЃАрЃљрЃњрЃљрЃюрЃњрЃћрЃЉрЃЮ рЃАрЃўрЃбрЃБрЃљрЃфрЃўрЃћрЃЉрЃўрЃА рЃЏрЃљрЃарЃЌрЃЋрЃўрЃА рЃАрЃљрЃЏрЃАрЃљрЃ«рЃБрЃарЃўрЃА рЃАрЃАрЃўрЃъ-рЃАрЃљрЃ«рЃћрЃџрЃЏрЃгрЃўрЃцрЃЮ рЃарЃћрЃќрЃћрЃарЃЋрЃћрЃЉрЃўрЃАрЃљ рЃЊрЃљ рЃАрЃљрЃЏрЃЮрЃЦрЃљрЃџрЃљрЃЦрЃЮ рЃБрЃАрЃљрЃцрЃарЃЌрЃ«рЃЮрЃћрЃЉрЃўрЃА рЃАрЃћрЃарЃЋрЃўрЃАрЃћрЃЉрЃўрЃА рЃАрЃљрЃљрЃњрЃћрЃюрЃбрЃЮрЃА, рЃарЃЮрЃЏрЃџрЃўрЃА рЃърЃљрЃАрЃБрЃ«рЃерЃўрЃф рЃЋрЃЎрЃўрЃЌрЃ«рЃБрЃџрЃЮрЃЉрЃЌ: \nРђърЃЌрЃЦрЃЋрЃћрЃюрЃў, 2024 рЃгрЃџрЃўрЃА 11 рЃўрЃЋрЃџрЃўрЃАрЃўрЃА N2098410 рЃњрЃљрЃюрЃ«рЃўрЃџрЃЋрЃўрЃА рЃерЃћрЃЊрЃћрЃњрЃљрЃЊ рЃЊрЃљрЃЊрЃњрЃўрЃюрЃЊрЃљ, рЃарЃЮрЃЏ рЃЦрЃљрЃџрЃљрЃЦ рЃЉрЃљрЃЌрЃБрЃЏрЃерЃў, рЃЊрЃћрЃЏрЃћрЃбрЃарЃћ рЃЌрЃљрЃЋрЃЊрЃљрЃЊрЃћрЃЉрЃБрЃџрЃўрЃА рЃЦрЃБрЃЕрЃљ N49-рЃерЃў рЃљрЃарЃАрЃћрЃЉрЃБрЃџ рЃЏрЃўрЃгрЃўрЃА рЃюрЃљрЃЎрЃЋрЃћрЃЌрЃќрЃћ (рЃА/рЃЎ 05.22.47.001) рЃАрЃЎрЃЮрЃџрЃўрЃА рЃерЃћрЃюрЃЮрЃЉрЃўрЃА рЃ«рЃљрЃюрЃФрЃљрЃарЃАрЃљрЃгрЃўрЃюрЃљрЃљрЃдрЃЏрЃЊрЃћрЃњрЃЮ рЃЊрЃљрЃфрЃЋрЃўрЃА рЃАрЃўрЃАрЃбрЃћрЃЏрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃгрЃДрЃЮрЃЉрЃўрЃА рЃърЃарЃЮрЃћрЃЦрЃбрЃћрЃЉрЃў (рЃљрЃЋрЃбрЃЮрЃЏрЃљрЃбрЃБрЃарЃў рЃАрЃљрЃ«рЃљрЃюрЃФрЃарЃЮ рЃАрЃўрЃњрЃюрЃљрЃџрЃўрЃќрЃљрЃфрЃўрЃљ рЃЊрЃљ рЃ«рЃљрЃюрЃФрЃарЃўрЃА рЃерЃћрЃАрЃљрЃ«рЃћрЃЉ рЃЏрЃљрЃБрЃгрЃДрЃћрЃЉрЃџрЃЮрЃЉрЃўрЃА, рЃбрЃћрЃЦрЃАрЃбрЃБрЃарЃў рЃњрЃљрЃЏрЃЮрЃфрЃ«рЃљрЃЊрЃћрЃЉрЃўрЃА, рЃљрЃЊрЃљрЃЏрЃўрЃљрЃюрЃЌрЃљ рЃћрЃЋрЃљрЃЎрЃБрЃљрЃфрЃўрЃўрЃА рЃЏрЃљрЃарЃЌрЃЋрЃўрЃА рЃЊрЃљ рЃљрЃЋрЃљрЃарЃўрЃБрЃџрЃў рЃњрЃљрЃюрЃљрЃЌрЃћрЃЉрЃўрЃА рЃАрЃўрЃАрЃбрЃћрЃЏрЃћрЃЉрЃў), рЃерЃћрЃћрЃАрЃљрЃЉрЃљрЃЏрЃћрЃЉрЃљ рЃАрЃљрЃЏрЃерЃћрЃюрЃћрЃЉрЃџрЃЮ рЃюрЃЮрЃарЃЏрЃћрЃЉрЃўрЃА рЃЊрЃљ рЃгрЃћрЃАрЃћрЃЉрЃўрЃА, рЃбрЃћрЃЦрЃюрЃўрЃЎрЃБрЃарЃў рЃарЃћрЃњрЃБрЃџрЃўрЃарЃћрЃЉрЃўрЃА рЃАрЃ«рЃЋрЃљ рЃЊрЃЮрЃЎрЃБрЃЏрЃћрЃюрЃбрЃћрЃЉрЃўрЃЌ рЃЊрЃљрЃЊрЃњрЃћрЃюрЃўрЃџ рЃАрЃљрЃ«рЃљрЃюрЃФрЃарЃЮ рЃБрЃАрЃљрЃцрЃарЃЌрЃ«рЃЮрЃћрЃЉрЃўрЃА рЃЏрЃЮрЃЌрЃ«рЃЮрЃЋрЃюрЃћрЃЉрЃАРђю."
